(41, 3, 2143797875822052400, NULL, 'B3ATM9KnEPT', 191, 1270, 8522, 0, 0, 0, 0, 0, '0.72', 'Frher war ich ein richtiger Serienjunkie, sa ganze Tage nur vor dem Rechner und habe mir eine Staffel nach der anderen reingezogen, jeden Spannungsbogen mitgefiebert, jeder Cliffhanger hat mich erwischt, ich konnte gar nicht ausschalten ..\n\nBis ich irgendwann gemerkt habe, dass ich mehr bei Abenteuern anderer mitfiebere als eigene zu erleben und das hat mir Angst gemacht: Will ich mein ganzes Leben vor dem Rechner verbringen? Im Popcornmodus ber fiktive Welten staunen, die Erfolge anderer sehen, whrend mein Leben immer mehr zum Drama wird dabei?\n\nIch hab von heute auf morgen alles gendert. Radikal. Das funktionierte nur, weil ich es realisiert habe, etwas das ich lange nicht konnte.\n\nAm 16.11.2019 werde ich mein einziges Event dieses Jahr hosten und mchte meiner Community zeigen, wie man es schaffen kann. Wie man sein Leben in die eigenen Hnde nimmt und was mir zum Durchbruch verholfen hat .. das wird das intimste Business Event, welches es jemals gab.\n\nKeine Geheimnisse. 100%ige Transparenz!\n\nWir sprechen ber die richtige Einstellung, das Mindset, aktuelle Businesstrends und Mglichkeiten, den Businessaufbau, sowie Social Media - alle Kanle, wie man sie aufbaut und schlussendlich sprechen wir ber den Branding Part - das, was bei mir am Ende alles vernderte.\n\nEs gibt leider nur sehr wenige Tickets, da wir uns in einer Premium Location in Mnchen befinden werden, die nur 330 Pltze umfasst, aber fr diejenigen, die die Reise antreten, wird danach die eigene erst beginnen .. \n\nLink findet ihr in der Bio !\n\n\nTeile diesen Trailer in deiner Story, markiere mich @torbenplatzer und eine Person, die das interessieren knnte und du kannst eine SELFMADE Box aus Hoodie, Shirt und Kaffee gewinnen!\n\n\n\n\n\n\n\n\n_____\n#tpa #torbenplatzer #selfmade #selfmadesociety #mnchen #money #millionaire #business #cash #success #rich #wealth #entrepreneur #billionaire #entrepreneurship