(108, 6, 3008471393352485825, NULL, 'CnAPMrtswvB', 12, -1, 0, 0, 0, 0, 0, 0, '0.21', 'A new chapter begins Michi und Ich haben uns entschieden mehr Zeit und Energie in unsere Arbeit mit der Fotografie zu stecken. Einerseits weil es uns groen Spa macht, aber andererseits auch weil wir uns was aufbauen mchten fr die Zukunft. . Falls ihr uns auf dieser Reise begleiten mchtet, freuen wir  uns wenn wir uns auch auf unseren 2. Account @hollaus_media_art folgt. Natrlich werden wir auch hier weiterhin aktiv sein und euch mit leckeren Rezepten versorgen. Aber beim anderen Account geht es hauptschlich um die Kunst der Foto und Videografie. Wir freuen uns auf alle Flle wenn ihr mitdabei seit. \n\nWir haben die Woche zum Thema Minimalismus einiges geshootet. Lasst uns gerne wissen wie euch der Stil und die/das Foto gefllt. \n\n#foodphotography #photooftheday #photographers #veggies #foodfotografie #foodfotographylove #camera #sonyalpha #veganfood #lebensmittelfotografie', 1672857759, '{\"city_name\":\"\\u00d6sterreich\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/323660794_576235307622913_1395231350317426979_n.jpg', NULL, NULL, 'https://instagram.com/p/CnAPMrtswvB', 0, 1, '[\"#photooftheday\",\"#photographers\",\"#veggies\",\"#foodfotografie\",\"#foodfotographylove\",\"#camera\",\"#sonyalpha\",\"#veganfood\",\"#lebensmittelfotografie\"]', 'post', 'profile_scrape', 0, 1680284067, 1680103420),
(109, 6, 2707682980501936957, NULL, 'CWTn1MpMFs9', 12, 274, 0, 0, 0, 0, 0, 0, '5.42', 'Hi   alle zusammen  ( English version in the comments) Heute wollen wir uns bei euch mal ein wenig nher vorstellen. Da einige neue Gesichter dazu gestoen sind.  Wir sind Dani und Michi, zwei Food Fotografen aus sterreich  und Polen . Gemeinsam mit unserer kleinen Tochter leben wir am Land  in sterreich. Wie ihr sehen knnt, ist unsere groe Leidenschaft das Kochen und Backen. berwiegend vegan  ernhren wir uns nun seit ca. 2 Jahren und sind sehr dankbar diesen Weg eingeschlagen zu haben. Grund war damals die Gesundheit, denn Dani hatte seit ber 15 Jahren starke Haut Ekzeme auf den Hnden und keine Creme oder Medikament hat geholfen. Erst die Ernhrungsumstellung (obwohl sie anfangs sehr, sehr skeptisch war) hat etwas verndert. Nach einem halben Jahr waren die Ekzeme vollstndig verschwunden. Bei Michi war es hnlich, er hatte ber 8 Jahre Probleme mit dem Darm und der Verdauung und ist von einem Arzt zum anderen gelaufen. Das uns eine vollwertige Ernhrung einmal so helfen wrde, hatten wir selbst nicht gedacht. Nach der Umstellung kamen noch andere Faktoren wie Umwelt, Klima uns ethische Grnde dazu warum wir uns pflanzenbasiert ernhren wollen. Diese ganzen Erfahrungen haben Dani nun auch ermutigt mit meiner Ausbildung zum veganen Ernhrungsberater zu starten, was ihr wirklich groe Freude bereitet. UND Wir sind wirklich sehr dankbar fr diese tolle und liebe Community! Wir freuen uns das ihr uns auf unserer Reise begleitet immer so toll untersttzt. . Schn, dass ihr hier seid! DANKE \nFalls ihr auch vegan oder vegetarisch seit, knnt ihr gerne in den Kommentaren erzhlen was eure Beweggrnde waren/sind. Wrde uns freuen:) \n.\n#veganjourney #vegansterreich #family #autumnvibes #autumnleaves #veganfood #vegabfamily #herbstoutfit #liebe #pflanzlicheernhrung #austria #vegandeutschland #veganerezepte #veganrecipes #fallvibes #foodphotography #photography #photooftheday', 1637000986, '{\"city_name\":\"Austria\",\"country_code\":\"AT\",\"country_name\":\"austria\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/257148116_389817269546951_8060130719498178144_n.jpg', NULL, NULL, 'https://instagram.com/p/CWTn1MpMFs9', 0, 1, '[\"#vegan\\u00f6sterreich\",\"#family\",\"#autumnvibes\",\"#autumnleaves\",\"#veganfood\",\"#vegabfamily\",\"#herbstoutfit\",\"#liebe\",\"#pflanzlicheern\\u00e4hrung\",\"#austria\\ud83c\\udde6\\ud83c\\uddf9\",\"#vegandeutschland\",\"#veganerezepte\",\"#veganrecipes\",\"#fallvibes\",\"#foodphotography\",\"#photography\",\"#photooftheday\"]', 'post', 'profile_scrape', 0, 1680284067, 1680103420),
(110, 6, 2864189579663770219, NULL, 'Ce_pT9hPAJr', 20, 320, 5197, 0, 0, 0, 0, 0, '6.45', 'Vegan Green Goodness Bowl   perfect for  hot summer daysEnjoy! \n \nIngredients:\n1 cup whole grain pasta \n1 cup spinach\n1/2 cup sauted asparagus + zucchini\n1 Avocado \n1/2 cup green pepper\n1 cup roasted oven chickpeas (olive oil, paprika powder, salt, agave, herbs, garlic and onion powder)\nhemp seeds\n\nGreen pesto: \n2 cups (or a big handful) fresh basil\n3 tbsp olive oil \n3 tbsp lemon juice\n1/4 cup cashews\n3 tbsp nutritional yeast\n1 tsp garlic powder \n1/2 tsp salt\n\nTag us with @trust.and.try if you try it out.  ENJOY! All the best, Dani and Mike\n\nVegan Green Goodness Bowl   perfekt fr heie Sommertage wie heuteViel Spa!  \n \n Zutaten:\n Eine Handvoll Vollkornnudeln\n Eine Handvoll Spinat\n 1/2 Bund Spargel (blanchiert) + gebratene Zucchini \n 1 Avocado\n 1 grner Paprika\n 250g gerstete Ofenkichererbsen (Marinade: Olivenl, Paprikapulver, Salz, Agave, Kruter, Knoblauch und Zwiebelpulver)\nZum Garnieren: Hanfsamen\n\n Grnes Pesto:\n Eine groe Handvoll frisches Basilikum\n 3 EL Olivenl\n 3 EL Zitronensaft\n 4 EL Cashewnsse\n 3 EL Hefeflocken \n 1 TL Knoblauchpulver\n 1/2 TL Salz\n\nViel Spa beim nachmachen Falls ihr das Rezept ausprobiert, freuen wir uns, wenn ihr uns mit @trust.and.try makiert. \n\n#vegan#veganism#plantbased#whatveganseat#vegansofinstagram #veganpesto#healthyfood#vegetarianrecipes#dairyfree#veganfood#foodphotography #veganerezepte #veganespesto #pestoliebe #vegangreenpesto #veganosterreich #vegandeutschland #vegancooking', 1655658299, '[]', 'VIDEO', 'images/content/posts/289026658_162069983023888_5543631392676576997_n.jpg', NULL, NULL, 'https://instagram.com/p/Ce_pT9hPAJr', 0, 1, '[\"#veganpesto#healthyfood#vegetarianrecipes#dairyfree#veganfood#foodphotography\",\"#veganerezepte\",\"#veganespesto\",\"#pestoliebe\",\"#vegangreenpesto\",\"#vegano\\u0308sterreich\",\"#vegandeutschland\",\"#vegancooking\"]', 'post', 'profile_scrape', 0, 1680284067, 1680103420),
(111, 6, 3031522717450993561, NULL, 'CoSIdmOMX-Z', 9, -1, 0, 0, 0, 0, 0, 0, '0.15', 'Delicious quick vegan tiramisu.  (DE ) I think this has become one of our best desserts so far. Really creamy and tasty. \n\nRECIPE:\nFOT THE CRUST\n2 cup (200g) pecans (or walnuts)\n10 dates\n1-2 tsp coffee (brewed coffee)\n1 tsp vanilla extract\npinch of salt\nFOR THE FILLING\n3 cup (400g) cashews (unsalted)\n2 cup (500ml) soy milk\n  cup (100g) agave syrup or other sweetness \n1/2 cup (100g) melted coconut oil\n2 tsp vanilla\npinch of salt\ncacao powder for dusting\n\nSoak cashews and dates in water overnight. Blend all ingredients for the crust in a food processor together. Then do the same with the ingredients for the filling. Press the crust on the bottom of a jar and pour in the filling. Refrigerate for 2-4 hours. Dust a bit of cacao powder and enjoy. So good!  \nTag us with @trust.and.try if you try it out.  ENJOY! Dani and Mike \n\nLeckeres schnelles veganes Tiramisu.  Also ich finde das ist bis jetzt eines unserer besten Desserts geworden. Richtig  cremig und geschmackvoll. \n\nREZEPT\nTeig \n200 g Pekannusse (oder Walnusse)\n10 Datteln \n1-2 TL Kaffee \n1 TL Vanilleextrakt\nPrise Salz\nFullung\n400 g Cashewnusse\n500 ml Sojamilch\n100 g Agavensirup oder andere Sue\n100 g geschmolzenes Kokosol\n2 TL Vanille\nPrise Salz\nKakaopulver\n\nCashewnusse und Datteln uber Nacht in Wasser einweichen. In einer Kuchenmaschine alle Zutaten fur den Teig miteinander vermischen. Dasselbe mit den Zutaten fur die Fullung machen. Den Teig in ein Glas drucken und die Fullung hineingieen. 2-4 Stunden im Kuhlschrank kuhlen. Mit Kakaopulver bestauben und genieen. So gut!  Makiert uns gerne mit @trust.and.try falls ihr das Rezept ausprobiert. Lasst es auch schmecken . Alles Liebe Dani und Michi \n\n#foodphotography #tiramisu #veganerezepte #veganfood #vegandessert #foodblogger #tiramisulove #veganeernhrungsberaterin #veganfood #fotografie', 1675605691, '[]', 'IMAGE', 'images/content/posts/328831548_212672521230583_824324724219360340_n.jpg', NULL, NULL, 'https://instagram.com/p/CoSIdmOMX-Z', 0, 0, '[\"#foodphotography\",\"#tiramisu\",\"#veganerezepte\",\"#veganfood\",\"#vegandessert\",\"#foodblogger\",\"#tiramisulove\",\"#veganeern\\u00e4hrungsberaterin\",\"#veganfood\",\"#fotografie\"]', 'post', 'profile_scrape', 0, 1680284067, 1680103420),
(112, 6, 3024103385381113033, NULL, 'Cn3xgGxsozJ', 14, -1, 0, 0, 0, 0, 0, 0, '0.25', 'Homemade Vegan Green Pesto. () Super easy to make and great for pasta and co.  Enjoy!  \n\n	2- 3 cloves Garlic\n	2 handful basil \n	1 tbsp Lemon juice, fresh\n	1 tsp Salt\n	1/2 cup Olive oil (125ml)\n	2-3 tbsp nutritional yeast \n	1 cup Cashew (or nuts of your choice)\n\nDirections: \nIn a food processor, combine all ingredients and blend until smooth. If its too thick you can add more oil. You can serve it immediately (with pasta for example) or store in the refrigerator until ready to serve. Tag us with @trust.and.try if you try it out.  ENJOY! All the best, Dani and MikeEnjoy! \n\nHausgemachtes Veganes Basilikum- Pesto. So einfach zubereitet und absolut lecker! Ideal fur Pasta, Vorspeisen, Saucen, als Marinade und vieles mehr. Viel Spa! \n\n 2-3 Knoblauchzehen\n 2 Handvoll Basilikum (ca. 200 g)\n 1 EL Zitronensaft, frisch\n  Salz und Pfeffer \n 125ml Olivenol \n 2-3 EL Hefeflocken \n 150g Cashew\n\nZubereitung:\nMixe in einer Kuchenmaschine (Blender) alle Zutaten bis eine cremige Konsistenz entsteht (evt. Ol hinzufugen). Frisch servieren (z. B. mit Pasta) oder bis zum Servieren im Kuhlschrank aufbewahren. Lasst es euch schmecken. Falls ihr das Rezept ausprobiert , freuen wir uns wenn ihr uns mit @trust.and.try makiert.  Alles Liebe Dani und Michi\n\n#vegan#foodphotography #plantbased#whatveganseat#vegansofinstagram#veganrecipes#wholefoods#pestopasta#veganpesto#pastarecipe#healthylifestyle#healthyfood#vegetarianrecipes#dairyfree#veganfood#foodphotography #veganerezepte #veganespesto #regionalkochen #sustainablefood #pestoliebe #vegangreenpesto #nachhaltigleben #nachhaltigkochen #grunespesto #pestorezepte #veganosterreich #vegancooking', 1674721237, '[]', 'IMAGE', 'images/content/posts/327157649_737605607721558_7299941269238146797_n.jpg', NULL, NULL, 'https://instagram.com/p/Cn3xgGxsozJ', 0, 0, '[\"#plantbased#whatveganseat#vegansofinstagram#veganrecipes#wholefoods#pestopasta#veganpesto#pastarecipe#healthylifestyle#healthyfood#vegetarianrecipes#dairyfree#veganfood#foodphotography\",\"#veganerezepte\",\"#veganespesto\",\"#regionalkochen\",\"#sustainablefood\",\"#pestoliebe\",\"#vegangreenpesto\",\"#nachhaltigleben\",\"#nachhaltigkochen\",\"#gru\\u0308nespesto\",\"#pestorezepte\",\"#vegano\\u0308sterreich\",\"#vegancooking\"]', 'post', 'profile_scrape', 0, 1680284067, 1680103420),
(113, 6, 3017838760386065589, NULL, 'CnhhF0GN3S1', 17, -1, 0, 0, 0, 0, 0, 0, '0.3', 'Creamy pear - passion fruit yoghurt \nJust a really easy and light dessert. All you need is your favourite yoghurt (ours is soy yoghurt), maple syrup, pears and passion fruit. Enjoy \n\nCremiges Birnen - Maracuja Joghurt \nEntweder als leckeres leichtes Dessert oder als fruchtiges Frhstck. Ihr braucht dazu nur euer Lieblings Joghurt (unseres ist Sojajoghurt), Ahornsirup, Birnen und Maracuja \n\n#foodphotography #foodstyling #photooftheday #food #yoghurt #pear #passionfruit #plantbased #fotografie #foodfotografie #vegan #vegandessert', 1673974436, '[]', 'IMAGE', 'images/content/posts/326086041_670762608115284_4773869648617182564_n.jpg', NULL, NULL, 'https://instagram.com/p/CnhhF0GN3S1', 0, 0, '[\"#foodstyling\",\"#photooftheday\",\"#food\",\"#yoghurt\",\"#pear\",\"#passionfruit\",\"#plantbased\",\"#fotografie\",\"#foodfotografie\",\"#vegan\",\"#vegandessert\"]', 'post', 'profile_scrape', 0, 1680284067, 1680103420),
(114, 6, 3014639465570468520, NULL, 'CnWJp8nM4Ko', 13, -1, 0, 0, 0, 0, 0, 0, '0.23', 'Waffles  (vegan) () - Our ultimate favourite Sunday breakfast . Enjoy!\n\nIngredients: (for 2-3 People)\n300g spelt flour\n 450ml soy milk\n 2-3 tsp baking powder\n 1 tsp vanilla extract\n 4 tablespoons oil (e.g. rapeseed oil)\n 1/2 tsp salt\n 2-3 tbsp agave syrup\n\nMix everything in a bowl and bake in a waffle iron.  Serve with fresh fruits, jam, chocolate cream or yoghurt and enjoy  \n\nWaffeln  (vegan) - Unser ultimativer Sonntags-Favorit zum Frhstck . Viel Spa beim nachmachen !\n\nZutaten:\n300g Dinkelmehl \n450ml Sojamilch\n2-3 TL Backpulver \n1 TL Vanillezucker oder Extrakt \n4 EL l (Rapsl z.B) \n1/2 TL Salz \n2- 3 EL Agavendicksaft \n\nAlles in einer Schssel vermengen und im Waffeleisen herausbacken. Mit frischen Frchten Marmelade, Schokocreme oder Joghurt servieren und genieen \nPS: Ihr knnt auch Vollkornmehl verwenden, ihr braucht dann nur ein wenig mehr Milch :) Oder 1/2 - 1/2 \n Viel Spa\n\n#veganwaffles #waffles #breakfast #plantbased #waffeln #sundaybreakfast #pancakes #veganerezepte #veganrecipes #veganeernhrungsberaterin #vegan', 1673593050, '{\"city_name\":\"\\u00d6sterreich\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/325435235_113471371634813_230638632661605899_n.jpg', NULL, NULL, 'https://instagram.com/p/CnWJp8nM4Ko', 0, 0, '[\"#waffles\",\"#breakfast\",\"#plantbased\",\"#waffeln\",\"#sundaybreakfast\",\"#pancakes\",\"#veganerezepte\",\"#veganrecipes\",\"#veganeern\\u00e4hrungsberaterin\",\"#vegan\"]', 'post', 'profile_scrape', 0, 1680284067, 1680103420);
