(133, 7, 2740750140550859919, NULL, 'CYJGbtRosyP', 124, 389, 438, 0, 0, 0, 0, 0, '4.65', 'Bye Bye 2021\nDu brachtest mich zum Weinen und zum Lachen. Ich fiel zu Boden und stand wieder auf. Ich lernte positive und auch negative\nMenschen kennen und entschied mich fur bestimmte Wege.\n\nIch danke dir fur alles, doch ich lasse dich nun hinter mir und bin bereit fur das neue Jahr.\nHabt einen glucklichen Tag\n\nDANKE fur, so einen tollen Austausch, den ich nicht mehr missen mochte.\n\n#Margitsblog @margitsblog #silvester #Jahreswechsel\n#nordichome #wohnideen #interiordesign #wohnungseinrichtung #minimalist #dekoliebe #easyinterieur#solebenwir #couchstyle#homesweethome #zeigthereurewohnung #desenio #germaninteriorbloggers #deininspirationsmonat #heimeligeinspo #zuhauseistesamschonsten #zuhauseimgluck #ersteeigenewohnung #interiordesign #meinikea #skandinavischwohnen #skandistyle #abschied', 1640943038, '[]', 'VIDEO', 'images/content/posts/271051840_226741819633928_5386131335524709651_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/270148568_452389973111948_1556864758353155046_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=108&_nc_ohc=pCWpm8nMSaEAX9v-myF&edm=AOQ1c0wBAAAA&vs=2962290607321318_4149135364&_nc_vs=HBksFQAYJEdOZ2pHaENNdEtVLWNwc0JBT2JUOXNRLUdKc1ZidlZCQUFBRhUAAsgBABUAGCRHQ1gxR1JENEpieVRlZFVCQUNiSVFmV0Y0VjV2YnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACaO1qbN8OXMPxUCKAJDMywXQD7u2RaHKwIYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=9a7abf2725&ccb=7-5&oh=00_AfArFoSLPpsJZ9NYiureQzgsbDkf6IuMZhxJ3pSeEbeaNA&oe=64290C39&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CYJGbtRosyP', 0, 0, '[\"#silvester\",\"#jahreswechsel\\n#nordichome\",\"#wohnideen\",\"#interiordesign\",\"#wohnungseinrichtung\",\"#minimalist\",\"#dekoliebe\",\"#easyinterieur#solebenwir\",\"#couchstyle#homesweethome\",\"#zeigthereurewohnung\",\"#dese