(188, 11, 3069797603324564972, NULL, 'CqaHKfegZXs', 14, 234, 3411, 0, 0, 0, 0, 0, '0.17', 'Milan has a special place in my heart, for various reasons, one of them being my friends!\n\nIve spent a lot of time in the past years in this city, and coming here is always a bit emotional for me.\n\nI came, in fact, to Milan to celebrate the birthday of a dear friend of mine and I had the opportunity to stay in @sonderstays hotel which is located in the Missori district,in the heart of Milan, perfect for those who want to discover the city on foot ! \n\nMilan is one of the cities where I am always in a hurry, thats why I like to be able to start my day slowly enjoying the peace and some good Italian coffee in my room at @sonderstays with the birds singing out of the window.\n\nSonder offers a great experience, which can be a hotel room or an apartment, in more than 40 cities!\nThe @sonderstays experience is easily managed through their app, which makes it easy to get whatever you need during your stay!!\n\nAd | Werbung @sonderstays \n#Abetterwaytostay #sondermilan\n\n#milan #hotel #hotellife #italy #travel #traveling #bedroom #bedroomdesign #design #interiors #interiores #interiordesigner #apartment #contenporarydesign #modern\n#home #paceful #bedroom #bedroomdecor #bedroominspo #mybdrm #pigletinbed #home #interior #interiordesign #interiorinspiration', 1680168440, '{\"city_name\":\"Milan\",\"country_name\":\"italy\",\"country_code\":\"IT\",\"tagged_location\":\"true\"}', 'VIDEO', 'images/content/posts/338590988_243149194852875_7376065267136961432_n.jpg', NULL, NULL, 'https://instagram.com/p/CqaHKfegZXs', 0, 0, '[\"#abetterwaytostay\",\"#sondermilan\\n\\n#milan\",\"#hotel\",\"#hotellife\",\"#italy\",\"#travel\",\"#traveling\",\"#bedroom\",\"#bedroomdesign\",\"#design\",\"#interiors\",\"#interiores\",\"#interiordesigner\",\"#apartment\",\"#contenporarydesign\",\"#modern\\n#home\",\"#paceful\",\"#bedroom\",\"#bedroomdecor\",\"#bedroominspo\",\"#mybdrm\",\"#pigletinbed\",\"#ho