(190, 11, 3064035058521295516, NULL, 'CqFo6bagUqc', 19, 1579, 9086, 0, 0, 0, 0, 0, '1.09', 'I have been wanting to change the style of this kitchen for a while now, as it no longer reflects me.\n1 honestly havent liked it for months, it doesnt give me positive emotions and I just want to change the visual as soon as possible, and this moment is coming!\nIt takes years and years of experience and mistakes to find ourselves and our own style, the one we like and feel comfortable with, the one that reflects our personality.\nIt is not easy,it is instead very difficult. I spent years trying to figure out what I like, not feeling good because I couldnt find my dimension, but it seems like everything is going in the right direction, it seems like all I needed was time. Sometimes you just need time!!!!!\nI am happy that I have made so much progress, im sorry I blamed myself for making the mistakes I made, but now I understand the process, and Im happy to make more mistakes.\nI cant wait to share with you the biggest change of this year\n#spring #springtime #kitchen #kitchendesign #kitcheninspiration #kitcheninspo\n#kitchendecor #kitchenset#ikea#architecture #design #interiordesign\n#kitcheninterior #kitchenstories #cream#marmor #marmorkuchen #interior #interiorinspo #interiorinspiration#ikeaideas #solebich #myktchn', 1679481477, '{\"city_name\":\"Berlin\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'VIDEO', 'images/content/posts/338165126_965539884890852_5165024382172407633_n.jpg', NULL, NULL, 'https://instagram.com/p/CqFo6bagUqc', 0, 0, '[\"#springtime\",\"#kitchen\",\"#kitchendesign\",\"#kitcheninspiration\",\"#kitcheninspo\\n#kitchendecor\",\"#kitchenset#ikea#architecture\",\"#design\",\"#interiordesign\\n#kitcheninterior\",\"#kitchenstories\",\"#cream#marmor\",\"#marmorkuchen\",\"#interior\",\"#interiorinspo\",\"#interiorinspiration#ikeaideas\",\"#solebich\",\"#myktchn\"]', 'post', 'profile_scrape', 0, 1680279326, 1680279326),
