(293, 17, 3069100465090170545, NULL, 'CqXopy5r46x', 17, 1123, 0, 0, 0, 0, 0, 0, '5.52', 'Sai come abbinare il blu elettrico?\n\nNegli abbinamenti di colore viene in nostro aiuto la ruota colore di Itten.\n\nUn primo tipo di abbinamento sar quello monocromatico, ossia combinando diverse tonalit di blu. Si tratta dei colori appartenenti allo stesso spicchio della ruota colore, come blu e azzurro. \n\nAbbiamo poi l\'abbinamento tra colori analoghi e vicini sulla ruota di Itten, come con il viola  e con il verde. \n\nParticolarmente d\'effetto sar l\'accostamento di colori complementari, ossia opposti sulla ruota colore, parliamo quindi  di blu e arancione .\nIn questo tipo di abbinamento i colori si esaltano a vicenda e il risultato  di forte impatto!  anche un modo per utilizzare colori non proprio in palette: il colore che non ci valorizza andr indossato lontano dal viso. \n\nQuesta tonalit di blu inoltre sta molto bene sia con il bianco  che con il nero. \n\nScorri la galleria per questi ed altri abbinamenti con il blu elettrico!\n\nE tu conosci altri modi di abbinare questo colore? Scrivilo nei commenti \n\n#ootdinspo \n#aestheticfeed \n#aestheticinspiration \n#bluelettrico \n#daytimesunni\n#armocromia \n#coloranalysis \n#coloranalyst\n#oodtspringtime', 1680085307, '{\"city_name\":\"Napoli\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/338209841_163961302853417_1426188436884716101_n.webp', NULL, NULL, 'https://instagram.com/p/CqXopy5r46x', 0, 0, '[\"#aestheticfeed\",\"#aestheticinspiration\",\"#bluelettrico\",\"#daytimesunni\\n#armocromia\",\"#coloranalysis\",\"#coloranalyst\\n#oodtspringtime\"]', 'post', 'profile_scrape', 0, 1680341387, 1680341387),
