(295, 17, 3058989321909681249, NULL, 'CpztpTAI7xh', 21, 1563, 0, 0, 0, 0, 0, 0, '7.67', 'Un bianco per ogni palette! \n\nSai che per ogni palette esiste un bianco ideale?\n\nPer la palette winter, caratterizzata da sottotono freddo ed alta intensit, anche i bianchi pi valorizzanti saranno freddi e luminosi, come il bianco ottico.\n\nPer le summer, poich hanno sottotono freddo ma colori pi soft, saranno pi indicati il bianco seta, il bianco corda e il bianco sporco, anch\'essi freddi ma dalla attenuata luminosit. \n\nPer chi ha sottotono caldo ed alta intensit, e quindi rientra nella categoria Spring, il bianco pi valorizzante  sicuramente il color champagne, bellissimo soprattutto in seta.\n\nPer la palette autumn, calda e soft, punteremo invece sul bianco antico, burro, alabastro, sul bianco latte e sull\'avorio.\n\nE tu conosci gi la tua palette colori ed il bianco che pi ti valorizza?\n\n#aestheticinspiration\n#aestheticfeed\n#whitemood \n#armocromia\n#coloranalysis \n#istabeautygirls\n#dailyphootos', 1678879965, '[]', 'IMAGE', 'images/content/posts/335588615_866659014403011_3049752296604363159_n.webp', NULL, NULL, 'https://instagram.com/p/CpztpTAI7xh', 0, 0, '[\"#armocromia\\n#coloranalysis\",\"#istabeautygirls\\n#dailyphootos\"]', 'post', 'profile_scrape', 0, 1680341387, 1680341387),
(296, 17, 3043171558804847987, NULL, 'Co7hGjJIn1z', 26, 1369, 0, 0, 0, 0, 0, 0, '6.75', 'Conosci l\'armocromia?\n\nL\'armocromia  una disciplina che analizza il mix cromatico di pelle, occhi e capelli, misurandone temperatura, intensit, valore e contrasto per definire la nostra palette di colori amici.\n\nQuesti ultimi ci aiuteranno nella scelta di abiti, make-up e colore capelli, in quanto sono i colori che pi ci valorizzano, donando brillantezza allo sguardo e luminosit all\'incarnato, minimizzando eventuali discromie e piccole imperfezioni. \n\nVi siete mai chieste perch il rossetto che sta tanto bene alla nostra amica su di noi ha tutt\'altro effetto? \n\nLa risposta sar da ricercare nelle diverse caratteristiche cromatiche, argomento d\'analisi, appunto, dell\'Armocromia!\n\nOggi se ne parla tanto ma vediamo insieme quali sono i reali benefici di questa disciplina.\n\n- Dopo una seduta di Armocromia noterai subito la differenza nell\'indossare colori che ti valorizzano e in breve tempo la tua  autostima ti ringrazier! \n\n- Uscirai dalla comfort zone del nero o di pochi altri colori;\n\n- Eviterai la fastidiosa sensazione di armadio pieno e nulla da indossare! \n\n- Fare abbinamenti di colori non sar mai stato cos facile, poich tutti i colori della tua palette staranno bene tra di loro; \n\n- Per ultimo, non certo per importanza, conoscere le tue caratteristiche cromatiche ti permetter di fare acquisti mirati e risparmiare!  \n\nConoscevi gi l\'armocromia?\n\nScrivimi nei commenti \n\n#armocromia \n#armocromiaautunno \n#armocromiaprimavera \n#armocromiainverno \n#armocromiaestate \n#coloranalysis \n#colouranalysisworks \n#colouranalysis \n#aestheticinspiration \n#aestheticfeed\n#mythuersdayshoots', 1676994341, '[]', 'IMAGE', 'images/content/posts/331968644_1001528454145526_5255937007874033149_n.webp', NULL, NULL, 'https://instagram.com/p/Co7hGjJIn1z', 0, 0, '[\"#armocromiaautunno\",\"#armocromiaprimavera\",\"#armocromiainverno\",\"#armocromiaestate\",\"#coloranalysis\",\"#colouranalysisworks\",\"#colouranalysis\",\"#aestheticinspiration\",\"#aestheticfeed\\n#mythuersdayshoots\"]', 'post', 'profile_scrape', 0, 1680341387, 1680341387),
