(335, 19, 3066160768340937605, NULL, 'CqNMPk9M0uF', 0, 9, 0, 0, 0, 0, 0, 0, '0.43', 'TODAY IS EARTH HOUR \nIm Jahr 2007 wurde in Sydney die #earthhour ins Leben gerufen: Fr eine Stunde wurde in mehr als 2,2 Millionen australische Haushalten das Licht ausgeschaltet, um ein Zeichen fr mehr Klimaschutz zu setzen. Inzwischen ist die Earth Hour ein weltweites Ereignis. \n\nHeute um 20.30 Uhr findet bereits zum 17. Mal die @wwf Earth Hour statt. Fr 60 Minuten  wird das Licht ausgeschaltet, damit anderen ein Licht aufgeht. \n\nWir finden die Idee spitze und werden natrlich auch alle Lichter heute Abend ausmachen. Habt ihr schon mal von der Earth Hour gehrt und seid ihr dabei? \n\nQuelle:  WWF Deutschland 2023\n@wwf_deutschland #wwf #wwfdeutschland #earthhour #earthhour2023 #gemeinsamfrmehrklimaschutz #klimaschutz #climatechange', 1679734886, NULL, 'IMAGE', 'images/content/posts/330201359_1663069907473363_8630885586326874720_n.jpg', NULL, NULL, 'https://instagram.com/p/CqNMPk9M0uF', 0, 0, '[\"#earthhour\",\"#wwf\",\"#wwfdeutschland\",\"#earthhour\",\"#earthhour2023\",\"#gemeinsamf\\u00fcrmehrklimaschutz\",\"#klimaschutz\",\"#climatechange\"]', 'post', 'profile_scrape', 0, 1680707503, 1680707503),
