(337, 19, 3063940911927225949, NULL, 'CqFTgakNW5d', 1, 34, 238, 0, 0, 0, 0, 0, '1.68', 'BAKE IT or fake it  \nKeine Zeit? Keine Lust? Kein Problem! Ich hab den ultimativen Hack fr Homemade  Cinnamon Rolls: \nFertigen Bltterteig ausrollen und mit veganer Butter bestreichen. Zucker + Zimt vermischen und auf den bestrichenen Teig geben, einrollen, schneiden und ab in den Ofen damit (ca. 15 Min). Du kannst die Zimtschnecken noch mit einem Cream Cheese Frosting und Toppings verfeinern oder direkt verschlingen.  \n\n#plsntbased #backen #recipe #rezepte #rezeptinspiration #baking #hack #hacks #cinnamon #cinnamonrolls #cinnamonbuns', 1679470200, '{\"city_name\":\"Munich\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'VIDEO', 'images/content/posts/336822722_212100334831838_501806154131744679_n.jpg', NULL, NULL, 'https://instagram.com/p/CqFTgakNW5d', 0, 0, '[\"#plsntbased\",\"#backen\",\"#recipe\",\"#rezepte\",\"#rezeptinspiration\",\"#baking\",\"#hack\",\"#hacks\",\"#cinnamon\",\"#cinnamonrolls\",\"#cinnamonbuns\"]', 'post', 'profile_scrape', 0, 1680707503, 1680707503),
(338, 19, 3062597057823095759, NULL, 'CqAh8w5s7vP', 303, 386, 0, 0, 0, 0, 0, 0, '33.11', 'G I V E A W A Y \n\nDu brauchst mal wieder ein bisschen Me-Time? Dann haben wir das perfekte Gewinnspiel fr dich, denn wir verlosen 2x ein Set fr deinen nchsten  Selfcare  Moment.\n\nDas Set enthlt jeweils ein Abschminktuch & den Multi-Stick von @naktofficial um deine Haut mal wieder so richtig zu verwhnen. Die Produkte sind alle vegan, tierversuchsfrei und handmade in Darmstadt.\n\nPassend dazu bekommst du ein Probier-Paket der veganen Specialty L*ttes von @theplantmagic.co zum entspannen & genieen. Die Drinks sind vegan, klimaneutral und enthalten nur natrliche Bio-Zutaten & Superfoods.\n\nWas du tun musst?\n Du folgst @naktofficial und @theplantmagic.co \n Like diesen Beitrag und markiere deine 2 liebsten Selfcare-Buddies \n Doppelte Gewinnchance: du teilst den Beitrag in deiner Story \n\nWir wnschen euch ganz viel Erfolg \n\n__\n\nDas Gewinnspiel endet am 24.03.23 um 23:59 Uhr. Wir versenden nur innerhalb Deutschlands. Derdie Gewinnerinnen werden per Zufallsprinzip ausgelost und im Anschluss per DM benachrichtigt.Das Gewinnspiel steht in keinem Zusammenhang mit Instagram, Facebook oder Meta. Verantwortlich fr dieses Gewinnspiel sind The Plant Magic Company GmbH sowie die Stoffschmiede GmbH. Der Rechtsweg ist ausgeschlossen.', 1679310041, NULL, 'IMAGE', 'images/content/posts/336807758_572312198190661_5998294987894190327_n.jpg', NULL, NULL, 'https://instagram.com/p/CqAh8w5s7vP', 0, 0, NULL, 'post', 'profile_scrape', 0, 1680707503, 1680707503),
