(341, 20, 3074115160809461707, NULL, 'Cqpc3OOsNfL', 0, -1, 0, 0, 0, 0, 0, 0, '0', 'NASA and the Canadian Space Agency (CSA) have named the four astronauts who will be part of the crewed Artemis II mission. Reid Wiseman, Victor Glover and Christina Hammock Koch, and CSA astronaut Jeremy Hansen, which will set the stage for the first woman and first person of color on the Moon through the Artemis program.\n\nThis will be the first crewed trip on NASA\'s path to establishing a long-term presence on the Moon where they will execute an ambitious set of demonstrations during the approximately 10-day flight. The flight test will also validate the capabilities and techniques needed for humans to live and work in deep space.\n\n#TheLatest #Nasa #CSA #Artemis #Moon', 1680683106, NULL, 'IMAGE', 'images/content/posts/339816326_128864873383190_6109616881202355305_n.webp', NULL, NULL, 'https://instagram.com/p/Cqpc3OOsNfL', 0, 0, '[\"#nasa\",\"#csa\",\"#artemis\",\"#moon\"]', 'post', 'profile_scrape', 0, 1680707823, 1680707823),
(342, 20, 3072711118912969931, NULL, 'CqkdnuUM1zL', 0, -1, 0, 0, 0, 0, 0, 0, '0', 'London-based startup @electronicmaterialsoffice has launched its first product, a sustainable computer keyboard called the Altar I. Made from post-consumer waste-derived plastic, the keyboard has a rotary encoder knob, USB-C port, and an aluminum monobody, with Bluetooth connectivity that can connect with two devices simultaneously. Electronic Materials Office is a startup focused on producing long-lasting electronics from sustainable materials.\n\nPre-orders for the Altar I are available on their website from April 6th.\n\n#TheLatest #Sustainability #Mechanicalkeyboard #IndustrialDesign #ProductDesign', 1680515731, NULL, 'IMAGE', 'images/content/posts/339196550_928245821759571_8888154705354620063_n.webp', NULL, NULL, 'https://instagram.com/p/CqkdnuUM1zL', 0, 0, '[\"#sustainability\",\"#mechanicalkeyboard\",\"#industrialdesign\",\"#productdesign\"]', 'post', 'profile_scrape', 0, 1680707823, 1680707823),
(343, 20, 3069064792283194533, NULL, 'CqXgisAsqSl', 0, -1, 0, 0, 0, 0, 0, 0, '0', 'The @gstarraw design team have released an AI-designed denim collection. The project originated from the brand\'s digital fashion group, aimed at exploring new technologies and techniques. The team briefed MidJourney to create the first-ever AI design, resulting in a minimalistic, futuristic tech-wear fashion piece with organic shapes and intricate details. \n\nDespite initial challenges in the production process, the team used the potential of AI in fashion design, emphasising the importance of the human designer\'s creative input. With the integration of AI-powered chatbots and virtual events such as Metaverse Fashion Week, is the fashion industry\'s future set to be revolutionised?\n\nImage: G-Star RAW\n\n#TheLatest #MidJourney #GStarRaw #AiGenerated #Metaverse #Fashion', 1680081055, NULL, 'IMAGE', 'images/content/posts/337926981_946673873029037_228570865685498223_n.webp', NULL, NULL, 'https://instagram.com/p/CqXgisAsqSl', 0, 0, '[\"#midjourney\",\"#gstarraw\",\"#aigenerated\",\"#metaverse\",\"#fashion\"]', 'post', 'profile_scrape', 0, 1680707823, 1680707823),
(344, 20, 3068427516754771314, NULL, 'CqVPpG7M71y', 12, 807, 0, 0, 0, 0, 0, 0, '1.66', 'McDonald\'s France has partnered with @elium.studio to create a new range of reusable tableware in a bid to reduce waste in its restaurants. The range, which took more than two years to develop, uses Tritan, a plastic resin that is similar to glass and ceramic in hardness and transparency, and which preserves the taste and quality of food.\n\nAttention was also given to details such as vents, graining, and striations to address their functions in the best possible way. The tableware aims to offer an enhanced experience to customers while meeting the operational constraints of McDonald\'s restaurants.\n\n#TheLatest #McDonalds #France #Sustainability #Tableware', 1680005086, NULL, 'IMAGE', 'images/content/posts/338222578_538236485153712_2637486059854911348_n.webp', NULL, NULL, 'https://instagram.com/p/CqVPpG7M71y', 0, 0, '[\"#mcdonalds\",\"#france\",\"#sustainability\",\"#tableware\"]', 'post', 'profile_scrape', 0, 1680707823, 1680707823),
(345, 20, 3067637480169767995, NULL, 'CqScAkBMYQ7', 1, -1, 0, 0, 0, 0, 0, 0, '0', 'OpenAI has announced that its advanced language model, ChatGPT, now has the capability to browse the web, book flights, and perform other tasks. ChatGPT uses natural language processing to understand and respond to user queries. The integration of web browsing and task completion abilities into ChatGPT opens up new possibilities for developers building conversational AI applications.\n\nChatGPT can now perform a range of tasks, including making restaurant reservations, booking flights, and searching for information online. The updated plugin demonstrates the continued evolution of natural language processing and the potential for conversational AI to transform how people interact with technology.\n\n#TheLatest #OpenAI #ChatGPT #Technology', 1679910906, NULL, 'IMAGE', 'images/content/posts/337577335_1023281105299509_6918502759193587703_n.webp', NULL, NULL, 'https://instagram.com/p/CqScAkBMYQ7', 0, 0, '[\"#openai\",\"#chatgpt\",\"#technology\"]', 'post', 'profile_scrape', 0, 1680707823, 1680707823),
(346, 20, 3064750909263174645, NULL, 'CqILrbXr9v1', 0, -1, 0, 0, 0, 0, 0, 0, '0', '@nothing returns with its first-ever second-generation product, Ear (2). The earbuds promise an exceptional sound experience, with industry-leading technology for personalised listening. Ear (2) features a dual-chamber design and a dynamic 11.6mm driver to provide the purest sound experience, while adaptive noise cancellation and a personal sound profile optimise the listening experience. \n\nThe charging case is made from strong, pressure-resistant material, making it smaller, lighter, and more robust. With a charging time of just 10 minutes, Ear (2) can play music for up to 36 hours. Nothing\'s Ear (2) is now available from the Nothing Store Soho and Kith stores worldwide.\n\n#TheLatest #Nothing #wirelessearbuds #Kith #NoiseCancelling', 1679566800, NULL, 'IMAGE', 'images/content/posts/337164674_734492551672308_3746574137535371852_n.webp', NULL, NULL, 'https://instagram.com/p/CqILrbXr9v1', 0, 0, '[\"#nothing\",\"#wirelessearbuds\",\"#kith\",\"#noisecancelling\"]', 'post', 'profile_scrape', 0, 1680707823, 1680707823),
(347, 20, 3063285173919361136, NULL, 'CqC-aK9Lyhw', 0, -1, 0, 0, 0, 0, 0, 0, '0', '@rollsroycecars has launched the Black Badge Wraith Black Arrow, a limited edition to mark the end of production of one of the marque\'s most transformative vehicles. The 12-car edition is also the last V12 coup that the automaker will produce as it switches to electric vehicles. \n\nThe vehicle features gradient paint with a \"motion blur effect from front to rear,\" a club leather interior and the illuminated Thunderbolt Speedform. It also boasts a record-breaking bespoke Starlight Headliner, featuring 2,117 fibre-optic stars. Each interior door panel is made of 320 marquetry pieces.\n\n#TheLatest #RollsRoyce #RollsRoyceWraith #LuxuryCars #Bespoke', 1679392071, NULL, 'IMAGE', 'images/content/posts/337148374_598251298841181_5985827231467176756_n.webp', NULL, NULL, 'https://instagram.com/p/CqC-aK9Lyhw', 0, 0, '[\"#rollsroyce\",\"#rollsroycewraith\",\"#luxurycars\",\"#bespoke\"]', 'post', 'profile_scrape', 0, 1680707823, 1680707823),
(348, 20, 3062617922748958308, NULL, 'CqAmsY4MkZk', 1, -1, 0, 0, 0, 0, 0, 0, '0', '@snoopdogg has launched a new line of premium coffee products with beans sourced from Indonesia. The rapper and entrepreneur has partnered with Indonesian coffee entrepreneur Michael Riady to launch @indo.xyz, a lifestyle coffee brand aimed at entrepreneurs and innovators. \n\nSnoops coffee beans will be sourced from Gayo, a region in Aceh, Sumatra, known for producing high-quality Arabica beans. Snoop said his relationship with coffee goes back a long way, as it provided the fuel for many long nights in the studio. He added that Indo is going to change the industry and is a common abbreviation for Indonesia.\n\n#TheLatest #SnoopDogg #indoxyz #Coffee', 1679312528, NULL, 'IMAGE', 'images/content/posts/336341421_1358197831420565_1799448162549754385_n.webp', NULL, NULL, 'https://instagram.com/p/CqAmsY4MkZk', 0, 0, '[\"#snoopdogg\",\"#indoxyz\",\"#coffee\"]', 'post', 'profile_scrape', 0, 1680707823, 1680707823),
(349, 20, 3054710119711422770, NULL, 'CpkgqtZMLky', 1, -1, 0, 0, 0, 0, 0, 0, '0', 'Munich-based Diez Office has designed a new bathtub, the Meisterstck OYO DUO, winning the German Design Award 2023. The double-walled, free-standing bathtub is made entirely of sustainable and recyclable 100% steel enamel.\n\n@stefandiez graceful design sculpture integrates harmoniously into any bathroom which impressed the expert jury of the German Design Council among 4,200 entries. \n\nThe bathtub is available in selected colours and two sizes and can be found at ISH in Frankfurt from March 13 to 17.\n\n#TheLatest #StefanDiez #GermanDesignAward #Kaldewei #Sustainability', 1678369844, NULL, 'IMAGE', 'images/content/posts/334771411_924458992306678_7956808797575385667_n.webp', NULL, NULL, 'https://instagram.com/p/CpkgqtZMLky', 0, 0, '[\"#stefandiez\",\"#germandesignaward\",\"#kaldewei\",\"#sustainability\"]', 'post', 'profile_scrape', 0, 1680707823, 1680707823),
(350, 20, 3054024291372822766, NULL, 'CpiEul-sPDu', 2, -1, 0, 0, 0, 0, 0, 0, '0', 'On this International Women\'s Day, the tech industry celebrates women\'s progress and contributions to the field. While companies are promoting gender diversity and offering support for women, there\'s still a long way to go to achieve true equality in tech. Women bring unique perspectives and talents, essential for creating innovative solutions that address diverse needs. \n\nTo achieve gender equality in tech, we need to address systemic issues that limit women\'s opportunities and create more inclusive policies and practices. This day is a reminder of progress made and work still needed to create an equitable and diverse tech industry.\n\nHere are our top 5 women lead tech brands:\n@mate.bike\n@nova.audioearrings\n@laemon.eu\n@ecooline.global\n@peppermove\n\n#InternationalWomensDay #IWD #WomenInTech #TheLatest', 1678288087, NULL, 'IMAGE', 'images/content/posts/334280573_228166543003224_349155429110938639_n.webp', NULL, NULL, 'https://instagram.com/p/CpiEul-sPDu', 0, 0, '[\"#iwd\",\"#womenintech\",\"#thelatest\"]', 'post', 'profile_scrape', 0, 1680707823, 1680707823),
(351, 20, 3053305572325845228, NULL, 'CpfhT2tM-js', 0, -1, 0, 0, 0, 0, 0, 0, '0', '@omega and @swatch have announced the upcoming release of an exclusive edition of the Mission to the Moon wristwatch. The watch features a seconds hand made from Omega\'s Moonshine Gold, produced only during February\'s full moon as stated in the accompanying certificate.\n\nThe timepiece will be available for purchase on March 7th at select locations in Zurich, London, Milan, and Tokyo, with availability expanding to other sites during the next full moon. \n\nThe only catch is the special edition cannot be bought online with queues expected and release locations.\n\n#TheLatest #Omega #Swatch', 1678202409, NULL, 'IMAGE', 'images/content/posts/334423275_1266973430891312_2716166099771552763_n.webp', NULL, NULL, 'https://instagram.com/p/CpfhT2tM-js', 0, 0, '[\"#omega\",\"#swatch\"]', 'post', 'profile_scrape', 0, 1680707823, 1680707823),
(352, 20, 3052515109045998721, NULL, 'CpctlGaMxSB', 0, -1, 0, 0, 0, 0, 0, 0, '0', '@harvardchansph researchers used data from the @apple Womens Health Study to investigate the relationship between persistently abnormal periods, polycystic ovary syndrome (PCOS), and endometrial hyperplasia and cancer. Participants with PCOS had more than four times the risk of endometrial hyperplasia and more than 2.5 times the risk of uterine cancer. \n\nThose who experienced cycle irregularity for five or more years after their first period had more than twice the risk of endometrial hyperplasia and more than 3.5 times the risk of uterine cancer. \n\nThe study highlighted the importance of talking to a healthcare provider early when experiencing persistent changes to the menstrual cycle.\n\nImage: Apple\n\n#TheLatest #Harvard #AppleWatch #MenstrualCycle #Tech #Science', 1678108179, NULL, 'IMAGE', 'images/content/posts/334264965_223969506707936_4194719153801024999_n.webp', NULL, NULL, 'https://instagram.com/p/CpctlGaMxSB', 0, 0, '[\"#harvard\",\"#applewatch\",\"#menstrualcycle\",\"#tech\",\"#science\"]', 'post', 'profile_scrape', 0, 1680707823, 1680707823),
(353, 20, 2886485516740627569, NULL, 'CgO20jCooxx', 5, 77, 1163, 0, 0, 0, 0, 0, '0.17', 'Need a great fat e-bike for an even better price? \n\n@himiwaybike is your one-stop shop for high-quality fat tire e-bikes, from the best-selling Step Thru version to the high-performance mountain bike.\n\nHimibike\'s fat tires and extended range of over 95 kilometers make them the perfect bike for anyone! Whether you want to get back on a bike after some years off or are a hardcore enthusiast wanting to tackle the most challenging terrain, Himibike has something for you.\n\nOf course, our favorite bike is the snake skin Cobra Pro model! \n\nRide a Himibike now at The Latest\n\n#TheLatest #TheLatestStore #Himiway #ebike #electricbike #fatbike #fattire #fatbike #fatebike #himiwaybike #emobility #stepthru #mountainbike #urban #urbantransport', 1658315917, NULL, 'VIDEO', 'images/content/posts/294991961_623072438956911_1188037747436332689_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/294411584_5417864821593664_4059902442504228944_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5mZWVkLmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=104&_nc_ohc=hZlufu01HZUAX8CTHF-&edm=AOQ1c0wBAAAA&vs=17934870590472935_3294135849&_nc_vs=HBksFQAYJEdFQmRqQkZBMWlIMGhEOFRBRkNRTk56Q3ExYzRia1lMQUFBRhUAAsgBABUAGCRHSUFXa3hGUDFkXzlpNFVCQUoxVEJsYVpESDhRYmtZTEFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMBUAACbw7bqJgYXePxUCKAJDMywXQC5EGJN0vGoYEmRhc2hfYmFzZWxpbmVfMV92MREAdeoHAA%3D%3D&_nc_rid=37db57038a&ccb=7-5&oh=00_AfBhQwYNoLfGwcjpek2pBlyGdixHheycdh6xVYjDzFhQUw&oe=642F16EF&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CgO20jCooxx', 0, 0, '[\"#thelateststore\",\"#himiway\",\"#ebike\",\"#electricbike\",\"#fatbike\",\"#fattire\",\"#fatbike\",\"#fatebike\",\"#himiwaybike\",\"#emobility\",\"#stepthru\",\"#mountainbike\",\"#urban\",\"#urbantransport\"]', 'post', 'profile_scrape', 0, 1680707823, 1680707823),
