(356, 20, 2872116953649208598, NULL, 'Cfbzyb3o10W', 1, 376, 52974, 0, 0, 0, 0, 0, '0.77', 'Your kid\'s furniture can now grow with them.\n\nFrom the first day at home up until 10 years old, the @wilja_moebel MINIMALMAXI can be extended and grow to match your child\'s needs.\n\nThe first form of the MINIMALMAXI is the extra bed which can be adjusted to match the height of the parent\'s bed. The cot is the next stage and the full length 160cm junior bed is the final version. \n\nBuy less but buy better with Wilja furniture.\n\n#TheLatest #TheLatestStore #Wilja #interiordesign #furniture #kids #children #cot #kidstable #kidsbench #greenproductaward #greendesign #greenliving #sustainableliving #sustainablefurniture #slowfurniture #kidsroom', 1656603050, NULL, 'VIDEO', 'images/content/posts/290947201_434782618282451_6022629400813914343_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/290452177_727256688522142_7669531774060628864_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5mZWVkLmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=110&_nc_ohc=cllJoOEHxo4AX-ZXMRx&edm=AOQ1c0wBAAAA&vs=17956362652763175_4148225534&_nc_vs=HBksFQAYJEdOSHlUeEdlYzVTa2I1VUNBSUNMZEhxRHBtOXFia1lMQUFBRhUAAsgBABUAGCRHSno3V0JIYm5kWG80bHNCQUlRTFphX1NfSjlhYmtZTEFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMBUAACaU%2BL73v%2BmOQBUCKAJDMywXQCKqfvnbItEYEmRhc2hfYmFzZWxpbmVfMV92MREAdeoHAA%3D%3D&_nc_rid=37db55d681&ccb=7-5&oh=00_AfD_MhwBar8wFrHQebEUr1qL0CysRTockrGdM026HAA0HA&oe=642F3FBF&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/Cfbzyb3o10W', 0, 0, '[\"#thelateststore\",\"#wilja\",\"#interiordesign\",\"#furniture\",\"#kids\",\"#children\",\"#cot\",\"#kidstable\",\"#kidsbench\",\"#greenproductaward\",\"#greendesign\",\"#greenliving\",\"#sustainableliving\",\"#sustainablefurniture\",\"#slowfurniture\",\"#kidsroom\"]', 'post', 'profile_scrape', 0, 1680707823, 1680707823),
(357, 20, 2868455347771900096, NULL, 'CfOzPDqA4DA', 4, 1484, 76692, 0, 0, 0, 0, 0, '3.02', 'The newest bike from @ridecake is a force to be reckoned with along the trails of the African bush.\n \nThe idea for this bike grew from the problem that anti-poaching rangers in South Africa needed a better mode of transport.\n \nTo patrol their area and protect the animals efficiently, they need something fast, clean, and quiet, low maintenance, and long-lasting - like the Kalk AP!\n \n#TheLatest #TheLatestStore #offroad #solar #solarpower #offgrid #poaching #antipoaching #wildlife #wildelifeconservation #transportdesign #battery #electricvehicle #EV #digitalnomad #rideelectric #cakekalk #ridecake #vehicledesign #electric #streetlegal #electricmotorcycle', 1656166641, NULL, 'VIDEO', 'images/content/posts/290285265_400617155339944_6110624215401668487_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/290218056_1173549890156301_7494793526967129703_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=109&_nc_ohc=UQzjdm6lTtsAX90qAhS&edm=AOQ1c0wBAAAA&vs=332944432366066_3392205489&_nc_vs=HBksFQAYJEdFaGdUQkVOTjFSZ1Zpc0VBR2ZXeGU4QTJ3Sm9idlZCQUFBRhUAAsgBABUAGCRHUE1uVFJHVDJpQWV2MThBQU84b0ExQm54cjhpYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbexo3MhvzVQBUCKAJDMywXQCIAAAAAAAAYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=37db5ec208&ccb=7-5&oh=00_AfADZ9TNDYLAdtao7NY2rnCig3fjf5XKJMP2hx9uCXklsA&oe=642F5407&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CfOzPDqA4DA', 0, 0, '[\"#thelatest\",\"#thelateststore\",\"#offroad\",\"#solar\",\"#solarpower\",\"#offgrid\",\"#poaching\",\"#antipoaching\",\"#wildlife\",\"#wildelifeconservation\",\"#transportdesign\",\"#battery\",\"#electricvehicle\",\"#ev\",\"#digitalnomad\",\"#rideelectric\",\"#cakekalk\",\"#ridecake\",\"#vehicledesign\",\"#electric\",\"#streetlegal\",\"#electricmotorcycle\"]', 'post',