(358, 20, 2867504244007848152, NULL, 'CfLa-rQA0jY', 0, 50, 6857, 0, 0, 0, 0, 0, '0.1', 'It\'s day two at the @greentech_festival! \n\nIf you haven\'t already made it to Berlin TXL, now is the time. The event is full of people, brands, and organizations doing everything they can to positively impact the world for a sustainable future. Our role at The Latest is two-sided, we not only support innovative and sustainable brands, but we also present them to you before anyone else. Check out our booth A09 at Green Tech Festival to see the amazing products we have brought with us.\n\n@novusbike\n@v.sun.care\n@aerofoils.official - Audi e-tron foils\n@goberobots\n@blackteamotorbikes\n@airy_luftreiniger\n@affenzahn_official \n@hello_volla \n\n #TheLatest #TheLatestStore #GreenTechFestival #sustainability #climatechange #togetherwechange #gofreen #greenfuture #changemaker #green #innovations #future #saveourplanet #gtf2022 #greentechfestival2022 #savetheplanet #greentech', 1656053333, NULL, 'VIDEO', 'images/content/posts/289636855_413581507349000_2730982008363804874_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/289655047_196482629390451_318453902191399869_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=103&_nc_ohc=exSnlCLn88UAX-ViF0W&edm=AOQ1c0wBAAAA&vs=347790403998837_358442852&_nc_vs=HBksFQAYJEdBZkpReEZ6VUZRdHM3SUFBTDJUZEFVallHc0VidlZCQUFBRhUAAsgBABUAGCRHRHl2TEJITXczWUViS01DQUpfSDV2TnRFSWNaYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACaCqb6kmo7pPxUCKAJDMywXQCgAAAAAAAAYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=37db5ed192&ccb=7-5&oh=00_AfARgDunYgbYTGhpGtQ9fBYhmJDlFnEgf3HOHaqqb8U-wg&oe=642EECDD&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CfLa-rQA0jY', 0, 0, '[\"#thelatest\",\"#thelateststore\",\"#greentechfestival\",\"#sustainability\",\"#climatechange\",\"#togetherwechange\",\"#gofreen\",\"#greenfuture\",\"#change