(363, 20, 2853055708399463936, NULL, 'CeYFwz3jO4A', 11, 75, 1354, 0, 0, 0, 0, 0, '0.17', 'Mnchner aufgepasst \n\nDieser Monat steht ganz unter dem bunten Regenbogen des Pride Months und wir wollen die Menschen erreichen und ihnen zu hren - die die wirklich wichtigen Geschichten erzhlen. Geschichten von Ausgrenzung und Diskriminierung; wir wollen die Menschen erreichen, die die Welt verndern knnen. \n\nDeshalb haben wir den MOD.3 vegan in der Rainbow Edition gelauncht und untersttzen pro verkauftem Sneaker mit 10 die Mnchner Organisation @regenbogenfamilienmuenchen . \n\nUnd ihr Mnchner habt jetzt die Mglichkeit 2 Paar MOD.3 vegan Rainbow Edition im The Latest Pop up in der Breuninger Erlebniswelt bei Konen im UG zu gewinnen. \n\nWas ihr dafr tun msst? \n\nHeute von 12:00  20:00 Uhr bei dem The Latest Pop up in der Breuninger Erlebniswelt bei Konen im UG vorbeischauen, dort die Gewinnspielteilnahmekarte ausfllen und Daumen drcken \n\nWir werden den Gewinner kontaktieren und ihm sein brandneues Paar MOD.3 vegan Rainbow Edition in gewnschter Farbe zusenden. \n\nWir freuen uns auf euch!\n\n#MONACODUCKS #vegansneakers #happypride #pridemonth #happypridemonth #pride #absolutnachhaltig #toleranz #vielfalt #vegan #circulareconomy #breuningermnchen #munich #saturdays #TheLatest #TheLatestMunich #Breuninger #Konen #innovation #trends', 1654330793, NULL, 'VIDEO', 'images/content/posts/285745622_1065734507681809_2604572272330585060_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/285468777_328680842763771_4473870381332177792_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=103&_nc_ohc=Q6olC_Dws5cAX8I_eOZ&edm=AOQ1c0wBAAAA&vs=557791832404499_357986521&_nc_vs=HBksFQAYJEdHbm9BeEg3bmVENDdpb0JBSUFqY29Kb1lSWV9idlZCQUFBRhUAAsgBABUAGCRHRm1SNnhBRGowZHBlOW9IQU9QU2REVG1qNTBpYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbyjZnUg4K4PxUCKAJDMyw