(381, 21, 2614647845313798319, NULL, 'CRJGFzAq2Cv', 0, 29, 199, 0, 0, 0, 0, 0, '0.72', 'Du willst zusammen mit WEtell Wirtschaft nachhaltig verndern? Dann mach mit bei #gemeinsammehr und erzhle allen von uns! \n\nWie im Video von @studio.wilma erklrt, installieren wir dafr Solarmodule oder erlassen den Personen, die durch dich zu uns kommen, die Bereitstellungsgebhr. Du bekommst zustzlich 5 Mobilfunkguthaben fr jeden neuen WEtell Vertrag, der durch dich zustande kommt. \nEs springt also richtig viel fr alle raus! Dein Geldbeutel freut sich und du und deine Freund*innen und Bekannte knnen sich sicher sein, dass ihr mit #gemeinsammehr Teil einer richtig coolen Bewegung seid, die echt was verndern kann. \nDenn wir setzen neue Standards fr den Mobilfunk und den Markt, damit alle in Zukunft mit gutem Gewissen und Spa mobilfunken knnen und sich sicher sind, dass ihre Daten in guten Hnden sind. Also macht mit und erzhlt allen vom Wandel, erzhlt von WEtell! \nAlle Infos zu #gemeinsammehr gibt es auf unserer Website, Link in Bio.\n\nWir gehen noch einen Schritt weiter und werden WEtell GW zertifizieren lassen. Wie das aussieht, zeigen wir euch nchste Woche, es wird spannend! \n\n#wetell #endlichgruenfunken #thechange #mobilfunkgehtauchnachhaltig #nachhaltigkeit #nachhaltig #zukunft #sustainability  #umweltschutz #klimaschutz #nachhaltigleben #datenschutz #mobilfunk #nachhaltigermobilfunk #telekommunikation #verantwortungsbewusst #telefonieren #grnfunken #freiburg #berlin #hamburg #wandel  #community #transparenz  #solarenergie #fairness #nachhaltigwirtschaften', 1625910377, NULL, 'VIDEO', 'images/content/posts/213546764_317387580065679_6929448603635187819_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_300475895145059_8328653013197162616_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=111&_nc_ohc=Z5lzi7xCQGgAX8nVoeW&