(382, 21, 2611726231601327329, NULL, 'CQ-tyuNKqzh', 0, 30, 208, 0, 0, 0, 0, 0, '0.74', '#gemeinsammehr  Du erzhlst von WEtell und wir installieren mehr Solarmodule! \nWie im Video von @studio.wilma erklrt, bekommst du bei WEtell fairen, sicheren und nachhaltigen Mobilfunk, damit du mit richtig gutem Gewissen mobilfunken kannst. Und mit #gemeinsammehr kannst du sogar noch mehr fr die Umwelt und deinen Geldbeutel tun! \n\nDu teilst den #gemeinsammehr Rabattcode und bekommst 5 Mobilfunkguthaben pro neues WEtell Mitglied, das durch dich zu uns kommt, und wir erlassen allen neuen WEtell Mitgliedern, die so einen Vertrag abschlieen, die Bereitstellungsgebhr oder investieren 40 in die Installation von weiteren Solarmodulen.\n\n#gemeinsammehr findest du ne coole Sache und willst es allen deinen Freund*innen und Bekannten erzhlen? Das kannst du ganz einfach ber verschiedene Teilemglichkeiten, die wir vorbereitet haben: \nbers Handy kannst du #gemeinsammehr per E-Mail, Facebook, Threema, Telegram und Whatsapp teilen, in der Desktop-Ansicht klappt es ber E-Mail und Facebook. Oder du nimmst einfach direkt diesen Text und schickst ihn an alle deine Freund*innen:\n\nIch hab die klimaneutralen Mobilfunktarife von WEtell fr mich entdeckt und find\'s super cool! Wenn du auch fair und zuverlssig telefonieren willst, wechsel doch jetzt im Rahmen der #gemeinsammehr-Aktion! Gut fr dich, weil du dir die Anschlussgebhr sparen kannst! Gut fr mich, weil ich einen kleinen Bonus bekomme! Und sowieso gut fr\'s Klima, weil WEtell fr uns Solaranlagen baut! Dein Wechselcode lautet WE-GMM-AB-2021 und weitere Infos findest du auf wetell.de/gemeinsammehr \nLiebe Gre\n\nUnd natrlich kannst du dich auch mit dem Megafon in deine Strae stellen, dafr haben wir aber leider keinen Text vorbereitet.  \nMach deinen Mobilfunk nachhaltig mit WEtell und bewege die Welt mit #gemeinsammehr!\nFr weitere Infos klick den Link in der Bio.\n\n#wetell #endlichgruenfunken #thechange #mobilfunkgehtauchnachhaltig #nachhal