(386, 21, 2501124830589044800, NULL, 'CK1x8gqK0hA', 2, 51, 733, 0, 0, 0, 0, 0, '1.31', 'Naaa? Wie steht es um deine Vorstze? Eher 1:0 fr den Schweinehund? Oder hast du schon zu WEtell gewechselt? \n\nWarum zu WEtell wechseln? Ganz einfach!\n1. Du bist total unabhngig! Du mchtest ja sicherlich nicht nochmal 24 Monate in deinem Vertrag stecken, oder? Mit einem WEtell Vertrag und unseren monatlich kndbaren Tarifen entscheidest alleine du!\n2. Du schtzt das Klima! Mit unseren 1.000 Solarmodulen, kompensieren wir bereits jetzt den CO2 Verbrauch von unseren 3.000 Kund*innen zu 200 %.\n3. Du bekommst den besten Service! 99 % unserer Kund*innen sind super zufrieden mit unserer Hilfe!\n\n Zu den Tarifen findest du ber unsere Bio bzw. ber diesen Link: https://www.wetell.de/tarife/\n\n#wechselzuwetell #2021 #esistniezuspt #nachhaltigkeit #fairness #datenschutz #klimapositiv', 1612377341, NULL, 'VIDEO', 'images/content/posts/146385875_244922997101656_5458575878381305244_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/146634403_860552581397448_2405357641141324547_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjQyNi5mZWVkLmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=100&_nc_ohc=S-IAfwzEhJoAX84Yc9w&edm=AOQ1c0wBAAAA&vs=17867245697331665_3514492374&_nc_vs=HBkcFQAYJEdLTjJ2UWpJdV93Q3F3NERBQU1MQU00SGpHRWhia1lMQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAEwFQAAJqLTrb7Jir0%2FFQIoAkMzLBdAFAAAAAAAABgSZGFzaF9iYXNlbGluZV8xX3YxEQB16gcA&_nc_rid=efeff7df2e&ccb=7-5&oh=00_AfA17bkC1V1CRnRQ1L-0_nKLRTGu0KBh06sjM4xqMBkSkw&oe=642F3E81&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CK1x8gqK0hA', 0, 0, '[\"#2021\",\"#esistniezusp\\u00e4t\",\"#nachhaltigkeit\",\"#fairness\",\"#datenschutz\",\"#klimapositiv\"]', 'post', 'profile_scrape', 0, 1680711215, 1680711215),
