(399, 23, 2998937868034986120, NULL, 'CmeXhoXsVCI', 11, 875, 0, 0, 0, 0, 0, 0, '3.08', 'Eule oder Lerche? \nWelcher Schlaftyp seid ihr? \n\nKennt ihr schon die zauberhafte #kurzstrecke mit @max_mutzke_official & @pierre_m_krause?\nWas die beiden alles im Zauberwald erlebt haben, seht ihr in der @ardmediathek \n\nLink in der Bio! \n\n#wandern #vomswr #swr #swrfernsehen #durststrecke #schnaps #wanderroute #nature #bestfriends #saufen #trip #hike #mountain #witzig #talk #talkshow #deeptalk #spaziergang #pierremkrause #maxmutzke #ausflug #ausflugsziel #ausflugstipp #gynkologe #dorfleben #eule #lerche #schlaftyp', 1671721274, NULL, 'IMAGE', 'images/content/posts/321051168_915635366474089_2314929304825741278_n.jpg', NULL, NULL, 'https://instagram.com/p/CmeXhoXsVCI', 0, 0, '[\"#kurzstrecke\",\"#vomswr\",\"#swr\",\"#swrfernsehen\",\"#durststrecke\",\"#schnaps\",\"#wanderroute\",\"#nature\",\"#bestfriends\",\"#saufen\",\"#trip\",\"#hike\",\"#mountain\",\"#witzig\",\"#talk\",\"#talkshow\",\"#deeptalk\",\"#spaziergang\",\"#pierremkrause\",\"#maxmutzke\",\"#ausflug\",\"#ausflugsziel\",\"#ausflugstipp\",\"#gyn\\u00e4kologe\",\"#dorfleben\",\"#eule\",\"#lerche\",\"#schlaftyp\"]', 'post', 'profile_scrape', 0, 1681214247, 1681214247),
(400, 23, 2987119271517971207, NULL, 'Cl0YSaojWMH', 59, 211, 3394, 0, 0, 0, 0, 0, '0.94', ' Ho ho ho. Heute ist Nikolaus-Tag. Und unser Nikolaus Max Mutzke hat Geschenke vorbeigebracht: \n\nNIKOLAUS-GEWINNSPIEL: Schwarzwald Reloaded IV  Das Veggie-Kochbuch fr Heimat-Entdecker. Einige Gerichte werden mit Velike! aufgepeppt.\n \nWir verlosen 3 Kochbcher und Du hast die Chance, eines davon zu gewinnen.\n \nWie kannst Du teilnehmen?\n \n Folge @Velike.vegan\n Like diesen Beitrag\n Schreibe das richtige Lied in die Kommentare\n Markiere deine:n Lieblingskochpartner:in in den Kommentaren\n \nUnd mit etwas Glck kannst Du das Veggie-Kochbuch bald in Deinen Hnden halten.\n \n___________________________\nDas heutige Gewinnspiel endet am 13. Dezember 2022 um 18 Uhr und steht in keinerlei Verbindung mit Instagram bzw. Facebook und wird nicht durch Instagram/Facebook gesponsert, untersttzt oder organisiert! Der Gewinner wird per DM benachrichtigt und in der Story erwhnt. Keine Barauszahlung. Der Rechtsweg ist ausgeschlossen. Nur wenn Du 18 Jahre alt bist und alle 4 Punkte erfllt sind, nimmst Du am Gewinnspiel teil! Teilnahme nur mit Wohnsitz in Deutschland erlaubt. \n\n#velike #velikeVegan #velikeblackforestnatureoat #bio #schwarzwald #haferhelden #vegan #veganfood #umwelt #schwarzwaldregion #hafer #maxmutzke #musik', 1670312426, NULL, 'VIDEO', 'images/content/posts/318206650_137829958820053_7680057701861135823_n.jpg', NULL, NULL, 'https://instagram.com/p/Cl0YSaojWMH', 0, 0, '[\"#velike\",\"#velikevegan\",\"#velikeblackforestnatureoat\",\"#bio\",\"#schwarzwald\",\"#haferhelden\",\"#vegan\",\"#veganfood\",\"#umwelt\",\"#schwarzwaldregion\",\"#hafer\",\"#maxmutzke\",\"#musik\"]', 'post', 'profile_scrape', 0, 1681214247, 1681214247);
