(446, 25, 3049787705936405302, NULL, 'CpTBcKUsWM2', 4, 98, 0, 0, 0, 0, 0, 0, '3.86', 'Ich kenn\' Dich zur Hlfte, nein, ich kenn\' Dich dreiviertel und eigentlich kenn\' ich Dich berhaupt nicht.\nIch schreibe groe Zeilen in klitzekleine Lieder und sing\' sie dann heimlich fr Dich. \nDu lachst und Du weinst und Du bist, so wie Du bist - ein rudimentres Unikat.\nVielleicht hab\' ich einmal Glck und es ist so wie es ist, es gewinnt der, der alte Trume wahrt.\nUnd Du drehst Dich in Deiner kleinen Welt.\nMit Deinen groen Farben, wie sie Dir gefllt. \nOb trist, ob manchmal grau, ob blau und wunderschn, oh, ich wrd mich so gerne in Deinen Welten dreh\'n./ \n\n#foto #fotoshooting #berdenwolken #girl #luckygirl #happygirl #happyelli #potd #karokauer #carmushka #carmushkis #marykay #marykaydeutschland #blogger #bloggerlife #bloggerstyle', 1677783047, '{\"city_name\":\"Breitungen\",\"region_name\":\" Thuringen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/334199708_568036915278461_5712604741435222634_n.jpg', NULL, NULL, 'https://instagram.com/p/CpTBcKUsWM2', 0, 0, '[\"#fotoshooting\",\"#\\u00fcberdenwolken\",\"#girl\",\"#luckygirl\",\"#happygirl\",\"#happyelli\",\"#potd\",\"#karokauer\",\"#carmushka\",\"#carmushkis\",\"#marykay\",\"#marykaydeutschland\",\"#blogger\",\"#bloggerlife\",\"#bloggerstyle\"]', 'post', 'profile_scrape', 0, 1682411622, 1682411622),
