(463, 27, 2942162176580989044, NULL, 'CjUqOlOszB0', 22, 235, 0, 0, 0, 0, 0, 0, '5.4', 'Jeder von uns hat Trume oder zumindest eine Vorstellung davon, was ihn glcklich macht oder machen knnte. Jeder von uns wei was er braucht oder bruchte um diesem Ziel nher zu kommen. Und trotzdem bleibt es bei so vielen immer nur der Traum, immer nur ein das wrde ich auch so gerne machen aber.. oder schade, dass ich jetzt zu alt dafr bin..\n\nMein Traum ist es zu Reisen. So viele verschiedene Kulturen kennenzulernen wie mglich, mich von dem gewohnten Leben zu lsen und raus aus der Komfort-Zone zu kommen. Mit so wenig wie mglich Dingen auszukommen, sich bewusst werden was man im Leben wirklich braucht. Neues Essen probieren, neue Leute kennenlernen, inspirieren & inspiriert werden. Eine andere Sprache sprechen. Sich ab und zu mit Hand & Fu verstndigen und einfach Spa am Leben haben. Ich mchte fr mich ein unabhngiges Leben erschaffen. Wie lange ich unterwegs zuhause bin, das wei ich nicht. Aber die Heimat empfngt einen immer mit offenen Armen, zurck kann man IMMER.\n\nMenschen und deren Trume sind so unterschiedlich, wie die Blumen auf einer Wiese. Es geht viel mehr darum zu berlegen warum man diesen Visionen nicht nachgeht?\n\nGlcklich zu sein bedeutet Dinge anzupacken, Situationen herauszufordern und vielleicht auch mal etwas zu riskieren, ohne zu wissen ob es die richtige Entscheidung war. Ich habe meinen Traumjob gekndigt, genau wie meine wunderschne Wohnung, weil ich gemerkt habe, dass ich einen Tapetenwechsel brauche. Und dieser ist jetzt mein wunderschner T5 Bus ,Bruno.\nHallo Welt. \n\n#wortzummittwoch #travelbug #girlandthebackpack #camargue #europetravel #europetrip #vanlifediaries #vansofgermany #ontheroadagain #campingmithund #campingvibes #dronephotography #dji', 1664953084, '{\"city_name\":\"Camargue\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/310444638_487910976399733_2385625689102701559_n.jpg', NULL, NULL, 'https://instagram.com/p/CjUqOlOszB0', 0, 1, '[\"#wortzummittwoch\",\"#travelbug\",\"#girlandthebackpack\",\"#camargue\",\"#europetravel\",\"#europetrip\",\"#vanlifediaries\",\"#vansofgermany\",\"#ontheroadagain\",\"#campingmithund\",\"#campingvibes\",\"#dronephotography\",\"#dji\"]', 'post', 'profile_scrape', 0, 1682678709, 1682678709),
(464, 27, 2957084519342229019, NULL, 'CkJrLP6M0Yb', 74, 331, 0, 0, 0, 0, 0, 0, '8.5', 'Loki \n\nIve been trying to find words but couldnt manage in the past days. Someone told me that the Spanish translation for ,Loki is crazy and it made me smile. And I know you would have wanted me to talk about you, to keep your memory alive. Because you were a crazy dog, with the biggest heart and personality. Im beyond grateful for the time we spent together. When I moved to Austria in 2018 people used to ask me if Im not feeling alone. And why Im doing so many things alone. But to be honest I NEVER felt alone because I met you and had you by my side ever since. You listened to me, you made me laugh, you taught me how to slow down, to soak in the simple moments in life & be more present, how to take care of someone else with pure love and you gave me so much affection I never experienced from an animal before. We have the best memories together I could ever ask for. We hiked, we SUPed, we swam, weve been on boats, we adventured together for the past years, camping, traveling and I am so happy I took you on this last roadtrip with me. I have never seen you that happy, running alongside the beaches, digging holes in the sand to find bones. I love you from the bottom of my heart. I have from the second I first saw you - with the biggest ears I ever saw on a dog - and I will continue loving you for the rest of my life. I miss you deeply and I hope I will see you again one day. \n\n#imissyou\n#goodbyemylove\n#runfree\n#rip', 1666731966, '{\"city_name\":\"\\ud835\\udcd7\\ud835\\udcee\\ud835\\udcea\\ud835\\udcff\\ud835\\udcee\\ud835\\udcf7.\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/312620823_805328934121845_854167663163160213_n.jpg', NULL, NULL, 'https://instagram.com/p/CkJrLP6M0Yb', 0, 1, '[\"#imissyou\\n#goodbyemylove\\n#runfree\\n#rip\"]', 'post', 'profile_scrape', 0, 1682678709, 1682678709),
(465, 27, 2950865065138456889, NULL, 'CjzlCRzsAk5', 11, 227, 0, 0, 0, 0, 0, 0, '5', '1 month on the road! \nI saw a quote the other day saying Slowly cut things out until youre left only with what you love, with whats necessary, with what makes you happy and I really feel it right now. I have everything in Bruno, that I need - even more. And living like this teaches me again how to appreciate the little things, who seem so normal at home. Turning on the tap to run water, have a long warm shower, getting cold food out of your fridge. Even going to the toilet. This is exactly what I wanted. A simple life, minimalism, a home on wheels that can bring me anywhere. And who said I cant have plants and candles here with me!  I love every little corner of this bus. And I would love for you to follow along my journey! \n\n#campergirls #solotravel #t5 #t5camperconversion #girlandthebackpack #roadtripeurope #switzerland #france #andorra #spain #camping #campervan #camperlife #vanlife #happyme #traveladdict', 1665990549, NULL, 'IMAGE', 'images/content/posts/311790641_1014673106598434_1372574239265884958_n.jpg', NULL, NULL, 'https://instagram.com/p/CjzlCRzsAk5', 0, 1, '[\"#solotravel\",\"#t5\",\"#t5camperconversion\",\"#girlandthebackpack\",\"#roadtripeurope\",\"#switzerland\",\"#france\",\"#andorra\",\"#spain\",\"#camping\",\"#campervan\",\"#camperlife\",\"#vanlife\",\"#happyme\",\"#traveladdict\"]', 'post', 'profile_scrape', 0, 1682678709, 1682678709),
(466, 27, 3066535926192711677, NULL, 'CqOhi17sKf9', 13, 120, 0, 0, 0, 0, 0, 0, '2.79', 'Wir wollen mehr von den Tagen, die nicht nach Grnden fragen\nIch will die schnen Stunden, ich nehm\' auch die Sekunden\nLass uns lieber nur noch machen, was wir woll\'n \nIch hab\' keine Zeit zu verlier\'n Dinge zu tun, die getan werden soll\'n \nLass uns gewinnen und verlier\'n \nLass uns Dinge ausprobier\'n\nIch will, dass ich irgendwann zurckschau\'n kann \nUnd mich gern erinner\' daran\n\n\n#gutaiderbichl #fullheart #cuddles', 1679779590, '{\"city_name\":\"Gut Aiderbichl\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/337668743_1416001282137697_1435973688028124591_n.jpg', NULL, NULL, 'https://instagram.com/p/CqOhi17sKf9', 0, 0, '[\"#fullheart\",\"#cuddles\"]', 'post', 'profile_scrape', 0, 1682678709, 1682678709),
(467, 27, 3065109509697472842, NULL, 'CqJdNwDMIlK', 10, 174, 0, 0, 0, 0, 0, 0, '3.86', 'I\'m the kind of girl who stares at sunsets and would pull off on the side of the road just to capture the beauty. I would stay out all night just to watch the stars, until it was time for the sun to come up. I will crash into the universe every chance I get, because there\'s nothing more magical than taking in the pieces of the world that take your breath away. I\'m the kind of girl that will savor a bottle of wine to myself, just to pass the time at a new place, in the quiet, to make a new memory.\nSometimes magic is about the things you can see, feel, and touch. And sometimes magic is everything you can\'t touch, see or feel. But know without a shadow of a doubt is there.\nThat is the beauty of this world, this universe.\nAnd I am completely blown away by it all.\n\n#beauty #nature #waterfall #salzburg #gollingerwasserfall #salzburgerland #visitaustria #outdoorlover #travelgirls #girlandthebackpack #blownaway #appreciation', 1679609548, '{\"city_name\":\"Gollinger Wasserfall\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/337314849_889274772370031_855485296989597932_n.jpg', NULL, NULL, 'https://instagram.com/p/CqJdNwDMIlK', 0, 0, '[\"#nature\",\"#waterfall\",\"#salzburg\",\"#gollingerwasserfall\",\"#salzburgerland\",\"#visitaustria\",\"#outdoorlover\",\"#travelgirls\",\"#girlandthebackpack\",\"#blownaway\",\"#appreciation\"]', 'post', 'profile_scrape', 0, 1682678709, 1682678709),
(468, 27, 3058663071940644026, NULL, 'CpyjdvCoIy6', 25, 160, 0, 0, 0, 0, 0, 0, '3.88', 'Die Erinnerung ist das einzige Paradies aus dem man nicht vertrieben werden kann.\n\nHabe lange die Zeit gezhlt in der du bei mir warst. Jetzt zhle ich die Zeit, seit du weg bist. Die Zeit heilt alle Wunden, haben sie gesagt. Aber das ist nicht wahr. Man findet einfach einen Weg damit zu leben, weil man ja auch keine andere Wahl hat. Du bist immer in meinen Gedanken. Ich vermisse dich so sehr und ich wnsche mir nichts mehr, als dich noch einmal in die Arme zu nehmen. Deine sen Ohren noch einmal zu sehen. Mein Leben ohne dich ist anders. Ich fhl mich irgendwie allein, ohne dich! \n\n#soulmate #imissyou #dogjourney #doggrief', 1678841073, NULL, 'IMAGE', 'images/content/posts/335900796_776397776836044_332631626325248699_n.jpg', NULL, NULL, 'https://instagram.com/p/CpyjdvCoIy6', 0, 0, '[\"#imissyou\",\"#dogjourney\",\"#doggrief\"]', 'post', 'profile_scrape', 0, 1682678709, 1682678709),
(469, 27, 3056256493133642202, NULL, 'CpqARZ3tjna', 4, 110, 0, 0, 0, 0, 0, 0, '2.39', 'have you ALWAYS WANTED to get involved in working with ANIMALS, but have no idea WHERE TO START? \n\nwatch  @behind_the_greens_  latest youtube video and find out WHY @margreen_s and @girlandthebackpack recommend you to start LOCAL!  it\'s one of the easiest ways to get a hands on experience without breaking the bank & there\'s nothing as REWARDING as helping the animals in your area!\n\nand dont miss out on learning more about the volunteer experience at @gut_aiderbichl_official & #practicaltips on how to take NAPS with PIGS, avoid being SPIT in the FACE by a camel  and how to give SECOND CHANCE AT LIFE to animals that have went through suffering and abuse.\n\nthe right time is NOW - follow your passion, start volunteering with animals, and if you want to learn about using the power of social media to spread similar messages - JOIN OUR TEAM \n #linkinbio\n\nimages: Melina Kaspar\n#behindthegreens #gutaiderbichl #wildlife #farmwork #wildlifeworker #greenfluencer #animalsanctuary #wildlifeconservation #animalvolunteer #volunteer #rewardingwork #animals #dreamjob #meaningful', 1678554186, '{\"city_name\":\"Gut Aiderbichl Henndorf\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/334375591_1295888507936508_1879512293820828262_n.jpg', NULL, NULL, 'https://instagram.com/p/CpqARZ3tjna', 0, 0, '[\"#practicaltips\",\"#linkinbio\\n\\u2800\\u2800\\u2800\\u2800\\u2800\\u2800\\u2800\\u2800\\u2800\\nimages:\",\"#gutaiderbichl\",\"#wildlife\",\"#farmwork\",\"#wildlifeworker\",\"#greenfluencer\",\"#animalsanctuary\",\"#wildlifeconservation\",\"#animalvolunteer\",\"#volunteer\",\"#rewardingwork\",\"#animals\",\"#dreamjob\",\"#meaningful\"]', 'post', 'profile_scrape', 0, 1682678709, 1682678709),
(470, 27, 3054260587706184825, NULL, 'Cpi6dKFs_R5', 21, 210, 0, 0, 0, 0, 0, 0, '4.85', 'Liebe Frauen, \nbitte hrt auf, mit Mnnern und anderen Frauen zu konkurrieren.\nWir Frauen werden und knnen niemals der bessere Mann\" sein. Warum auch?\nDas ist nicht unsere Aufgabe.\nWir haben unsere ganz eigenen Strken, die unsere Welt mehr als dringend braucht.\nWir haben eine starke Intuition. \nWir haben Mitgefhl. \nWir haben Leidenschaft. \nWir haben die Fhigkeit einen Raum zu halten - indem sich jemand anderes fallen lassen kann.\nDas Wichtigste: Bist du selbst!\nSchlie Frieden mit deinem Aussehen. Schlie Frieden mit deinen Schwchen.\nFang an zu sehen, wie gro du bist. \nSpre, wie stark du bist. \nSpre, wie mchtig du bist. \nSpre wie vernderbar du bist. \nWie mtterlich du sein kannst.\nEs fngt alles an bei dir selbst. \nEchte Mnner werden dir folgen.\n\n@ramona_arendt ich liebe deinen Text - danke! \n\n finally get to share the beautiful art @msaulits_photography created! Thank you so much!  I had a lot of fun shooting with you!\n\n#internationalwomensday #happywomensday #frauenpower #girlspower #weltfrauentag #photoshoot #sagres', 1678316256, '{\"city_name\":\"Sagres\",\"country_name\":\"portugal\",\"country_code\":\"PT\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/332382105_958809241956354_553372019348448703_n.jpg', NULL, NULL, 'https://instagram.com/p/Cpi6dKFs_R5', 0, 0, '[\"#happywomensday\",\"#frauenpower\",\"#girlspower\",\"#weltfrauentag\",\"#photoshoot\",\"#sagres\"]', 'post', 'profile_scrape', 0, 1682678709, 1682678709),
(471, 27, 3051053772738420104, NULL, 'CpXhT26sF2I', 0, 93, 0, 0, 0, 0, 0, 0, '1.95', 'There will be times when standing alone feels too hard, too scary. And will doubt our ability to make our way through the uncertainty. Someone somewhere will say - dont do it. You dont have what it takes to survive the wilderness. This is when you reach deep into your wild heart and remind yourself. I am the wilderness. \n\n#wild #fox #spanishwildlife #campingguest #beauty', 1677933974, '{\"city_name\":\"Spain\",\"country_code\":\"ES\",\"country_name\":\"spain\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/329004298_679321303994962_1465978912844773157_n.jpg', NULL, NULL, 'https://instagram.com/p/CpXhT26sF2I', 0, 0, '[\"#fox\",\"#spanishwildlife\",\"#campingguest\",\"#beauty\"]', 'post', 'profile_scrape', 0, 1682678709, 1682678709),
