(474, 27, 3033938094609083173, NULL, 'Coatp9fsysl', 2, 94, 0, 0, 0, 0, 0, 0, '2.02', 'Ich glaube, mittlerweile habe ich verstanden, warum das Surfen so etwas einzigartiges fr mich ist. Etwas das mich von Anfang an gefesselt hat & mir gleichzeitig so einen Respekt vor der Natur verschafft. Beim Surfen ist kein Platz fr andere Gedanken. Du fokussierst dich nur auf dich, deinen Krper & die Welle. Der Kopf ist frei. Die Wellen kommen so & so, die Natur ist unglaublich gewaltig & wer sich nicht anpasst wird mitgenommen und einmal komplett durchgesplt. Du kannst die Wellen nicht stoppen - aber du kannst lernen sie zu surfen. Und dann fhlst du dich einfach unglaublich frei. ', 1675893626, '{\"city_name\":\"Taghazout\",\"country_name\":\"morocco\",\"country_code\":\"MA\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/329427354_918159995857095_878248922968444831_n.jpg', NULL, NULL, 'https://instagram.com/p/Coatp9fsysl', 0, 0, NULL, 'post', 'profile_scrape', 0, 1682678709, 1682678709),
