(484, 28, 3016130355497470918, NULL, 'CnbcpQDswvG', 58, 843, 0, 0, 0, 0, 0, 0, '8.36', 'ss\nIch bin Miriam und gerade 37 Jahre alt geworden.\nIch bin seit 16 Jahren mit einem wunderbaren Mann verheiratet und wir sind Eltern von 4 Kindern, wobei der alteste mit 18 dieses Jahr schon sein Studium begonnen hat und dafr im Sden Deutschlands ist. \nund die anderen mit 16 und 14 auch nicht mehr so klein sind. Unser jungster ist allerdings erst 6 seit diesem Jahr ein Schulkind \n\nWie ich zu Instagram kam (Achtung Realitt)\nBis vor ein paar Jahren war ich die Alleinverdienerin in unserer Familie und mein Mann der Hausmann.\nIch habe groe Konzerne zum Datenschutz und It Sicherheit beraten.\n\nBis ich einen Schnupfen hatte \nIhr kennt das. Klar geht man mit einem Schnupfen nicht gleich zum Arzt und erstmal ging ich auch weiter arbeiten.\nAls es nach einer Woche immer schlechter wurde, ging ich doch zum Arzt.\n5 min rein , Medikament - wird bald wieder \n\nWurde aber nicht besser\nAls die Woche darauf meine Motorik immer schlechter wurde , wieder zum Arzt und ab ins Krankenhaus  \nMittlerweile konnte ich nicht mehr alleine laufen.\n\nWer jetzt auf ein Happy End hofft \nGibt keines.\nIch lag damals 3 Wochen am Stck in der Neurologie und auch zahlreiche Krankenhausaufenthalte und rzte spter, hre ich nur wie interessant mein Fall ist.\nAuch dem Zentrum fr seltene Erkrankungen war er zu selten. \n\nDann fing auch noch Corona an und da ich zu der Zeit fast nur liegen konnte fing ich an YouTube und Instagram zu schauen (Netflix hatte ich gefhlt schon durch ) und ja irgendwie bin ich dann selbst hier gelandet und auch wirklich froh darber.\n\nIch habe mich mittlerweile arrangiert und auch das laufen geht wieder relativ gut und ich brauche keinen Rollstuhl mehr.\n\nIch habe hier viele tolle Leute kennen gelernt und gerade an Tagen an denen gar nichts geht, freue ich mich immer quasi virtuell an euren tollen Ideen und Geschichten teil zu haben \n\nSoziale Medien knnen also tatschlich auch wirklich sozial sein. Mir hilft Instagram total, weil ich hier nur mache was mir gut tut und ich schn finde.\n\nUmso mehr freut es mich, wenn es auch anderen gefllt \n\nDanke das ihr da seid \n\n#mamablogger_de #frmehrrealittaufinstagram #vorstellung \n\n', 1673770778, NULL, 'IMAGE', 'images/content/posts/320925456_209536804967139_4853728678249907891_n.jpg', NULL, NULL, 'https://instagram.com/p/CnbcpQDswvG', 0, 1, '[\"#f\\u00fcrmehrrealit\\u00e4taufinstagram\",\"#vorstellung\"]', 'post', 'profile_scrape', 0, 1682678843, 1682678843),
(485, 28, 3090192576246324173, NULL, 'CrikcaKthvN', 6, 236, 0, 0, 0, 0, 0, 0, '2.25', '\nNa kennt ihr noch LK ? \n\nBei uns das tolle miniLK-Set @luek.lernspiel fr Mathematik und Deutsch im Einsatz\n\nDas Set enthlt bungen zum sinnerfassenden Lesen von Silben, Wrtern und Stzen sowie zum Verstehen mathematischer Inhalte der 1. Klasse nach den neuesten didaktisch-methodischen Erkenntnissen. Das Beste daran ist, dass das Lernen an der LK-Station besonders motivierend ist, da es spielerisch, eigenverantwortlich und mit Selbstkontrolle erfolgen kann. #montessori\n\nDas miniLK-Set ist nicht nur motivierend und fachlich fundiert, sondern auch flexibel einsetzbar. Es ist perfekt geeignet fr die Schule, fr zu Hause oder unterwegs. Und das Beste daran ist, dass es immer auf dem neuesten Stand der Lernforschung ist und ber 200 Themenhefte vom Kindergarten bis zur 4. Klasse erhltlich sind.\n\nEtwas das ich schon selber als Kind genutzt habe und auch bei meinen 4 super gerne nutze \n\n#miniLK #Lernspielzeug #Mathematik #Deutsch #Lernen #Motivation #Kinder #Selbststndigkeit #mamablogger #lernenmitkindern #abendpostig', 1682599683, '{\"city_name\":\"Nordrhein-Westfalen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/343282664_620635209604404_2485241426655507619_n.jpg', NULL, NULL, 'https://instagram.com/p/CrikcaKthvN', 0, 0, '[\"#montessori\\n\\ndas\",\"#lernspielzeug\",\"#mathematik\",\"#deutsch\",\"#lernen\",\"#motivation\",\"#kinder\",\"#selbstst\\u00e4ndigkeit\",\"#mamablogger\",\"#lernenmitkindern\",\"#abendpostig\"]', 'post', 'profile_scrape', 0, 1682678843, 1682678843),
(486, 28, 3089402436666146631, NULL, 'CrfwyXVtj9H', 5, 315, 0, 0, 0, 0, 0, 0, '2.97', 'Am 8 Mai gehts los \n\nIch freue mich, euch meine kommenden Themenwochen zum Thema \'Kindergarten, Vorschule, Einschulung und Schule\' ankndigen zu knnen! \nUnd am 8 Mai starten wir mit \nKindergarten und Vorschule\n\nAls Mama von vier Kindern wei ich, wie wichtig es ist, unsere Kleinen und Groen auch beim lernen zu begleiten, deswegen teile ich in den nchsten Wochen meine Erfahrungen und Tipps mit euch, um euch bei dieser wichtigen Aufgabe zu untersttzen. \n\nAuerdem habe ich einige tolle berraschungen geplant, darunter zwei Gewinnspiel mit ntzlichen und sinnvollen Dingen rund um das Thema Kindergarten und natrlich mit kreative Ideen, um das Lesen und Lernen fr eure Kinder noch spannender zu gestalten.\n\nIn welchem Alter sind eure Kinder eigentlich gerade ?\nIch habe ja vom Schulkind bis zu gerade Erwachsen alles dabei  \n\n#Kindergarten #Vorschule #Schule #Bildung #Lernen\n#Erziehung #Eltern #Kinder #ZukunftdurchBildung\n#bIoggertimes #spielzeugfrkinder #mamaalltag #mamablogger_de #baldkindergartenkind #vorschule', 1682505491, '{\"city_name\":\"Nordrhein-Westfalen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/343409267_1156576921704270_6602894525027971101_n.jpg', NULL, NULL, 'https://instagram.com/p/CrfwyXVtj9H', 0, 0, '[\"#kindergarten\",\"#vorschule\",\"#schule\",\"#bildung\",\"#lernen\\n#erziehung\",\"#eltern\",\"#kinder\",\"#zukunftdurchbildung\\n#bioggertimes\",\"#spielzeugf\\u00fcrkinder\",\"#mamaalltag\",\"#mamablogger_de\",\"#baldkindergartenkind\",\"#vorschule\"]', 'post', 'profile_scrape', 0, 1682678843, 1682678843),
(487, 28, 3088707023487338814, NULL, 'CrdSqxWN4k-', 10, 340, 0, 0, 0, 0, 0, 0, '3.25', ' Manchmal sind es die kleinsten Dinge, welche den meisten Platz in deinem Herzen einnehmen. \n#winniethepooh \n\n#mamablogger #lebenmitkindern #mamaleben #endlesslove #mamaliebe #mutterliebe #lebenmitkindern #hitstyleevetues #family \n\n Das Bild ist aus dem letzten Jahr', 1682422591, '{\"city_name\":\"Nordrhein-Westfalen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/342740207_1308792189727658_1508201574641230091_n.jpg', NULL, NULL, 'https://instagram.com/p/CrdSqxWN4k-', 0, 0, '[\"#mamablogger\",\"#lebenmitkindern\",\"#mamaleben\",\"#endlesslove\",\"#mamaliebe\",\"#mutterliebe\",\"#lebenmitkindern\",\"#hitstyleevetues\",\"#family\"]', 'post', 'profile_scrape', 0, 1682678843, 1682678843),
(488, 28, 3087151000271981608, NULL, 'CrXw3pzNAwo', 6, 445, 0, 0, 0, 0, 0, 0, '4.18', '\nSonnenkollektoren als Rampe ? \nOder als Hebebhne ? \n\nKein Problem fr die Holzkltze Stadt Aiden von @kidsconcept.germany \n\nWenn das nicht perfekt zum Earthday passt, denn\ndiese moderne Spielstadt ist inspiriert von grnen Stadtprojekten in der ganzen Welt. Die elektrische Energie wird sowohl durch Sonnenkollektoren als auch durch Windrder erzeugt. Grne Felder und Bume wachsen zwischen wrfelfrmigen Huser. \n\nDas Set enthlt fnf groe Huser, fnf kleine Huser, drei Birken, fnf Kiefern und ein Windrad. Einen grnen Busch, ein Solardach und verschiedene Wege und Straen.\n\nSpielideen\n\n\nKreativitt: Lass deine Kinder ihre eigene Stadt erschaffen und ihrer Fantasie freien Lauf lassen.\n\nRollenspiele: Spiele mit deinen Kindern Rollenspiele in der Stadt Aiden und frdere so ihre sozialen Fhigkeiten.\n\nUmweltbewusstsein: Nutze die Stadt Aiden als Mglichkeit, um mit deinen Kindern ber erneuerbare Energiequellen und Umweltbewusstsein zu sprechen.\n\nMathematik: Verwende die Holzkltze Stadt Aiden, um mit deinen Kindern mathematische Konzepte wie Gre, Form und Farbe zu lernen.\n\nGemeinschaft: Nutze die Stadt Aiden als Mglichkeit, um mit deinen Kindern ber Gemeinschaft und Zusammenarbeit zu sprechen.\n\nDas Beste daran ist, dass die Stadt von @kidsconcept.germany aus nachhaltigen Materialien hergestellt werden und somit umweltfreundlich sind.\n\nFazit\nDie tollen Bausteine spielen und frdere die Kreativitt, das Umweltbewusstsein und es macht super viel Spa \neine eigene kleine Welt entstehen zu lassen.\n\n#Holzkltze #StadtAiden #Nachhaltigkeit #Kreativitt #Umweltbewusstsein #Kinder #Spielen #Rollenspiele #Gemeinschaft #nachhaltigkeit #kinderzimmer #kinderzimmerideen #holzspielzeug #bIoggersunny #spielenmitkindern #mamaleben #mamablogger_de #Familienalltag #spielideenfrkinder', 1682237099, '{\"city_name\":\"Nordrhein-Westfalen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/342379151_3501173833538312_3948313098277349635_n.jpg', NULL, NULL, 'https://instagram.com/p/CrXw3pzNAwo', 0, 0, '[\"#stadtaiden\",\"#nachhaltigkeit\",\"#kreativit\\u00e4t\",\"#umweltbewusstsein\",\"#kinder\",\"#spielen\",\"#rollenspiele\",\"#gemeinschaft\",\"#nachhaltigkeit\",\"#kinderzimmer\",\"#kinderzimmerideen\",\"#holzspielzeug\",\"#bioggersunny\",\"#spielenmitkindern\",\"#mamaleben\",\"#mamablogger_de\",\"#familienalltag\",\"#spielideenf\\u00fcrkinder\"]', 'post', 'profile_scrape', 0, 1682678843, 1682678843);
