(499, 28, 2669185919092823061, NULL, 'CUK2nOTAJQV', 7, 55, 131, 0, 0, 0, 0, 0, '0.58', '#spielenistvielfltig \nUnd wenn etwas vielfltig ist, dann sind es die tollen Mitmachbcher von @vickeybo\nOb Ausrstung fr Superheldinnen und Helden   \nTolle Pappbilderbcher fr die Allerkleinsten, Anziehpuppen und noch so viel mehr.fr jede Altersstufe gibt es wunderschne Sachen.\nIch werde euch natrlich alles noch ganz in Ruhe und in allen Einzelheiten vorstellen, aber im Video knnt ihr schon das ein oder andere entdecken  \nWir basteln gerade an einer Welt fr die Anziehpuppen, die so unfassbar s sind und Abends sammeln wir mit dem Traumtier Farben \nDas tollste ist, das es die Bcher echt  fr jedes Alter gibt. \nWirklich von 1 bis .\nMeine Tochter mit 12 malt gerade genauso fleiig, wie mein Sohn mit 15 und ich auch (36 )\n\nWie alt sind denn eure Kinder ?', 1632415716, NULL, 'VIDEO', 'images/content/posts/242529158_391544702414927_3487303581210896305_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/242354337_629128848078789_2178043819394323598_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5mZWVkLmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=109&_nc_ohc=Eu_-eZb9KoEAX9YfDQN&edm=AOQ1c0wBAAAA&vs=17914822517000114_220285952&_nc_vs=HBksFQAYJEdLRUljZzdGOTRGNU1Ed0NBSTdVTzJCUTl6a2Via1lMQUFBRhUAAsgBABUAGCRHS0FZZHc0VHZOdnQyYzRKQUh2RnRXbGEzSnRnYmtZTEFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMBUAACai17G4%2Bt%2FSPxUCKAJDMywXQECAAAAAAAAYEmRhc2hfYmFzZWxpbmVfMl92MREAdeoHAA%3D%3D&_nc_rid=870f99d272&ccb=7-5&oh=00_AfBu4-cUltQnmecqXkfC3qsr7mPhOtH59iMyiBO4bzxk1Q&oe=644D3B77&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CUK2nOTAJQV', 0, 0, '[\"#spielenistvielf\\u00e4ltig\"]', 'post', 'profile_scrape', 0, 1682678844, 1682678844),
