(541, 31, 3089313485434311257, NULL, 'Crfcj9DItJZ', 11, 52, 0, 0, 0, 0, 0, 0, '2.66', 'Neue Strecke fr @cheadsmagazine out no  In der Freien Arbeit Perception geht es um die bewusste Manipulation des Bildes durch einfache Mittel wie Unschrfe oder Verschiebung durch Glas. Diese vernderte Wahrnehmung soll den Einfluss unseres Erlebten auf die Welt sichtbar zu machen.\nWas ich und wie ich es sehe, beruht auf meinen Erfahrungen, Mustern, Projektionen. Bist du wirklich so schn, schlank, arrogant oder sexy? Oder projiziere ich das in dich hinein? Schaust du wirklich gerade streng und bist genervt? Oder ist das meine Erfahrung, meine Unsicherheit? Was sehe ich wirklich und siehst auch du das, oder sehe ich nur, was ich kenne. Kann ich berhaupt Neues sehen?\n\nWas passiert, wenn ich bewusst die Optik verzerre? Wenn ich meine unterbewussten Filter, unsichtbare Filter, sichtbar mache? Ich mchte dir zeigen, sichtbar machen, was unsere Psyche, unser Erleben mit einem Bild machen kann. Ich mchte sichtbar machen, wie es sein kann, anders wahrzunehmen. Verzerrt wahrzunehmen.\nWir alle tragen unsere Geschichte mit uns rum, die unsere Wahrnehmung beeinflusst. Eine absolute Wahrheit gibt es nicht. Siehst du das, was ich sehe? ', 1682494887, '{\"city_name\":\"Neuhausen-Nymphenburg\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/343036700_6169309996459411_7999973254410645636_n.jpg', NULL, NULL, 'https://instagram.com/p/Crfcj9DItJZ', 0, 0, '[]', 'post', 'profile_scrape', 0, 1683024098, 1683024098),
