(565, 32, 3081695614375622326, NULL, 'CrEYdVwvPa2', 12, 160, 0, 0, 0, 0, 0, 0, '5.03', 'Meeresblau. Immer wieder aufs Neue faszinierend.\n.\n.\nAufgenommen whrend einer Kstenwanderung im Parc natural de Mondrag. Wir haben uns an einer Route aus dem wundervollen Reisefhrer \"Naturzeit mit Kindern - Mallorca\" orientiert. Wunderschn war es! (WERBUNG unbeauftragt, Reisefhrer selbstgekauft). @mallorca4kids', 1681586768, '{\"city_name\":\"Parc Natural de Mondrag\\u00f3\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/341122842_171360882097478_5325609688793703169_n.jpg', NULL, NULL, 'https://instagram.com/p/CrEYdVwvPa2', 0, 0, '[]', 'post', 'profile_scrape', 0, 1683024102, 1683024102),
