(569, 32, 3001069337402973010, NULL, 'Cml8Kl6OJtS', 3, 242, 0, 0, 0, 0, 0, 0, '7.16', '\"   ,            .      ,   .\"\n( )\n.\n.\n.\nIch wnsche euch allen ein wunderbares Weihnachten - besinnlich, frhlich, kunterbunt, laut, leise ... ganz so, wie ihr es euch wnscht! \nHappy Holidays!\n', 1671975368, '[]', 'IMAGE', 'images/content/posts/322409926_1203090413664407_6185464363827425981_n.jpg', NULL, NULL, 'https://instagram.com/p/Cml8Kl6OJtS', 0, 0, '[]', 'post', 'profile_scrape', 0, 1683024102, 1683024102),
(570, 32, 2990285288375498788, NULL, 'Cl_oKBmsrgk', 6, 206, 0, 0, 0, 0, 0, 0, '6.2', 'Auch dieses Jahr darf ein Zuckerwattefoto vom Weihnachtsmarkt nicht fehlen. Meine Tochter verbindet gedanklich seit dem letzten Jahr einen Weihnachtsmarktbesuch immer auch mit einer groen klebrigen Zuckerwatte, hmmm. Dieses Bild entstand am letzten Wochenende auf dem Weihnachtsmarkt in der Kulturbrauerei. Lessons learned - der Samstagabend ist definitiv nicht DER Tag fr einen besinnlichen Weihnachtsmarktbesuch mit Kind . Kann natrlich auch daran liegen, dass wir jetzt ein Schulkind haben und wir bis zum letzten Jahr solche Ausflge eher auf unter der Woche bevorzugt am frhen Nachmittag gelegt haben. Nun ja. Passiert mir so schnell nicht wieder. Eine Runde Kettenkarussell war nach dem Zuckerschock jedenfalls noch drin und das Kind glcklich. \nDieses Wochenende verbringen wir dann ganz entspannt daheim, machen es uns gemtlich und sammeln Krfte.', 1670689809, '{\"city_name\":\"Kulturbrauerei\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/318583491_1699418257121606_4699977313140525727_n.jpg', NULL, NULL, 'https://instagram.com/p/Cl_oKBmsrgk', 0, 0, '[]', 'post', 'profile_scrape', 0, 1683024102, 1683024102),
(571, 32, 2986736418832484171, NULL, 'ClzBPLSO4dL', 11, 243, 0, 0, 0, 0, 0, 0, '7.42', 'It\'s beginning to look a lot like Christmas.\n.\nWir haben jetzt einen Baum. Und wundersamer Weise haben sich die Wlder rund um Berlin genau zur rechten Zeit mit einer zarten Schneedecke \"in Schale geschmissen\".', 1670266750, '[]', 'IMAGE', 'images/content/posts/318592079_1311569429643623_6424407489615762298_n.jpg', NULL, NULL, 'https://instagram.com/p/ClzBPLSO4dL', 0, 0, '[]', 'post', 'profile_scrape', 0, 1683024102, 1683024102),
