(578, 33, 2808136051929013911, NULL, 'Cb4gNxwMl6X', 40, 1064, 0, 0, 0, 0, 0, 0, '8.68', 'Sei glcklich, nicht perfekt! \n\nWer bestimmt eigentlich was perfekt ist? Das ewige Bestreben nach Perfektionismus, man mchte schlank sein oder aber man ist schlank und mchte ein paar Pfunde mehr, hat man glatte Haare mchte man gerne Locken oder umgekehrt, und diese Aufzhlung knnte man wahrscheinlich bis ins unendliche fortfhren man mchte immer perfekt sein , besser als der / die Andere. \n\nGerade in Zeiten der sozialen Medien ist das Ganze wahrscheinlich noch schwieriger geworden. \n\nDoch wozu der ganze Stress und Druck den man sich macht Warum nicht einfach nur glcklich sein !!!!! \n\nJeder ist auf seine Art und Weise perfekt  Also seid glcklich und vergesst den ganzen Mist ! Liebt euch und eure Ecken und Kanten!!! \n\n#selflove #seiglcklich #seiglcklichnichtperfekt #perfekt #glcklich #glcklichsein #bodypositivity #love #loveyourself #loveyourbody #loveyourcurves #jederistschn #einzigartig #mamablogger_de #mamablogger #mamabloggerin', 1648975925, '{\"city_name\":\"Bernkastel Altstadt\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/277658866_361542379049955_3178255803854407553_n.jpg', NULL, NULL, 'https://instagram.com/p/Cb4gNxwMl6X', 0, 0, '[\"#seigl\\u00fccklich\",\"#seigl\\u00fccklichnichtperfekt\",\"#perfekt\",\"#gl\\u00fccklich\",\"#gl\\u00fccklichsein\",\"#bodypositivity\",\"#love\",\"#loveyourself\",\"#loveyourbody\",\"#loveyourcurves\",\"#jederistsch\\u00f6n\",\"#einzigartig\",\"#mamablogger_de\",\"#mamablogger\",\"#mamabloggerin\"]', 'post', 'profile_scrape', 0, 1683024108, 1683024108),
