(584, 33, 2748013920197446972, NULL, 'CYi6BnPMo08', 9, 1128, 0, 0, 0, 0, 0, 0, '8.94', 'Da es das Wetter in der letzten Zeit nicht zugelassen hat sich groartig drauen aufzuhalten, sind wir eben indoor durch die Straen gezogen \n\nWas sind eure Alternativen ?   \n\n{Werbung}\nUnser neuer Buggy von Twistshake ist super fr solch spontane Ausflge.\nSuper klein zusammenzuklappen, sehr leicht und schn wendig  \n @twistshakebaby gibt es gerade noch 50% auf alles\n Mit meinem Code 20stephie bekommt ihr nochmal 20% extra (nur 48Std. gltig!)\n Kostenloser Versand ab 60\n Den Link findet ihr in meiner Bio! \n\n#rainydays #twistshake #buggy #mamaleben #mamaalltag #spielteppich #mamablogger_de #mamablogger', 1641808808, '{\"city_name\":\"Nordrhein-Westfalen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/271684088_1322352694853199_6586247033185505579_n.jpg', NULL, NULL, 'https://instagram.com/p/CYi6BnPMo08', 0, 0, '[\"#rainydays\",\"#twistshake\",\"#buggy\",\"#mamaleben\",\"#mamaalltag\",\"#spielteppich\",\"#mamablogger_de\",\"#mamablogger\"]', 'post', 'profile_scrape', 0, 1683024108, 1683024108),
(585, 33, 2740960249537611172, NULL, 'CYJ2NMhJ8Wk', 13, 1031, 523, 0, 0, 0, 0, 0, '8.21', 'Ich wnsche euch allen ein guten Rutsch ins Jahr 2022 und puste euch etwas Glck rber\n\nAuch wenn es 2021 sicherlich auch sehr viel Leid und unschne Dinge gab, mchte ich auf die schnen Dinge zurckblicken.\nSchwere Zeiten machen uns alle strker, geduldiger, erfinderischer und lassen uns reifen. Am Ende kommt es oft auf die Sichtweise an. \n\nIch bin dankbar \n\n fr meine Familie\n fr meine Freunde\n das wir gesund sind \n fr viele wunderschne Momente \n\nEinfach dankbar , dass es uns gut geht \n\nDas Jahr 2022 kann kommen, ich freu mich auf die Abenteuer die das Leben fr mich bereithlt \n\nWofr seid ihr dankbar? \n\n#gutenrutsch #gutenrutschinsneuejahr #happynewyear #dankbarkeit #abenteuer #leben #familie #freunde #bye2021 #2022 #mamablogger_de', 1640968245, '{\"city_name\":\"Bottrop\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/270333223_1099930970836723_261663403328608290_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/271016244_467966271427205_246768287076741136_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=105&_nc_ohc=AHpZISqBXR8AX8Byiji&edm=AOQ1c0wBAAAA&vs=5782545735095059_1747043919&_nc_vs=HBkcFQAYJEdEUmhKeENGRW1Eam5La0JBQkJ3Q2gxenNtd0RidlZCQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAExFQAAJtaojeTMssI%2FFQIoAkMzLBdAGAAAAAAAABgSZGFzaF9iYXNlbGluZV8xX3YxEQB17AcA&_nc_rid=a33d36f2c4&ccb=7-5&oh=00_AfBMEZ8DR9NPHhIembJPyzTGdd5aWIpB-eKQtMlwiLTUTg&oe=645250B5&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CYJ2NMhJ8Wk', 0, 0, '[\"#gutenrutschinsneuejahr\",\"#happynewyear\",\"#dankbarkeit\",\"#abenteuer\",\"#leben\",\"#familie\",\"#freunde\",\"#bye2021\",\"#2022\",\"#mamablogger_de\"]', 'post', 'profile_scrape', 0, 1683024108, 1683024108),
