(605, 35, 3065701706885073500, NULL, 'CqLj3WqMYpc', 208, 457, 0, 0, 0, 0, 0, 0, '15.77', '#einfachmalmachen\n \nIch wollt Euch doch die ganze Zeit mein hei geliebtes Vertiko, dass quasi schon ausrangiert war, in Gnze zeigen  \n\nBin so so froh, dass wir es einfach gepackt, die Treppe runter geschleppt und hingestellt haben!!! \nWeil ganz im Gegensatz zur Vorstellung - lieb ich es genau da \n- und Leute - Schande passt da viel rein!\n\nIm in love \n\nSo und damit nach 2 Tagen Pause einen extrem chicen Freitagabend Ihr Sweeties \n\n#liebewasduzeigst #meandmyhappyhome @maybe.indesign #wohndichhappy @scandirella \n#hyggeamfreitag #kitti\n#interiorzauber #meininteriorzauber #vertiko #lieblingsstck #livingathome #livingathome_magazin #couch_magazin  #vintage #solebich #solebenwir #hyggehome #nordichome #scandistyle #meinlandhausstyle #wohnenunddekorieren #landhaus_magazin_neu @landhaus_magazin_neu #vertiko #interior123 #interior444 #schwedenhausliebe #holzhausliebe', 1679680144, '{\"city_name\":\"LieblingsTeil\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/337348147_616724973257462_473505826996918367_n.jpg', NULL, NULL, 'https://instagram.com/p/CqLj3WqMYpc', 0, 0, '[\"#einfachmalmachen\",\"#liebewasduzeigst\",\"#meandmyhappyhome\",\"#wohndichhappy\",\"#hyggeamfreitag\",\"#kitti\\n#interiorzauber\",\"#meininteriorzauber\",\"#vertiko\",\"#lieblingsst\\u00fcck\",\"#livingathome\",\"#livingathome_magazin\",\"#couch_magazin\",\"#vintage\",\"#solebich\",\"#solebenwir\",\"#hyggehome\",\"#nordichome\",\"#scandistyle\",\"#meinlandhausstyle\",\"#wohnenunddekorieren\",\"#landhaus_magazin_neu\",\"#vertiko\",\"#interior123\",\"#interior444\",\"#schwedenhausliebe\",\"#holzhausliebe\"]', 'post', 'profile_scrape', 0, 1683024116, 1683024116),
