(607, 35, 3055917164308650803, NULL, 'CpozHhRotsz', 167, 475, 0, 0, 0, 0, 0, 0, '15.22', '#lenaplottet\n\nNachdem ich neulich den Teppich in den kleinen Flur gelegt habe, habe ich direkt mein Schuhschrnkchen bisschen aufpoliert - da der kleine Flur unsere, ich nenne es liebevoll unsere Spa-Rumlichkeiten, verbindet, fand ich den Plott sehr passend  - zum fr 2 der drei Rume  \n\nGute Idee auch fr heute  \n\n#flurinspo #bastelnmitpapier #buchstabenliebe #sprhdiy #plotterliebe #cricutmaker #diyliebe #zeigdein_diy #zeigwasduliebst #liebewasduzeigst #kltzchenliebe #kltzchenfieber #interiorzauber #trockenblumen #colourfulhome #colourfullife #colourfulinterior #landhaus #landhausliebe #meinlandhausstyle #schwedenhausliebe #nordicchic #nordicstyle #nordichome #skandihome', 1678513735, '{\"city_name\":\"Wellness & Lifestyle\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/334450851_1856762414680099_4554374583029804539_n.jpg', NULL, NULL, 'https://instagram.com/p/CpozHhRotsz', 0, 0, '[\"#lenaplottet\\n\\nnachdem\",\"#flurinspo\",\"#bastelnmitpapier\",\"#buchstabenliebe\",\"#spr\\u00fchdiy\",\"#plotterliebe\",\"#cricutmaker\",\"#diyliebe\",\"#zeigdein_diy\",\"#zeigwasduliebst\",\"#liebewasduzeigst\",\"#kl\\u00f6tzchenliebe\",\"#kl\\u00f6tzchenfieber\",\"#interiorzauber\",\"#trockenblumen\",\"#colourfulhome\",\"#colourfullife\",\"#colourfulinterior\",\"#landhaus\",\"#landhausliebe\",\"#meinlandhausstyle\",\"#schwedenhausliebe\",\"#nordicchic\",\"#nordicstyle\",\"#nordichome\",\"#skandihome\"]', 'post', 'profile_scrape', 0, 1683024116, 1683024116);
