(630, 37, 3082813998819016544, NULL, 'CrIWv-cNX9g', 1, 29, 0, 0, 0, 0, 0, 0, '0.61', 'Couscous \n  zum Frhstck \n\nSchnell, lecker und mal etwas anderes \n\n200ml Fruchtsaft mit 100ml Wasser erwrmen \n120g Couscous und etwas Zimt einstreuen, verrhren und 15-20 min ohne Hitze quellen lassen\n\nThats its \n\nIch habe noch 2 Essl. Kokosgurt, kleinen Apfel, Birne und Kiwi mit Mandel hinzugegeben .\n\nDas Rezept reicht fr 2 Pers. \n\n#frhstck #couscous #obst #gesundkochen #veganfood #foodinspiration #bio #kokosjoghurt #veganisthefuture #foody_follower_loop2 #foodlover #veganfoodie #vegankannjeder #nrnberg', 1681720088, '[]', 'IMAGE', 'images/content/posts/341380742_194159870060285_6685628854340579871_n.jpg', NULL, NULL, 'https://instagram.com/p/CrIWv-cNX9g', 0, 0, '[\"#fr\\u00fchst\\u00fcck\",\"#couscous\",\"#obst\",\"#gesundkochen\",\"#veganfood\",\"#foodinspiration\",\"#bio\",\"#kokosjoghurt\\u2764\\ufe0f\",\"#veganisthefuture\",\"#foody_follower_loop2\",\"#foodlover\",\"#veganfoodie\",\"#vegankannjeder\",\"#n\\u00fcrnberg\"]', 'post', 'profile_scrape', 0, 1683024407, 1683024407),
(631, 37, 3075541784252062560, NULL, 'CquhPU2Nxtg', 0, 29, 0, 0, 0, 0, 0, 0, '0.59', ' Bananen Pancake  \n\nGesundes Frhstck geht auch lecker  \nReife Bananen zerdrcken \nHaferflocken, Chiasamen, geschrotete Leinsamen und Mehl dazugeben \nEtwas Backpulver, Vanillezucker und Pflanzenmilch \nWenn der Teig zu dick ist etwas Mineralwasser hinzugeben \n Wenn der Teig zu dnn ist noch etwas Mehl \n10 min ruhen lassen und das Obst schneiden \n\nOhne Fett in einer beschichteten Pfanne beidseitig backen \n\nZuletzt noch etwas Cashewmus \n\nGesund und Lecker  \n\nSchnen Karfreitag \n\n#vegan #vegannrnberg #veganfood #pancakes #resteverwertung #gesund #bananenpancakes #feedfeedvegan #foody_follower_loop2 #foodblogger #plantbased #instafood #veganfoodlovers #schnellesrezept', 1680853172, '{\"city_name\":\"N\\u00fcrnberg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/339994403_1284375012148064_5291884090683269937_n.jpg', NULL, NULL, 'https://instagram.com/p/CquhPU2Nxtg', 0, 0, '[\"#vegann\\u00fcrnberg\",\"#veganfood\",\"#pancakes\",\"#resteverwertung\",\"#gesund\",\"#bananenpancakes\",\"#feedfeedvegan\",\"#foody_follower_loop2\",\"#foodblogger\",\"#plantbased\",\"#instafood\",\"#veganfoodlovers\",\"#schnellesrezept\"]', 'post', 'profile_scrape', 0, 1683024407, 1683024407),
