(657, 38, 3034965503440364722, NULL, 'CoeXQuiIKSy', 3, 73, 1515, 0, 0, 0, 0, 0, '6.86', '|Rezept Cheesecake| ohne raffinierten Zuckerzusatz! \nDer leckere Cheesecake kommt ganz ohne extra Zucker aus! Dafr ist er aber mit weier Schokolade und Datteln gest.\nFr den Boden: \n- 50 g Datteln\n- 80 g Margarine oder Butter geschmolzen \n- 100 g Kekse\n-  50 g Walnsse \nzerkleinern, fest drcken und bei 180 circa 15 Minuten backen.\n\nFr die Fllung: \n- 250 g saure Sahne (hat nur 10% Fett)\n- 300g Frischkse\n- Vanilleextrakt\n- 3 Eier\n- 150g Weie Schokolade (geschmolzen)\n- 2 El Esslffel strke\nAlle Zutaten bis auf die Schokolade und Strke mindestens 5 Minuten schaumig schlagen. geschmolzene Schokolade dazugeben und dann die Strke hinzufgen kurz unterheben. Die Fllung auf den gebackenen Boden gieen und mit gefrorenen Himbeeren bestreuen. Den Kuchen circa 50 Minuten bei 180 backen. Fr den Dampf sorgt eine feuerfeste Schssel mit Wasser, alternativ macht einfach euer Backblech voll mit Wasser und schiebt es mit in den Ofen.\n\nVor dem servieren, unbedingt 3-4 Stunden auskhlen lassen!', 1676016127, '[]', 'VIDEO', 'images/content/posts/330278958_1273265286926890_4240508495593341093_n.jpg', NULL, NULL, 'https://instagram.com/p/CoeXQuiIKSy', 0, 0, '[]', 'post', 'profile_scrape', 0, 1683024415, 1683024415),
