(662, 39, 3091774394304170295, NULL, 'CroMG5CJgk3', 0, 2, 147, 0, 0, 0, 0, 0, '0.01', 'WEISST DU, dass die Verwendung von zu viel Reinigungsmitteln, kann gesundheitliche Probleme verursachen. \n\nDie meisten Reinigungsmittel enthalten chemische Inhaltsstoffe wie Duftstoffe, Tenside und Bleichmittel, die bei uerlichem Gebrauch oder unsachgemer giftiger Handhabung sein knnen.\nDie Reaktion gegenber zu viel Putzmittel kann zu Atemwegsproblemen, Hautreizungen, Kopfschmerzen, belkeit und Schwindel fhren. Insbesondere Menschen mit Asthma oder anderen Atemwegserkrankungen knnen empfindlich auf bestimmte Inhaltsstoffe von Reinigungsmitteln reagieren.\nDie Symptome knnen von leichten Reizungen wie Hautausschlag, Husten und Niesen bis hin zu schweren Erkrankungen wie Atemwegserkrankungen, Vergiftungen oder Krebs reichen.\n\nEs gibt aber eine alternative Methode zur Reinigung, das ist GREEN CLEANING  die umweltfreundliche Reinigungsrevolution! \n\n100 % SAUBER\n100 % CHEMIEFREI\n100 % KOLOGISCH\n\n REINIGEN NUR MIT WASSER UND HITZE \n\nWillst du mehr darber erfahren, dann schreibt mir kurz! Ich freue mich auf deine Anfrage \n\n#microtrockendampf #umwelt #medecocleantec #thermostar #chemiefrei #reinigung #industriedampf #nachhaltigkeit #umweltschutz #umweltfreundlich #umweltbewusst #greencleaning #chemiefreireinigen #ohneputzmittel #putzmittelfrei #allergiker #naturpur #desinfizieren #hotel #gastro #kche #restaurant #spa #wellnesshotel #pflegeheim #arztpraxis #haushalt #greenvisiongroup', 1682788354, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/343573192_263429546026833_6286544132175916801_n.jpg', NULL, NULL, 'https://instagram.com/p/CroMG5CJgk3', 0, 0, '[\"#umwelt\",\"#medecocleantec\",\"#thermostar\",\"#chemiefrei\",\"#reinigung\",\"#industriedampf\",\"#nachhaltigkeit\",\"#umweltschutz\",\"#umweltfreundlich\",\"#umweltbewusst\",\"#greencleaning\",\"#chemiefreireinigen\",\"#ohneputzmittel\",\"#putzmittelfrei\",\"#allergiker\",\"#naturpur\",\"#desinfizieren\",\"#hotel\",\"#gastro\",\"#k\\u00fcche\",\"#restaurant\",\"#spa\",\"#wellnesshotel\",\"#pflegeheim\",\"#arztpraxis\",\"#haushalt\",\"#greenvisiongroup\"]', 'post', 'profile_scrape', 0, 1683024422, 1683024422),
(663, 39, 3090234845854666696, NULL, 'CriuDgzs4_I', 2, 948, 461, 0, 0, 0, 0, 0, '2.38', 'Mit Thermostar macht Reinigung richtig Spa!\nSo einfach funktioniert chemiefreie hygienische Reinigung und Desinfektion von Luft und smtlichen Oberflchen im Gewerbe sowie in Privathaushalten.\nSeit der Ausbreitung von Corona auf der ganzen Welt wird vielen Menschen bewusst, dass es bei der Reinigung nicht mehr nur um Sauberkeit geht. Es geht um hygienische Sauberkeit, die uns vor Viren und Bakterien schtzt. Die Tatsache, dass verschmutzte Oberflchen und multiresistente Keime existieren, zeigt, dass herkmmliche Reinigungs- und Desinfektionsmittel oft nicht ausreichend wirksam sind und manchmal sogar das Problem verschlimmern knnen.\nEs gibt jedoch eine Lsung, die vielen nicht bekannt ist: die Verwendung von Microtrockendampf.  Dabei handelt es sich um gesttigten Dampf, der bis auf 182 C, erhitzt wird. Mit dieser Methode knnen alle Rckstnde von Reinigungs- und Desinfektionsmitteln sowie Schmutz, schnell und rckstandsfrei entfernt werden, auch an schwer zugnglichen Stellen. Gleichzeitig werden den Keimen auch ihre Nhrbden entzogen. Sogar sensible Oberflchen knnen auf diese Weise schonend gereinigt werden.\nUnd das alles nur mit Wasser und ohne Chemie!\nWillst du mehr darber erfahren, dann schreibt mir kurz! Ich freue mich auf deine Anfrage \n\n#microtrockendampf #medecocleantec #chemiefrei #reinigung #industriedampf #nachhaltigkeit #umweltschutz #umweltfreundlich #umweltbewusst #greencleaning #chemiefreireinigen #ohneputzmittel #putzmittelfrei #allergiker #naturpur #desinfizieren #hotel #gastro #kche #restaurant #spa #wellnesshotel #pflegeheim #arztpraxis #haushalt #porentiefsauber #thermostar #trockendampf #dampfreiniger', 1682604850, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/343595142_185326253960487_917685930390757637_n.jpg', NULL, NULL, 'https://instagram.com/p/CriuDgzs4_I', 0, 0, '[\"#microtrockendampf\",\"#medecocleantec\",\"#chemiefrei\",\"#reinigung\",\"#industriedampf\",\"#nachhaltigkeit\",\"#umweltschutz\",\"#umweltfreundlich\",\"#umweltbewusst\",\"#greencleaning\",\"#chemiefreireinigen\",\"#ohneputzmittel\",\"#putzmittelfrei\",\"#allergiker\",\"#naturpur\",\"#desinfizieren\",\"#hotel\",\"#gastro\",\"#k\\u00fcche\",\"#restaurant\",\"#spa\",\"#wellnesshotel\",\"#pflegeheim\",\"#arztpraxis\",\"#haushalt\",\"#porentiefsauber\",\"#thermostar\",\"#trockendampf\",\"#dampfreiniger\"]', 'post', 'profile_scrape', 0, 1683024422, 1683024422),
(664, 39, 3086690485196540751, NULL, 'CrWIKRtt8tP', 0, 331, 0, 0, 0, 0, 0, 0, '0.83', 'Rotkohl-Apfel-Pfanne mit Hackfleisch und Mandeln \nLeichtes und gesundes Gericht! \nZutaten fr 4 Personen:\n 1 kleiner Rotkohl (ca. 800 g)\n 2 Zwiebeln\n 300 g Rinderhackfleisch\n 2 EL Pflanzenl zum Braten  2 1/2 TL Gewrzmischung fr Hackfleisch\n 150 ml Apfelsaft, naturtrb\n 1 Lorbeerblatt\n 1 TL Wacholderbeeren\n 3 EL Rosinen\n 1 EL Apfelessig  1 EL Honig \n 2 pfel\n 40 g Mandelstifte\n 1 EL Butter  Salz & Pfeffer nach Bedarf\n Zubereitung:\nRotkohl halbieren, den Strunk entfernen. Kohl in Streifen schneiden. Mit 1 TL Salz in einer Schssel krftig durchkneten. \nDie Zwiebeln abziehen und wrfeln. Das Hackfleisch in heiem l krmelig braten. Mit Salz und 2 TL Gewrzmischung krftig wrzen. Aus der Pfanne nehmen und warm stellen.\nZwiebeln in Bratsatz andnsten, Rotkohl hinzufgen. Apfelsaft mit 150 ml Wasser mischen und angieen. Lorbeerblatt, Wacholderbeeren, das restliche Gewrzmischung, Rosinen, Honig und Essig untermischen und den Rotkohl zugedeckt etwa 30 Minuten schmoren lassen.\nInzwischen pfel entkernen und wrfeln. Zusammen mit den Mandelstiften in der Butter goldbraun rsten. Hackfleisch in der Rotkohl-Pfanne noch einmal erwrmen und Abschmecken. Mit dem Apfel-Mandel-Mix bestreut anrichten. \nGuten Appetit!  \n#gutesessen #rotkohl #rotkraut #rotkohlpfanne #apfel #faschiertes  #hackfleisch #abnehmen #abnehmrezepte #healthyeating #pfannengericht #foodporn #yummyfood #leckeressen #leckerschmecker #yummi #delicious #foodlover #mrsmarzena', 1682182201, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/343224078_810364743801844_1048580656461823166_n.jpg', NULL, NULL, 'https://instagram.com/p/CrWIKRtt8tP', 0, 0, '[\"#gutesessen\",\"#rotkohl\",\"#rotkraut\",\"#rotkohlpfanne\",\"#apfel\",\"#faschiertes\",\"#hackfleisch\",\"#abnehmen\",\"#abnehmrezepte\",\"#healthyeating\",\"#pfannengericht\",\"#foodporn\",\"#yummyfood\",\"#leckeressen\",\"#leckerschmecker\",\"#yummi\",\"#delicious\",\"#foodlover\",\"#mrsmarzena\"]', 'post', 'profile_scrape', 0, 1683024422, 1683024422),
(665, 39, 3086652121759989119, NULL, 'CrV_cA-tb1_', 0, 214, 0, 0, 0, 0, 0, 0, '0.54', ' Weit du, wie viel Wasser verbraucht wird, um Reinigungsmittel zu produzieren\nDie Menge an Wasser, die zur Herstellung von Reinigungsmitteln bentigt WIRD, kann je nach Art des Reinigungsmittels und dem Herstellungsprozess variieren. In der Regel bentigen Reinigungsmittel jedoch Wasser als Bestandteil der Formulierung, sowie zur Verdnnung und fr die Reinigung whrend des Produktionsprozesses.\n\nEs ist schwer, eine genaue Menge fr den Wasserverbrauch anzugeben, da dieser von verschiedenen Faktoren abhngig ist, wie zum Beispiel der Art des Reinigungsmittels, der Herstellungsmethode, der Gre der Produktionsanlage und der verwendeten Ausrstung.\n\nAllerdings gibt es Studien, die sich mit dem Wasserverbrauch von Reinigungsmitteln beschftigen. Eine Studie von Greenpeace aus dem Jahr 2011 ergab beispielsweise, dass fr die Herstellung von 1 kg flssigem Allzweckreiniger etwa 1.900 Liter Wasser bentigt werden. Eine andere Studie von Henkel aus dem Jahr 2012 zeigte an, dass fr die Herstellung von 1 kg Waschmittel etwa 500 bis 1.500 Liter Wasser bentigt werden, abhngig von der Art des Waschmittels und dem Herstellungsprozess.\n\nEs ist wichtig zu beachten, dass nicht nur die Herstellung von Reinigungsmitteln, sondern auch deren Anwendung und Entsorgung Auswirkungen auf den Wasserverbrauch haben knnen. Eine bewusste Nutzung von Reinigungsmitteln und die Entscheidung fr umweltfreundliche Alternativen knnen dazu beitragen, den Wasserverbrauch und die Umweltauswirkungen insgesamt zu reduzieren.\n\nWir reinigen Chemiefrei! \n\n#greencleaning #nachhaltig #hygiene #umweltschutz #greenvisiongroup #ressourcenschonen #chemiefrei #microtrockendampf #naturpur #gesundheit #menschheit #wassersparend #tagdererde2023 #tagdererde #greencleaningconcept', 1682177628, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/342555946_1253096098640890_3587111248114786064_n.jpg', NULL, NULL, 'https://instagram.com/p/CrV_cA-tb1_', 0, 0, '[\"#nachhaltig\",\"#hygiene\",\"#umweltschutz\",\"#greenvisiongroup\",\"#ressourcenschonen\",\"#chemiefrei\",\"#microtrockendampf\",\"#naturpur\",\"#gesundheit\",\"#menschheit\",\"#wassersparend\",\"#tagdererde2023\",\"#tagdererde\",\"#greencleaningconcept\"]', 'post', 'profile_scrape', 0, 1683024422, 1683024422),
(666, 39, 3081675574888001685, NULL, 'CrET5uiMnCV', 0, 6, 45, 0, 0, 0, 0, 0, '0.02', 'Weit du, warum steht auf KOLOGISCHEN REINIGUNGSMITTELN, verursacht Hautreizungen oder schwere Augenreizungen\nObwohl kologische Reinigungsmittel im Allgemeinen aus natrlichen Inhaltsstoffen hergestellt werden und weniger schdlich fr die Umwelt und die Gesundheit von Menschen und Tieren sind als herkmmliche Reinigungsmittel, knnen sie dennoch Reizungen verursachen, insbesondere bei direktem Kontakt mit der Haut oder den Augen.\nEinige der natrlichen Inhaltsstoffe in kologischen Reinigungsmitteln, wie Zitronensure oder therische le, knnen bei empfindlichen Personen oder bei bermiger Anwendung Haut- oder Augenreizungen verursachen.\nDaher werden solche Warnhinweise auf den Etiketten angegeben, um Verbraucher darauf aufmerksam zu machen. Es ist wichtig, kologische Reinigungsmittel immer gem den Anweisungen auf dem Etikett zu verwenden, um unntige Exposition und mgliche Reizungen zu vermeiden.\nHandschuhe und Schutzbrillen sollten verwendet werden, wenn eine direkte Berhrung mit dem Reinigungsmittel nicht vermieden werden kann.\nWenn Haut- oder Augenreizungen auftreten, sollten die betroffenen Bereiche sofort mit viel Wasser gesplt und ein Arzt aufgesucht werden\nUnd ich habe bis jetzt geglaubt, dass ich, was Gutes zum Reinigen benutzt habe!Soll, das gut fr die Umwelt sein?\nWas denkst du darber?\nWEISST DU, DAS UNSERER MIKROTROCKENDAMPFREINIGER 100 % KOLOGISCH REINIGEN! NUR MIT WASSER!\n#microtrockendampf #umwelt #medecocleantec #chemiefrei #reinigung #industriedampf #nachhaltigkeit #umweltschutz #umweltfreundlich #umweltbewusst #greencleaning #chemiefreireinigen #ohneputzmittel #putzmittelfrei #allergiker #naturpur #desinfizieren #hotel #gastro #kche #restaurant #spa #wellnesshotel #pflegeheim #arztpraxis #haushalt', 1681584636, '[]', 'VIDEO', 'images/content/posts/341143424_2058692077855315_3627626686445700176_n.jpg', NULL, NULL, 'https://instagram.com/p/CrET5uiMnCV', 0, 0, '[\"#umwelt\",\"#medecocleantec\",\"#chemiefrei\",\"#reinigung\",\"#industriedampf\",\"#nachhaltigkeit\",\"#umweltschutz\",\"#umweltfreundlich\",\"#umweltbewusst\",\"#greencleaning\",\"#chemiefreireinigen\",\"#ohneputzmittel\",\"#putzmittelfrei\",\"#allergiker\",\"#naturpur\",\"#desinfizieren\",\"#hotel\",\"#gastro\",\"#k\\u00fcche\",\"#restaurant\",\"#spa\",\"#wellnesshotel\",\"#pflegeheim\",\"#arztpraxis\",\"#haushalt\"]', 'post', 'profile_scrape', 0, 1683024422, 1683024422),
(667, 39, 3079470844728262866, NULL, 'Cq8emrkM0DS', 3, 359, 0, 0, 0, 0, 0, 0, '0.91', 'Green Cleaning Concept - Wir reinigen 100% grndlich & rein\nUnser Green Cleaning Konzept vereint die hochwirksame Reinigung von Oberflchen und gleichzeitig die Neuvermeidung von Rckstnden auf einer geschtzten Oberflche mit Prozessoptimierung fr schnellere Reinigungsprozesse. Nachhaltig, kologisch und gleichzeitig mit Zeit- und Geldersparnis bei besserer Sauberkeit und Hygiene.\n Sie wollen Geld und Zeit sparen?\n Sie wollen perfekte und rckstandsfreie Sauberkeit?\n Sie wollen Ihr Green Cleaning Concept?\nFordern Sie noch heute ein Termin an: +49 176 201 831 66 oder m.krickl@green-vision-group.com\n#umwelt #chemiefrei #reinigung #microtrockendampf #industriedampf #nachhaltigkeit #umweltschutz #umweltfreundlich #umweltbewusst #greencleaning #chemiefreireinigen #ohneputzmittel #putzmittelfrei #allergiker #naturpur #desinfizieren #hotel #gastro #kche #restaurant #spa #wellnesshotel #pflegeheim #duftessenz #aromatherapie #arztpraxis #tiere', 1681321553, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/340670869_545115384403442_1054254373650234326_n.jpg', NULL, NULL, 'https://instagram.com/p/Cq8emrkM0DS', 0, 0, '[\"#chemiefrei\",\"#reinigung\",\"#microtrockendampf\",\"#industriedampf\",\"#nachhaltigkeit\",\"#umweltschutz\",\"#umweltfreundlich\",\"#umweltbewusst\",\"#greencleaning\",\"#chemiefreireinigen\",\"#ohneputzmittel\",\"#putzmittelfrei\",\"#allergiker\",\"#naturpur\",\"#desinfizieren\",\"#hotel\",\"#gastro\",\"#k\\u00fcche\",\"#restaurant\",\"#spa\",\"#wellnesshotel\",\"#pflegeheim\",\"#duftessenz\",\"#aromatherapie\",\"#arztpraxis\",\"#tiere\"]', 'post', 'profile_scrape', 0, 1683024422, 1683024422);
