(673, 39, 2884977669554341983, NULL, 'CgJf-e6uIhf', 15, 474, 0, 0, 0, 0, 0, 0, '1.23', '*WERBUNG* \n \nHallo Ihr Lieben, heute habe ich noch eine Variante von @BEETGOLD PIZZA fr euch\nKstlicher Lower Carb, glutenfreie & ballaststoffreich Pizza! Ich bin begeistert! Die Vollgemse Pizzaboden, sich so einfach in deinen Ernhrungsalltag zu integrieren, sind voll lecker und gut fr dich und die Umwelt!  \nDie gesamte Rohstoffe kommen aus dem Beet! Die Produkte bestehen aus Gemsetrester & sind voller Ballaststoffe, Mineralstoffe und Vitamine. Je nach Sorte verwenden werden Karotten- oder Rote-Beete-Trester. Ich finde es groartig, was sagst Du dazu? \n \n Zutaten:\n1 x VOLLGEMSE Pizzaboden von BEETGOLD \nFr die Sauce\n1 Dose geschlte Tomaten \n1 Zehe Knoblauch\n1 Zwiebel\n2 TL Tomatenmark\n1 EL Olivenl \nSalz & Pfeffer\nPrise Zucker\nGetrocknete Oregano\nDann fr Pizzabelag:\n100 g Kochschinken\n1 gelber Paprika klein geschnitten\nPaar Oliven \nGeriebene Mozzarella\nAls Topping: frische Rucola \n Tomatensauce selbstgemacht:\nOlivenl erhitzen, die gehackte Zwiebel und die ebenfalls gehackten Knoblauchzehen darin 5 Minuten dnsten.\nTomaten, Tomatenmark, Zucker, Oregano zufgen. Mit Salz und Pfeffer wrzen.\nDie Sauce einmal aufkochen. Dann abdecken und bei schwacher Hitze mindestens eine Stunde kcheln. Zwischendurch umrhren.\nVollstndig abkhlen lassen. Die Sauce ist in einem luftdichten Gef 1 Woche im Khlschrank haltbar.\n \nDen Ofen auf 180 C Umluft vorheizen.\nDen VOLLGEMSE Pizzaboden auf ein mit Backpapier ausgelegtes Backblech legen mit der Tomatensauce bestreichen, mit Schinken, Oliven, Paprika & Kse belegen. \nDie Pizza ca. 15-18 Minuten backen, bis der Kse geschmolzen ist.\nSobald die Pizza fertig gebacken ist mit dem frischen Rucola servieren.  \nGuten Appetit! \n\n#beetgold #vollgemse #pizza #pizzaboden #schnellgekocht #gesundessen #gesunderezepte #gesundundlecker #nachhaltigleben #gemseliebe #resteverwertung #gemse #karotten #rotebeete #bio #veganfoods #lowcarb #leckerschmecker #foodschau #goodbrands #beetgoldvollgemse #goodfood #lecker #foodporn #leckerschmecker', 1658136160, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/294210079_105816852149964_7616546720224175905_n.jpg', NULL, NULL, 'https://instagram.com/p/CgJf-e6uIhf', 0, 0, '[\"#vollgem\\u00fcse\",\"#pizza\",\"#pizzaboden\",\"#schnellgekocht\",\"#gesundessen\",\"#gesunderezepte\",\"#gesundundlecker\",\"#nachhaltigleben\",\"#gem\\u00fcseliebe\",\"#resteverwertung\",\"#gem\\u00fcse\",\"#karotten\",\"#rotebeete\",\"#bio\",\"#veganfoods\",\"#lowcarb\",\"#leckerschmecker\",\"#foodschau\",\"#goodbrands\",\"#beetgoldvollgem\\u00fcse\",\"#goodfood\",\"#lecker\",\"#foodporn\",\"#leckerschmecker\"]', 'post', 'profile_scrape', 0, 1683024422, 1683024422),
(674, 39, 2877192660477996897, NULL, 'Cft13sOJu9h', 8, 1162, 509, 0, 0, 0, 0, 0, '2.94', 'Leckere Gnocchi mit Brokkoli und Katenschinkenwrfel in einer cremigen Kse-Soe. \nZUTATEN\n 140 g Gnocchi aus dem Khlregal\n 200 g Brokkoli frisch oder TK\n 2 EL Reibekse \n 120 ml Cremefine \n 125 g magere Katenschinkenwrfel oder Bacon\n 1 Frhlingszwiebel\n 1 TL l\n Salz & Pfeffer\n Zubereitung:\nDie Gnocchi und die Katenschinkenwrfel in l anbraten, aus der Pfanne nehmen und beiseitestellen.\nBrokkoli klein zupfen und in der Pfanne mit 50 ml Wasser 3-4 Minuten garen, bis dass Wasser verdunstet ist.\nNun alle weiteren Zutaten in die Pfanne geben, kurz kcheln lassen, mit Salz und Pfeffer abschmecken und genieen. \n#gnocchi #creamy #cheese #cooking #homemade #foodlover #lunch #dinner #recipe #lecker #kochrezepte #gnocchi #foodstagram #foodpics #foodgram #foodlovers #fooddiary #yum #eatfamous #feedyoursoull #foodgasm #foodoftheday #macandcheese #macncheese #cheeselove #cheeselovers #leckerschmeccker #mrsmarzena', 1657208194, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/292122635_163414159535378_9039994935452877812_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/292848828_457393932883217_4765131309938095967_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=105&_nc_ohc=AgRk7V5MhUQAX_mZi6J&edm=AOQ1c0wBAAAA&vs=434109675285417_2547392220&_nc_vs=HBkcFQAYJEdMeUVkQkVSVmVSUy01OEJBRl8zOC15dEpTRkNidlZCQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAExFQAAJvD%2BxPiVquE%2FFQIoAkMzLBdAGAAAAAAAABgSZGFzaF9iYXNlbGluZV8xX3YxEQB17AcA&_nc_rid=8e0edd1f5b&ccb=7-5&oh=00_AfCvEsyDZ98-7WO8I4Z8kHA_uqWU1BiJMkSLZa8qXlb5uQ&oe=645262D2&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/Cft13sOJu9h', 0, 0, '[\"#creamy\",\"#cheese\",\"#cooking\",\"#homemade\",\"#foodlover\",\"#lunch\",\"#dinner\",\"#recipe\",\"#lecker\",\"#kochrezepte\",\"#gnocchi\",\"#foodstagram\",\"#foodpics\",\"#foodgram\",\"#foodlovers\",\"#fooddiary\",\"#yum\",\"#eatfamous\",\"#feedyoursoull\",\"#foodgasm\",\"#foodoftheday\",\"#macandcheese\",\"#macncheese\",\"#cheeselove\",\"#cheeselovers\",\"#leckerschmeccker\",\"#mrsmarzena\"]', 'post', 'profile_scrape', 0, 1683024422, 1683024422),
(675, 39, 2872838550174081629, NULL, 'CfeX3DALKJd', 5, 1212, 467, 0, 0, 0, 0, 0, '3.05', 'Hhnchenbrust mit Knoblauch-Sahne-Sauce und knusprig gebratenen Speck - leckeres Keto Gericht \nZUTATEN:\n 4 Scheiben Speck\n 600 g Hhnchenbrust, klein schneiden \n 1 kleine rote Zwiebel, gehackt\n 250 g Champignons, geschnitten\n 2 Knoblauchzehen, gehackt\n 1 kleiner Bund Thymian\n 1 Chili\n Salz, frisch gemahlener schwarzer Pfeffer\n 180 ml Hhnerbrhe\n 160 ml Schlagsahne\n 80 g frisch geriebener Parmesan\n Saft von 1/2 Zitrone\n l\n\n Speck in einer groen Pfanne bei mittlerer Hitze ca. 8 Minuten knusprig braten. Die Scheiben auf einem mit Kchenpapier ausgelegten Teller abtropfen lassen und etwa 2 Esslffel Fett in der Pfanne aufbewahren. \n Hhnchen rundherum mit Salz und Pfeffer wrzen. Die Hitze auf mittelhoch erhhen und gebe das Hhnchen in die Pfanne. Etwa 5 Minuten goldbraun backen, dann umdrehen und auf der zweiten Seite weitere etwa 5 Minuten backen, bis sie angebraten sind. Hhnchen aus der Pfanne nehmen und beiseitestellen. \n Fge die Zwiebel hinzu und brate, bis sie beginnt, weich zu werden, etwa 5 Minuten. Champignons unterrhren und mit Salz und Pfeffer wrzen. \n Brate unter hufigem Rhren, bis sie goldbraun sind, etwa 5 Minuten. Knoblauch einrhren, dann Hhnerbrhe, Sahne, Parmesan, Thymian und Zitronensaft hinzufgen. Die Mischung zum Kcheln bringen und 5 Minuten kochen lassen. \n Das Hhnchen wieder in die Pfanne geben und kcheln lassen, bis das Hhnchen gar ist und die Sauce leicht eingedickt ist, etwa 10 Minuten. \n Speck hacken und vor dem Servieren ber das Hhnchen streuen. \nGuten Appetit \nErnhrung (pro Portion): 633 Kalorien, 33 g Protein, 8 g Kohlenhydrate, 1 g Ballaststoffe, 3 g Zucker, 52 g Fett, 22 g gesttigte Fettsuren, 534 mg Natrium\n\n#hhnchenbrust #hhnchen #hhnchenbrustfilet #chicken #food #foodporn #foodblogger \n#hhnchen #hhnchenbrust #hhnchenbrustfilet #abnehmen #abnehmrezepte #healthyeating #chickenrecipes #chickenbreast #pfannengericht #foodporn #yummyfood #leckeressen #leckerschmecker #yummi #delicious #foodlover #keto #ketofood #mrsmarzena', 1656689079, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/291682665_423864799625799_7542094616409572470_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/290191528_738840614031924_2409940516474509205_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=100&_nc_ohc=vzoz1EzscCIAX-oXMCx&edm=AOQ1c0wBAAAA&vs=1208546483212771_1639301491&_nc_vs=HBkcFQAYJEdLajRTeEUwVWxpOF9KOENBSlhYU0o0aDFIRWhidlZCQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAExFQAAJprhzqC%2B9bk%2FFQIoAkMzLBdAGAAAAAAAABgSZGFzaF9iYXNlbGluZV8xX3YxEQB17AcA&_nc_rid=8e0ed9725d&ccb=7-5&oh=00_AfDjYxI_-SK-sPv3Y23os1xWqnCIoNBxsj6GaW8ivSIb9g&oe=6452676B&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CfeX3DALKJd', 0, 0, '[\"#h\\u00e4hnchen\",\"#h\\u00e4hnchenbrustfilet\",\"#chicken\",\"#food\",\"#foodporn\",\"#foodblogger\",\"#h\\u00fchnchen\",\"#h\\u00e4hnchenbrust\",\"#h\\u00e4hnchenbrustfilet\",\"#abnehmen\",\"#abnehmrezepte\",\"#healthyeating\",\"#chickenrecipes\",\"#chickenbreast\",\"#pfannengericht\",\"#foodporn\",\"#yummyfood\",\"#leckeressen\",\"#leckerschmecker\",\"#yummi\",\"#delicious\",\"#foodlover\",\"#keto\",\"#ketofood\",\"#mrsmarzena\"]', 'post', 'profile_scrape', 0, 1683024422, 1683024422),
(676, 39, 2869929179181499201, NULL, 'CfUCWIHpENB', 20, 1287, 427, 0, 0, 0, 0, 0, '3.28', 'Marillenkuchen  ein Superflaumiger und lockere Obstkuchen \n\nZutaten: \n 6 Eier\n 300 g Staubzucker\n 1 Prise Salz\n 1 P. Vanillezucker\n Abgeriebene Schale v. 1 Zitrone\n 1 Prise Zimt\n 170 ml l \n 280 g Mehl\n 1 P. Backpulver\n 2 EL Rum\n Belag: ca. 15 Marillen.\n\nZubereitung: \nBackblech (ca. 30 x 40 cm) mit l ausstreichen und mit Mehl einstauben (oder Backpapier verwenden). \nBackofen auf 160 C (Ober- und Unterhitze) vorheizen. \nMarillen halbieren und Kerne entfernen.\nMehl und Backpulver vermischen. Eier, Salz, Vanillezucker, abgeriebene Zitronenschale, Zimt und  vom Staubzucker gut schaumig (mind. 10 Min.) schlagen. \nl langsam unter stndigem Rhren einlaufen lassen, Mehlmischung mit restlichem Staubzucker vermischen, vorsichtig unterheben und zum Schluss den Rum zugeben.\nMasse auf das Backblech aufstreichen und mit Marillenhlften belegen (halbierte Seite nach oben). Auf unterer Schiene ca. 35 Min. backen.\n \nEin sehr feiner, lockerer Kuchen! \nLass euch schmecken! \n\n#marillenkuchen #marillen #blechkuchen #kuchenliebe #kuchenrezept #backenistliebe #backenmachtglcklich #backen #leckerschmecker #saisonalekche #foodblogger #mehlspeise #foodblogfeed #ausmeinerkche #backenfrdiefamilie #rezeptefrjedentag #lieblingskuchen #selbstgebacken #foodartblog #foodblogger #foodphotography #essenmachtglcklich #sommerkche #sterreichischekche', 1656342289, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/290451457_154112690526238_6688327435838231636_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/290377120_602586087735853_5037994322717106330_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=101&_nc_ohc=f-5HvenkQ7wAX_7VnS7&edm=AOQ1c0wBAAAA&vs=617190979395056_2831447153&_nc_vs=HBksFQAYJEdLRE5UaEV0d3JTQkRDUUNBSnJnLU9Fa2plcEZidlZCQUFBRhUAAsgBABUAGCRHRGVmU0JGeEFZdlgyWlFDQU1LNUdENmJHa0FTYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACakiL%2FRkpLmPxUCKAJDMywXQBgAAAAAAAAYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=8e0edca3fa&ccb=7-5&oh=00_AfCVxMKRbjbjTF8ayTfXMyZHF43FeS6jAl7FVzUOqSwZDw&oe=645281C5&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CfUCWIHpENB', 0, 0, '[\"#marillen\",\"#blechkuchen\",\"#kuchenliebe\",\"#kuchenrezept\",\"#backenistliebe\",\"#backenmachtgl\\u00fccklich\",\"#backen\",\"#leckerschmecker\",\"#saisonalek\\u00fcche\",\"#foodblogger\",\"#mehlspeise\",\"#foodblogfeed\",\"#ausmeinerk\\u00fcche\",\"#backenf\\u00fcrdiefamilie\",\"#rezeptef\\u00fcrjedentag\",\"#lieblingskuchen\",\"#selbstgebacken\",\"#foodartblog\",\"#foodblogger\",\"#foodphotography\",\"#essenmachtgl\\u00fccklich\",\"#sommerk\\u00fcche\",\"#\\u00f6sterreichischek\\u00fcche\"]', 'post', 'profile_scrape', 0, 1683024422, 1683024422),
(677, 39, 2867106750902270874, NULL, 'CfKAmY8p3ua', 20, 1455, 478, 0, 0, 0, 0, 0, '3.7', 'Hhnchenbrust mit Avocado-Karfiol-Pree   leichtes Sommer Gericht mit viel Ballaststoffen. Er ist reich an Vitaminen und Mineralstoffen, u. a. enthlt das Vitamin C, Vitamin K und E, Folsure sowie Kalium, Kalzium und Magnesium. \nEinfach lecker, schnell gemacht und nur 310 kcal! \n\n Zutaten fr 4 Personen\n400 g Hhnchenbrust\n10 getrocknete Tomaten ohne l\n50 g Erbsen (TK)\n1 groe Zwiebel\n0,5 Bund Petersilie\n400 g Karfiol (Blumenkohl) \n1 Avocado\n80 g Feta \n3 EL Olivenl\n50 ml Milch\nSalz, Pfeffer \n50 ml Gemsebrhe\nZubereitung:\nFleisch waschen, trocken tupfen und in kleine Stcke schneiden. Tomaten in heiem Wasser einweichen. Zwiebel schlen und fein wrfeln. Feta wrfeln. Petersilie waschen und in Streifen schneiden. Tomaten abtropfen lassen und klein schneiden.\nKarfiol in Rschen teilen bzw. schneiden, in kochendes Salzwasser geben und fr ca. 10-15 Minuten, bei mittlerer Hitze kochen lassen. Avocado halbieren, Stein entfernen und das Fruchtfleisch auslffeln.\n1 EL l in einer Pfanne erhitzen, Zwiebel darin anbraten, Tomaten zugeben, kurz mitbraten. Beides herausnehmen. Restliches l erhitzen, Hhnchenteile krftig darin anbraten. Pro Seite ca. 3 Minuten knusprig brunen.\nKarfiol abgieen, Milch zufgen und stampfen. Avocado unterheben und nur leicht stampfen. Mit Salz und Pfeffer abschmecken. Petersilie darauf streuen.\nTomaten und Zwiebeln wieder zu Hhnchen zugeben. Brhe angieen, Feta zugeben und in Pfanne mit Deckel noch 10 Minuten schmoren lassen, bis der Feta leicht anschmilzt. Hhnchen mit Pree und Soe anrichten.\nGuten Appetit \n\n#karfiol #karfiolpree #leckerschmecker #blumenkohl #coliflor #gesunderezepte #kochdichglcklich #blumenkohlstampf #avocado #frischkochenmachtglcklich #hhnchenbrust #eiwei #kreativeskochen #gesundeernhrung #gesunderezepte #ernhrungstipps #wenigkalorien #kalorienarm #gesundeernhrung #lowcarb #heihunger', 1656005808, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/289816235_429831498997099_5465258958687898669_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/289599901_627066291666672_2931987703612470884_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=100&_nc_ohc=EWv29QiJILMAX-pFjb5&edm=AOQ1c0wBAAAA&vs=569539854565784_1526793966&_nc_vs=HBkcFQAYJEdKM3hRaEh3dnBBLVVEb0NBR1Iyb2pkSWc3QW9idlZCQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAExFQAAJo7wo5L6pfE%2FFQIoAkMzLBdAGAAAAAAAABgSZGFzaF9iYXNlbGluZV8xX3YxEQB17AcA&_nc_rid=8e0ed4fe7c&ccb=7-5&oh=00_AfAgtSpbUAK7O4R5Jp0udoL1cmlmc0H_itBhVMMe8HVeDw&oe=6452D62C&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CfKAmY8p3ua', 0, 0, '[\"#karfiolp\\u00fcree\",\"#leckerschmecker\",\"#blumenkohl\",\"#coliflor\",\"#gesunderezepte\",\"#kochdichgl\\u00fccklich\",\"#blumenkohlstampf\",\"#avocado\",\"#frischkochenmachtgl\\u00fccklich\",\"#h\\u00e4hnchenbrust\",\"#eiwei\\u00df\",\"#kreativeskochen\",\"#gesundeern\\u00e4hrung\",\"#gesunderezepte\",\"#ern\\u00e4hrungstipps\",\"#wenigkalorien\",\"#kalorienarm\",\"#gesundeern\\u00e4hrung\",\"#lowcarb\",\"#hei\\u00dfhunger\"]', 'post', 'profile_scrape', 0, 1683024422, 1683024422),
(678, 39, 2865463124816208218, NULL, 'CfEK4e3pqFa', 23, 1269, 574, 0, 0, 0, 0, 0, '3.24', 'Kohlrabisuppe  einfach, schnell und kstlich!  \nEine perfekte Suppe fr Berufsttige, wenn es am Abend schnell gehen soll. \nZUTATEN 4 Portionen\n 1 Zwiebel\n 1 Knoblauchzehe\n 2 Kohlrabi (ca. 600 g)\n 2 Kartoffel\n 2 EL l\n 800 ml Gemsebrhe\n 100 g Creme a la Cuisine oder Crme frache\n etwas frisch gemahlener Pfeffer und Salz nach Bedarf\n Garnierung: Omega 3 Mix, Radieschen und Rote Rettich Kresse \n\n Zubereitung:\nKohlrabi, Kartoffeln, Zwiebel und Knoblauch schlen, in kleine Stcke schneiden und in einem Suppentopf in l 3 - 4 Minuten dnsten.\nMit Gemsebrhe auffllen und 20 - 25 Minuten kcheln lassen, bis die Gemse weich sind.\nAnschlieend die Creme a la Cuisine zufgen, die Suppe prieren und abschmecken.\nAuf Teller verteilen, mit Topping servieren und sich schmecken lassen! \nGuten Appetit \n\n#kohlrabi #kohlrabipflanzen #kalarepa #kohlrabigemse #kohlrabiliebe #foodinspo #suppe #rezeptideen #kohlrabisuppe #suppenkasper #gemsesuppe #mrsmarzena #souprecipe #healingfood #wellnessfood #gesundeernhrung #soulfood #leckerschmecker #mrsmarzena #unglaublichlecker #delicious #suppe', 1655809870, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/289276154_717486029466403_6600940870677190480_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/288931880_715351646400795_4072478161847799797_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=103&_nc_ohc=C7Qvw2vshMwAX8sIlLf&edm=AOQ1c0wBAAAA&vs=1198602314231029_1124404518&_nc_vs=HBkcFQAYJEdDakFPQkViOGNYSW00b0NBUFZQZWJCUFdZUTRidlZCQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAExFQAAJq6cqrWhy%2BU%2FFQIoAkMzLBdAGAAAAAAAABgSZGFzaF9iYXNlbGluZV8xX3YxEQB17AcA&_nc_rid=8e0ed3b439&ccb=7-5&oh=00_AfD_fj6kiDkWZp6iPBow72fhGovsg8wu6vIe09rrqOrHjw&oe=6452E359&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CfEK4e3pqFa', 0, 0, '[\"#kohlrabipflanzen\",\"#kalarepa\",\"#kohlrabigem\\u00fcse\",\"#kohlrabiliebe\",\"#foodinspo\",\"#suppe\",\"#rezeptideen\",\"#kohlrabisuppe\",\"#suppenkasper\",\"#gem\\u00fcsesuppe\",\"#mrsmarzena\",\"#souprecipe\",\"#healingfood\",\"#wellnessfood\",\"#gesundeern\\u00e4hrung\",\"#soulfood\",\"#leckerschmecker\",\"#mrsmarzena\",\"#unglaublichlecker\",\"#delicious\",\"#suppe\"]', 'post', 'profile_scrape', 0, 1683024422, 1683024422),
(679, 39, 2859766715094919869, NULL, 'Cev7qz5t-q9', 20, 1577, 548, 0, 0, 0, 0, 0, '4.01', 'Einfacher Erdbeerkuchen  sehr fruchtig und flaumig! \nEin groartiges Rezept fr Kochanfnger oder zum Backen mit Kinder. \n\n Zutaten:\n 1 Pk. Backpulver\n 250 g Butter (Zimmerwarm)\n 5 Eier\n 1 kg Erdbeeren\n 350 g Mehl\n 1 Pk. Vanillezucker\n 250 g Zucker\n Prise Salz\n\n Zubereitung\nDie Erdbeeren, waschen, verlesen und halbieren.\nDas Backrohr auf 200 Grad, Ober- und Unterhitze vorheizen und die Tortenform (Durchmesser 25cm) mit Backpapier auslegen (oder mit Butter einfetten).\n TIPP : Mache das Backpapier nass, dann brauchst du nie mehr zuschneiden oder einfetten. Das Papier ist einfach in jeder Form zu auslegen!\nAlle Zutaten in einer Schssel mit dem Mixer zu einem glatten Teig rhren.\nDen Teig in die Tortenform geben, mit der Teigspachtel glattstreichen und mit den Erdbeerhlften dicht belegen. \nIm Backrohr etwa 30 Minuten backen.\nAnschlieend die Torte aus dem Backofen nehmen, auskhlen lassen, mit etwas Staubzucker bestreuen und genieen. \nLasst euch schmecken! \n#kuchenbacken #kuchenliebe #backenmitkindern #backenmitliebe #erdbeerkuchen #erdbeerliebe #erdbeerkuchen #erdbeerliebe #kuchenliebe #kuchenbacken #backenmachtglcklich #strawberry #cake #cakelove #coffeetime #leckerschmecker #erdbeeren #erdbeerliebe #backenmachtglcklich # #delicious #mrsmarzena', 1655130967, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/287918339_425560536243827_4873450510714389410_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/285453892_174470101693611_8853094757737652581_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=103&_nc_ohc=Vly5Xma-sDgAX8Zhi_Z&edm=AOQ1c0wBAAAA&vs=422359496412763_1916946531&_nc_vs=HBksFQAYJEdFU3VBeE