(680, 39, 2856670298831055508, NULL, 'Cek7oBiO-qU', 23, 1489, 620, 0, 0, 0, 0, 0, '3.79', 'One Pot Pasta mit grner Spargel in Zitronensauce - super einfach, superschnell, vegan und unglaublich lecker! \nZUTATEN\n500 g grner Spargel\n1 Zwiebel, fein gehackt\n3 Knoblauchzehen, fein gehackt\n250 g Fusilli oder was Du willst \n250 ml Dose Kokosmilch \n600 ml Gemsebrhe\nSaft von einer Zitrone\n2 TL abgeriebene Zitronenschale\nSalz\nPfeffer\nChiliflocken\nl\n\nZubereitung: \nSpargel gut waschen, die holzigen Enden wegschneiden und in Stcke schneiden (ca. 5 cm lang).\nEtwas l in einer Pfanne erhitzen und den Spargel bei groer Hitze unter Rhren anbraten und zur Seite stellen.\nIn einem groen Topf etwas l erhitzen und die Zwiebel ungefhr 3 Minuten glasig anschwitzen. Dann den Knoblauch eine weitere Minute mit anbraten.\nDie ungekochten Nudeln, die Gemsebrhe, die Kokosmilch und den Zitronensaft hinzufgen. 15-18 Minuten bei mittlerer Hitze kochen. Gelegentlich umrhren.\nDen Spargel und die abgeriebene Zitronenschale unterrhren und warm werden lassen. Mit Salz, Pfeffer und Chiliflocken abschmecken.\nLasst Euch schmecken \n \n#spargel #spargelrezept #spargelzeit #grnerspargel #aspagarus #schnellerezepte #einfacherezepte #instafood #leckeressen #vegetarisch #vegan #yummy #foodblogger #einfachkochen #kochenmachtglcklich #foodie #spargelpasta #grnerspargelrezepte #grnerspargelpasta #food #foodporn #foodie #foodstagram #frhlingskche #leichtekche #mrsmarzena', 1654761679, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/286414201_254451750232777_5458235807849592211_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/286262624_124980696878817_2897878309261847494_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=109&_nc_o