(683, 39, 2821918388684545461, NULL, 'Ccpd9LGr121', 25, 1813, 633, 0, 0, 0, 0, 0, '4.61', 'Spaghetti mit Krbiskernpesto und Kirschtomaten  eine wahre Eisenbombe! \nDie Vollkornpasta und die Krbiskerne erhalten viel pflanzliches Eisen und das Vitamin C der Tomaten optimiert die Aufnahme von Eisen. \nFazit: Ein gesundes, kstliches und einfaches Gericht.  \n770 kcal, 73,6 g Kohlenhydrate, 23,9 g Eiwei, 39,7 g Fett\nZutaten fr 2 Personen:\n 200 g Vollkornspaghetti\n 100 g Kirschtomaten \n  Bund Basilikum\n 30 g Krbiskerne\n 20 g gerieben Parmesan\n 1 Bio-Zitrone\n 1 Knoblauchzehe\n 3 EL Gemsebrhe\n 2 EL Krbiskernl\n 1 EL Olivenl\n Salz\n Zubereitung:\nDie Nudeln nach Packungsanleitung kochen.\nDie Zitrone hei waschen, abtrocknen und die Schale abreiben. Den Knoblauch schlen, das Basilikum waschen, trockenen und die Bltter abzupfen. Die Krbiskerne in eine Pfanne ohne Fett anrsten, bis sie zu duften beginnen. Dann die Pfanne von Herd weggeben.\nKnoblauch, Zitronenschale, Parmesan, Basilikum und Krbiskerne sowie Gemsebrhe und Krbiskernl, in einen Mixbecher geben und mit Prierstab fein mixen. Das Pesto mit Salz abschmecken.\nOlivenl in eine kleine Pfanne erhitzen und die gewaschene Tomaten darin ca. 4 Minuten rundherum andnsten.\nDie Nudel abgieen, etwas Nudelwasser auffangen und mit dem Pesto verrhren.\nNudeln mit Pesto vermischen und mit Kirschtomaten servieren.\nLasst Euch schmecken! \n\n#krbis #krbiskerne #krbiskernpesto #rezept #diy #lecker #krbisliebe #nachhaltigleben #zerowaste #krbiskernl #gesund #food #fit #fitness #healthyfood #instafood #foodblogger #abnehemen #yazio #unglaublichlecker #spaghetti #delicious #mrsmarzena', 1650618933, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/278881956_659780201982132_5595133634389466692_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/278783641_683384272875372_7942461561794109473_n.mp4?efg