(690, 40, 3090664336434257605, NULL, 'CrkPtbFId7F', 35, 78, 0, 0, 0, 0, 0, 0, '2.33', 'Marzipankchlein \n.\nFreust du dich aufs lange Wochenende?\n.\nZum heutigen #mandyscakefriday habe ich das Mandel-Zimt-Kchlein von @sabis_genusswelt als Grundlage verwendet und in die Marzipan-Variante umgewandelt!\n.\nHier das Rezept \n.\nVerwendet habe ich Leinl, Erdmandel- und Dinkelmehl von @_mynatura.eu_ (15% mit Rebecca15), Marzipanprotein von @nutritionplus.de  und Bratapfel-Marzipankugeln von @zentis_aachen .\n.\n#kchlein #marzipan #marzipankugeln #weieschokolade #bratapfel #kchlein #muffin #heissluftfritteuse #foodie #foodblogger_de #backen #backenmachtglcklich #backenmitliebe #proteinreich #schnellgemacht', 1682655921, '{\"city_name\":\"Pulheim\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/343578955_1966710863661181_365294392684536959_n.jpg', NULL, NULL, 'https://instagram.com/p/CrkPtbFId7F', 0, 0, '[\"#mandyscakefriday\",\"#marzipan\",\"#marzipankugeln\",\"#wei\\u00dfeschokolade\",\"#bratapfel\",\"#k\\u00fcchlein\",\"#muffin\",\"#heissluftfritteuse\",\"#foodie\",\"#foodblogger_de\",\"#backen\",\"#backenmachtgl\\u00fccklich\",\"#backenmitliebe\",\"#proteinreich\",\"#schnellgemacht\"]', 'post', 'profile_scrape', 0, 1683024425, 1683024425),
(691, 40, 3089945239019001487, NULL, 'CrhsNLbIxaP', 35, 95, 0, 0, 0, 0, 0, 0, '2.69', 'Joghurtmuffin \n.\nSiehst du den grnen Schimmer? Der kommt vom Pistazienflavour und ist ein Muss am #grnerdonnerstag bei @vreaky_lena .\n.\nHier der Anschnitt  und das Rezept  zu dem mich @frollein_goodfood inspiriert hat. \n.\nIch habe dafr den Nussjoghurt von @ehrmann_  und Kokosmehl von @_mynatura.eu_ (15% mit Rebecca15) verwendet. Oben drauf gab es noch Salz-Karamell-Nsse von @koro_de .\n.\n#muffin #pistazie #nuss #kokos #joghurtmuffin #lowcarb #zuckerfrei #foodie #foodblogger_de #backen #backenmachtglcklich #backenmitliebe #lecker #salzcaramel #genuss #grn', 1682570198, '{\"city_name\":\"Pulheim\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/343292057_989723865521200_735505490289278907_n.jpg', NULL, NULL, 'https://instagram.com/p/CrhsNLbIxaP', 0, 0, '[\"#gr\\u00fcnerdonnerstag\",\"#pistazie\",\"#nuss\",\"#kokos\",\"#joghurtmuffin\",\"#lowcarb\",\"#zuckerfrei\",\"#foodie\",\"#foodblogger_de\",\"#backen\",\"#backenmachtgl\\u00fccklich\",\"#backenmitliebe\",\"#lecker\",\"#salzcaramel\",\"#genuss\",\"#gr\\u00fcn\"]', 'post', 'profile_scrape', 0, 1683024425, 1683024425),
(692, 40, 3089214766659655547, NULL, 'CrfGHaBo9d7', 55, 102, 0, 0, 0, 0, 0, 0, '3.24', 'Schwarzwlder Cupcakes  \n.\nWelcher Kuchen wird von dir immer wieder gefordert? \n.\nMein Mann mchte immer wieder Schwarzwlder Kirschkuchen, aber dieses Mal haben die Cupcakes als Party-Nachtisch einfach besser gepasst. \n.\nHier das Rezept  mit Kakaopulver von @azafran.de (10% mit Rebecca10), Kirschwasser von @eckesedlelikoere und Schokoraspeln von @ruf.deutschland \n.\n#muffinmittwoch @sabis_genusswelt #muffin #cupcake #schwarzwlderkirsch #sahnehaube #kirschen #kirschwasser #schokolade #foodie #foodblogger_de #backen #backenmachtglcklich #backenmitliebe', 1682483119, '{\"city_name\":\"Pulheim\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/343278070_1012296143264464_6730752431592484915_n.jpg', NULL, NULL, 'https://instagram.com/p/CrfGHaBo9d7', 0, 0, '[\"#muffin\",\"#cupcake\",\"#schwarzw\\u00e4lderkirsch\",\"#sahnehaube\",\"#kirschen\",\"#kirschwasser\",\"#schokolade\",\"#foodie\",\"#foodblogger_de\",\"#backen\",\"#backenmachtgl\\u00fccklich\",\"#backenmitliebe\"]', 'post', 'profile_scrape', 0, 1683024425, 1683024425),
(693, 40, 3088495785300583875, NULL, 'Crcio2dIeXD', 55, 113, 0, 0, 0, 0, 0, 0, '3.47', 'Brezenkndel  \n.\nKndel lieber aus Kartoffeln oder Brot?\n.\nIch liebe Brezenkndel und habe heute das Rezept fr euch dabei  mit Petersilie und Muskat von @azafran.de (10% mit Rebecca10). \n.\nDa ich neben alten Brezeln auch altest Toast verwendet habe, passt es auch zum #toasttuesday bei @vreaky_lena \n.\nAm liebsten schneide ich die Kndel wie hier danach in Scheiben und brate sie in Butter. \n.\n#brezeln #laugenbrezel #brezenkndel #altbrot #petersilie #foodie #foodblogger_de #resteverwertung #gebraten #beilage #lecker #veggie #vegetarisch #genuss #knusprig', 1682397410, '{\"city_name\":\"Pulheim\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/342734375_175688215015696_9066222152882335785_n.jpg', NULL, NULL, 'https://instagram.com/p/Crcio2dIeXD', 0, 0, '[\"#toasttuesday\",\"#laugenbrezel\",\"#brezenkn\\u00f6del\",\"#altbrot\",\"#petersilie\",\"#foodie\",\"#foodblogger_de\",\"#resteverwertung\",\"#gebraten\",\"#beilage\",\"#lecker\",\"#veggie\",\"#vegetarisch\",\"#genuss\",\"#knusprig\"]', 'post', 'profile_scrape', 0, 1683024425, 1683024425),
(694, 40, 3087732893882092574, NULL, 'CrZ1LUdIYwe', 35, 100, 0, 0, 0, 0, 0, 0, '2.79', 'Marzipan Riegel  \n.\nLetzte Woche gabs Kokos, diese Woche gibts Marzipan. Was ist dir lieber?\n.\nZum #mugcakemonday hab ich mal wieder Riegel fr euch und @vreaky_lena und auch fr @momocats_world zum #energiemontag .\n.\nHier der Anbiss  und das Rezept  verwendet habe ich Dinkelmehl von @_mynatura.eu_ (15% mit Rebecca15), Natron von @azafran.de (10% mit Rebecca10), Marzipanprotein von @nutritionplus.de und bei den Keksen handelt es sich um @digestivebiscuits \n.\n#backen #backenmachtglcklich #backenmitliebe #lecker #snack #kuchenriegel #kuchen #marzipan #proteinreich #vollkorn #foodie #foodblogger_de #digestive #kekskrmel #krmelmonsterkeksfreitag', 1682306466, '{\"city_name\":\"Pulheim\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/342576158_984628335871073_7975770126430022189_n.jpg', NULL, NULL, 'https://instagram.com/p/CrZ1LUdIYwe', 0, 0, '[\"#mugcakemonday\",\"#energiemontag\",\"#backenmachtgl\\u00fccklich\",\"#backenmitliebe\",\"#lecker\",\"#snack\",\"#kuchenriegel\",\"#kuchen\",\"#marzipan\",\"#proteinreich\",\"#vollkorn\",\"#foodie\",\"#foodblogger_de\",\"#digestive\",\"#kekskr\\u00fcmel\",\"#kr\\u00fcmelmonsterkeksfreitag\"]', 'post', 'profile_scrape', 0, 1683024425, 1683024425),
(695, 40, 3087041119169576956, NULL, 'CrXX4rDIH_8', 36, 119, 0, 0, 0, 0, 0, 0, '3.2', 'Rhabarberkuchen \n.\nHattest Du schon den ersten Rhabarber?\n.\nHier mein erstes Rezept fr dieses Jahr  nach dem Kuchen im Ganzen \n.\nPassend zum #cheesecakesonntag mit Schmandhaube. Auerdem verwendet habe ich Puddingpulver von @dr.oetker_deutschland und Vanilleflavour von @morenutrition.de .\n.\n#rhabarber #rhabarberkuchen #rhabarberzeit #fruchtig #lecker #cremig #vanillig #schmand #schmandkuchen #saftig #foodie #foodblogger_de #backen #backenmachtglcklich #backenmitliebe #pudding #vanillepudding #chunkyflavour', 1682224000, '{\"city_name\":\"K\\u00f6ln\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/342378320_1184547658912387_2190789205149290825_n.jpg', NULL, NULL, 'https://instagram.com/p/CrXX4rDIH_8', 0, 0, '[\"#cheesecakesonntag\",\"#rhabarberkuchen\",\"#rhabarberzeit\",\"#fruchtig\",\"#lecker\",\"#cremig\",\"#vanillig\",\"#schmand\",\"#schmandkuchen\",\"#saftig\",\"#foodie\",\"#foodblogger_de\",\"#backen\",\"#backenmachtgl\\u00fccklich\",\"#backenmitliebe\",\"#pudding\",\"#vanillepudding\",\"#chunkyflavour\"]', 'post', 'profile_scrape', 0, 1683024425, 1683024425),
(696, 40, 3086316370902876777, NULL, 'CrUzGMoI4Jp', 42, 105, 0, 0, 0, 0, 0, 0, '3.04', 'Apple Crumble  \n.\nMachst Du aus alten pfeln auch so gerne Crumble?\n.\nGeht schnell und ist immer lecker! Hier mein Rezept \n.\nNatrlich mit Zimt von @azafran.de (10% mit Rebecca10).\n.\n#crumble #streusel #apfel #apfelstreusel #apllecrumble #zimt #knusprig #streuselliebe #foodie #foodblogger_de #resteverwertung #lecker #genuss #zitrone #nachtisch', 1682137603, '{\"city_name\":\"Pulheim\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/342920020_6115019945255911_912126173184231872_n.jpg', NULL, NULL, 'https://instagram.com/p/CrUzGMoI4Jp', 0, 0, '[\"#streusel\",\"#apfel\",\"#apfelstreusel\",\"#apllecrumble\",\"#zimt\",\"#knusprig\",\"#streuselliebe\",\"#foodie\",\"#foodblogger_de\",\"#resteverwertung\",\"#lecker\",\"#genuss\",\"#zitrone\",\"#nachtisch\"]', 'post', 'profile_scrape', 0, 1683024425, 1683024425),
(697, 40, 3085592830880665266, NULL, 'CrSOlTeIk6y', 42, 135, 0, 0, 0, 0, 0, 0, '3.66', 'Amicelli-Trtchen *Werbung*\n.\nWie versprochen kommt hier ein Rezept mit Amicelli, die ich durch den Produkttest von @amicelli_dach und @ohoftheday erhalten habe. \n.\nHier ist das Rezept fr euch  und das natrlich am #mandyscakefriday\n.\nAuerdem verwendet habe ich Natron und Erythrit von @azafran.de (10% mit Rebecca10)\n.\nDa es sich um Waffelrllchen handelt, bin ich diese Woche auch wieder beim #krmelmonsterkeksfreitag dabei!\n.\n#amicelli #enjoyyourself #amicellioftheday #amicelliohotd #produkttest #lecker #nussig #nusscreme #kaffeebegleiter #foodie #foodblogger_de #waffelrllchen #backen #backenmitliebe #backenmachtglcklich #sahnetrtchen #sahne #cremig', 1682051350, '{\"city_name\":\"Pulheim\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/342505253_920784439067723_8063960741319260808_n.jpg', NULL, NULL, 'https://instagram.com/p/CrSOlTeIk6y', 0, 0, '[\"#mandyscakefriday\\n.\\nau\\u00dferdem\",\"#kr\\u00fcmelmonsterkeksfreitag\",\"#enjoyyourself\",\"#amicellioftheday\",\"#amicelliohotd\",\"#produkttest\",\"#lecker\",\"#nussig\",\"#nusscreme\",\"#kaffeebegleiter\",\"#foodie\",\"#foodblogger_de\",\"#waffelr\\u00f6llchen\",\"#backen\",\"#backenmitliebe\",\"#backenmachtgl\\u00fccklich\",\"#sahnet\\u00f6rtchen\",\"#sahne\",\"#cremig\"]', 'post', 'profile_scrape', 0, 1683024425, 1683024425),
(698, 41, 2833780234278632396, NULL, 'CdTnBvrs3vM', 62, 258, 0, 0, 0, 0, 0, 0, '9.05', ' FALAFEL AUS DEM AIRFRYER \n\nIch suche schon lange nach gute Falafel  \nLeider schmecken mir die im Handel erhaltliche nicht also, muss ich selber machen! \n\nSo ein Gluck , dass ich in Singapur  die Liebe Shadia @shadia.saba kennenlernen durfte! Sie hat mir ihr Familien Rezept verraten und ich darf es mit dir auf dem Blog teilen.  \nIch habe die Falafel  im Airfryer ausgebacken und finde sie genau so gut wie im Ol frittiert, sie sind aber dann so naturlich wesentlich gesunder \n\nDie Kichererbsen Ballchen tauche ich gerne in einem selbstgemachten Zitronen  und Tahini Dip - wie man das einfach nebenbei zubereiten kann, verrate ich dir auf dem Blog, thecookingglobetrotter.com \n\nBuon Appetito!\n.\n Untersttze meinen Blog, damit ich noch viele kostenlose Rezepten mit dir teilen kann! \nGeht ganz einfach:\n liken\n kommentieren\n speichern\n weiterleiten\n\nDeine Laura\n#thecookingglobetrotter \n\n#veganeernahrung #veganerezepte #foodbloggerliebe #einfacherezepte #einfachekuche #heissluftfritteuse #foodbloggers #falafel #airfryer #heiluftfritteuse #kichererbsen #orientalischekuche', 1652032950, '{\"city_name\":\"Graz Zentrum\",\"country_code\":\"AT\",\"country_name\":\"austria\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/280192394_157601203428309_5394212721091898905_n.jpg', NULL, NULL, 'https://instagram.com/p/CdTnBvrs3vM', 0, 1, '[\"#veganerezepte\",\"#foodbloggerliebe\",\"#einfacherezepte\",\"#einfacheku\\u0308che\",\"#heissluftfritteuse\",\"#foodbloggers\",\"#falafel\",\"#airfryer\",\"#hei\\u00dfluftfritteuse\",\"#kichererbsen\",\"#orientalischeku\\u0308che\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
(699, 41, 2965399640492973986, NULL, 'CknN0L8p5-i', 46, 309, 6586, 0, 0, 0, 0, 0, '10.04', 'TIRAMIS MIT RUM UND MARONI  CREME\n.\nSorry Kinder, das hier ist nichts fr euch! Die Kekse habe ich dieses Mal in Kaffee und Rum  eingetunkt.\nDie Mascarpone Creme mit Maroni  verfeinert (einfach die fertige Creme von Bonne Maman untermengt).\n.\nOk und da ich eine liebe Mamma  bin, habe ich dann natrlich auch ein Kinder Tiramis zubereitet - ohne Eier und mit Kakao.\n.\nBeide Rezepte und noch mehr Tiramis Variationen findest du auf dem Blog - einfach danach suchen oder in der Kategorie Italienisches Essen schauen \n.\nDeine Laura\n#thecookingglobetrotter \n.\n#tiramisu #tiramis #tiramis #maroni #rum #italienischekche #dessert #festlich #einfachbacken #nobakedessert #einfacherezepte #einfachekche #foodbloggerliebe #ichliebefoodblogs', 1667723976, '{\"city_name\":\"Graz Ruckerlberg\",\"country_code\":\"AT\",\"country_name\":\"austria\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/314489201_834714037566325_6411586916000130627_n.jpg', NULL, NULL, 'https://instagram.com/p/CknN0L8p5-i', 0, 1, '[\"#tiramis\\u00f9\",\"#tiramis\\u00fa\",\"#maroni\",\"#rum\",\"#italienischek\\u00fcche\",\"#dessert\",\"#festlich\",\"#einfachbacken\",\"#nobakedessert\",\"#einfacherezepte\",\"#einfachek\\u00fcche\",\"#foodbloggerliebe\",\"#ichliebefoodblogs\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
(700, 41, 2786683239276071402, NULL, 'CasSaRClcnq', 43, 216, 4264, 0, 0, 0, 0, 0, '7.32', ' PASTA AL FORNO BIANCA CON PISELLI \n\nPasta was??! Ok, auf deutsch: Nudelauflauf mit Erbsen \n\nSuper einfach und unglaublich lecker!\n\n Zutaten: \n500 g gekochte Nudeln\n750 ml- 1 Liter Bchamel Sauce\n150 g Erbsen (tiefgefroren)\n50 g Parmesan, gerieben\nMuskatnuss\n\n Zubereitung: \n1 Backofen auf 180 C Umluft vorheizen\n2 Pasta, Bchamel (mehr davon = cremiger), 1 Prise Muskatnuss und Erbsen vermischen\n3 Parmesan darber trufeln\n4 20 bis 30 Minuten backen (umso lnger, umso knuspriger werden die Rnder)\n5 Genieen \n\nUntersttze meinen Blog, damit ich noch viele kostenlose Rezepte mit dir teilen kann! Geht ganz einfach:\n speichern\n liken\n weiterleiten\n\nLaura\n#thecookingglobetrotter \n\n#pasta #foodbloggerliebe #einfacherezepte #einfachekche #foodbloggers #heutegibtspasta #pastaalforno #italienischekche #italienischkochen #sonntagsessen #schnellekche #backofen #nudelauflauf', 1646418609, '{\"city_name\":\"Graz\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/275154081_252533310412719_4790934206759117256_n.jpg', NULL, NULL, 'https://instagram.com/p/CasSaRClcnq', 0, 1, '[\"#foodbloggerliebe\",\"#einfacherezepte\",\"#einfachek\\u00fcche\",\"#foodbloggers\",\"#heutegibtspasta\",\"#pastaalforno\",\"#italienischek\\u00fcche\",\"#italienischkochen\",\"#sonntagsessen\",\"#schnellek\\u00fcche\",\"#backofen\",\"#nudelauflauf\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
(701, 41, 3082380796756943475, NULL, 'CrG0QDlLuJz', 16, 54, 423, 0, 0, 0, 0, 0, '1.98', ' TORTA PASQUALINA (FR FAULEN) \n.\nDie italienische Torta Pasqualina, bekannt durch @dasgrossebacken gibt es bei mir auf dem Blog in der einfachen und schnellen oder sogar super schnellen Version schon lnger.\n.\nEgal ob mit selbstgemachten Boden oder mit gekauften Bltterteig oder Quicheteig, uns schmeckt sie immer gut. Und da man sie recht schnell nebenbei zubereitet kann, wird sie gerne unter der Woche als schnellen und gesunden Abendessen aufgetischt.\n.\nZutaten:\nTeig	\n250 g	Mehl\n125 g	Butter, kalt, in Wrfeln\n60 g	kaltes Wasser\n4 g	Salz\nFllung	\n250 g	Spinat, tiefgekhlt\n250 g	Ricotta Kse\n25 g	Parmesan, gerieben\n1	Ei\n1	Prise Salz\n1	Prise Muskatnus\nDas Rezept, inklusive Videoanleitung, findest du auf meinem Blog.\n.\n Gutes Essen, das gut tut \nMeine Rezepte enthalten Kalorien- und Nhrstoffenangaben. Und in jedem Beitrag stelle ich dir ein Super Food vor. Im letzten Beitrag erfhrst du die guten Eigenschaften von Joghurt. \n.\nDeine Laura\n#thecookingglobetrotter \n\nDir gefallen meine Rezepte und du willst mehr davon? Dann brauche ich deine Untersttzung!\n Like den Post, lass einen Kommentar da und teile ihn gerne\n Besuche meinen Blog, bewerte meine Rezepte, kommentiere sie und trage dich beim Newsletter ein\n Wenn du ber meine (Affiliate) Links einkaufst, erhalte ich eine kleine Provision (ohne zustzliche Kosten fr dich) - das hilft mir einen Teil der Kosten zu decken.\nDanke \n.\n#tortapasqualina #spinatquiche #quiche #ricottaundspinat #dasgrossepromibacken', 1681668513, '{\"city_name\":\"Graz\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/341730963_969105924453213_2131627570551754432_n.jpg', NULL, NULL, 'https://instagram.com/p/CrG0QDlLuJz', 0, 0, '[\"#spinatquiche\",\"#quiche\",\"#ricottaundspinat\",\"#dasgrossepromibacken\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
(702, 41, 3075507840906964594, NULL, 'CquZhYpMC5y', 24, 56, 319, 0, 0, 0, 0, 0, '2.26', ' MAURITIUS \n.\nAuch als Paradies auf Erden bekannt.\nWieso? Ganz klar:\n Trkisblaues Meer \n Weie Sandstrnde\n schn warm\n National parken\n Gutes creolisches Essen\n freundliches Multi kulturelles Volk\n phantastischen Resorts\n.\nEindrcke unserer Reisen siehst du in meiner Stories und Mauritius Highlight auf meinem Profil @thecookingglobetrotter\n.\nFolge mir fr mehr Reisen Berichten und einfache Kche und Rezepte aus der ganzen Welt  \n.\nDeine Laura\n#thecookingglobetrotter\n.\n#mauritius #jwmarriott #jwmarriotmauritius #reisenmitkindern #urlaub', 1680850035, '{\"city_name\":\"JW Marriott Mauritius Resort\",\"country_code\":\"MU\",\"country_name\":\"mauritius\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/339689046_716163800207782_3981847249935735462_n.jpg', NULL, NULL, 'https://instagram.com/p/CquZhYpMC5y', 0, 0, '[\"#jwmarriott\",\"#jwmarriotmauritius\",\"#reisenmitkindern\",\"#urlaub\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
