(707, 41, 3060660338211147552, NULL, 'Cp5plyNM88g', 28, 94, 0, 0, 0, 0, 0, 0, '3.45', ' MILCHREIS KUCHEN \n.\nEinfaches Milchreis Kuchen Rezept, inspiriert von dem traditionellen italienischen Osterkuchen Pastiera di riso napoletana: der knusprige Mrbeteig Boden wird mit einer Milchreis Ricotta Creme gefllt. Ideal fr den Osterbrunch, man kann ihn kalt aus dem Khlschrank oder gleich nach dem Backen lauwarm geniessen.\n.\nZutaten:\n200 g	Arborio Reis*\n500 ml	Milch\n1	Tonka Bohne* (oder eine Prise Vanille oder Zimt)\n500 g	Mehl\n5	Eier\n150 g	Zucker (2/3 fr den Teig, 1/3 fr die Fllung)\n50 g	brauner Zucker\n200 g	Butter, kalt\n400 g	Ricotta\n100 g	Sahne\n1 TL	Mandel Extrakt* (optional)\n1	Prise Zimt\nPuder Zucker zum Dekorieren\n.\nDu willst ihn sofort backen? Die Zubereitung findest du auf dem Blog!\n.\nDeine Laura\n#thecookingglobetrotter \n\nDir gefallen meine Rezepte und du willst mehr davon? Dann brauche ich deine Untersttzung!\n Like den Post, lass einen Kommentar da und teile ihn gerne\n Besuche meinen Blog, bewerte meine Rezepte, kommentiere sie und trage dich beim Newsletter ein\n Wenn du ber meine (Affiliate) Links einkaufst, erhalte ich eine kleine Provision (ohne zustzliche Kosten fr dich) - das hilft mir einen Teil der Kosten zu decken.\nDanke \n.\n#milchreiskuchen #pastieradiriso #osterkuchen #ostertorte #milchreis', 1679079166, '{\"city_name\":\"Graz\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/336345421_115583228143153_7737330715460818116_n.jpg', NULL, NULL, 'https://instagram.com/p/Cp5plyNM88g', 0, 0, '[\"#pastieradiriso\",\"#osterkuchen\",\"#ostertorte\",\"#milchreis\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
(708, 41, 3055595662201017973, NULL, 'CpnqBDGt1Z1', 9, 60, 207, 0, 0, 0, 0, 0, '1.95', ' Indische Rezepte \n.\nDu liebst die indische Kche?\n.\nIch auch. Deswegen findest du authentische Rezepte aus Indien  auf meinem Blog, die man ganz leicht zu Hause zubereiten kann.\n.\n1 Butter Chicken - das beste Rezept\n2 Kokos Tomaten  Suppe - vegan\n3 Naan - Muss sein!\n4 Spinat Curry \n5 Goldene Milch  \n6 Kichererbsen Curry - super schnell\n7 Jeera - Kreuzkmmel Butterkekse\n8 Kheer - veganer Milchreis\nWas kochst du als erstes?\n.\n Gutes Essen, das gut tut \nMeine Rezepte enthalten Kalorien- und Nhrstoffenangaben. Und in jedem Beitrag stelle ich dir ein Super Food vor. Im letzten Beitrag erfhrst du die guten Eigenschaften von Joghurt. \n.\nDeine Laura\n#thecookingglobetrotter \n\nDir gefallen meine Rezepte und du willst mehr davon? Dann brauche ich deine Untersttzung!\n Like den Post, lass einen Kommentar da und teile ihn gerne\n Besuche meinen Blog, bewerte meine Rezepte, kommentiere sie und trage dich beim Newsletter ein\n Wenn du ber meine (Affiliate) Links einkaufst, erhalte ich eine kleine Provision (ohne zustzliche Kosten fr dich) - das hilft mir einen Teil der Kosten zu decken.\nDanke \n.\n#indischessen #indisch #indischekche #rezepte #einfacherezepte #butterchicken #curry #naan #indischesbrot #kheer #jeera #goldenemilch', 1678475460, '{\"city_name\":\"Graz Ruckerlberg\",\"country_code\":\"AT\",\"country_name\":\"austria\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/335524575_238119875231298_1214175204759158463_n.jpg', NULL, NULL, 'https://instagram.com/p/CpnqBDGt1Z1', 0, 0, '[\"#indisch\",\"#indischek\\u00fcche\",\"#rezepte\",\"#einfacherezepte\",\"#butterchicken\",\"#curry\",\"#naan\",\"#indischesbrot\",\"#kheer\",\"#jeera\",\"#goldenemilch\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
(709, 41, 3051971431072023758, NULL, 'Cpax9i1sETO', 21, 67, 0, 0, 0, 0, 0, 0, '2.49', ' NAAN  \n.\nWas darf zum Curry  auf keinen Fall fehlen? Das indische Fladenbrot Naan!\n.\nDas Rezept ist auf meinem Blog beschrieben, wo du natrlich auch die passenden Curries dazu findest.\n.\n Gutes Essen, das gut tut \nMeine Rezepte enthalten Kalorien- und Nhrstoffenangaben. Und in jedem Beitrag stelle ich dir ein Super Food vor. Hier erfhrst du die guten Eigenschaften von Joghurt. \n.\nDeine Laura\n#thecookingglobetrotter \n\nDir gefallen meine Rezepte und du willst mehr davon? Dann brauche ich deine Untersttzung!\n Like den Post, lass einen Kommentar da und teile ihn gerne\n Besuche meinen Blog, bewerte meine Rezepte, kommentiere sie und trage dich beim Newsletter ein\n Wenn du ber meine (Affiliate) Links einkaufst, erhalte ich eine kleine Provision (ohne zustzliche Kosten fr dich) - das hilft mir einen Teil der Kosten zu decken.\nDanke \n\n#naan #naanbrot #fladenbrot #indischefladenbrot #indischkochen #indischekche #pfannenbrot #einfacherezepte #einfachekche #joghurtbrot #brot', 1678043367, '{\"city_name\":\"Graz Ruckerlberg\",\"country_code\":\"AT\",\"country_name\":\"austria\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/331362063_224810383372971_3019357014873736549_n.jpg', NULL, NULL, 'https://instagram.com/p/Cpax9i1sETO', 0, 0, '[\"#naanbrot\",\"#fladenbrot\",\"#indischefladenbrot\",\"#indischkochen\",\"#indischek\\u00fcche\",\"#pfannenbrot\",\"#einfacherezepte\",\"#einfachek\\u00fcche\",\"#joghurtbrot\",\"#brot\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
