(711, 41, 2630844353430746672, NULL, 'CSCowAplPYw', 16, 72, 424, 0, 0, 0, 0, 0, '2.49', '#LIVEAUSDERKCHE mit @coppenrathundwiese und GEWINNSPIEL \n.\n.Werbung.\n.\nEine wunderschne personalisierte Torte in 30 Minuten zaubern? Geht das??! Oh ja, es ist sogar einfach und lustig! Wir 4 Mdels von #liveausderkche haben 4 Naked Cakes gemacht. Und wir mchten dir auch die Mglichkeit geben, so was cooles zu zaubern.  wie? Mit einem Gewinnspiel! \n.\nGewinne ein berraschungs-Paket von @coppenrath und gestalte damit deine eigene Torte (oder du geniet sie einfach so ). Die Teilnahme ist super einfach und du kannst alles in meinem letzten Post lesen!\n.\nDie Aufnahme des gesamten Live findest du bei Belma @ahalnisweethome \n.\nTIPP: erhhe deine Gewinnchancen in dem du bei allen 4 kommentierst!\n.\n@evelynimtortenland \n@zimtliebe_de \n#coppenrathundwiese #gewinnspiel', 1627841282, '[]', 'VIDEO', 'images/content/posts/230702214_119773963709418_7346157792759162571_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_130358902617427_7330085765217258559_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=107&_nc_ohc=DCN7jAQ4hWAAX_cPAHt&edm=AOQ1c0wBAAAA&vs=17917335187870597_526767014&_nc_vs=HBksFQAYJEdJQ1dtQUJUZFJXTWozWUFBRDhNN01BcXNybGxidlZCQUFBRhUAAsgBABUAGCRHRHVZdlEyVnlwaUlDV3NBQUU3c0NucFFxSFY3YnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbChbKymoi8PxUCKAJDMywXQHvt2yLQ5WAYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=c22e51bf26&ccb=7-5&oh=00_AfBfyKs4WynWJXi3XKcgIBInceHAuAd31auEY2iHszaU1w&oe=6452B9AD&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CSCowAplPYw', 0, 0, '[\"#liveausderk\\u00dcche\",\"#liveausderk\\u00fcche\",\"#coppenrathundwiese\",\"#gewinnspiel\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
(712, 41, 2614173219725529137, NULL, 'CRHaLFfFFAx', 6, 57, 255, 0, 0, 0, 0, 0, '1.78', 'Wir haben gestern Hummus gemacht. 2 davon, also Hummusse??? Was ist denn bitte der Plural von Hummus?!? \n.\nEgal. Beide waren super lecker! Und wie immer haben wir eine Menge Spa dabei gehabt. Insbesondere Evelyn @evelynimtortenland am Strand  in Frankreich  \n.\nWie immer sind unsere Rezepte erstaunlich einfach und unkompliziert uns sogar ein wenig planlos \n.\nJeden Donnerstag um 19 Uhr sind wir vier\nBelma @ahalnisweethome \nEvelyn @evelynimtortenland \nMona @zimtliebe_de\nUnd ich, Laura, @thecookingglobetrotter live nach dem Motto:\n#liveausderkche \n4 Mdels\n4 Kchen\n1 Rezept\nWird es einfach gekocht oder gebacken und natrlich viel getratscht \n.\nSchaue gerne nchste Woche vorbei! Wir freuen uns!\n.\nbrigens, alle Aufnahmen, Rezepte und Abschnitte findest du auf unseren Profilen unter IGTV und bei mir in den Guides  \n.\n#hummus  #liveausderkche #thecookingglobetrotter #einfacherezepte #sommerrezepte #kichererbsen', 1625853997, '[]', 'VIDEO', 'images/content/posts/213682243_531347541630542_8835068668297513475_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_1186634451799507_8846556957803340235_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=107&_nc_ohc=8_W5pVuPoOAAX-v79dW&edm=AOQ1c0wBAAAA&vs=17890004663321393_2614596728&_nc_vs=HBksFQAYJEdJQ1dtQURUVGZyY1BEY0VBTXZoSUp1dVNNVjZidlZCQUFBRhUAAsgBABUAGCRHTXo0d3d6RGs4Rk1tOG9PQUVjTlRFaDEzM0FqYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbw3YXLh9rqQBUCKAJDMywXQHcl2yLQ5WAYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=c22e5c52d4&ccb=7-5&oh=00_AfBbf4XqD-8AgDVpuAxs7oplq7FI2FeIMElRgrv4G1PuOA&oe=64525D87&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CRHaLFfFFAx', 0, 0, '[\"#liveausderk\\u00fcche\",\"#thecookingglobetrotter\",\"#einfacherezepte\",\"#sommerrezepte\",\"#kichererbsen\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
(713, 41, 2609096463633239875, NULL, 'CQ1X2j7lk9D', 2, 47, 208, 0, 0, 0, 0, 0, '1.39', 'Wir haben gestern leckere Cronuts gebacken! Bltterteig Donuts  im Backofen gebacken und dann ordentlich dekoriert!\n(Werbung) bis nchste Woche kannst du eine Box voller Streuseln von @super_streusel bei uns gewinnen!\nSo geht es:\n folge uns 4 (@thecookingglobetrotter ,  @ahalnisweethome @evelynimtortenland ,  @zimtliebe_de ) und @super_streusel \n poste ein Bild in deinem Feed oder Stories mit deinem schnsten Backwerk mit Streuseln\n verlinke uns und verwende #liveausderkche\n Du kannst mehrmals teilnehmen, fr jedes Bild landet ein Los  im Topf!\n Gerne kannst du deine Freunde zum Gewinnspiel einladen, sie markieren, das Bild in deinen Stories teilen oder weiterleiten - wir freuen uns auf deine Untersttzung!\n Wenn du kein ffentliches Profil hast, schick uns bitte das Bild per DM, wir stellen es in unsere Stories und so bist du auch dabei!\n\nDas Gewinnspiel luft bis einschlielich Mittwoch 7. Juli 18:55 Uhr.\nTeilnehmen drfen alle ab 18 Jahren und mit Wohnsitz in sterreich und Deutschland.\nDer Gewinner/in wird live am 8. Juli gezogen und in der Story und per Instagram Nachricht bekanntgeben.\nDas Gewinnspiel steht in keiner Verbindung mit Instagram und wird nicht von Instagram untersttzt, organisiert oder gesponsert\n#cronuts #gewinnspiel #liveausderkche #superstreusel #streusel #streuselliebe', 1625249138, '[]', 'VIDEO', 'images/content/posts/210568208_341260340966503_5980299531452625551_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_315769033522663_6297924856592565704_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjUwNi5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=107&_nc_ohc=0htaxufpHnQAX8H7Pzo&edm=AOQ1c0wBAAAA&vs=18016560169311955_248977629&_nc_vs=HBksFQAYJEdJQ1dtQURuLVJLMU1COEJBTWlGVFF0S3VXWlhidlZCQUFBRhUAAsgBABUAGCRHR0Q3cVF4dGhQR2FtVjREQUZ2Ymp0WUQ2UGxTYnZWQkFBQU