(736, 42, 2826601292810671086, NULL, 'Cc6GuZbo9Pu', 19, 101, 258, 0, 0, 0, 0, 0, '1.02', 'Werbung/ Heute ging Flammkuchen auf den Kamado von @pitbossgrills\n\nIch habe 3 verschiedene Geschmacksrichtungen gemacht. \n\n Lachs mit Lauchzwiebeln \n Tomate mit Basilikum\n Bacon mit Lauchzwiebeln \n\nDen Schmand habe ich mit Salz, Pfeffer und Knoblauch gewrzt.\n\nDer Fertigteig wurde 3 Minuten mit Backpapier angegrillt und dann habe ich das Papier entfernt. So backt der Teig nicht auf dem Pizzastein fest.\n\n#pitbossnation\n#pitbossdeutschland\n#pitbossgrills\n#pitbosseurope \n#bbq \n#bbqlove\n#bbqtime \n#pizzastein \n\n@pitbossgrillsde \n@hoevelgrillerbbq \n@kleine_rezeptideen \n@il_mine \n@beef.and.booze \n@barbecue_marq \n@blackgoldsmokehouse', 1651177237, '{\"city_name\":\"Spellen\",\"region_name\":\" Nordrhein-Westfalen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/279246884_519400336260252_4454558220387763129_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_522143716248037_3950565277622802297_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=101&_nc_ohc=WamdRedWXXEAX8hS31I&edm=AOQ1c0wBAAAA&vs=1377822133045326_925012753&_nc_vs=HBksFQAYJEdJQ1dtQURsaWJvTzQ5b0JBSGtYczJJd090TTJidlZCQUFBRhUAAsgBABUAGCRHTzUtcEJDU3FmUEtYX2dCQUxGajNZTWk2T3N2YnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbS2e6H87nOPxUCKAJDMywXQGdWZmZmZmYYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=3312204535&ccb=7-5&oh=00_AfCPdvEAzDbU_AvSRzG3EE5cKEoKk1OtaPXIoJasikTeCQ&oe=6452E09D&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/Cc6GuZbo9Pu', 0, 0, '[\"#bbq\",\"#bbqlove\\n#bbqtime\",\"#pizzastein\"]', 'post', 'profile_scrape', 0, 1683024442, 1683024442),
(737, 42, 2808930693263021727, NULL, 'Cb7U5VKolaf', 12, 107, 312, 0, 0, 0, 0, 0, '1.01', '@waldmann.adventures hat die Tage ne geile Currywurst gemacht. \nDs ich noch einige Bratwrste brig hatte, gab es dann bei mir, heute auch eine gegrillte Wurst und die habe ich dann mit Currysoe verfeinert.\n\nAls Beilage Twisted Potatoes und frischen Kopfsalat.\n\nWer sie nun erfunden hat, wird man kaum wirklich herausfinden.  Die Currywurst im Westen, aussem Pott oder die Currywurst aus Berlin. \n\nHauptsache et schmeckt. \n\nKommt gut in die Woche. \n\n#currywurst #Grill #bbqlovers #bbq #grillen #Wurst #dieechtecurrywurst #pott #Ruhrgebiet #Berlin', 1649070731, '{\"city_name\":\"Spellen\",\"region_name\":\" Nordrhein-Westfalen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/277856958_4950675465049645_4004259601692667173_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_302535445334672_1182383613137934516_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=108&_nc_ohc=7WXpY-Q3Ji4AX-W-7XW&edm=AOQ1c0wBAAAA&vs=712471560112701_278560207&_nc_vs=HBksFQAYJEdJQ1dtQUNRU3NDRkp4TUJBTFJZVkxHaHEyZ1FidlZCQUFBRhUAAsgBABUAGCRHSDBUa1JCZDZHUm80YjhFQURQUUJYVlVRdXhmYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbowbCQ6czlPxUCKAJDMywXQGVrtkWhysEYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=33122ddda5&ccb=7-5&oh=00_AfAipHTsh-kFI34VxyYflr0rAJSIlda1GLgntL4quNmP4A&oe=6452D8EF&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/Cb7U5VKolaf', 0, 0, '[\"#currywurst\",\"#grill\",\"#bbqlovers\",\"#bbq\",\"#grillen\",\"#wurst\",\"#dieechtecurrywurst\",\"#pott\",\"#ruhrgebiet\",\"#berlin\"]', 'post', 'profile_scrape', 0, 1683024442, 1683024442),
(738, 42, 2808343970095203636, NULL, 'Cb5PfYoooU0', 10, 89, 177, 0, 0, 0, 0, 0, '0.84', 'werbung /// Auf geht\'s, in den @pitbossgrillsde PB \n24K Kamado.\nDas gewrzte Hhnchen ging mit dem Hhnchenhalter fr 1,5 Stunden bei 160 Grad in den Grill.\nIn den letzten 30 Minuten gesellten sich noch Fcherkartoffeln und Grillgemse hinzu. \nAuf dem Kamado von Pitboss kann man ein ganzes Men hinbekommen.\nDie gleichbleibende Hitze ermglicht schonend zu garen. \nWie man sieht, ist vieles mglich. \n\nBig - Bigger - Heavier\n\n#pitbosseurope\n#pitbossdeutschland #pitboss #grill #bbqlovers #bbq #bbqfreunde #bbqtime #bbqszene #kamado #OutsideBBQ #grillseminare #grillenmitfreunde #grillen', 1649000832, '{\"city_name\":\"Spellen\",\"region_name\":\" Nordrhein-Westfalen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/277904668_374078947910010_7503617836210986990_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_551003676445077_3642128489182109141_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=109&_nc_ohc=VDHrxbz61-MAX9zw4Bp&edm=AOQ1c0wBAAAA&vs=1414742768984860_2940423948&_nc_vs=HBksFQAYJEdJQ1dtQUNWaVdlS0l2VUJBTldkQjJpUWNJc3lidlZCQUFBRhUAAsgBABUAGCRHTWJ1aXhDOUNzN2FOV0VEQUF0RG9KOXUyX2NIYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbkyqnLytzbPxUCKAJDMywXQGSSHKwIMScYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=331228b4e0&ccb=7-5&oh=00_AfDgUh_eZDHaCQRF9O6cbagEeH_yS21pVy2ibesKFMXJKg&oe=6452BE82&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/Cb5PfYoooU0', 0, 0, '[\"#pitboss\",\"#grill\",\"#bbqlovers\",\"#bbq\",\"#bbqfreunde\",\"#bbqtime\",\"#bbqszene\",\"#kamado\",\"#outsidebbq\",\"#grillseminare\",\"#grillenmitfreunde\",\"#grillen\"]', 'post', 'profile_scrape', 0, 1683024442, 1683024442),
