(762, 44, 3090406430700918053, NULL, 'CrjVEZpgtUl', 135, -1, 264, 0, 0, 0, 0, 0, '0.85', 'Falsche Freunde hatte ich viele\n\nIch habe falschen Menschen vertraut und leider die falschen zu meinen Freunden gezhlt. Ich denke ich bin da nicht allein mit das gute daran ist aber, dass wir alle dadurch strker werden knnen\n\nIch bin strker geworden und stehe zu allem was ich mache und bin stolz drauf wer ich bin!\n\nJa ich wurde gemobbt, geghostet, es wurden Lgen erzhlt und auch Geheimnisse, aber ich konnte mich von allen Menschen entfernen!\n\nIch binde mich nicht an Personen und mache mein Glck nicht von anderen abhngig, denn ich kann auch gut allein sein und brauche das sogar! Ich liebe mich selbst und bin lieber allein, als mit falschen Menschen zu sein. \n\nEs sollten viel Menschen reflektieren mit wem sie ihre Zeit verbringen bzw. mit wem sie befreundet sind und warum. Es gibt viele Toxische Freundschaften, die nur existieren aus Gewohnheit.\n\nIch habe mit der Sache abgeschlossen, mit den Menschen, mit dem Mobbing und all dem! Was allerdings sehr spannend ist, ist das ich immer noch interessant fr die Personen bin, denn sonst wssten sie nicht alles was ich poste und von mir preis gebe\n\nMir ist egal wer lstert, mir ist egal was ihr tut. Ich lebe mein Leben und bin stolz auf meinem Weg, denn die Steine haben mich nach ganz oben gebracht, ich habe nmlich Berge daraus gebaut und kann nun endlich frei fliegen ohne auf die Meinung anderer Wert zulegen!\n\n#mobbing #falschefreunde #freischwimmen #freiheitsgefhl #freifhlen #mentalegesundheit #traurigkeit #gesellschaftskritik #heilen #selbstliebe #berserkergang #berserkerfit #berserkerlifestyle #krperbild #selbstheilung #deutschpop #traurigeslied #emotionenfhlen #schulzeit #toxischebeziehungen #toxischefreunde #toxischefreundschaft', 1682625336, '{\"city_name\":\"Dortmund\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/343288587_959026585251585_7644641416051558253_n.jpg', NULL, NULL, 'https://instagram.com/p/CrjVEZpgtUl', 0, 0, '[\"#falschefreunde\",\"#freischwimmen\",\"#freiheitsgef\\u00fchl\",\"#freif\\u00fchlen\",\"#mentalegesundheit\",\"#traurigkeit\",\"#gesellschaftskritik\",\"#heilen\",\"#selbstliebe\",\"#berserkergang\",\"#berserkerfit\",\"#berserkerlifestyle\",\"#k\\u00f6rperbild\",\"#selbstheilung\",\"#deutschpop\",\"#traurigeslied\",\"#emotionenf\\u00fchlen\",\"#schulzeit\",\"#toxischebeziehungen\",\"#toxischefreunde\",\"#toxischefreundschaft\"]', 'post', 'profile_scrape', 0, 1683024459, 1683024459),
(763, 44, 3089575933715293202, NULL, 'CrgYPFDsiQS', 134, -1, 0, 0, 0, 0, 0, 0, '0.84', 'Immer unterwegs zu sein ist fr mich mega wertvoll!\n\nIch bin viel privat und beruflich unterwegs. Egal ob zur Fortbildung, TV Projekten, Schulungen die ich fr die Verbraucher Checker gebe oder meine Ehrenmter\n\nIch brauch aber immer den passenden Rucksack fr meine Reisen, er muss zu allen Outfits passen und zur Zeit am besten Wasserabweisend sein, denn der April macht was er will\n\nMein neuer Begleiter ist dieser tolle Rucksack von @newrebelsbags ich fdie Farbe soo schn, die Verarbeitung ist gut und er ist stylisch, wasserabweisend und man hat ein Laptop-Fach und eine Polsterung am Rcken und den Schultern\n\nSeid ihr gern unterwegs fr Kurztrips oder ist euch das eher zu stressig?\n\n#ad #unbezahltewerbung #outfitinspo #berserkergang #berserker #berserkerlifestyle #girl #blond #selbstliebe #mindset #glcksgefhle #glcklich #unterwegs #frhlingsgefhle #liebe #outfitliebe #empowerment #womanempowerment #feminismus #dowhatyoulove #dowhatyouwant #doit #rucksack #regenfest #altrosa #wasserabweisend', 1682526173, '{\"city_name\":\"D\\u00f6rverden\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/343416866_6892714724089440_7113126733513119557_n.jpg', NULL, NULL, 'https://instagram.com/p/CrgYPFDsiQS', 0, 0, '[\"#unbezahltewerbung\",\"#outfitinspo\",\"#berserkergang\",\"#berserker\",\"#berserkerlifestyle\",\"#girl\",\"#blond\",\"#selbstliebe\",\"#mindset\",\"#gl\\u00fccksgef\\u00fchle\",\"#gl\\u00fccklich\",\"#unterwegs\",\"#fr\\u00fchlingsgef\\u00fchle\",\"#liebe\",\"#outfitliebe\",\"#empowerment\",\"#womanempowerment\",\"#feminismus\",\"#dowhatyoulove\",\"#dowhatyouwant\",\"#doit\",\"#rucksack\",\"#regenfest\",\"#altrosa\",\"#wasserabweisend\"]', 'post', 'profile_scrape', 0, 1683024459, 1683024459),
(764, 44, 3087430036009079686, NULL, 'CrYwUKFMVOG', 58, 126, 0, 0, 0, 0, 0, 0, '1.16', 'Lebt im Moment\n\nIch bin zur Zeit so viel unterwegs und war dieses Jahr auch schon fter in Berlin\n\nEs ist irgendwie krass, denn alles ist wie vor der Pandemie, ich bin wieder nur unterwegs und kaum zuhause. Das ist ungewohnt, aber sehr schn\n\nIch geniee zur Zeit mein Leben und ich bin ehrlich die Uni kommt zur Zeit ein bisschen kurz, ich msste 2 Hausarbeiten schreiben, aber dafr hab ich zur Zeit keinen Kopf.\n\nIch bin jetzt im 6. Semeund habe vor nchstes Jahr fertig zu sein, was ich auch schaffe! Ich hab schon die Themen fr die 2 Hausarbeiten und auch schon fr meine Bachelorarbeit, also mach ich mir keinen Kopf in der meisten Zeit\n\nEs sind viele Fortbildungen, Beziehung die ich gerne pflege, Ehrenmter, Nebenjobs, Instagram und Familie. \n\nDie Uni ist zur Zeit nicht mein Hauptfokus, sondern ich lebe wieder! Ich erlebe lieber Dinge und bilde mich weiter, als mich jetzt einzusperren und zu schreiben, aber ich wei, das ich das machen muss und das bis sptestens Oktober\n\nWas ich euch mit diesen Post sagen will, lebt im Moment und nicht nur in der Zukunft! Ich kenne das zu gut, ich bin oft gestresst, weil ich mir Stress mache.\n\nSchaut auf euch und macht euch nicht so viele Gedanken, was andere machen oder leisten! Konzentriert euch auf euch selbst und blickt auf euch\n\n#ad #unbezahltewerbung #outfitinspo #berlin #berserkergang #berserker #berserkerlifestyle #girl #sightseeing #berlintour #hoodiekleid #kniestrmpfe #sneaker #weissesneaker #blond #selbstliebe #mindset #glcksgefhle #glcklich #unterwegs #sonne #frhlingsgefhle #liebe #outfitliebe #empowerment #womanempowerment #feminismus #dowhatyoulove #dowhatyouwant #doit', 1682270362, '{\"city_name\":\"Berlin\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/342532438_751845093207680_3912050977157643637_n.jpg', NULL, NULL, 'https://instagram.com/p/CrYwUKFMVOG', 0,