(766, 44, 3083804896604189062, NULL, 'CrL4Db6s_GG', 60, -1, 0, 0, 0, 0, 0, 0, '0.37', 'Erste Moderationserfahrung\n\nIch war in Berlin und habe im BMUV @umweltministerium zusammen mit @lisa.rchmnn eine Podiumsdiskussion moderiert.\n\nDie Veranstaltung diente dem Auftakt fr ein ganz tolles Projekt der @verbraucherzentrale.bayern und @verbraucherzentrale.nrw.\n\nDas Projekt Verbraucherschutz in lndlichen Regionen fr junge Menschen.\n\nDa Lisa und ich uns ehrenamtlich engagieren und Verbraucherschutz sehr wichtig finden, moderierten wir die Veranstaltung!\n\nIch habe das erste mal moderiert und es war eine sehr coole Erfahrung und hat sehr viel Spa gemacht!\n\nIch bin mega dankbar fr diese tolle Erfahrung und habe einfach gemerkt, dass mir moderieren so viel Spa macht und ich das gern fter machen wrde!\n\nDas Feedback an uns beide war auch sehr positiv, was mich sehr glcklich macht und fr die Zukunft nur gutes heien kann\n\n#bmuv #verbraucherschutz #podiumsdiskussion #politik #verbraucherzentrale #berlin #business #moderation #moderatorin #umweltbewusst #bundesumweltministerium #staatssekretrin #jugendverbraucherdialog #umweltministerum #ehrenamt #moderation #lndlicheregion #verbnde #berserkerfit #berserkergang #berserkerlifestyle #stolzaufmich #tolleerfahrung', 1681838212, '{\"city_name\":\"Berlin\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/342364078_781563146555287_3732932998385038305_n.jpg', NULL, NULL, 'https://instagram.com/p/CrL4Db6s_GG', 0, 0, '[\"#verbraucherschutz\",\"#podiumsdiskussion\",\"#politik\",\"#verbraucherzentrale\",\"#berlin\",\"#business\",\"#moderation\",\"#moderatorin\",\"#umweltbewusst\",\"#bundesumweltministerium\",\"#staatssekret\\u00e4rin\",\"#jugendverbraucherdialog\",\"#umweltministerum\",\"#ehrenamt\",\"#moderation\",\"#l\\u00e4ndlicheregion\",\"#verb\\u00e4nde\",\"#berserkerfit\",\"#berserkergang\",\"#berserkerlifestyle\",\"#stolzaufmich\",\"#tolleerfahrung\"]', 'post',