(767, 44, 3083053626827047887, NULL, 'CrJNPBagYPP', 119, -1, 239, 0, 0, 0, 0, 0, '0.75', 'Ein neuer Track vom Herzen \n\nIch habe lange mein inneres Kind, meine innere Stimme und mein Bauchgefhl sehr lange unterdrckt\n\nHeute hr ich auf mich, hre auf meine Gefhle und vor allem mein Bauchgefhl, denn das hat mich noch nie getuscht, auch wenn ich es manchmal nicht hren bzw. Fhlen wollte\n\nDieser Song ist an euch alle gerichtet, denn wir alle haben Intuitionen und Gefhle und vor allem ein inneres Kind, das wichtigste ist darauf zuhren!\n\nEs ist mir egal was irgendwer sagt, ich lass mich nicht mehr beeinflussen oder manipulieren! Es ist noch nicht lang her, da hab ich eine Person kennengelernt, mein Bauchgefhl hat geschrien Lass es und lauf!, doch ich hab nicht drauf gehrt, ich hab mich anfangs manipulieren lassen. Doch dann setzte mein Verstand ein und ich konnte mich zum Glck schnell distanzieren!\n\nDurch diese Person hab ich wieder einmal viel ber mich selbst gelernt und hab vor allem nher zu mir selbst gefunden, da ich die ganzen Dinge mal distanziert betrachtet habe\n\nDadurch wurde ich offener und bin jetzt einfach ich und hr auf mein Gefhl, ich hab jemanden kennengelernt wo mein Bauchgefhl direkt positiv reagiert hat und die Energie, Interessen, Einstellungen und Werte einfach passen!\n\nIch bin froh, denn durch die Erfahrung ffne ich mich nun mehr, kommuniziere deutlich was ich will und was nicht. Spreche meine Gefhle frei raus ohne Angst zu haben! Und habe eine Person gefunden, wo zur Zeit einfach alles passt und die es entspannt und ohne Label angeht, genauso wie ich auch mchte\n\nDas Shirt ist von @soulcult_deutschland \n\n#ad #unbezahltewerbung #mentalegesundheit #traurigkeit #gesellschaftskritik #heilen #selbstliebe #berserkergang #berserkerfit #berserkerlifestyle #krperbild #selbstheilung #deutschpop #traurigeslied #emotionenfhlen', 1681748857, '{\"city_name\":\"Dortmund\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/341896579_639759017963829_4291845804103932368_n.jpg', NULL, NULL, 'https://instagram.com/p/CrJNPBagYPP', 0, 0, '[\"#ad\",\"#unbezahltewerbung\",\"#mentalegesundheit\",\"#traurigkeit\",\"#gesellschaftskritik\",\"#heilen\",\"#selbstliebe\",\"#berserkergang\",\"#berserkerfit\",\"#berserkerlifestyle\",\"#k\\u00f6rperbild\",\"#selbstheilung\",\"#deutschpop\",\"#traurigeslied\",\"#emotionenf\\u00fchlen\"]', 'post', 'profile_scrape', 0, 1683024459, 1683024459),
(768, 44, 3080186243102908616, NULL, 'Cq_BRGOMaDI', 66, -1, 0, 0, 0, 0, 0, 0, '0.41', 'Lieb deinen Krper in allen Positionen!\n\nSo viele Menschen auf Social Media suggerieren den perfekten Krper zu haben, obwohl es den berhaupt gar nicht gibt\n\nIch dachte mir damals immer, oh wow die Beine sind so dnn, der Po trotzdem schn und bei den meisten waren es die Posen, Fotoshop oder Schnheitsops\n\nIch musste erst durch eine ES durch um meinen Krper lieben zu lernen und heute lieb ich ihn! Ich liebe es dass er weich ist am Bauch und nicht mehr wie damals fest! Ich liebe meinen Krper so wie er jetzt ist\n\nDas wichtigste ist dass DU dich wohl fhlst! Egal was andere denken, sagen oder wie sie gucken \n\nKeine*r hat das Recht deinen Krper oder hnliches zu kommentieren und dennoch passiert es tagtglich ich mach die Leute darauf aufmerksam, dass es schlimme Folgen haben kann. Weil ich selbst betroffen war, aber die Strke habe darber zu sprechen und versuche die Menschen darber auf zu klren. Denn Foodcalling und co ist vielen Menschen nicht bewusst\n\nDiese nice Leggings ist von @prozisdeutschland und ich liebe die Farbe so sehr!\n\n#ad #unbezahltewerbung #prozis #prozisleggings #sportlegging #essstrung #essstrungsrecovery #essstrungskampf #essstrungbesiegen #zwangsgedanken #krperheilen #recovery #tness #selbstliebe #realitt #mehrrealittaufinstagram #krperbewusstsein #krperbild #krperliebe #recovery #bewusstsein #bewusstleben #bewusstzunehmen #berserkergang #berserkerfit #berserkerlifestyle', 1681406835, '{\"city_name\":\"Dortmund\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/340995784_192281820240163_3370169567331125954_n.jpg', NULL, NULL, 'https://instagram.com/p/Cq_BRGOMaDI', 0, 0, '[\"#unbezahltewerbung\",\"#prozis\",\"#prozisleggings\",\"#sportlegging\",\"#essst\\u00f6rung\",\"#essst\\u00f6rungsrecovery\",\"#essst\\u00f6rungskampf\",\"#essst\\u00f6rungbesiegen\",\"#zwangsgedanken\",\"#k\\u00f6rperheilen\",\"#recovery\",\"#\\ufb01tness\",\"#selbstliebe\",\"#realit\\u00e4t\",\"#mehrrealit\\u00e4taufinstagram\",\"#k\\u00f6rperbewusstsein\",\"#k\\u00f6rperbild\",\"#k\\u00f6rperliebe\",\"#recovery\",\"#bewusstsein\",\"#bewusstleben\",\"#bewusstzunehmen\",\"#berserkergang\",\"#berserkerfit\",\"#berserkerlifestyle\"]', 'post', 'profile_scrape', 0, 1683024459, 1683024459),
(769, 44, 3079459390852537640, NULL, 'Cq8cAAUAZ0o', 98, -1, 302, 0, 0, 0, 0, 0, '0.61', 'Ein neuer Track von mir\n\nIch denke wir alle kennen diese Lge alles gut oder mir gehts gut, es ist die Lge, die jede Person erzhlt\n\nIch sage es auch oft, einfach weil die Menschen nichts fr mich bedeuten, wie Nachbarn oder so. Genauso aber auch zu Menschen, die mir viel bedeuten, denn die mchte ich nicht belasten.\nZudem habe ich mir auch oft selbst etwas vorgemacht\n\nDurch diesen Song versuche ich einfach zeigen, wer ich eigentlich bin. Dass ich innerlich oft nicht glcklich bin, auch wenn ich so wirke. \n\nMenschen die mich kennen, wissen wenn es Fake Lachen ist und wann nicht, denn man sieht es mir an! Auerdem hab ich sehr viele esoterische Freunde, die auch meine Energie spren\n\nDas T-Shirt ist von @dailypride.de und die Rckseite ist echt schn designed mit Smile with me\n\n#ad #unbezahltewerbung #mentalegesundheit #traurigkeit #gesellschaftskritik #heilen #selbstliebe #berserkergang #berserkerfit #berserkerlifestyle #krperbild #selbstheilung #deutschpop #traurigeslied #emotionenfhlen', 1681320399, '{\"city_name\":\"Dortmund\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/340510226_890033755438323_5625322511046984310_n.jpg', NULL, NULL, 'https://instagram.com/p/Cq8cAAUAZ0o', 0, 0, '[\"#unbezahltewerbung\",\"#mentalegesundheit\",\"#traurigkeit\",\"#gesellschaftskritik\",\"#heilen\",\"#selbstliebe\",\"#berserkergang\",\"#berserkerfit\",\"#berserkerlifestyle\",\"#k\\u00f6rperbild\",\"#selbstheilung\",\"#deutschpop\",\"#traurigeslied\",\"#emotionenf\\u00fchlen\"]', 'post', 'profile_scrape', 0, 1683024459, 1683024459),
(770, 44, 3077979334175142269, NULL, 'Cq3LeWHgLF9', 134, 118, 927, 0, 0, 0, 0, 0, '1.59', 'Mein Berlin Outfit\n\nIch bin zur Zeit sehr viel in Berlin unterwegs, sowohl privat, als auch beruflich!\n\nIch liebe diese Stadt und das Wetter ist zur Zeit einfach herrlich, ich entdecke immer mehr und es macht mich sehr glcklich so viel unterwegs zu sein und vor allem das zu knnen!\n\nIch studiere, hab dieses Semester aber nur noch einen Tag Uni in prsent. Das ist natrlich super, denn dadurch kann ich auch in der Woche einfach durch die Welt Touren. Die Hausarbeiten schreiben sich zwar nicht von allein, aber mein Kopf hat dazu einfach zur Zeit keinen Kopf und das ist auch okay so! Denn ich lebe das erste mal nur fr mich! Tu genau das was mir gut tut und denke nicht nach!\n\nWas sagt ihr zu meinem heutigen Outfit?\n\n#ad #unbezahltewerbung #outfitinspo #berlin #berserkergang #berserker #berserkerlifestyle #girl #sightseeing #berlintour #hoodiekleid #kniestrmpfe #sneaker #weissesneaker #blond #selbstliebe #mindset #glcksgefhle #glcklich #unterwegs #sonne #frhlingsgefhle #liebe #outfitliebe #empowerment #womanempowerment #feminismus #dowhatyoulove #dowhatyouwant #doit', 1681144093, '{\"city_name\":\"Berlin\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/340678140_598521772313626_1038852260056165311_n.jpg', NULL, NULL, 'https://instagram.com/p/Cq3LeWHgLF9', 0, 0, '[\"#unbezahltewerbung\",\"#outfitinspo\",\"#berlin\",\"#berserkergang\",\"#berserker\",\"#berserkerlifestyle\",\"#girl\",\"#sightseeing\",\"#berlintour\",\"#hoodiekleid\",\"#kniestr\\u00fcmpfe\",\"#sneaker\",\"#weissesneaker\",\"#blond\",\"#selbstliebe\",\"#mindset\",\"#gl\\u00fccksgef\\u00fchle\",\"#gl\\u00fccklich\",\"#unterwegs\",\"#sonne\",\"#fr\\u00fchlingsgef\\u00fchle\",\"#liebe\",\"#outfitliebe\",\"#empowerment\",\"#womanempowerment\",\"#feminismus\",\"#dowhatyoulove\",\"#dowhatyouwant\",\"#doit\"]', 'post', 'profile_scrape', 0, 1683024459, 1683024459),
(771, 44, 3074394926716519471, NULL, 'CqqceWiM4Qv', 79, -1, 0, 0, 0, 0, 0, 0, '0.49', 'Die Sonne scheint, doch du musst nicht raus!\n\nEndlich wird das Wetter besser und alle unternehmen etwas. Alle gehen raus und man muss die Sonnenstrahlen ja genieen.\n\nNein. Das muss man nicht. Hier ein kleiner Reminder, egal welches Wetter ist, hr auf deinen Krper und nimm dir was du brauchst! Du musst dich nicht schlecht fhlen, wenn du einen Tag zuhause verbringst, du lange schlfst und nicht viel rausgehst.\n\nUns wird suggeriert, dass es falsch ist, nicht rauszugehen, wenn das Wetter so schn ist. Aber das ist es nicht! Es ist falsch, nicht auf seinen Krper zu hren!\n\nDas Foto ist nicht von heute, denn heute gehts mir nicht gut. Ich habe Gliederschmerzen und fhl mich einfach nur schlapp. Ich habe Heuschnupfen und habe zu spt angefangen meine Tabletten zu nehmen, da ich nicht wusste, dass wir schon April haben\n\nMorgen ist mein erster Uni Tag im 6. Semester. Ich habe die Hausarbeiten aus dem 5. Semester noch nicht geschrieben, komm gar nicht voran. Mein Kopf ist berfordert und ich hab das Gefhl, nichts mehr zu schaffen. Ich bin dauergestresst und brauch einfach mal Urlaub fr 2 Wochen, ohne ber irgendwas nachzudenken. Denn dann knnte ich auch wieder effektiver arbeiten und Leistung bringen aber dafr hab ich keine Zeit, denn ich hab die Semesterferien keine Zeit fr Urlaub gehabt und jetzt kann ich maximal ein paar Tage wegfahren ich bin berfordert, denn ich hab nur noch 2 Hausarbeiten und dann meine Bachelorarbeit. Ich hab dieses Semester nur ein Seminar. Es stresst mich, da ich meinen neuen Lebensabschnitt in einem Jahr schon sehen kann, aber bis dahin noch so viel zu tun ist. Es stresst mich alles\n\nDer Pulli ist von @clothing.joga und ultrabequem. Ob zuhause auf der Coach, drauen beim spazieren oder im Gym!\n\n#ad #unbezahltewerbung #mentalegesundheit #selbstliebe #berserkergang #berserkerlifestyle #park #berserkerfit #mental #psyche krperbewusstsein #sonne #erkenntnis #zuh