(775, 44, 2754077058031427702, NULL, 'CY4cn4YBCB2', 69, -1, 636, 0, 0, 0, 0, 0, '0.43', 'Nach einer langen Zeit mal wieder ein Track von mir.\n\nWie man sehr wahrscheinlich merkt verarbeite ich meine Lebensgeschichte in den Songs, ich finde grade dieser Track beschreibt meine letzten Jahre sehr gut.\n\nIch habe einen Weg hinter mir und in diesem Track merkt man wo er begann und wohin die Reise bisher ging.\n\nIch wrde zwar sagen, dass ich mit meiner toxischen Beziehung komplett abgeschlossen habe und sie gut verarbeitet habe, allerdings habe ich dennoch eine Bindungsangst und das Gefhl gar nicht mehr Lieben zu knnen.\n\nIch war in meinem Leben einmal wirklich verliebt, dabei ist mein Herz zerbrochen, es war nicht alles schlecht, aber die schlechten Seiten habe ich leider erst viel zu spt wahrgenommen.\n\nIch habe mich selbst in der Beziehung verloren und mein damaliger Partner hat mich nicht untersttzt, sondern klein geredet und mich dadurch mental sehr auseinander gerissen.\n\nIch war vor der Beziehung sehr selbstbewusst und musste daher erstmal schauen wie ich nach der Beziehung damit umgehe, dass mir mein Selbstbewusstsein bisschen geklaut wurde.\n\nIch habe mich viel mit Achtsamkeit besttigt und meditiert um zu mir selbst zu finden. Alles zu verarbeiten.\n\nIch bin gern Single keine Frage und bis ich eine Beziehung eingehe muss schon viel passieren. Ich bin 22 Jahre alt und wenn ich mit einer Person zusammen komme, dann muss das eine Person sein mit der ich mir eine Zukunft vorstellen kann, also Kinder und co.\n\nDenn wieso sollte man Beziehungen auf Zeit fhren, die nicht in die gleiche Richtung fhren, wo die Partner nicht die gleichen Ziele haben.\n\nIch wei was ich wert bin und suche mir daher gezielt Menschen aus mit denen ich Zeit verbringe. Ich umgebe mich nur mit Menschen die mir gut tun (auer es geht nicht anders) und genau das rate ich jedem!\n\nFree Beat by @samhubeats \n\n#song #girl #fashion #beauty #lifestyle #cover #music #musicvideo #holiday #travel #blog #blond #german #germany #summer #view #single #lgbt #bisexual #music #dortmund #love #musik #musikcover #musiccover #happy #life', 1642531767, '{\"city_name\":\"Dortmund\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/271995724_1286948861717611_9186824797855707176_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_403405034894710_7855247933192366991_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=110&_nc_ohc=mYZXigjB0UwAX_vpxlU&edm=AOQ1c0wBAAAA&vs=743553283279510_381863386&_nc_vs=HBksFQAYJEdJQ1dtQUIyTmM0TjVXNEJBSTlyalZoZ2NnTnRidlZCQUFBRhUAAsgBABUAGCRHUG1FTnhBcjMzWlFtVjBDQVBRLTJwMk1RWjh0YnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbAwM%2Bw0e%2FJPxUCKAJDMywXQGnzMzMzMzMYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=50b4f16966&ccb=7-5&oh=00_AfAiiFM03gHuKdzP9LteOSLJJZ7jmSM8u_tK2rocGEBp4Q&oe=6452A9C5&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CY4cn4YBCB2', 0, 0, '[\"#song\",\"#girl\",\"#fashion\",\"#beauty\",\"#lifestyle\",\"#cover\",\"#music\",\"#musicvideo\",\"#holiday\",\"#travel\",\"#blog\",\"#blond\",\"#german\",\"#germany\",\"#summer\",\"#view\",\"#single\",\"#lgbt\",\"#bisexual\",\"#music\",\"#dortmund\",\"#love\",\"#musik\",\"#musikcover\",\"#musiccover\",\"#happy\",\"#life\"]', 'post', 'profile_scrape', 0, 1683024459, 1683024459),
(776, 44, 2705416815571385923, NULL, 'CWLkkKFgD5D', 10, -1, 689, 0, 0, 0, 0, 0, '0.06', 'Heute mal ein neuer Song fr euch!\n\nDieser Song ist tatschlich whrend der Dreharbeiten fr das TV Projekt Stadt + Land = Liebe entstanden, weshalb ich den Song jetzt erst bei der Ausstrahlung poste\n\nFr mich war der Dreh sehr krass, wegen allen ueren Umstnden! Der Dreh war wie wir alle wissen zu Zeiten von C*rona, ich hatte die 6 Monate davor insgesamt 10 feste Kontaktpersonen, habe nichts unternehmen, habe mich 100%ig auf mein online Studium konzentriert und htte im Leben nicht damit gerechnet eine Anfrage in meinen Insta-dms zu finden\n\nIch hatte whrend des Drehs tglich nicht mehr als 4 Stunden Schlaf, weil ich nach den Dreharbeiten meine 1. Hausarbeit geschrieben habe, alle Seminare nachts nachgeholt habe, ich einfach nervs war was passiert und nicht schlafen konnte!\n\nIch hasse es Kontrolle abzugeben wie einige von euch bestimmt wissen aber bei einer Datingshow wie dieser war ich von einem Mann abhngig will er mich kennenlernen? Fahr ich morgen schon nachhause? Usw.\n\nIch wrde jederzeit wieder an so einem Format teilnehmen und nach dem Song ging es mir schon viel viel besser!\n\nP.s. das ich angefragt wurde hat ja schon etwas schicksalhaftes finde ich\n\nAber unruhig war ich trotzdem wie sonst NIE!\n\nAlso schau dir heute die erste Folge an um 21 Uhr bei SWR oder einfach in der ARD Mediathek\n\nFree Beat by @raspobeats \n\n#girl #fashion #beauty #lifestyle #cover #music #musicvideo #holiday #travel #blog #blond #german #germany #summer #view #single #lgbt #bisexual #music #dortmund #love #musik #musikcover #bersekergang #bersekerlifestyle #life #memories', 1636730972, '{\"city_name\":\"Dortmund\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/255830839_257050413150491_1381268048075899047_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_2945601492353351_2650105452930296641_n.mp4?efg=