(777, 44, 2653955324607954061, NULL, 'CTUvk51A3yN', 7, -1, 442, 0, 0, 0, 0, 0, '0.04', 'Dieser Track spiegelt mein heutiges ich zu 100% wieder!\n\nIch habe Anfang letzten Jahres begonnen mich mit Selbstliebe und Achtsamkeit zu beschftigen, habe viel gemacht um endlich in mich reinzuhren und mit allem abzuschlieen.\n\nIch bin ich und ich liebe mich! Ja ich bin stolz auf mich, auch auf meine Ecken und Kanten, denn die gehren genauso zu mir wie alle das Gute.\n\nIch fr mein Teil habe abgeschlossen mit allem was mir widerfahren ist, ich bin absolut im reinen mit mir selbst und das ist so unfassbar schn\n\nIch bin 22 und bin einfach froh schon so weit zu sein, die meisten Menschen beschftigen sich nicht mit sich selbst, sie knnen nicht frei leben, weil sie nicht frei sind, sie leben oft in der Vergangenheit, bemitleiden sich selbst oder versuchen zwanghaft sich anzupassen weil es einfacher ist.\n\nIch habe lange keinen Track mehr gepostet, diese positiven Vibes wollte ich euch aber kurz schicken\n\nFree Beat by @matthewmaymusic \n\n#girl #fashion #beauty #lifestyle #cover #music #musicvideo #holiday #travel #blog #blond #german #germany #summer #view #single #lgbt #bisexual #music #dortmund #love #musik #musikcover #musiccover #happy #life #memories', 1630596225, '{\"city_name\":\"Dortmund\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/241120209_111752964566320_5946126087863130153_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/10000000_2016449798520083_4278471907864964556_n.mp4?efg=eyJxZV9ncm91cHMiOiJbXCJpZ19wcm9ncmVzc2l2ZV91cmxnZW4ucHJvZHVjdF90eXBlLmlndHZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=111&_nc_ohc=gtaNOUMbsvgAX9bM7H-&edm=AOQ1c0wBAAAA&ccb=7-5&oh=00_AfBRtY6KXoahkP7HPD8SG8gFfKIuHwhNtaP7wOt-nsNyKA&oe=64527F81&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CTUvk51A3yN', 0, 0, '[\"#girl\",\"#fashion\",\"#beauty\",\"#lifestyle\",\"#cover\",\"#music\",\"#musicvideo\",\"#