(779, 44, 2590310068977828423, NULL, 'CPyoUifioJH', 16, -1, 570, 0, 0, 0, 0, 0, '0.09', 'Hey  Ich habe psychische Blockaden die bei mir ngste und Zwnge auslsen, mal prsenter, mal blasser.\nAber ich will es nicht, genau deshalb bin ich in Therapie\n\nYes ich bin in Psychotherapie und ja ich schreibe es hier, weil daran nichts schlimm, auergewhnlich oder sonstiges ist, nein es ist normal und ja ich bin jetzt schon sehr happy, denn ich geh dort ohne Erwartungen hin, ohne mir Druck zu machen, ohne mir ein Zeitpunkt als Ziel zusetzen\n\nIch gehe dort hin und bin offen, ich lasse mich zu 100% drauf ein, ich lasse mich einfach fallen und tada bisher klappt es super.\n\nWarum ich das hier erzhle? Weil ich zeigen will dass es nicht schlimm ist! Es ist absolut stark wenn man bemerkt dass man Hilfe braucht und sich diese holt!\n\nWenn du Hilfe brauchst dann habe den Mut und hol sie dir, egal was andere sagen, denken oder sonstiges!\n\nWenn du ein gebrochenes Bein hast gehst du doch auch zum Arzt oder? Also wenn du Probleme hast die seelisch oder psychisch sind, die man eben nicht sieht hol sie dir auch\n\nIch stehe dazu, ich gehe damit offen um, ich erzhle es dir, vielleicht kennen wir uns, vielleicht sind wir uns aber auch fremd, egal ob wir eine Verbindung haben oder nicht, ich hoffe dass ich dich erreichen kann.\n\nIch schreibe diese Texte und Tracks und habe den Podcast genau dafr, ich mchte Menschen erreichen, ich mchte Menschen zum Umdenken bewegen, ich mchte euch inspirieren und selbst wenn ich nur ein paar wenige Menschen damit erreichen kann habe ich mein Ziel erreicht, denn es wird eine #kettenreaktion geben, umso mehr Leute so denken und es weiter verbreiten\n\nSteh zu dir selbst, sei du selbst! Wenn du offen drber reden willst tu es, wenn du es nicht willst tu es nicht. Aber tu einfach was fr dich richtig und wichtig ist!\n\nBeat by @beatzbyop \n\n#newcomer #singersongwriter #deutschrap #deutschpop #songwriter #sing #singer #musik #music #dortmund #girl #diagnosekrebs #homerecording #singing #songs #deutsch', 1623009113, '{\"city_name\":\"Dortmund\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/197448979_313139410304061_5248115898922148549_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_323516616084037_6396431211348528258_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=101&_nc_ohc=ZfiAopdntHgAX_jPoLt&edm=AOQ1c0wBAAAA&vs=18114866974220366_2096565662&_nc_vs=HBksFQAYJEdJQ1dtQUJGQ3Z1VVBDWUJBSUtNcGdaTXNNUllidlZCQUFBRhUAAsgBABUAGCRHQjJUMlF2Tjk4QkhweGNCQURKbGdIaWo2MUJwYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACa2vKqT0q69PxUCKAJDMywXQGWyHKwIMScYEmRhc2hfYmFzZWxpbmVfMl92MREAdewHAA%3D%3D&_nc_rid=50b4f2cc81&ccb=7-5&oh=00_AfC7_Hp_PVFyRjLmvUxaSNSTdrGzJcRDET8BkTOve1LFsg&oe=6452D0CD&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CPyoUifioJH', 0, 0, '[\"#kettenreaktion\",\"#newcomer\",\"#singersongwriter\",\"#deutschrap\",\"#deutschpop\",\"#songwriter\",\"#sing\",\"#singer\",\"#musik\",\"#music\",\"#dortmund\",\"#girl\",\"#diagnosekrebs\",\"#homerecording\",\"#singing\",\"#songs\",\"#deutsch\"]', 'post', 'profile_scrape', 0, 1683024459, 1683024459),
(780, 44, 2580079296337480111, NULL, 'CPOSHM-iQmv', 20, -1, 400, 0, 0, 0, 0, 0, '0.12', 'Hey passend zu meinem Podcast heute mal ein Song wo es um Selbstliebe und Body Positivity geht!\n\nNimm dir die Worte zu Herzen und verinnerlich sie! Wenn du mal sad bist und von Selbstzweifeln geplagt bist, speichere dir den Track und hr ihn an\n\nDu bist perfekt! Du bist wunderschn! Du kannst alles schaffen! Du bist ein wunderbarer Mensch! Dein Krper ist dein Lebensort, also behandle ihn auch so, liebe ihn, liebe deine Seele, liebe dich!\n\nEine toxische Beziehung mit sich selbst zu fhren ist das schlimmste was geht, denn vor dir selbst kannst du nicht fliehen, du hast dich 24/7 um dich rum, also hr auf dich selbst zu bekmpfen!\n\nBeat by @matthewmaymusic \n\n#newcomer #singersongwriter #deutschrap #deutschpop #songwriter #sing #singer #musik #music #dortmund #girl #diagnosekrebs #homerecording #singing #songs #deutsch', 1621789515, '{\"city_name\":\"Dortmund\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/189819740_250823030153766_8896690412863761834_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_912638436245030_3131725609220111157_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=102&_nc_ohc=MUlAS1Bxl3kAX8mQCmf&edm=AOQ1c0wBAAAA&vs=18156917788145603_1959040811&_nc_vs=HBksFQAYJEdJQ1dtQUFtLXN3eENqNERBRFg3amxmWkgzWXJidlZCQUFBRhUAAsgBABUAGCRHQTVmSnd2TzN5bzhPSndBQUNVcmRSbnpnSkZaYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACacnoiT9urFPxUCKAJDMywXQGUxDlYEGJMYEmRhc2hfYmFzZWxpbmVfM192MREAdewHAA%3D%3D&_nc_rid=50b4fb6363&ccb=7-5&oh=00_AfBhKBqB9NvKizHNOrWuqZP10300eX_iwB-zfIqQLNdzZQ&oe=64529592&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CPOSHM-iQmv', 0, 0, '[\"#newcomer\",\"#singersongwriter\",\"#deutschrap\",\"#deutschpop\",\"#songwriter\",\"#sing\",\"#singer\"