(781, 44, 2575031980727596701, NULL, 'CO8WfGAifad', 10, -1, 534, 0, 0, 0, 0, 0, '0.06', 'Mal wieder ein neuer Track von mir, warst du schon mal in einer toxischen Beziehung?\n\nEgal ob Liebe, Freundschaft, Familie oder mit dir selbst?\n\nToxische Beziehungen sind das schlimmste was es gibt.\n\nVor allem wenn man eine toxische Beziehung mit sich selbst hat, sollte man einen Psychotherapeut aufsuchen, da man von sich selbst 24/7 umgeben ist...\n\nToxische Beziehung mit anderen Personen muss man erstmal erkennen... das dauert meist lang, aber wenn man es erkannt hat, sollte man auch da schnell das weite suchen um wieder glcklich zu werden!\n\nBeat by @raspobeats \n\n#newcomer #singersongwriter #deutschrap #deutschpop #songwriter #sing #singer #musik #music #dortmund #girl #diagnosekrebs #homerecording #singing #songs #deutsch', 1621187838, '{\"city_name\":\"Dortmund\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/186275080_637603167638015_7417055316139984364_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_175302977834755_7570229710494767729_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=107&_nc_ohc=HLBGYREsLlcAX88corp&edm=AOQ1c0wBAAAA&vs=17905502356825289_3864185516&_nc_vs=HBksFQAYJEdJQ1dtQUFEejdqbmI1OEFBSEVhSmhyUTJ3NXBidlZCQUFBRhUAAsgBABUAGCRHS3hIQmd2X0toX1lPaFVCQUJ0emlsSmFaN0JUYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACaSn975sL3OPxUCKAJDMywXQGbQAAAAAAAYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=50b4f63c3e&ccb=7-5&oh=00_AfBs3QvPW_DClIIdeWhkXWfapHv9reydSovRqKxHubJTXQ&oe=645241B9&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CO8WfGAifad', 0, 0, '[\"#newcomer\",\"#singersongwriter\",\"#deutschrap\",\"#deutschpop\",\"#songwriter\",\"#sing\",\"#singer\",\"#musik\",\"#music\",\"#dortmund\",\"#girl\",\"#diagnosekrebs\",\"#homerecording\",\"