(785, 44, 2538120404259066662, NULL, 'CM5Nw9lCFMm', 24, -1, 878, 0, 0, 0, 0, 0, '0.15', 'Huhu mal wieder nen neuer Track von mir, wie immer gern Konstrukt Kritik oder Meinung in die Kommis\n\nBisschen deeper Shit, einfach so just vor fun bei nem Waldspaziergang ist der Text entstanden, bis auf den Schluss haha, da war der Beat doch noch ein wenig lnger\n\nBut Im not perfect und das muss man auch nicht sein!\n\nSolang du Spa hast an dem was du tust und es keinem wehtut go for it!\n\nHoffe ich konnte dir paar positive vibes fr deinen day schicken, trotz der teilweise deepen Themen\n\nHave a nice day\n\nFree Beat auf YouTube by @buddha_vybez \n\n#newcomer #singersongwriter #deutschrap #deutschpop #songwriter #sing #singer #musik #music #dortmund #girl #diagnosekrebs #homerecording #singing #songs #deutsch', 1616787690, '{\"city_name\":\"Dortmund\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/164439677_752394982337679_8710277964839967528_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_355402149117980_244452514051239436_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=108&_nc_ohc=JGiL2GI2SHQAX-HlyqL&edm=AOQ1c0wBAAAA&vs=17931895186506255_1431232808&_nc_vs=HBksFQAYJEdJQ1dtQUFjd05tQ1BFTUJBQXl1ZVRCRWVHUURidlZCQUFBRhUAAsgBABUAGCRHSm92NlFtbjJiazlmcmtCQUQ3TVNMbG5aN0o4YnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACae%2Bumy0L3aPxUCKAJDMywXQGKVT987ZFoYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=50b4f0a93d&ccb=7-5&oh=00_AfDikSALIsObBJpY3hVs3a9Q3YYupFyK76RQN8XV8Ei1ug&oe=6452B96B&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CM5Nw9lCFMm', 0, 0, '[\"#newcomer\",\"#singersongwriter\",\"#deutschrap\",\"#deutschpop\",\"#songwriter\",\"#sing\",\"#singer\",\"#musik\",\"#music\",\"#dortmund\",\"#girl\",\"#diagnosekrebs\",\"#homerecording\",\"#singing\",\"#songs\