(786, 45, 3082806569540639991, NULL, 'CrIVD3Ytdz3', 0, 62, 0, 0, 0, 0, 0, 0, '1.43', ' Was fr ein Saisonstart! \n\nWir sind wieder daheim... von einem Saisonstart, der es in sich hatte... \n\nMittwoch sind wir angereist und hatten noch Sonnenschein. Donnerstag lief Candy dann ihre erste LK1/2 junior Pleasure und wie konnten unsere erste Platzierung erreichen und sie lief wirklich toll! \nUnsere erste LK1/2 Horsemanship mit einem fr uns noch zu schweren Pattern war auch vollkommen in Ordnung \n\nIn der Nacht zum Freitag ging dann der Dauerregen los plus wurde ich richtig krank. Mein Krper wollte nicht mehr nach den letzten Monaten... die restlichen Tage funktionierte ich nur noch mit Massen Medikamenten. Und fr Candy fielen unsere Routinen mit spazieren gehen und grasen weg ... \n\nSamstag kam dann Rikke zum Coaching fr die Trails und half uns da durch... in beiden Trails konnten wir trotz Pilotennervenflattern uns platzieren und genauso wie in der junior Pleasure am Sonntag uns die beiden halben Qualis erreiten. \n\nEs ist noch viel Luft nach oben und ich hoffe sehr, das mit besseren Bedingungen und wenn ich auch einfach gesund bin und meine Nerven mit mehr Routine und Kilometern in Griff bekomme, wir auch wirklich zeigen knnen, was wir knnen! \n\nIch bin dankbar fr klein Candy, die ihr bestes gegeben hat wie es nur ging mit allem auenherum! Und danke @rb_showhorses fr deine Geduld und das Herzblut fr uns! \n\nErgebnisse:\nLK1/2 Junior Trail\n4. Platz Quali Junior Trail\n4. Platz Quali Junior Pleasure \n5. Platz LK1/2 Junior Pleasure \n\nIch freue mich sehr auf die weitere Saison \n Beginning of the Year Double Quarter Show Memmingen\n\n~~~~~~~~~~~~~~~~\n\n#thecandyfactory #candy #quarterhorse #aqha #aqhaproud #dqha #horse #pferd #Pferdemdchen #pferde #love #training #horselove #blogger #pferdeblog #equestrian #equestrianlife #horseofinstagram #pferdeliebe #westernhorse #showpferd #reiter #jungpferd #instadaily #instahorse #reiterwelt #loveyoulittlecandy#reiten #frauenpower #karrierefrau', 1681719202, '[]', 'IMAGE', 'images/content/posts/341517481_589282869930594_3927030199303020772_n.webp', NULL, NULL, 'https://instagram.com/p/CrIVD3Ytdz3', 0, 0, '[\"#candy\",\"#quarterhorse\",\"#aqha\",\"#aqhaproud\",\"#dqha\",\"#horse\",\"#pferd\",\"#pferdem\\u00e4dchen\",\"#pferde\",\"#love\",\"#training\",\"#horselove\",\"#blogger\",\"#pferdeblog\",\"#equestrian\",\"#equestrianlife\",\"#horseofinstagram\",\"#pferdeliebe\",\"#westernhorse\",\"#showpferd\",\"#reiter\",\"#jungpferd\",\"#instadaily\",\"#instahorse\",\"#reiterwelt\",\"#loveyoulittlecandy\\u00a0#reiten\",\"#frauenpower\",\"#karrierefrau\"]', 'post', 'profile_scrape', 0, 1683024642, 1683024642),
(787, 45, 3077784931887697744, NULL, 'Cq2fRa4N09Q', 2, 64, 0, 0, 0, 0, 0, 0, '1.53', ' Es ist vorbei! \n\nJa... das Wintertraining ist offiziell beendet... in 2 Tagen geht die Saison los. Und ja, ich muss mir von meinen Mdels die letzten Tage fter verbal ein paar klatschen lassen.  Wir haben viel geschafft ber den Winter und ich bin unfassbar dankbar!\n\n Fr die tollen Trainer in meinen Leben, mit denen ich immens gute Kurse und Einzelstunden erfahren durfte, die Candy und mich so stark nach vorne gebracht haben!\n @rb_showhorses  @carolin_lenz  @fraenshi \n\n Fr meine unfassbar fitte und gesunde kleine Candy ... um mich herum erlebe ich so viele Krankheitsschlge, nicht brave Pferde, Probleme etc. Doch wir scheinen einen riesen Schutzschild zu haben... Unser einziges Thema war eine offene Stelle vom Wlzen ... danke liebe Candy fr deine Gesundheit und dein unfassbar tolles liebes Wesen! \n\nFr meinen eigenen Willen... oft wei ich nicht, woher ich neben all dem Stress und rger der letzten Monate, die Kraft hernehme ... doch wahrscheinlich ist es einfach mein Herzblut und meine Liebe zu Candy und dem Sport, der mich wachsen und durchhalten lsst! Und mir hilft alles zu schaffen!\n\n Fr die tollen Menschen in meinen Leben, die an meiner Seite sind ... und mich immer auffangen und mehr an mich glauben als ich selbst! \n\nWas die Saison bringt, wei ich nicht... ich wnsche mir so sehr, dass wir meine Ziele gemeinsam erreichen knnen ... doch genau wei man es vorher nie! Ich bin der meinung, besser vorbereitet knnen wir nicht sein... klar knnte ich noch 5 kg mehr geschafft haben und sie noch besser einhndig sein usw. Doch nein ... wir sind jetzt so und so starten wir Mittwoch in die Saison \n\n~~~~~~~~~~~~~~~~~\n\n#thecandyfactory #candy #quarterhorse #aqha #aqhaproud #dqha #horse #pferd #Pferdemdchen #pferde #love #training #horselove #blogger #pferdeblog #equestrian #equestrianlife #horseofinstagram #pferdeliebe #westernhorse #showpferd #reiter #jungpferd #instadaily #instahorse #reiterwelt #loveyoulittlecandy#reiten #frauenpower #karrierefrau', 1681120576, '[]', 'IMAGE', 'images/content/posts/340355558_1343125589563602_4108748296339103838_n.webp', NULL, NULL, 'https://instagram.com/p/Cq2fRa4N09Q', 0, 0, '[\"#candy\",\"#quarterhorse\",\"#aqha\",\"#aqhaproud\",\"#dqha\",\"#horse\",\"#pferd\",\"#pferdem\\u00e4dchen\",\"#pferde\",\"#love\",\"#training\",\"#horselove\",\"#blogger\",\"#pferdeblog\",\"#equestrian\",\"#equestrianlife\",\"#horseofinstagram\",\"#pferdeliebe\",\"#westernhorse\",\"#showpferd\",\"#reiter\",\"#jungpferd\",\"#instadaily\",\"#instahorse\",\"#reiterwelt\",\"#loveyoulittlecandy\\u00a0#reiten\",\"#frauenpower\",\"#karrierefrau\"]', 'post', 'profile_scrape', 0, 1683024642, 1683024642),
(788, 45, 3045892371756626262, NULL, 'CpFLvlqoDFW', 8, 86, 0, 0, 0, 0, 0, 0, '2.17', 'Mein Leben ist derzeit nicht leicht, ich kmpfe wie eine Lwin, dass meine Existenz nicht weiter in Gefahr ist wegen Dingen, die ich selbst nicht in der Hand habe ... mein Bauchgefhl sagt mir, dass Moral und Gerechtigkeit wirken werden und alles gut geht, doch es kostet Kraft \n\nOhne klein Candy, meine Mdels in meinem Leben und auch meine viele Arbeit, wre ich in der Zeit sicher an kritische Punkte gekommen. Doch ich liebe einfach mein Leben!  \n\nWir machen groe Fortschritte im Training zudem und die Saison rckt mir trotzdem zu schnell nher  nchste Woche kommt sicher die erste Ausschreibung raus und dann beginnt es ernst zu werden... mein Selbstvertrauen in unser Knnen schwankt wie immer oftmals, doch die positiven Tage sind mehr als die anderen \n\nEs ist also unfassbar viel los in meinem Leben, doch es bleibt MEIN geliebtes Leben in dem ich Step by Step nach vorne und oben gehe, unabhngig aller Steine, die da noch kommen werden \n\nIn dem Sinne habt einen schnen Start ins Wochenende! \n\n~~~~~~~~~~~~~~~~~~~~\n\n#thecandyfactory #candy #quarterhorse #aqha #aqhaproud #dqha #horse #pferd #Pferdemdchen #pferde #love #training #horselove #blogger #pferdeblog #equestrian #equestrianlife #horseofinstagram #pferdeliebe #westernhorse #showpferd #reiter #jungpferd #instadaily #instahorse #reiterwelt #loveyoulittlecandy#reiten #frauenpower #karrierefrau', 1677318687, '{\"city_name\":\"Augsburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/333083288_142788345337660_8330197596535068443_n.webp', NULL, NULL, 'https://instagram.com/p/CpFLvlqoDFW', 0, 0, '[\"#candy\",\"#quarterhorse\",\"#aqha\",\"#aqhaproud\",\"#dqha\",\"#horse\",\"#pferd\",\"#pferdem\\u00e4dchen\",\"#pferde\",\"#love\",\"#training\",\"#horselove\",\"#blogger\",\"#pferdeblog\",\"#equestrian\",\"#equestrianlife\",\"#horseofinstagram\",\"#pferdeliebe\",\"#westernhorse\",\"#showpferd\",\"#reiter\",\"#jungpferd\",\"#instadaily\",\"#instahorse\",\"#reiterwelt\",\"#loveyoulittlecandy\\u00a0#reiten\",\"#frauenpower\",\"#karrierefrau\"]', 'post', 'profile_scrape', 0, 1683024642, 1683024642),
(789, 45, 3031333940795313722, NULL, 'CoRdiiQsI46', 10, 71, 0, 0, 0, 0, 0, 0, '1.87', 'Klein Candy  wir sind auf dem Weg zur nchsten Turniersaison und dank meinen tollen Trainern, viel Herzblut und konsequenten Training, wird alles immer besser ... ich schaue sehr optimistisch auf die Saison \n\nFolgende Plne habe ich derzeit und trainieren wir dahin:\n\n*EWU*\n 2 bis 3 AQ Turniere plus Bayerische Meisterschaft \n Junior Trail, Junior Pleasure, Allround Youngstar Challenge, Horsemanship \n\nZiel - Finale German Open in den Junior Klassen \n\n*VWB/AQHA/DQHA*\n 2 Kreuth Shows plus Sdfuturity \n 2 Kat. II Turniere fr die Routine \n Trail, Horsemanship, Hunterklassen, Pleasure auf den kleinen Turnieren und in den unteren Klassen \n\nZiel - Q23 Aachen starten \n\nViel vor, doch ohne Ziele auch kein Weg dahin  Zudem bin ich unfassbar dankbar, dass wir beide so fit und gesund sind und dies ist neben dem Vertrauen und Miteinander was wir haben das wichtigste! \n\nWas habt ihr fr diese Saison so geplant? \n\n~~~~~~~~~~~~~~~~~~\n\n#thecandyfactory #candy #quarterhorse #aqha #aqhaproud #dqha #horse #pferd #Pferdemdchen #pferde #love #training #horselove #blogger #pferdeblog #equestrian #equestrianlife #horseofinstagram #pferdeliebe #westernhorse #showpferd #reiter #jungpferd #instadaily #instahorse #reiterwelt #loveyoulittlecandy#reiten #frauenpower #karrierefrau', 1675583187, '{\"city_name\":\"Augsburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/328745431_546439040772004_8191337712587572629_n.webp', NULL, NULL, 'https://instagram.com/p/CoRdiiQsI46', 0, 0, '[\"#candy\",\"#quarterhorse\",\"#aqha\",\"#aqhaproud\",\"#dqha\",\"#horse\",\"#pferd\",\"#pferdem\\u00e4dchen\",\"#pferde\",\"#love\",\"#training\",\"#horselove\",\"#blogger\",\"#pferdeblog\",\"#equestrian\",\"#equestrianlife\",\"#horseofinstagram\",\"#pferdeliebe\",\"#westernhorse\",\"#showpferd\",\"#reiter\",\"#jungpferd\",\"#instadaily\",\"#instahorse\