(790, 45, 3008988934873183396, NULL, 'CnCE350MnSk', 2, 59, 0, 0, 0, 0, 0, 0, '1.41', ' Zu sich selbst finden, man selbst sein, sich treu bleiben und seine Wege gehen... dies sollte man niemals vergessen und an oberste Stelle stellen! \n\n~~~~~~~~~~~~~\n\n#motivation #sprchezumnachdenken #quarterhorse #aqha #aqhaproud #dqha #horse #pferd #Pferdemdchen #pferde #love #training #horselove #blogger #pferdeblog #equestrian #equestrianlife #horseofinstagram #pferdeliebe #westernhorse #showpferd #reiter #jungpferd #instadaily #instahorse #reiterwelt #loveyoulittlecandy#reiten #frauenpower #karrierefrau', 1672919454, '[]', 'IMAGE', 'images/content/posts/323498985_1340073233424885_7437941464408100422_n.webp', NULL, NULL, 'https://instagram.com/p/CnCE350MnSk', 0, 0, '[\"#spr\\u00fcchezumnachdenken\",\"#quarterhorse\",\"#aqha\",\"#aqhaproud\",\"#dqha\",\"#horse\",\"#pferd\",\"#pferdem\\u00e4dchen\",\"#pferde\",\"#love\",\"#training\",\"#horselove\",\"#blogger\",\"#pferdeblog\",\"#equestrian\",\"#equestrianlife\",\"#horseofinstagram\",\"#pferdeliebe\",\"#westernhorse\",\"#showpferd\",\"#reiter\",\"#jungpferd\",\"#instadaily\",\"#instahorse\",\"#reiterwelt\",\"#loveyoulittlecandy\\u00a0#reiten\",\"#frauenpower\",\"#karrierefrau\"]', 'post', 'profile_scrape', 0, 1683024642, 1683024642),
(791, 45, 3004494942349755614, NULL, 'CmyHDtINwTe', 0, 72, 0, 0, 0, 0, 0, 0, '1.66', ' Finally end of the Year ... \n\nWas fr ein Jahr... das Jahr 2022 war unfassbar voll und immens anstrengend... es war nicht schlecht, es war Ereignis- und Erkenntnisreich! \n\nVor allem hat es mir einmal mehr gelehrt, was wichtig ist und was man erreichen kann! Am Ende diesen Jahres bin ich einfach nur dankbar...\n\n gesund zu sein und es auch so durch das Jahr geschafft zu haben \n fr unglaublich liebe Freundinnen an meiner Seite, die einfach #friendsarethefamilyyouchoose sind -  die immer fr mich da sind \n meinen geliebten Freund an meiner Seite, der auch wenn es definitiv nicht leicht war dieses Jahr, ein immer grer werdenden Teil meines Lebens wird und bleiben soll\n klein Candy, mein Fels in meinem Leben, mein Ausgleich und so vieles mehr \n meinen Job, der durch den Karrieresprung dieses Jahr mir zwar unendlich viel Arbeit bereitet hat, mir aber mein Leben auf dem Niveau und mit einer riesen Sicherheit im Nacken ermglicht und gleichzeitig mir Freude bereitet \n all die vielen Mglichkeiten, die ich mir zustzlich erarbeitet habe und die mir zeigen, wie viel Vertrauen so viele Menschen in meine Fhigkeiten haben\n\nIch werde heute mit meinem Freund fr 4 Nchte ber Silvester mir genau das gnnen, wofr ich so viel arbeite -  Zeit fr wunderschne Erinnerungen, eine Auszeit, die genau der entspricht, was ich mir vom Leben wnsche! All das was man tut, sollte authentisch sein und den Weg zu seinen Zielen im Leben ebnen! \n\nAuch 2023 werde ich genau das weiter verfolgen und vor allem mir treu bleiben! #staywhoyouare \n\nIn dem Sinne verabschiede ich mich schon heute von dem Jahr 2022 und wnsche euch allen einen wunderschnen und erfolgreichen Start ins neue Jahr!  #staystrong\n\n~~~~~~~~~~~~~~~~~\n\n#thecandyfactory #candy #quarterhorse #horse #pferd #Pferdemdchen #pferde #love #happynewyear #horselove #blogger #pferdeblog #equestrian #endof2022 #horseofinstagram #pferdeliebe #westernhorse #reiter #jungpferd #instadaily #instahorse #reiterwelt #loveyoulittlecandy#reiten #frauenpower #karrierefrau #newyear', 1672383729, '{\"city_name\":\"Augsburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/322989193_912890413210604_9053906632400355065_n.webp', NULL, NULL, 'https://instagram.com/p/CmyHDtINwTe', 0, 0, '[\"#friendsarethefamilyyouchoose\",\"#staywhoyouare\",\"#staystrong\\n\\n~~~~~~~~~~~~~~~~~\\n\\n#thecandyfactory\",\"#candy\",\"#quarterhorse\",\"#horse\",\"#pferd\",\"#pferdem\\u00e4dchen\",\"#pferde\",\"#love\",\"#happynewyear\",\"#horselove\",\"#blogger\",\"#pferdeblog\",\"#equestrian\",\"#endof2022\",\"#horseofinstagram\",\"#pferdeliebe\",\"#westernhorse\",\"#reiter\",\"#jungpferd\",\"#instadaily\",\"#instahorse\",\"#reiterwelt\",\"#loveyoulittlecandy\\u00a0#reiten\",\"#frauenpower\",\"#karrierefrau\",\"#newyear\"]', 'post', 'profile_scrape', 0, 1683024642, 1683024642),
(792, 45, 3000140507322263534, NULL, 'Cmio-VfNCfu', 2, 55, 0, 0, 0, 0, 0, 0, '1.32', ' Merry Christmas \n\nEs war ein harter langer Weg dieses Jahr bis zu diesem Weihnachtsfest... und zumindest fr mich wird es anders sein als die letzten 32 Jahre, doch das ist eine der Vernderungen, die das Jahr 2022 mit sich brachte \n\nEuch allen wnsche ich folgendes zu Weihnachten:\n liebevolle Menschen um euch herum\n erholsamen besinnliche Tage\n Wetter bei dem ihr euch wohl fhlt\n Gesundheit auf allen Wegen \n Ehrlichkeit \n Essen, was schmeckt, euch aber nicht berfllt \n Zeit ohne Streit, Stress und Hektik \n viel Liebe\n Geschenke, bei denen man sich Gedanken um euch gemacht hat\n Raum um reflektieren zu knnen und wo Stolz auf euch selbst Platz hat\n\nVergesst nie ... Zeit ist unbezahlbar - lasst euch die schne Zeit nicht nehmen und passt auf euch auf! \n\n~~~~~~~~~~~~~~~~\n\n#thecandyfactory #candy #quarterhorse #merrychristmas #aqhaproud #weihnachten #horse #pferd #Pferdemdchen #pferde #love #training #horselove #blogger #pferdeblog #equestrian #equestrianlife #horseofinstagram #pferdeliebe #westernhorse #showpferd #reiter #jungpferd #instadaily #instahorse #reiterwelt #loveyoulittlecandy#reiten #frauenpower #karrierefrau', 1671864640, '[]', 'IMAGE', 'images/content/posts/321254714_459764959493845_4454153809972900935_n.webp', NULL, NULL, 'https://instagram.com/p/Cmio-VfNCfu', 0, 0, '[\"#candy\",\"#quarterhorse\",\"#merrychristmas\",\"#aqhaproud\",\"#weihnachten\",\"#horse\",\"#pferd\",\"#pferdem\\u00e4dchen\",\"#pferde\",\"#love\",\"#training\",\"#horselove\",\"#blogger\",\"#pferdeblog\",\"#equestrian\",\"#equestrianlife\",\"#horseofinstagram\",\"#pferdeliebe\",\"#westernhorse\",\"#showpferd\",\"#reiter\",\"#jungpferd\",\"#instadaily\",\"#instahorse\",\"#reiterwelt\",\"#loveyoulittlecandy\\u00a0#reiten\",\"#frauenpower\",\"#karrierefrau\"]', 'post', 'profile_scrape', 0, 1683024642, 1683024642),
(793, 45, 2992897610470137347, NULL, 'CmI6IUJMB4D', 17, 78, 0, 0, 0, 0, 0, 0, '2.2', ' Gefhle eines Sieges \n\nWir betreiben den Reitsport aus vielen Grnden heraus ... vordergrndig steht denke und hoffe ich bei den meisten die Liebe zum Pferd - unserem Pferd an unserer Seite!  \n\nDann trainieren wir ... warum? Sicherlich weil wir wollen das unser Pferd gesund uns tragen kann! Warum trainieren wir soweit, dass wir auf Turniere fahren knnen? Nur zum Spa?  Teuer dieser \"Spa\"  natrlich wollen wir Amateure neben einer schnen Zeit, Urlaub und guten Prfungen einfach zeigen was wir knnen und natrlich will jeder wenn er ehrlich zu sich ist, fr das Training, das Herzblut und auch das Geld und die Mhen belohnt werden und erfolgreich sein \n\nUnd ja... ich gehre dazu - ich liebe Candy und gleichzeitig den Reitsport. Ich konnte noch nie einen Sport machen ohne ihn auf Wettkampfniveau zu machen, ich brauchte schon immer Ziele und habe mir Erfolg gewnscht und arbeite in allen meinen Lebenslagen dafr, diesen auch zu haben und nach vorne zu kommen! Da stehe ich auch komplett dahinter \n\nNachdem die Saison eher schwierig war fr mich, vor allem durch die lange Plateauphase Mitte des Jahres, war es Ende der Saison soweit... in Pfeffenhausen im Amateur Trail ... standen wir beide bis zum Schluss... null habe ich damit gerechnet, doch wie gewannen unseren ersten gerittenen Pokal in unserem gemeinsamen Leben... Eine Freude, die auch immer noch prsent ist! \n\n*Warum? * \n weil wir es zusammen erreicht haben\n Weil wir uns treu geblieben sind\n Weil ich mich ohne Beritt durch das tgliche Training mit so viel Konsequenz, Abwechslung und Herzblut wie mglich arbeite\n Weil so viele Zweifel einfach mal weg waren fr einige Zeit \n Weil gewinnen einfach ein tolles Gefhl ist \n\nUnd wir haben uns lieb... sind freinander da und sie gibt mir so viel neben dem Sport ... so viele Punkte, die mir einfach ein Lcheln und Stolz ins Gesicht zaubern ... unvergessen unser erster gerittener Pokal! \n\nKnnt ihr euch noch an euren ersten gemeinsamen Sieg mit eurem Pferd erinnern? Erzhlt doch mal! \n\n~~~~~~~~~~~~~~~~~~~\n\n#thecandyfactory #candy #quarterhorse #aqha #aqhaproud #dqha #horse #pferd #Pferdemdchen #pferde #love #training #horselove #blogger', 1671001219, '{\"city_name\":\"Augsburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/319879243_568787501752531_6031176023784144455_n.webp', NULL, NULL, 'https://instagram.com/p/CmI6IUJMB4D', 0, 0, '[\"#candy\",\"#quarterhorse\",\"#aqha\",\"#aqhaproud\",\"#dqha\",\"#horse\",\"#pferd\",\"#pferdem\\u00e4dchen\",\"#pferde\",\"#love\",\"#training\",\"#horselove\",\"#blogger\"]', 'post', 'profile_scrape', 0, 1683024642, 1683024642),
(794, 45, 2987107761645666036, NULL, 'Cl0Vq7Os770', 4, 48, 0, 0, 0, 0, 0, 0, '1.2', ' Happy Nikolaus \n\nIch wnsche euch allen einen wunderschnen Nikolaustag mit hoffentlich kleinen sen berraschungen in euren Schuhen oder ber den Tag verteilt \n\nMeiner ist leider komplett bervoll, aber ich zhle eh die Tage bis zum Urlaub... aber heute Abend brauche ich nur noch eine Hand dafr \n\n~~~~~~~~~~~~~~\n\n#thecandyfactory #candy #quarterhorse #advent #nikolaus #weihnachten #horse #pferd #Pferdemdchen #pferde #love #training #horselove #blogger #pferdeblog #equestrian #equestrianlife #horseofinstagram #pferdeliebe #westernhorse #showpferd #reiter #jungpferd #instadaily #instahorse #reiterwelt #loveyoulittlecandy#reiten #frauenpower #karrierefrau', 1670311015, '{\"city_name\":\"Augsburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/318461549_1271429466757567_44951622027603259_n.webp', NULL, NULL, 'https://instagram.com/p/Cl0Vq7Os770', 0, 0, '[\"#candy\",\"#quarterhorse\",\"#advent\",\"#nikolaus\",\"#weihnachten\",\"#horse\",\"#pferd\",\"#pferdem\\u00e4dchen\",\"#pferde\",\"#love\",\"#training\",\"#horselove\",\"#blogger\",\"#pferdeblog\",\"#equestrian\",\"#equestrianlife\",\"#horseofinstagram\",\"#pferdeliebe\",\"#westernhorse\",\"#showpferd\",\"#reiter\",\"#jungpferd\",\"#instadaily\",\"#instahorse\",\"#reiterwelt\",\"#loveyoulittlecandy\\u00a0#reiten\",\"#frauenpower\",\"#karrierefrau\"]', 'post', 'profile_scrape', 0, 1683024642, 1683024642),
(795, 45, 2985707928212762923, NULL, 'ClvXYqwMHEr', 0, 27, 0, 0, 0, 0, 0, 0, '0.62', ' In dem Sinne wnsche ich euch einen wunderschnen 2. Advent! \n\nGeniet die Zeit mit den Menschen, die dich wichtig sind!  Ich habe heute auch meine lieben Mdels zu Besuch und damit schon fleiig am Morgen gewesen. Die Zeit vergeht so schnell, daher muss man einfach schauen, was wirklich wichtig im Leben ist ... und ich habe kleine Traditionen fr die letzte Zeit des Jahres, die mir einfach wichtig sind! \n\nDaher ... Habt einen schnen Sonntag  und vergesst nicht, die nchste Kerze anzuznden \n\n~~~~~~~~~~~~~~~~~~\n\n#Weihnachten #advent #quarterhorse #motivation #freundschaft #weihnachten2022 #horse #pferd #Pferdemdchen #pferde #love #training #horselove #blogger #pferdeblog #equestrian #equestrianlife #horseofinstagram #pferdeliebe #westernhorse #showpferd #reiter #jungpferd #instadaily #instahorse #reiterwelt #sprche#sprchezumnachdenken #frauenpower #karrierefrau', 1670144142, '{\"city_name\":\"Augsburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/317823082_899718484522519_4399537242360172504_n.webp', NULL, NULL, 'https://instagram.com/p/ClvXYqwMHEr', 0, 0, '[\"#advent\",\"#quarterhorse\",\"#motivation\",\"#freundschaft\",\"#weihnachten2022\",\"#horse\",\"#pferd\",\"#pferdem\\u00e4dchen\",\"#pferde\",\"#love\",\"#training\",\"#horselove\",\"#blogger\",\"#pferdeblog\",\"#equestrian\",\"#equestrianlife\",\"#horseofinstagram\",\"#pferdeliebe\",\"#westernhorse\",\"#showpferd\",\"#reiter\",\"#jungpferd\",\"#instadaily\",\"#instahorse\",\"#reiterwelt\",\"#spr\\u00fcche\\u00a0#spr\\u00fcchezumnachdenken\",\"#frauenpower\",\"#karrierefrau\"]', 'post', 'profile_scrape', 0, 1683024642, 1683024642),
(796, 45, 2984917289896534979, NULL, 'ClsjnXcNGPD', 2, 90, 0, 0, 0, 0, 0, 0, '2.13', ' Back in the Instagram Feed Game \n\nJa ... dieses Jahr war es hier im Feed sehr ruhig... in den Storys besser, weil das ehrlich gesagt auch einfacher und schneller im Alltag geht... \n\nNachdem mein alter Account Anfang des Jahres gehackt worden ist, war leider meine Motivation doch weg... so viel Herzblut war einfach weg und nicht mehr zurck zu holen. Dazu kam ein unfassbar volles Jahr, das ich gar nicht wusste wann auch meine anderen Dinge sonst alle gemacht werden sollen... \n\nDoch zu den Themen komme ich bestimmt in den nchsten Beitrgen auch immer mal dazu ... ich bleibe mir treu ... es wird Beitrge in alle Lebensrichtungen wieder geben, da mein Leben eben nicht nur aus Pferde Teilen besteht \n\nWie ihr mitbekommen habt in den Storys sind Candy und ich schon voll im Wintertraining angekommen. Viele Kurse mit unseren beiden Trainerinnen stehen an und sind fest geplant. Das umsetzen und weiterkommen daheim klappt derzeit auch sehr gut und krperlich und mental sind wir gerade topfit ... nach dem vor allem im Kopf sehr durchwachsenen Jahr habe ich endlich ein gutes Gefhl und viele Plne und Wnsche fr nchste Saison! Zudem ist sie einfach final \"mylittlebiggirlonmyside\" geworden \n\nIch hoffe ihr freut euch bisschen, dass es hier jetzt weiter geht  was habt ihr denn ber den Winter so vor mit euren Pferden?\n\nIch freue mich auf jeden Fall sehr ber mehr regen Austausch wieder \n\n~~~~~~~~~~~~~~~\n\n#thecandyfactory #candy #quarterhorse #aqha #aqhaproud #dqha #horse #pferd #Pferdemdchen #pferde #love #training #horselove #blogger #pferdeblog #equestrian #equestrianlife #horseofinstagram #pferdeliebe #westernhorse #showpferd #reiter #jungpferd #instadaily #instahorse #reiterwelt #loveyoulittlecandy#reiten #frauenpower #karrierefrau', 1670049891, '{\"city_name\":\"Augsburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/318215752_1156720281616348_645676152143948439_n.webp', NULL, NULL, 'https://instagram.com/p/ClsjnXcNGPD', 0, 0, '[\"#candy\",\"#quarterhorse\",\"#aqha\",\"#aqhaproud\",\"#dqha\",\"#horse\",\"#pferd\",\"#pferdem\\u00e4dchen\",\"#pferde\",\"#love\",\"#training\",\"#horselove\",\"#blogger\",\"#pferdeblog\",\"#equestrian\",\"#equestrianlife\",\"#horseofinstagram\",\"#pferdeliebe\",\"#westernhorse\",\"#showpferd\",\"#reiter\",\"#jungpferd\",\"#instadaily\",\"#instahorse\",\"#reiterwelt\",\"#loveyoulittlecandy\\u00a0#reiten\",\"#frauenpower\",\"#karrierefrau\"]', 'post', 'profile_scrape', 0, 1683024642, 1683024642),
(797, 45, 2902985761927359177, NULL, 'ChJeit3smrJ', 3, 280, 0, 0, 0, 0, 0, 0, '6.54', ' Exited for the next Shows \n\nHach ... Endlich habe ich mal ein paar Tage frei vom Hauptjob ... die letzten Wochen seit erstem Juli mit Start meiner neuen Position in der Arbeit waren extrem anstrengend fr meinen Kopf... dazu das Training, die eigenen Ansprche, schlechtes Gewissen meinen Mdels gegenber so wenig Zeit zu haben und vieles mehr \n\nKarriere mit Amateursport und dem restlichen Leben unter einen Hut zu bringen ist nicht wirklich immer leicht... umso mehr freue ich mich jetzt auf ein paar Tage weniger arbeiten und ein wenig abschalten... ich freue mich riesig auf die kommenden Shows \n\n EWU Landesmeisterschaft Bayern \n Sdfuturity\n German Open \nUnd mit groer Wahrscheinlichkeit gnne ich mir Urlaub und Training auf der Q22, wenn sie schon in Kreuth ist... auer die nchsten Turniere laufen richtig mies \n\nJetzt heit es erstmal viel erledigen, die letzten Trainings und Vorbereitungen und Mittwoch geht es los ... zwischen den 2 Turnieren muss ich kurz 2 Tage auf Dienstreise und dann geht\'s weiter \n\nWie schafft ihr es denn alles unter einen Hut zu bringen?\nHabt einen schnen Freitag und baldiges Wochenende! \n\n#thecandyfactory #candy #quarterhorse #aqha #aqhaproud #dqha #horse #horserider #pferd #Pferdemdchen #pferde #love #training #horselove #blogger #bloggerlife #equestrian #equestrianlife #horseofinstagram #horseoftheday #westernhorse #showhorse #rider #younghorse #5yearsold #5yo #instadaily #instahorse #instablog #loveyoulittlecandy', 1660282891, '{\"city_name\":\"Augsburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/298401517_589624935936514_6067171238731691212_n.webp', NULL, NULL, 'https://instagram.com/p/ChJeit3smrJ', 0, 0, '[\"#candy\",\"#quarterhorse\",\"#aqha\",\"#aqhaproud\",\"#dqha\",\"#horse\",\"#horserider\",\"#pferd\",\"#pferdem\\u00e4dchen\",\"#pferde\",\"#love\",\"#training\",\"#horselove\",\"#blogger\",\"#bloggerlife\",\"#equestrian\",\"#equestrianlife\",\"#horseofinstagram\",\"#horseoftheday\",\"#westernhorse\",\"#showhorse\",\"#rider\",\"#younghorse\",\"#5yearsold\",\"#5yo\",\"#instadaily\",\"#instahorse\",\"#instablog\",\"#loveyoulittlecandy\"]', 'post', 'profile_scrape', 0, 1683024642, 1683024642),
(798, 46, 3039664494149315109, NULL, 'CovDsCqIyol', 8, 347, 0, 0, 0, 0, 0, 0, '6.03', 'Und nun bist du einfach schon 13. Jahre jung. Offizieller Teenager. Wahnsinn wo ist nur die Zeit geblieben ? \nIch hab dich doch erst geboren \nIch bin unfassbar stolz auf dich, du bist ein wirklich wunderbarer Mensch mit all deinen kleinen Macken. Bleib genau so wie du bist , den so bist du perfekt. \nIch liebe dich mein Engel \n#birthdaygirl #happybirthday #meinschatz #stolzemama #girlsmama #4fachmama #happy #lastsaturday #13jahre #13yearsold #officialteenager #girl', 1676576266, '[]', 'IMAGE', 'images/content/posts/331254877_895150868476183_5022644021023956844_n.jpg', NULL, NULL, 'https://instagram.com/p/CovDsCqIyol', 0, 0, '[\"#happybirthday\",\"#meinschatz\",\"#stolzemama\",\"#girlsmama\",\"#4fachmama\",\"#happy\",\"#lastsaturday\",\"#13jahre\",\"#13yearsold\",\"#officialteenager\",\"#girl\"]', 'post', 'profile_scrape', 0, 1683024647, 1683024647),
