(827, 48, 3090350828349898914, NULL, 'CrjIbR7IUCi', 2, 35, 107, 0, 0, 0, 0, 0, '0.36', 'Ad: Jeder kann grtnern . Das Konzept von @wearebloomify hat mich berzeugt. Ich bin nicht gerade bekannt fr meinen grnen Daumen . \nDas Team ist so sympathisch und wurschtelt so emsig im Garten. Das ist so ansteckend \nJetzt leben Carmen die Calamondinorange, Erdbeere Enno, Wassermelone Werner und Lavendel Lasse bei uns. \nWerner durfte erstmal rein auf die Fensterbank. Der ist noch zu klein zum drauen spielen. Der restlichen Gang macht die Klte hoffentlich nichts aus. Sicherheitshalber habe ich sie etwas eingepackt. \nDrckt mir die Daumen. \nDie nchste Zeit werde ich hoffentlich nur noch ber meine grtnerischen Erfolge berichten. #staytuned \nNatrlich alles in Bio Qualitt. \n#grtner #garten #bio #pflanzen @wearebloomify', 1682618620, '{\"city_name\":\"Heilbronn\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/343274866_964804574646522_2002489334724004481_n.jpg', NULL, NULL, 'https://instagram.com/p/CrjIbR7IUCi', 0, 0, '[\"#staytuned\",\"#g\\u00e4rtner\",\"#garten\",\"#bio\",\"#pflanzen\"]', 'post', 'profile_scrape', 0, 1683110903, 1683110903),
(828, 48, 3088161918140054052, NULL, 'CrbWucboHok', 2, 33, 69, 0, 0, 0, 0, 0, '0.34', '#frhlingsgefhle \nEin ganz normaler deutscher April. Wie oft habe ich mich in meiner Jugend gefragt, wie wird das Wetter an meinem Geburtstag Ende April?\nOft war es wie jetzt, wechselhaft, khl, nass, windig , sonnig  und das gerne durch gemixt an einem Tag. Daher gibts jetzt die volle Drhnung Frhlingsgefhle vom gestrigen Sonntag.\nEin Spaziergang im herrlichen Botanischen Garten in @heilbronn.erleben klein aber fein. Herrliche historische Pavillons meet Bltenpracht und  Bienensummen. Balsam fr die Seele, kleine grne Lunge mitten in der Stadt. #botanischergartenheilbronn #heilbronn #frhling #frhlingserwachen #frhlingsblumen #frhlingsliebe', 1682358094, '{\"city_name\":\"Heilbronn\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/342717604_983885533024167_123189820334152041_n.jpg', NULL, NULL, 'https://instagram.com/p/CrbWucboHok', 0, 0, '[\"#fr\\u00fchlingsgef\\u00fchle\\ud83c\\udf37\",\"#botanischergartenheilbronn\",\"#heilbronn\",\"#fr\\u00fchling\",\"#fr\\u00fchlingserwachen\",\"#fr\\u00fchlingsblumen\",\"#fr\\u00fchlingsliebe\"]', 'post', 'profile_scrape', 0, 1683110903, 1683110903),
(829, 48, 3083101489047035299, NULL, 'CrJYHglIF2j', 12, 59, 330, 0, 0, 0, 0, 0, '0.69', 'Vorsicht  Betrugsflle.\nNachdem ich ja bei einer Bank arbeite, mchte ich heute mal auf einige Betrugsmaschen aufmerksam machen, die leider in der Praxis vorkommen and. \n\nNein, es trifft nicht nur ltere Menschen, teilweise trifft Dreistigkeit auf Gutglubigkeit - eine fatale und zum Teil teure Mischung.\n\n- Enkeltrickanruf, ja gibt es immer noch und ja, leider funktioniert er auch noch. Es geht noch schlimmer, nmlich mit dem\n- Schockanruf, hier geben die Betrger am Telefon vor ein Familienmitglied wre schwer verletzt und fr die Behandlung msste sofort, um das Leben zu retten, ein meist 5stelliger Betrag berwiesen werden. \n\n- authentisch scheinende E-Mail mit dem Betreff Aussetzung Ihrer Zugnge# wer dann auf die Links klickt holt sich oft Spyware auf den Rechner. Noch blder wirds, wenn Ihr PINs und TANS eingebet, die ffnen Tr und Tor zum Konto. Gebt diese sensiblen Daten nie, nie leichtfertig weiter. Auch nicht telefonisch an vermeintliche Bankmitarbeiter. Ruft im Zweifel lieber bei eurer Bank an, um sicherzugehen wen ihr in der Leitung habt.\n\n- WhatsApp Nachrichten, wo einer eurer Kontakte pltzlich ne neue Nummer hat und dann schnell fr irgendwas Geld bentigt.\n\n- natrlich Gewinnbenachrichtigungen von Gewinnspielen an denen man nie beteiligt war, fr die berfhrung des z.B. Autos  erstmal zahlen soll.\nTipps: \n- checkt regelmig eure Umstze, nutzt z.B. Benachrichtigsservice funktioniert auch bei Kreditkartenumstzen\n- hinterlegt bei OnlineShops nicht eure Kontonummer sondern besser eure Kreditkarte. Geiz ist geil, wenn es um eure Daten geht \n- legt ein OnlineLimit fr euer Konto fest. Lieber einmal fr hhere Betrge das Limit erhhen. \n- gebt weder PIN noch TAN leichtfertig weiter!!! / wechselt eure Zugangsdaten regelmig (lstig aber wichtig)\n- klickt nicht auf jeden Link \n- im Zweifelsfall Karte/Konto sperren lassen\n- berlegt eine Internetversicherung abzuschlieen\n\nHoffe die Tipps waren ntzlich fr euch. Kennt ihr jemanden der schon mal betroffen war? \n\n#internetsicherheit \n#betrger\n#betrugsmasche \n#bauernfnger', 1681754656, '{\"city_name\":\"Heilbronn\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/341735266_948737086158732_7886196883609178981_n.jpg', NULL, NULL, 'https://instagram.com/p/CrJYHglIF2j', 0, 0, '[\"#internetsicherheit\",\"#betr\\u00fcger\\n#betrugsmasche\",\"#bauernf\\u00e4nger\"]', 'post', 'profile_scrape', 0, 1683110903, 1683110903),
