(903, 52, 3055476029938518552, NULL, 'CpnO0K4NMoY', 36, 403, 0, 0, 0, 0, 0, 0, '2.28', 'Zwar nicht perfekt aber irgendwie doch perfekt. \n\nWir Mamas leisten tglich so viel, wir sind zwar nicht perfekt keiner von uns aber fr unsere Kinder knnen wir perfekter nicht sein. Wir lesen ihnen vor, wir spielen mit ihnen, geben ihnen Geborgenheit, Sicherheit und Liebe. Wir geben so viel Liebe, dass sie keinerlei Begrenzung hat. \nWie oft aber denken wir Abends nach war ich vielleicht zu streng?, habe ich zu wenig mit ihnen gespielt? ah die Wsche musste doch noch gemacht werden \nWir Mamas haben sowas wie Feierabend garnicht, nicht mal, wenn wir im Bett liegen und die Kinder bereits schlafen. In unserem Kopf gehen wir schon den nchsten Tag Strukturiert durch und planen alles. Jedoch klappt das alles am Ende nicht, was wir uns vorgenommen haben. Das ist aber in Ordnung, ein Tag sollte sich Bedrfnisorientiert richten aber nicht nur den Kindern gegenber sondern auch uns selbst, denn wir Mamas vergessen uns selbst zu oft. Und jetzt setz dich hin whrend dein Kind schlft und trinke deinen Kaffee oder Tee in Ruhe warm aus und lass mal alles stehen und liegen. \n\n#erziehung#mama#bedrfnisorientiert#bedrfnisorientierteerziehung#elternschaft#elternschaftaufaugenhhe#kinder#baby#zara#zarafashion#kaffeepause#pause#mamasein#mamaleben#alltag#mamaliebe#mamaalltag#3kids#3boys#boysmom', 1678461148, '[]', 'IMAGE', 'images/content/posts/334243832_1527278687795480_3235563538779118032_n.jpg', NULL, NULL, 'https://instagram.com/p/CpnO0K4NMoY', 0, 0, '[]', 'post', 'profile_scrape', 0, 1683110922, 1683110922),
