(908, 52, 2921342154774184706, NULL, 'CiKsTY6sIMC', 46, 718, 0, 0, 0, 0, 0, 0, '3.97', 'Unser kleiner Schatz ist schon 1 Monat und 2 Tage alt und steckt laut der App ohje ich wachse und seinem Verhalten im ersten Schub.  Ich bin schon total gespannt, wann er uns das erste mal bewusst anlchelt.  \n\nWerbung* \nDas tolle Nestchen ist brigens von @myhummy.deutschland sie haben noch andere tolle Sachen und Nestchen im anderen Design. \n\n#baby#bebek#stillzeit#schwangerschaft#geburt#babyboy#babyzimmer#nestchen#newborn#neugeborenes#4weeksold#onemonthold#stillen', 1662471144, '[]', 'IMAGE', 'images/content/posts/305052518_465964051912346_5648450445034995278_n.jpg', NULL, NULL, 'https://instagram.com/p/CiKsTY6sIMC', 0, 0, '[]', 'post', 'profile_scrape', 0, 1683110923, 1683110923),
(909, 52, 2909724018375494422, NULL, 'ChhapQNsYsW', 18, 795, 0, 0, 0, 0, 0, 0, '4.23', 'Unser kleiner Schatz ist schon 17 Tage alt, die Zeit fliegt nur so davon.  Langsam mchte ich auch aktiver hier werden, nur, dass der kleine leider an Koliken leidet wie seine Brder damals auch. Bauchmassage ist hier Alltag, leider hilft das aber auch nicht so und er meckert viel.  Wischt nach rechts, dann findet ihr den Strampler vom Beitrag bevor er da war. \n\nHatten eure kleinen Koliken? Was hat bei euch geholfen? Bei den groen halfen sab simplex Salben und kmmelzpfchen nie \n\n#koliken#baby#colic#colicbaby#17daysold#augustbaby#augustbaby2022#august#summer#babyoutfit#outfitinspiration#stillen#stillbaby#geburt#babyboy', 1661086154, '[]', 'IMAGE', 'images/content/posts/300164026_727936378302164_9222864054756171666_n.jpg', NULL, NULL, 'https://instagram.com/p/ChhapQNsYsW', 0, 0, '[]', 'post', 'profile_scrape', 0, 1683110923, 1683110923),
(910, 53, 3090919387087811393, NULL, 'CrlJs5gvLNB', 0, 25, 295, 0, 0, 0, 0, 0, '1.3', 'Jedes Pelvi Power Beckenboden-Training bringt mich nher an mein Ziel, wieder einen starken, funktionierenden Beckenboden zu haben.\n\nBin so dankbar fr diese Mglichkeit!\n\nBraucht Dein Beckenboden auch Untersttzung?\n\n#beckenbodentraining #Beckenboden \n#pelvipower #starkerbeckenboden #dankbarkeit', 1682686593, '[]', 'VIDEO', 'images/content/posts/343423826_1121605955899328_3600340877319414537_n.jpg', NULL, NULL, 'https://instagram.com/p/CrlJs5gvLNB', 0, 0, '[\"#beckenboden\",\"#pelvipower\",\"#starkerbeckenboden\",\"#dankbarkeit\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(911, 53, 3089736517232655535, NULL, 'Crg8v4HNHyv', 0, 167, 0, 0, 0, 0, 0, 0, '8.68', '\"Zergeht auf der Zunge und bleibt lange frisch\" hat meine Mutter bei diesem Rezept dazu geschrieben, das ich mir bei meinem Auszug zuhause, 2001, aus ihrem Kochbuch abgeschrieben habe.\n\nErschreckenderweise hab ich dieses Rezept erst jetzt wieder entdeckt, nachdem uns meine Mutter an Ostern damit verwhnt hatte \n\nUnd sie hat nicht bertrieben, er zerging auf der Zunge und war drei Tage spter noch genau so kstlich \n\nFalls ihr auch kstlichen Kuchen essen mchtet - hier das Rezept:\n\n*Mandelkuchen vom Blech*\n\nFr den Teig:\n\n* 1/4l Schlagsahne\n* 2 Becher Mehl\n* 1 Becher Zucker\n* 4 Eier\n* 1 Pck Vanillezucker\n* 1 PriseSalz\n\nFr die Glasur:\n\n* 200g Mandelplttchen\n* 1 Becher Zucker\n* 125g Butter\n* 2 EL Milch oder Sahne\n\nSahne schlagen und mit den brigen Zutaten verrhren. Auf ein eingefettetes Blech geben und bei 160 Grad Umluft ca. 15 Minuten, bis der Kuchen leicht gebrunt ist, backen.\n\nFr die Glasur die Butter bei miger Hitze schmelzen und mit den brigen Zutaten verrhren. Auf dem Kuchen verteilen und nochmals 15 Minuten goldgelb backen.\n\n#kuchen #mandel #mandelkuchenrezept #backenistliebe #schmecktwiebeimama #yummy #rezept', 1682545316, '[]', 'IMAGE', 'images/content/posts/343186989_6201758123244183_3857357723984318041_n.webp', NULL, NULL, 'https://instagram.com/p/Crg8v4HNHyv', 0, 0, '[\"#mandel\",\"#mandelkuchenrezept\",\"#backenistliebe\",\"#schmecktwiebeimama\",\"#yummy\",\"#rezept\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(912, 53, 3084993720096928829, NULL, 'CrQGXGEsDQ9', 1, 32, 746, 0, 0, 0, 0, 0, '1.72', 'Nach einem Jahr mit viel Arbeit, einem Umzug und ohne Urlaub leg ich nun zwei mal pro Woche die Beine hoch und trainiere meine Beckenbodenmuskeln \n\nEin Wahnsinn, was der Beckenboden alles leisten muss und wie er vor allem das allgemeine Wohlbefinden beeinflussen kann. \nZwei Geburten haben ihn bei mir ziemlich mitgenommen, aber auch das hufige Tragen meiner Kinder (oder schwerer Umzugskisten ), Niesen, weil mein Heuschnupfen mich wieder plagt, aber auch und vor allem Stress \n\nDer Pelvi Power Beckenboden-Trainer trainiert die Beckenbodenmuskeln, die oft schwer zu finden sind und ein effektives Beckenbodentraining manchmal gar nicht erst zulassen, ohne dass ich irgendwas dafr tun muss. Nur dasitzen und entspannen ist da angesagt \n\nNach ca 25 Minuten hab ich das Gefhl, die Muskeln aus eigener Kraft viel schneller ansteuern und anspannen zu knnen. So fhlt sich mein Alltag gleich um einiges leichter an!\n\nProbier\'s doch auch mal aus!!! \n\n#pelvipower #beckenboden #beckenbodentraining #geburt #wohlbefinden #ichtuwasfrmich #trainieren #bestestraining #mamaleben #starkerbeckenboden', 1681982499, '[]', 'VIDEO', 'images/content/posts/342067219_542329888050395_2499405016629872148_n.jpg', NULL, NULL, 'https://instagram.com/p/CrQGXGEsDQ9', 0, 0, '[\"#beckenboden\",\"#beckenbodentraining\",\"#geburt\",\"#wohlbefinden\",\"#ichtuwasf\\u00fcrmich\",\"#trainieren\",\"#bestestraining\",\"#mamaleben\",\"#starkerbeckenboden\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(913, 53, 3081789069751462871, NULL, 'CrEttS3N6vX', 10, 708, 0, 0, 0, 0, 0, 0, '37.32', 'Der absolute Traum meiner Kindheit - Zitronenkuchen vom Blech!!!\n\nIch hab ihn viel zu lang nicht gemacht, und das, weil er einfach noch zur ganz alten Backschule gehrt. Frei nach dem Motto: mehr ist mehr!\nDie Zutatenliste ist nmlich erschreckend kalorienreich \n\nIch backe ihn daher nur, wenn ich wei, dass viele Leute zu Besuch kommen und nicht all zu viele Kuchenstcke brig bleiben, derer ich mich dann schrecklicherweise annehmen muss \n\nHier das Rezept. Entscheidet selbst, ob und wann ihr ihn nachbacken mchtet \n\nEinfacher, aber himmlisch guter Zitronenkuchen vom Blech:\n\n* 8 Eier\n* 350g Butter\n* 350g Zucker\n* 350gDinkelmehl\n* Schale von 2 Zitronen\n* 1 Pck. Vanillezucker\n* 3 gestrichene TL Backpulver\n\nFr die Glasur:\n\n* 200gPuderzucker\n* Saft von 2 Zitronen\n* evtl. ein bisschen Wasser\n\nAlle Zutaten vermengen und auf ein eingefettetes Backblech streichen.\nIm Ofen bei 180 Grad Ober/Unterhitze ca 25 Minuten backen, bis der Kuchen hellbraun ist. \nFr die Glasur Puderzucker und Zitronensaft vermengen. Sollte die Glasur zu fest sein, noch ein bisschen Wasser dazu geben. ber den noch warmen Kuchen verteilen, auskhlen lassen.\n\n#zitronenkuchen #einfachesrezept #kindheitserinnerungen #kindheitstraum #rezept #backenistliebe #lecker #yummy #food #blechkuchen #kalorienbombe', 1681597907, '[]', 'IMAGE', 'images/content/posts/341018354_185149877681758_8830777554380087848_n.webp', NULL, NULL, 'https://instagram.com/p/CrEttS3N6vX', 0, 0, '[\"#einfachesrezept\",\"#kindheitserinnerungen\",\"#kindheitstraum\",\"#rezept\",\"#backenistliebe\",\"#lecker\",\"#yummy\",\"#food\",\"#blechkuchen\",\"#kalorienbombe\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(914, 53, 3077197866842104882, NULL, 'Cq0Zyf8tqQy', 40, 237, 0, 0, 0, 0, 0, 0, '14.4', 'Frohe Ostern \n\nGlauben eure Kinder an den Osterhasen? \nBzw. ab wann wuten sie, dass es den Osterhasen gar nicht gibt?\n\nWir haben dem kleinen Mann erzhlt, dass der Osterhase eine \"Phantasiefigur\" ist und tatschlich WIR die Ostereier verstecken. hnlich haben wir das auch mit dem Nikolaus gemacht und dem Weihnachtsmann.\n\nHab aber schon gemerkt, dass das Thema \"Gibts den Osterhasen wirklich?\" ein wenig die Gemter der Elternschaft erhitzt. \"Du nimmst den Kindern doch jegliche Freude an Ostern\" hab ich schon gehrt. Aber tatschlich macht es fr den kleinen Mann keinen Unterschied, wer da was versteckt. Hauptsache es gibt Ostereier \n\nDaher fhlt es sich fr uns genau richtig an ohne Osterhasen \n\nWie seht ihr das?\n\n#froheostern #ostern #osterhase #gibtsdenosterhasenwirklich #ostereier #ostereiersuche #easter', 1681050593, '[]', 'IMAGE', 'images/content/posts/340179520_914119519891636_7605460498806768822_n.webp', NULL, NULL, 'https://instagram.com/p/Cq0Zyf8tqQy', 0, 0, '[\"#ostern\",\"#osterhase\",\"#gibtsdenosterhasenwirklich\",\"#ostereier\",\"#ostereiersuche\",\"#easter\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(915, 53, 3072333434017933727, NULL, 'CqjHvr2Memf', 7, 192, 0, 0, 0, 0, 0, 0, '10.34', 'Es wird langsam Frhling, zumindest kulinarisch gesehen.\nMit fruchtigem Himbeer-Tiramisu!!!\nGerade fr Kinder eine spannende Alternative zum klassischen Tiramisu.\nUnd, in diesem Fall, nur mit Honig gest!\n\nHier fr euch das Rezept:\n\nHimbeer-Tiramisu:\n\n* 1kg Tiefkhl-Himbeeren\n* 500g Mascarpone\n* 5 Eier getrennt\n* 6 EL Honig\n* ca 300g Eierbiskotten (Lffelbiskuit)\n* 300ml Kirsch- oder Traubensaft\n* 1-2 EL Amaretto nach Wunsch\n* Kakaopulver\n\nDie aufgetauten Himbeeren prieren und durch ein Sieb passieren.\nDas Eigelb mit dem Honig cremig rhren und die Mascarpone dazugeben.\nDas Eiwei steif schlagen und unter die Mascarpone-Creme heben.\n1/3 der Masse in eine Auflaufform geben.\nBiskotten in Saft-Amaretto-Mischung eintauchen und dicht aneinander auf die Mascarpone-Masse legen, leicht in die Masse drcken.\n1/3 des Himbeer-Prees darauf verteilen. Noch zwei weitere Schichten machen.\nMindestens 3 Stunden kalt stellen und vor dem Servieren mit Kakaopulver bestreuen.\n\n#himbeertiramisu\n#ohneraffiniertenzucker #fruchtig #yummy #food #dessert #einfachesrezept', 1680470707, '[]', 'IMAGE', 'images/content/posts/339123752_541675594787598_7741246873827235306_n.webp', NULL, NULL, 'https://instagram.com/p/CqjHvr2Memf', 0, 0, '[\"#fruchtig\",\"#yummy\",\"#food\",\"#dessert\",\"#einfachesrezept\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(916, 53, 3058604794495206243, NULL, 'CpyWNr8MYNj', 14, 745, 0, 0, 0, 0, 0, 0, '39.45', '\"Mama, zeig mir die Welt!\"\n\nDrei Monate sind vergangen seit unserem Umzug und noch immer haben wir kein einziges Bild an die Wand gehngt.\n\nIrgendwie \"passen\" manche Bilder, die wir in unserer alten Wohnung geliebt haben, nicht mehr zu uns. Aber irgendwie mchten wir auch unsere schnen neu ausgemalten nagelfreien Wnde nicht \"verunstalten\" \n\nDarum bin ich mittlerweile zum Wandsticker-Fan geworden. Und diesmal hab ich mich gleich in unsere neuen Sticker verliebt, weil sie so pdagogisch wertvoll sind.\n\nAbgesehen von der schnen Zeit, die man mit dem gemeinsamen Aufkleben der Sticker von @wandsticker4u_de verbringt, knnten wir diesmal stundenlang dasitzen und ber die Welt reden.\n\n\"Mama, welches Tier ist das?\"\n\"Mama, wo wohnen wir?\"\n\"Mama, kann man das Eis da oben essen?\"\n\nEs ergeben sich groartige Mglichkeiten der Kommunikation und auch die kleine Frau ist mit Begeisterung dabei \n\nEine Bereicherung frs Kinderzimmer!!\n\nWenn ihr auch mal Wandsticker ausprobieren mchtet (man kann sie brigens ganz einfach wieder von der Wand ablsen), nutzt gerne den Code\nInstaLove und spart 10% beim Kauf von 1 Artikel oder 15% beim Kauf von 2 Artikeln.\n\nWerbung selbstbezahlt\n#wandsticker #pdagogischwertvoll #wandsticker4u #spielen #zeigmirdiewelt #mamaleben #mumlife #lebenmitkindern\n#kreativitt', 1678834126, '[]', 'IMAGE', 'images/content/posts/335645213_739701491206442_2945758230070758089_n.webp', NULL, NULL, 'https://instagram.com/p/CpyWNr8MYNj', 0, 0, '[\"#p\\u00e4dagogischwertvoll\",\"#wandsticker4u\",\"#spielen\",\"#zeigmirdiewelt\",\"#mamaleben\",\"#mumlife\",\"#lebenmitkindern\\n#kreativit\\u00e4t\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(917, 53, 3047768251378490885, NULL, 'CpL2ROtIN4F', 5, 135, 0, 0, 0, 0, 0, 0, '7.28', 'Schon wieder weht uns ein eisiges Lftchen um die Nase, wenn wir uns auf den Weg in den Kindergarten machen. Und am Spielplatz ist es auch wieder einfach nicht mehr aushaltbar.\n\nDarum wollte ich uns wenigstens kulinarisch ein wenig Frhling ins Haus bringen und hab endlich mal wieder ein neues Rezept ausprobiert.\n\nDie kleine Frau sollte auch davon naschen drfen, also hab ich jeglichen raffinierten Zucker durch alternative Sungsmittel ersetzt.(Wenn ihr ganz normalen Haushaltszucker verwenden mchtet, knnt ihr das beim Nachbacken aber natrlich auch tun.)\n\nHier mein Rezept fr herrlich leichte Topfen-Trtchen:\n\n10 kleine Backformen\n\nFr den Boden:\n\n* 4 Eier\n* 80g Kokosbltenzucker\n* 120g Dinkelmehl\n* 15g Kakaopulver ungessst\n* 4 EL Mineralwasser\n\nFr die Joghurtcreme:\n\n* 500g Naturjoghurt\n* 300g Schlagobers\n* 6 Blatt Gelatine\n* 1 Vanilleschote\n* Sungsmittel nach Wahl und Geschmack (ich hab Honig verwendet)\n\nFr das Topping:\n\n* Ca 500g Beeren/Frchte nach Wahl(Ich hab Erdbeeren und Mango verwendet)\n* 4 Blatt Gelatine, aufgelst\n* Sungsmittel nach Wahl und  Geschmack (ich hab Reissirup verwendet)\n\nDen Backofen auf 200 Grad Heiluft vorheizen.\n\nFr den Boden, Eier mit Kokosbltenzucker mindest 5 Minuten lang schaumig rhren. Dann mit einem Lffel portionsweise das Mehl und den Kakao dazugeben und vorsichtig unterheben. Zuletzt das Mineralwasser unterheben.\n\nDie Masse auf ein Backblech (ca 30x40cm) streichen und 10 Minuten backen. Auskhlen lassen und mit den Backformen 10 runde Bden ausstechen.\n\nFr die Creme, Joghurt mit dem Mark der Vanilleschote verrhren. Die Gelatine einweichen und dann in 2 EL Wasser auf dem Herd auflsen und unter die Masse ziehen. Das Schlagobers steif schlagen und unterheben. Mit Sungsmittel nach Geschmack abschmecken.\n\nDie Creme auf die 10 Frmchen verteilen und diese 1 Stunde lang in den Khlschrank stellen.\n\nFr das Topping, die Beeren/Frchte prrieren, Gelatine einweichen und in 2EL Wasser auf dem Herd auflsen. Unter die Beerenmasse ziehen und auf den Trtchen verteilen.\n\nFr mindestens 2 Stunden in den Khlschrank stellen.\n\n#backen #food #yummy #backrezept #Joghurttrtchen #backenistliebe  #lecker\n#backrezepte', 1677542309, '[]', 'IMAGE', 'images/content/posts/333750550_1213227599589006_9150901642356109861_n.webp', NULL, NULL, 'https://instagram.com/p/CpL2ROtIN4F', 0, 0, '[\"#food\",\"#yummy\",\"#backrezept\",\"#joghurtt\\u00f6rtchen\",\"#backenistliebe\",\"#lecker\\n#backrezepte\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(918, 53, 2994927633631916419, NULL, 'CmQHtCiobGD', 60, 880, 0, 0, 0, 0, 0, 0, '48.86', 'GEWINNSPIEL Trchen 17 \n\nDas Fotoshooting fr das Gewinnspielfoto war sehr amsierlich, wie ihr sehen knnt. Vielleicht hnlich chaotisch wie es in meinem Leben gerade zugeht? \n\nGewinnen knnt ihr heute jedenfalls gleich 3 Dinge, die meine verschiedenen beruflichen Ttigkeiten widerspiegeln.\n\n1.) Meine Weihnachts-CD *Because it\'s Christmas*\n2.) Einen Handbalsam von Ringana\n3.) Eine Sprach- oder Gesangsaufnahme eurer Wahl, von mir persnlich aufgenommen (nhere Infos dazu in meiner Story )\n\nEs wird also 3 Gewinner geben!!!\n\nWas musst du dafr tun:\n\nFOLGE: @workingmum_aus_leidenschaft, @mkayalisa und @zeyzeystickerei\nLike und Kommentiere das Foto so oft Du magst und schreibe dazu, was Du gerne gewinnen mchtest (1, 2 oder 3)\nMarkiere, wenn Du mchtest, einen Freund, der sich ebenfalls ber einen Gewinn freuen wrde.\nExtralos: TEILE das Gewinnspiel in deiner Story\n\n PSST.. Umso mehr Kommentare desto hher die Gewinnchance \n\n\n   Start: 17.12.2022 00.00uhr\n Ende: 19.12.2022 23.59Uhr\n\n VIEL GLCK AN ALLE \n\nDie Gewinner werden im Anschluss per Zufallsauslosung gezogen & in der Story bekanntgegeben.\n\nDer Rechtsweg ist ausgeschlossen.\nKeine Barauszahlung.\nInstagram steht in keinem Zusammenhang mit dem Gewinnspiel.\n\nVersand auerhalb Europas muss selbst bernommen werden.\nTeilnahme erst ab 18 Jahren mglich.\n\n#adventskalender #weihnachten #advent #christmas #adventszeit #gewinnspiel #weihnachtszeit #xmas #winter #adventcalendar #geschenk #geschenke #giveaway #verlosung #geschenkideen #vorweihnachtszeit #weihnachtsgeschenke #dezember #kalender', 1671243217, '[]', 'IMAGE', 'images/content/posts/320233626_214291664290749_913813192162511519_n.webp', NULL, NULL, 'https://instagram.com/p/CmQHtCiobGD', 0, 0, '[\"#weihnachten\",\"#advent\",\"#christmas\",\"#adventszeit\",\"#gewinnspiel\",\"#weihnachtszeit\",\"#xmas\",\"#winter\",\"#adventcalendar\",\"#geschenk\",\"#geschenke\",\"#giveaway\",\"#verlosung\",\"#geschenkideen\",\"#vorweihnachtszeit\",\"#weihnachtsgeschenke\",\"#dezember\",\"#kalender\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(919, 53, 2983883804129836416, NULL, 'Clo4oK0Mz2A', 15, 66, 0, 0, 0, 0, 0, 0, '4.21', 'Family Adventskalender  \n\nDas Jahr neigt sich dem Ende zu.\nUm euch und euren kleinen das Warten auf Weihnachten  etwas zu versen haben wir uns etwas tolles fr euch berlegt. \nAb Donnerstag erwartet euch jeden Tag ein anderes Gewinnspiel \n\n um nichts zu verpassen, aktiviert die Glocke auf meinem Profil! Ich zeig euch jeden Tag in der Story bei welchem Profil ihr etwas gewinnen knnt. \n\nFolgende Profile haben das Gewinnspiel ermglicht: \n@schnubsibu \n@mymomlife2014.2020.2022 \n@mami_tinka \n@steffi8909 \n@vannys.mamaleben \n@tanjaweber \n@sellisworld\n@annikaskreativekiste\n@laura_ann2192 \n@zbri89\n@all.about.carmen\n@a.n.n.a._m.a.r.i.e\n@mkayalisa\n@mrs.blik\n@sixcute_design\n@mummy_love2018\n@workingmum_aus_leidenschaft\n@zeyzeystickerei\n@tini.and.the.toon @makidy_muttermilchschmuck\n@idaundrosa\n@stephanies_schokowelt \n@jackilicious_ \n@mrshandmadelove\n\n#adventskalender #weihnachten #advent #christmas  #adventszeit #gewinnspiel #weihnachtszeit  #xmas #winter #adventcalendar #geschenk  #geschenke #giveaway #diy #verlosung #geschenkideen #vorweihnachtszeit #weihnachtsgeschenke #dezember #kalender #weihnachtsdeko', 1669926690, '[]', 'IMAGE', 'images/content/posts/317650405_1134337437450166_8876085591564574517_n.webp', NULL, NULL, 'https://instagram.com/p/Clo4oK0Mz2A', 0, 0, '[\"#weihnachten\",\"#advent\",\"#christmas\",\"#adventszeit\",\"#gewinnspiel\",\"#weihnachtszeit\",\"#xmas\",\"#winter\",\"#adventcalendar\",\"#geschenk\",\"#geschenke\",\"#giveaway\",\"#diy\",\"#verlosung\",\"#geschenkideen\",\"#vorweihnachtszeit\",\"#weihnachtsgeschenke\",\"#dezember\",\"#kalender\",\"#weihnachtsdeko\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(920, 53, 2982964031128734740, NULL, 'CllnftdMgwU', 0, 170, 0, 0, 0, 0, 0, 0, '8.84', 'Der Umzug ist geschafft...\n\n...und als erstes nach den Kinderzimmern musste ich natrlich die Kche einrumen \n\nUnd... tadaaa... ich hab eine eigene Twistshake-Schublade \nMittlerweile haben wir so viele Produkte, dass sich das lohnt \n\nIch liebe ja die Farben und die Muster und selbstverstndlich die Erleichterung im Alltag, die man durch die Produkte versprt.\n\nAber auch, dass es bei @twistshakebaby fr JEDES Alter etwas gibt, vom Beiring ber Hochstuhl und Buggy zum Essbesteck. So finde ich fr meine BEIDEN Kinder immer Produkte und kann Angebote super nutzen.\n\nWie z.B. den aktuellen BLACK FRIDAY SALE, der -50% auf alle Produkte bringt.\n\nUnd mit meinem Code 30workingmumausleidenschaft gibts heute nochmal -30% oben drauf.\n\nDas aber nur mehr wenige Stunden!!!\n\nFolgt gerne dem Link in meiner Bio, um zum Sale zu gelangen!\n\n#twistshake\n@twistshakebaby\n@oliviar.contact\n#igdecembertv\nWerbung', 1669817044, '[]', 'IMAGE', 'images/content/posts/317482685_683069113256271_8208273980883418470_n.webp', NULL, NULL, 'https://instagram.com/p/CllnftdMgwU', 0, 0, '[]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(921, 53, 2977391812432532961, NULL, 'ClR0hQZMpXh', 3, 341, 0, 0, 0, 0, 0, 0, '17.88', 'Ein richtig herbstliches Rezept hab ich heute fr euch....\n\n...und es ist beliebt bei Gro und Klein.\n\nViel Freude beim Nachkochen und vor allem beim Genieen!!!!\n\nKrbiskndel mit Faschiertem und Bergkse!!!\n\n* 300g Butternusskrbis, geschlt, entkernt\n* 100g Kartoffel, geschlt\n* 200g Topfen/Quark\n* 90g Dinkelgries\n* 90g Semmelbrsel\n* 50g Butter, geschmolzen\n* 100g Dinkelmehl\n* 2 Eier\n* Salz, Pfeffer\n\nFr die Fllung:\n\n* 40g Zwiebel, fein gewrfelt\n* 1 Knoblauchzehe, fein gewrfelt\n* 2 EL Sonnenblumenl\n* 300g Faschiertes/Hackfleisch gemischt\n* 1 EL Weiwein\n\nAuerdem:\n\n* 100g Krbiskerne\n* 50g Butter, geschmolzen\n* 100g Bergkse, gerieben\n\nKrbis und Kartoffeln weich kochen und fein prieren.\nMit Topfen, Gries,Brseln, Butter, Mehl und Eiern zu einem Teig mischen.\nMit Salz und Pfeffer wrzen und ca 30 Minuten zugedeckt im Khlschrank ruhen lassen.\n\nFr die Fllung Zwiebel und Knoblauch im l anschwitzen, Faschiertes dazugeben, mitbraten und Weiwein beifgen. Ca 3 Min. bei mittlerer Hitze garen, bis die Flssigkeit verdampft ist. Mit Salz und Pfeffer wrzen.\n\nTeig mit angefeuchtete Hnden zu 12 Kugeln formen. In der Mitte jeder Kugel eine Mulde drcken und mit je 1 EL Faschiertem fllen. Gut verschlieen, rund drehen und in Mehl wlzen.\n\nDie Kndel in siedendem Wasser 15-20 Minuten garen. Sie sind fertig, wenn sie an der Oberflche schwimmen. Kndel mit einem Schaumlffel rausnehmen, abtropfen lassen und sofort in den Krbiskernen wlzen. Mit geschmolzener Butter anrichten und mit Kse bestreuen.\n\nKennt ihr noch andere gute Kndelvariationen? Mcht gerne fter Kndel essen \n\n#kndelliebe #krbiskndel #krbis #kndel #rezept #yummy #food', 1669152784, '[]', 'IMAGE', 'images/content/posts/316477673_1321367611968217_2263347735686043285_n.webp', NULL, NULL, 'https://instagram.com/p/ClR0hQZMpXh', 0, 0, '[\"#k\\u00fcrbiskn\\u00f6del\",\"#k\\u00fcrbis\",\"#kn\\u00f6del\",\"#rezept\",\"#yummy\",\"#food\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928);
