(922, 53, 2735754818372084009, NULL, 'CX3WoM9oaEp', 32, 713, 490, 0, 0, 0, 0, 0, '38.72', 'Mit diesem Mitschnitt meiner Weihnachts-CD-Prsentation wnsch ich euch allen FROHE WEIHNACHTEN!!!\n\n\"The Power Of Love\" von FRANKIE GOES TO HOLLYWOOD ist ja kein typisches Weihnachtslied (wurde aber trotzdem immer bisl mit Weihnachten verknpft, weil es im Musikvideo zu dem Song um die Weihnachtsgeschichte geht). \nWir haben es daher mit auf die CD genommen in einer Version, die nicht unbedingt dem Original entspricht.\nUnd die vielleicht auch dem ein oder anderen Weihnachtsmuffel gefllt \n\nEs lohnt sich das ganze Video anzuschauen, meine groartigen Musikerkollegen zeigen am Schlu nmlich erstmal so richtig was sie draufhaben \n\nPiano: Michael Schnell\nBass: Stefan Thaler\nSchlagzeug: Maria Petrova\n\nUnd das Bild, das ich als Titelbild gewhlt habe ist von Isabell Schatz. \nIch liebe es, irgendwie hat es so eine schne \'Zweideutigkeit\'. Jeder Weihnachtsmuffel wird wissen, was ich meine \n\nWobei ich persnlich Weihnachten ja liebe!!!  \nUnd ihr???\n\n#weihnachten #weihnachtssong #christmas #christmassongs #thepoweroflove #frankiegoestohollywood #cover #christmasalbum', 1640347528, '[]', 'VIDEO', 'images/content/posts/269844526_151546547196079_8832239634832420238_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_292116762721901_8931312738997037888_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=105&_nc_ohc=kdzrfRzd2XgAX_-K5np&edm=AOQ1c0wBAAAA&vs=3146005522309078_468252275&_nc_vs=HBksFQAYJEdJQ1dtQUJ0LXRfN3JRa0JBRURyMXJHZFpmSjdidlZCQUFBRhUAAsgBABUAGCRHTmZ3R0JETk9tR1lMLXNEQUYxT0JTUlBZd3NDYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACac6ZrmwvjbPxUCKAJDMywXQHR7ul41P30YEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=510f438059&ccb=7-5&oh=00_AfC8Gy_b4TqEyZrglPsBH6lOry3x12hGiaLvEstZB8K-Bw&oe=6453E00A&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CX3WoM9oaEp', 0, 0, '[\"#weihnachtssong\",\"#christmas\",\"#christmassongs\",\"#thepoweroflove\",\"#frankiegoestohollywood\",\"#cover\",\"#christmasalbum\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(923, 53, 2722259732400647360, NULL, 'CXHaM2wFyzA', 54, 79, 320, 0, 0, 0, 0, 0, '6.91', '5 Jahre ist es jetzt her, dass mein eigentliches \"Baby Nr.1\" das Licht der Welt erblickt hat - meine Weihnachts-CD \"Because it\'s Christmas\".\n\nPuh, und was ist in diesen 5 Jahren nicht alles passiert???\nIch glaube, es waren die intensivsten aber auch bisher emotionalsten Jahre meines Lebens. Und mit dem kleinen Mann und ab Februar auch mit \"Baby Nr.3\"  wird es sicherlich nicht weniger turbulent weitergehen.\n\nTrotzdem hoffe ich, dass diese musikalischen Freuden, Auftritte, Konzerte, Studio-Gesangstermine wieder mehr werden. So viele Projekte und Engagements vielen in den letzten Jahren ins Wasser.... \n(und dass nicht, weil ich Mutter geworden bin, sondern weil uns leider immer noch ein mhsames Virus im Griff hat, mit dem wir hoffentlich bald Leben lernen werden!!! )\n\nIch schwelge heute also in Erinnerungen und hoffe, euch mit dem Trailer zur damaligen CD-Prsentation ein wenig in Weihnachtsstimmung bringen zu knnen! \n\nLive, 05.12.2016 @theateramspittelberg \n\nPiano: Michael Schnell\nBass: Stefan Thaler\nSchlagzeug: Maria Petrova\nSaxophon: Horst Hausleitner\nDuett-Gesang: Megan Crain\n\nCoverfoto: @isabellschatz_photographer', 1638738745, '[]', 'VIDEO', 'images/content/posts/263700186_485527589573639_8698678444345931242_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/264426837_897228171158915_714520458008257909_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=111&_nc_ohc=gY-gcd4Ble4AX_vp8-R&edm=AOQ1c0wBAAAA&vs=18211482598107661_1039736668&_nc_vs=HBksFQAYJEdGWFZ3Z19EcFd3MkJqQURBSFhsVkNTU2ZPb0pidlZCQUFBRhUAAsgBABUAGCRHT3V0eVEtOWh1bkZBc1lDQVB6aUMwanZOMUp3YnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACakqrHXpLrZQBUCKAJDMywXQHCMQYk3S8cYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=510f47406c&ccb=7-5&oh=00_AfBMkn_MNZzpU