(927, 54, 3090216334017145776, NULL, 'Crip2IUM6uw', 49, 214, 0, 0, 0, 0, 0, 0, '5.17', 'Feigen - Salat\n\nZutaten: \nTomaten \nGurke\nPaprika \nFeigen \nWalnsse \nBacon \nFeta \nHonig \n\nDressing: \n\nHonig \nOlivenl \nSenf \nBalsamico Essig \n\nZubereitung: \n\nTomaten, Gurke, Paprika waschen und in Stcke schneiden. \nFeta in Bacon einrollen und solange backen, bis es schn kross ist. \nFeigen waschen, einschneiden und mit Honig betrufeln. Im Backofen backen. \nWalnsse anrsten und Honig dazugeben. \nDressing vorbereiten. \nAlle Zutaten in einem Salatschlchen anrichten und mit Dressing betrufeln. \nBaguette passt gut dazu. \nGuten Appetit  \n\n#feigen \n#feigenliebe \n#honig \n#salat \n#salatliebe \n#salad \n#saatka \n#salatbowl \n#saladrecipe \n#saladideas \n#leckerschmecker \n#leckerschmecker \n#bowlfood \n#ig_bowl \n#tastyfood \n#tastyfoods \n#gesundeernhrung \n#gesundekche \n#gesunderezepte \n#neuekche \n#neuerezepte \n#einfacherezepte \n#einfachesrezept \n#kochenmitliebe \n#kochenmachtspass \n#kochenmachtglcklich \n#rezeptefrjedentag \n#rezeptwelt \n#bowlrecipes \n#salatrezepte \n#salatrezept', 1682602500, '[]', 'IMAGE', 'images/content/posts/343295456_894179048546058_1196753266783390254_n.jpg', NULL, NULL, 'https://instagram.com/p/Crip2IUM6uw', 0, 0, '[\"#feigen\",\"#feigenliebe\",\"#honig\",\"#salat\",\"#salatliebe\",\"#salad\",\"#sa\\u0142atka\",\"#salatbowl\",\"#saladrecipe\",\"#saladideas\",\"#leckerschmecker\",\"#leckerschmecker\",\"#bowlfood\",\"#ig_bowl\",\"#tastyfood\",\"#tastyfoods\",\"#gesundeern\\u00e4hrung\",\"#gesundek\\u00fcche\",\"#gesunderezepte\",\"#neuek\\u00fcche\",\"#neuerezepte\",\"#einfacherezepte\",\"#einfachesrezept\",\"#kochenmitliebe\",\"#kochenmachtspass\",\"#kochenmachtgl\\u00fccklich\",\"#rezeptef\\u00fcrjedentag\",\"#rezeptwelt\",\"#bowlrecipes\",\"#salatrezepte\",\"#salatrezept\"]', 'post', 'profile_scrape', 0, 1683110932, 1683110932),
