(952, 56, 2267353851380816259, NULL, 'B93QlCbqtmD', 10, 94, 976, 0, 0, 0, 0, 0, '11.5', ' Protein-Pizza  high protein | glutenfrei \nWenn im Teig schon so viel Eiwei drin ist, muss nicht unbedingt noch was obendrauf. Deswegen habe ich mich dieses mal fr eine vegetarische Variante entschieden.  Inspiriert wurde ich von @iqskitchen; habe das Rezept aber natrlich entglutenisiert  \nZutaten:\n glutenfreie Mehlmischung (80 g)\n Proteinpulver geschmacksneutral (50 g)\n Magerquark (125 g)\n Backpulver (5 g)\n Flohsamenschalen gemahlen (1 TL)\n 1 Prise Salz\n\nAnleitung: \n1. Alle Zutaten zu einem Teig verkneten. \n2. Den Teig auf die gewnschte Gre ausrollen. \n3. Nach Belieben belegen. \n4. Im Ofen bei 200-220 Grad Ober-/Unterhitze so lang backen bis die gewnschte Brune erreicht ist. \n5. Guten Appetit!\n\nNhrwerte (ohne Belag) : 565 kcal | 73,1g Kohlenhydrate | 57,5g Eiwei | 3,6g Fett \n#pizza #proteinpizza #pizzalover', 1584509681, '{\"city_name\":\"Kempten\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/90400700_244016999977596_1696900198798733109_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/89640418_287640365537462_8861713503901954091_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5mZWVkLmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=102&_nc_ohc=NFqz-_xMo78AX8cQytE&edm=AOQ1c0wBAAAA&vs=17860220248772924_3484454135&_nc_vs=HBksFQAYJEdPTE5Wd1cybU05OW13VUJBQ3V3Vy0xNklmdDZia1lMQUFBRhUAAsgBABUAGCRHR2JUV1FYTFJuTWJxQ0lDQURhLS1rcllNQ3RaYmtZTEFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMBUAACb4gKSW0vG5PxUCKAJDMywXQDGQ5WBBiTcYEmRhc2hfYmFzZWxpbmVfMV92MREAdeoHAA%3D%3D&_nc_rid=a5bd73821e&ccb=7-5&oh=00_AfCYy_mRawx_1JEh4MyFht3WU-F_6GWq1UCAaabvheThNQ&oe=6453E6CF&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/B93QlCbqtmD', 0, 0, '[\"#pizza\",\"#proteinpizza\",\"#pizzalover\"]', 'post', 'profile_scrape', 0, 1683110938, 1683110938),
(953, 56, 2240547036558539321, NULL, 'B8YBaiooDo5', 12, 96, 604, 0, 0, 0, 0, 0, '11.95', ' Pancakes | high protein | glutenfrei  \nPfannkuchen gehen doch immer, oder!?  \nDafr habe ich einfach ein Ei mit 25g Proteinpulver, 40g Mandelmehl, etwas Backpulver und Wasser/Milch nach Gefhl vermischt und in einer Pfanne ausgebacken. \n#pancakes #pancakelover #pfannkuchen', 1581314061, '[]', 'VIDEO', 'images/content/posts/83740501_181540993071014_38043203296109424_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/85713608_525312218112776_9163056286072146037_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5mZWVkLmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=108&_nc_ohc=xw0kSx0xh8wAX93dn1-&edm=AOQ1c0wBAAAA&vs=17871929956577078_1820252219&_nc_vs=HBksFQAYJEdNamlHd1VJSXlqSXhOMEJBSFdJUGV3a3R5bC1ia1lMQUFBRhUAAsgBABUAGCRHS0pySGdVeVhqamQzcXNJQUlIMi1aV1pQS2REYmtZTEFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMBUAACbsk92onpu%2FPxUCKAJDMywXQDFu2RaHKwIYEmRhc2hfYmFzZWxpbmVfMV92MREAdeoHAA%3D%3D&_nc_rid=a5bd7901a0&ccb=7-5&oh=00_AfDTwv8BIAxrzDJKjZBHSMXO9aFj3XXOnBB2vBxbGMURBQ&oe=6453CC72&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/B8YBaiooDo5', 0, 0, '[\"#pancakes\",\"#pancakelover\",\"#pfannkuchen\"]', 'post', 'profile_scrape', 0, 1683110938, 1683110938),
