(995, 59, 3092552349071482611, NULL, 'Crq8_n3tJ7z', 52, 350, 230, 0, 0, 0, 0, 0, '3.92', 'Skincerely Yours ist eine deutsche Marke, gegrndet und hergestellt in Deutschland, die es in mein Badezimmer geschafft hat.\n\nWerbung @skincerelyyours \n\n \n\nEs reduziert Hautunebenheiten wie Pickelmale,glttet kleine Fltchen und polstert die Haut optisch auf.\nRegelmig angewendet werden Poren sichtbar verfeinert.\n\n   \n\nDie eingesetzten Filter sind von der unbedenklichen Sorte. Die Textur sahnig und reichhaltig (das kommt auch von den UV-Filtern). Vertrglichkeit TOP!\n\n \n\nAlle Benefits auf einen Blick:\n- Spendet Feuchtigkeit\n- Reduziert den Wasserverlust\n- Strkt die Hautbarriere\n- Schtzt die Zellen\n\n  ?\n\nCeramide strken die Hautbarriere, Ectoin schtzt die Zellen, Squalan reduziert den Wasserverlust und Rote Beete Extrakt spendet Feuchtigkeit.\n\n?\n\nEine straffe, erholte und gut durchfeuchtete Haut.\n\n \n\nDas wasserbasierte Reinigungsgel von Skincerely Yours befreit deine Haut grndlich von Schmutz, Talg, Schwei, Make-Up & co. Dabei bewahrt es Feuchtigkeit und wichtige Fette deiner Haut, sodass nach der Reinigung kein Spannungsgefhl entsteht.\nZuerst kann ich sagen, dass sich meine Haut mit allen Produkten wunderbar vertragen hat.\n\n         %\n\nAlle Skincerely Yours Produkte sind frei von tierischen Inhaltsstoffen, Mikroplastik, Duftstoffen, Parfms & therischen len, Farbstoffen, klassischen Konservierungsstoffen wie Parabenen, Silikonen, Minerallen und Paraffinen, PEGs und gnzlich ohne Tierversuche hergestellt.\n\n      ?\n_______________\n#skincerelyyours #skincarecommunity_de #skincareroutine #skincarejunkie', 1682881023, '{\"city_name\":\"NRW\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/343982384_203717525770917_1824222039435000973_n.jpg', NULL, NULL, 'https://instagram.com/p/Crq8_n3tJ7z', 0, 0, '[\"#skincarecommunity_de\",\"#skincareroutine\",\"#skincarejunkie\"]', 'post', 'profile_scrape', 0, 1683111087, 1683111087),
