(997, 59, 3090347258151063962, NULL, 'CrjHnU6slGa', 29, 347, 197, 0, 0, 0, 0, 0, '3.67', '  \n\nAnzeige @thebodyshop \n\n  :   &   \n\nZesty Lime Blossom Water-Gel Body Yogurt\n\nDer erfrischende, zitronige, blumige Sommerduft erinnert Dich an tolle Sommertage.\n\nZieht schnell ein, ist ultra leicht und versorgt Deine Haut 24 Stunden mit Feuchtigkeit.\n\nLuscious Lychee Body Scrub\n\nDie erfrischende, fruchtige Formulierung lsst sich ganz leicht auftragen, peelt Deine Haut ganz sanft, entfernt abgestorbene Hautzellen und hinterlsst Deine Haut geschmeidig und mit Feuchtigkeit versorgt.\n\nLuscious Lychee Duschcreme\n\nDie milchige Textur schumt herrlich und reinigt Deine Haut ganz sanft.\n\nZesty Lime Blossom Duschgel\n\nSorgt fr eine erfrischende Dusche, duftet herrlich blumig und zitronig nach Lindenblte und holt Dir die Sonne in Deine Morgenroutine. Hinterlsst Deine Haut erfrischt und geschmeidig: Sommer in der Flasche.\n\nNeue Summer Limited Edition mit neuen Texturen erfrischt Sommerhaut und duftet herrlich!\n_______________\n#thebodyshopgiftedme  #thebodyshop #limitededition #complimentaryfromthebodyshop #influencer #beautyaddict #summertime', 1682619502, '{\"city_name\":\"Nordrhein-Westfalen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/343277955_567506908823285_7649312308691819364_n.jpg', NULL, NULL, 'https://instagram.com/p/CrjHnU6slGa', 0, 0, '[\"#thebodyshop\",\"#limitededition\",\"#complimentaryfromthebodyshop\",\"#influencer\",\"#beautyaddict\",\"#summertime\"]', 'post', 'profile_scrape', 0, 1683111087, 1683111087),
