(999, 59, 3088799246694371534, NULL, 'Crdnoy5tlDO', 32, 358, 299, 0, 0, 0, 0, 0, '3.8', '     \n\nAnzeige @payot_de_at \n\nDer Augenstick wirkt feuchtigkeitsspendend, abschwellend und khlend mit Eiswrfel-Effekt. Er schtzt die Haut vor Umweltstress, whrend das Bio-Kornblumenbltenwasser die Augenpartie entstaut und feine Linien glttet. Der Stick hat 99 % Inhaltsstoffe natrlichen Urpsrungs, ist vegan, parfmfrei und nach dem Clean Beauty Ansatz von Payot hergestellt.\n\n :\n\nReishi Pilz wirkt gegen uere Umwelteinflsse\n\nBretonische Meeresalge speichert intensiv Feuchtigkeit\n\n \n\nMorning Mask\n\nDie Tuchmaske mit Gojiberren Extrakt, eine Superfrucht, reich an Vitamin C, liefert den richtigen Schuss an Energie, damit die Haut ihre Ausstrahlung und ihr gesundes Aussehen wiedererlangt. Der Tag kann kommen: Die Haut strahlt wieder\n______________\n#payot #payotglow #skincare #skincaretips #skincarenatural #skincarecommunity #contentcreator #beautytips #tutorial #aestetic #blogger_de #reels #influencer #germany', 1682434051, '{\"city_name\":\"Nordrhein-Westfalen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/343288059_623438702587320_1540779887210383453_n.jpg', NULL, NULL, 'https://instagram.com/p/Crdnoy5tlDO', 0, 0, '[\"#payotglow\",\"#skincare\",\"#skincaretips\",\"#skincarenatural\",\"#skincarecommunity\",\"#contentcreator\",\"#beautytips\",\"#tutorial\",\"#aestetic\",\"#blogger_de\",\"#reels\",\"#influencer\",\"#germany\"]', 'post', 'profile_scrape', 0, 1683111087, 1683111087);
