(1001, 59, 3087454351773982759, NULL, 'CrY11_5uOAn', 24, 408, 256, 0, 0, 0, 0, 0, '4.21', '    +    -      (%)   (%) .\n\nWerbung @theordinary @deciem \n\n   ?\n\nLactic Acid is an alpha hydroxyl acid that exfoliates the skin. Direct acids such as Lactic Acid work by encouraging exfoliation of the top layer of the skin.\n\nContinuous daily use visibly improves skins radiance and clarity. This formula contains a derivative of Tasmanian Pepper Berry to reduce signs of inflammation and sensitivity that is often associated with exfoliation.\n\nHow to integrate it into your skin care regimen?\nThe Ordinary recommends a 3-step skincare regimen, 1-Prep 2-Treat 3-Seal, to create an easy skincare regimen. The Ordinary Lactic Acid 5% + HA or 10% + HA are part of the 2-Treat step.\n\nMy skin is noticeably smoother and brighter, and my pores appear smaller after using the 10% concentration. Ive also noticed a reduction in the appearance of fine lines and wrinkles.\n\nIts up to you to choose the concentration that suits you best!\n_____________\n#theordinary#deciem #TheOrdinarygiftedme #complimentaryfromTheOrdinary #reels #beautyaddict #tutorial #aesthetic #contentcreator #influencer #openmyworld', 1682273536, '{\"city_name\":\"NRW\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/342528481_181159728147035_3770475952534051240_n.jpg', NULL, NULL, 'https://instagram.com/p/CrY11_5uOAn', 0, 0, '[\"#theordinarygiftedme\",\"#complimentaryfromtheordinary\",\"#reels\",\"#beautyaddict\",\"#tutorial\",\"#aesthetic\",\"#contentcreator\",\"#influencer\",\"#openmyworld\"]', 'post', 'profile_scrape', 0, 1683111087, 1683111087),
