(1018, 60, 3092286118385325429, NULL, 'CrqAddOOpV1', 2, 38, 443, 0, 0, 0, 0, 0, '2.85', 'Make breakfast with me: Nutbutter toast \n\nThe ingredients that I used: \n\n- wholegrain bread\n- peanut butter from @koro_de \n- Moroccan Amlou (nut butter made from almonds, including honey and argan oil -> probably the best nut butter I ever ate!)\n- honey - to sweeten up the peanut butter toast\n- fresh fruits, I always vary the fruits I put on top, depending on what I fancy. Banana is my go to option though \n\n#breakfastinspo #breakfast #nutbuttertoast', 1682849552, '{\"city_name\":\"Frankfurt\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/343971627_775906044156573_6339724006788250463_n.jpg', NULL, NULL, 'https://instagram.com/p/CrqAddOOpV1', 0, 0, '[\"#breakfast\",\"#nutbuttertoast\"]', 'post', 'profile_scrape', 0, 1683111092, 1683111092),
(1019, 60, 3087421423693377708, NULL, 'CrYuW1PLLCs', 4, 110, 0, 0, 0, 0, 0, 0, '8.11', 'Dancing in the rain, or skating, doesnt matter \n\nGrowing up I had a waveboard but havent been on anything skateboard-like since then. So getting back on a surfskateboard did cost me overcoming my fears. \nFinal conclusion, It was great to see how quickly my body memorized the movements!\nWuhuuu, fun and a great way to practice the movements needed for surfing! \n\n#surfskate #surfskateboard #outofcomfortzone', 1682269336, '[]', 'IMAGE', 'images/content/posts/342726920_114864758252482_3124667592647695029_n.jpg', NULL, NULL, 'https://instagram.com/p/CrYuW1PLLCs', 0, 0, '[\"#surfskateboard\",\"#outofcomfortzone\"]', 'post', 'profile_scrape', 0, 1683111092, 1683111092),
