(1021, 60, 3084257123592279224, NULL, 'CrNe4NHr5S4', 2, 40, 305, 0, 0, 0, 0, 0, '2.99', 'Make breakfast with me: Quick and easy microwave porridge bowl \n\n1) In a bowl: Mix 50g of oats, cinnamon, salt, and plant milk (I used oatmilk).\n3) Heat it in the microwave until the desired texture is reached.\n4) Add your favorite toppings. I used: Banana, blueberries, cherries, peanut butter, granola, more oat milk:), honey, cacao powder\n\n#porridge #breakfast #makebreakfastwithme #porridgebowl #porridgerecipe #breakfastinspo', 1681892150, '[]', 'VIDEO', 'images/content/posts/341554719_213107938088635_4511682789296122042_n.jpg', NULL, NULL, 'https://instagram.com/p/CrNe4NHr5S4', 0, 0, '[\"#breakfast\",\"#makebreakfastwithme\",\"#porridgebowl\",\"#porridgerecipe\",\"#breakfastinspo\"]', 'post', 'profile_scrape', 0, 1683111092, 1683111092),
(1022, 60, 3082115329803273246, NULL, 'CrF35ANtcQe', 1, 45, 489, 0, 0, 0, 0, 0, '3.27', 'Start the day with me : Weekend morning routine  \n\nI start my days with a glas of warm water, adding a squeeze of lemon juice. That wakes me up and kick starts my digestion.\nAnother habit I developed is to put on my workout clothes first thing in the morning, that way I set the right tone for the day, and my workout is non-negotiable!\nNext, healthy breakfast -> recipe to follow! I realized that for my body it is better to eat before working out. Otherwise I lack the energy to get through a whole workout.\nWorkout time - I always vary the type of exercise, depending on how my body feels at the end of the week. My options are yoga, pilates, or strength workouts.\nAfter working out I enjoy calm me-time. Especially on weekends I love investing extra time in my beauty routine. \n\n#morningroutine #weekendroutine #starttheday #morninghabits', 1681636836, '[]', 'VIDEO', 'images/content/posts/341557601_209461818456956_4220945503800088794_n.jpg', NULL, NULL, 'https://instagram.com/p/CrF35ANtcQe', 0, 0, '[\"#morningroutine\",\"#weekendroutine\",\"#starttheday\",\"#morninghabits\"]', 'post', 'profile_scrape', 0, 1683111092, 1683111092),
