(1070, 62, 2757520581509389562, NULL, 'CZErlvhshz6', 3, 205, 114, 0, 0, 0, 0, 0, '4.69', 'In der Weihnachtszeit habe ich viel gebacken.. wie man sieht \nUnd habe kleine Geschenktten fr die Familie und Angehrigen zusammen gestellt \nEs wurden Cookies mit Schokostckchen, Pltzchen eingetunkt in Kuvertre, Marmeladen Pltzchen, Streusel Pltzchen und speziell fr meine Mama Cranberrie Kekse \nSie haben sich sehr gefreut. \n\n#cookies #present #dessert #bakery #schokolade #rezept #bake #selbstgebacken #foodie #kuchenbacken #backliebe #delicious #selfmade #torten  #backenmachtspass  #foodstagram #leckerschmecker #pl #hobbyb #t #m #bakinglove #chocolate #sweet', 1642942102, '[]', 'VIDEO', 'images/content/posts/272444267_4639875256111851_7502409501160247656_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/272651292_526330875198580_1151955130320079088_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjQ4MC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=104&_nc_ohc=Jz-t8vIl3MYAX-GB24Y&edm=AOQ1c0wBAAAA&vs=1224198747985779_2340666860&_nc_vs=HBksFQAYJEdCeFVRQkIwdk5uMHNkNEJBUERJNm5NV2tmd1BidlZCQUFBRhUAAsgBABUAGCRHS2hKT2hCcWl0QTZFREVDQUVFR3JGZ1UyeDlBYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbgyr%2BH3MTNPxUCKAJDMywXQDCiDEm6XjUYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=d4985159ac&ccb=7-5&oh=00_AfB7H1V4fwjiK6FsM7LbXdyMzuKl6G0nnALQXGdNPRVyrw&oe=6454274F&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CZErlvhshz6', 0, 0, '[\"#present\",\"#dessert\",\"#bakery\",\"#schokolade\",\"#rezept\",\"#bake\",\"#selbstgebacken\",\"#foodie\",\"#kuchenbacken\",\"#backliebe\",\"#delicious\",\"#selfmade\",\"#torten\",\"#backenmachtspass\",\"#foodstagram\",\"#leckerschmecker\",\"#pl\",\"#hobbyb\",\"#t\",\"#m\",\"#bakinglove\",\"#chocolate\",\"#sweet\"]', 'post', 'profile_scrape', 0, 1683111107, 1683111107),
(1071, 63, 3047392827902473060, NULL, 'CpKg6GWMzNk', 88, 349, 0, 0, 0, 0, 0, 0, '17.75', 'Ich habe gerade durch meinen Feed gescrollt und gesehen, dass es berhaupt nicht viele Fotos von unserer Kche gibt \n\nDies liegt berhaupt nicht daran, dass ich sie nicht mag oder so. Ich liebe sie mit ihrem schlichten, zeitlosen Design sogar sehr \n\nIch glaube der Grund ist einfach, dass unsere Kche etwas das Zentrum des Geschehens ist und immer mal was rumsteht und es daher auch nicht einfach so schnell, schnell ein Foto gibt  Bei mir ist es nmlich oft so, dass ich im Haus unterwegs bin und pltzlich machts klick und ich sehe ein Foto  \nAber bei der Kche ist das selten so. Mir ist zwar mega wichtig, dass sie immer schn aufgerumt ist, aber das ein oder andere steht halt doch einfach da. Beispielsweise Trinkflaschen der Kinder, Wasserkocher, Handykabel, etc.\n\nSagt mal wie ist das bei euch? Freue mich ber eure Kommentare  \n.\n.\n.\n.\n.\n.\n#kitchen #kitchengoals #kche #offenekche #instakche #instahome #hausundgartenliebe #interior #interiorblogger #zeitlose #design #kitchendesign #miele #hausbau #traumhaus #hausbau2020 #eigenheim #reallife #momlife', 1677497555, '[]', 'IMAGE', 'images/content/posts/333471615_1618247455278394_4393476213733277848_n.jpg', NULL, NULL, 'https://instagram.com/p/CpKg6GWMzNk', 0, 1, '[\"#kitchengoals\",\"#k\\u00fcche\",\"#offenek\\u00fcche\",\"#instak\\u00fcche\",\"#instahome\",\"#hausundgartenliebe\",\"#interior\",\"#interiorblogger\",\"#zeitlose\",\"#design\",\"#kitchendesign\",\"#miele\",\"#hausbau\",\"#traumhaus\",\"#hausbau2020\",\"#eigenheim\",\"#reallife\",\"#momlife\"]', 'post', 'profile_scrape', 0, 1683111113, 1683111113),
(1072, 63, 3031405164179469639, NULL, 'CoRtu-NM7VH', 113, 511, 0, 0, 0, 0, 0, 0, '25.35', 'Bei uns hat heute Morgen seit Tagen wieder mal die Sonne geschienen, einfach so schn \n\nDa musste ich einfach direkt ein Foto machen, zumal meine Fotovorrte auch bald zu Ende gehen  ja und wie ihr seht sind auch noch die nicht ganz so vorzeigbaren Decken auf dem Sofa, die wir zum Schutz aufs Sofa gelegt haben und es einfacher machen Flecken von den Kindern zu entfernen. Sonst werden die ja immer weggerumt, aber heute hatte ich Angst, dass die Sonne sonst schon wieder weg ist  Somit sag ich nur #mehrrealittaufinstagram \n\nAlso, Hand aufs Herz, was rumt ihr jeweils fr die Fotos weg? \n.\n.\n.\n.\n.\n.\n#interior #home #hausundgartenliebe #wohnzimmer #scandi #blogger #interiorblogger #viral #design #haus #hausbau2020 #traumhaus #offeneswohnen #parkett #holzboden #lichteinfall', 1675591677, '[]', 'IMAGE', 'images/content/posts/329392633_131184476272168_7298291361649940641_n.jpg', NULL, NULL, 'https://instagram.com/p/CoRtu-NM7VH', 0, 1, '[\"#mehrrealit\\u00e4taufinstagram\",\"#home\",\"#hausundgartenliebe\",\"#wohnzimmer\",\"#scandi\",\"#blogger\",\"#interiorblogger\",\"#viral\",\"#design\",\"#haus\",\"#hausbau2020\",\"#traumhaus\",\"#offeneswohnen\",\"#parkett\",\"#holzboden\",\"#lichteinfall\"]', 'post', 'profile_scrape', 0, 1683111113, 1683111113),
(1073, 63, 2851146235449551667, NULL, 'CeRTmUmqasz', 25, 325, 0, 0, 0, 0, 0, 0, '14.22', 'Da es heute nicht wirklich Gartenwetter war  mal ein Foto vom Inneren des Hauses. \n\nUnser Eingangsbereich\n\nWir sind so froh uns fr diesen grossen Einbauschrank entschieden zu haben. So hlt sich das Jacken-Chaos einigermassen in Grenzen \n\nIn diesem Sinne wnsche ich euch einen schnen Abend  \n\n#hausbau2020 #eingangsbereich #einbauschrank #ordnung #hellefarben #sitzbank #interior #scandihome #scandistyle #eingangsinspo #teppich #mybenuta \n@benuta', 1654103138, '[]', 'IMAGE', 'images/content/posts/285217883_168692228898198_1242233069486898506_n.jpg', NULL, NULL, 'https://instagram.com/p/CeRTmUmqasz', 0, 1, '[\"#hausbau2020\",\"#eingangsbereich\",\"#einbauschrank\",\"#ordnung\",\"#hellefarben\",\"#sitzbank\",\"#interior\",\"#scandihome\",\"#scandistyle\",\"#eingangsinspo\",\"#teppich\",\"#mybenuta\"]', 'post', 'profile_scrape', 0, 1683111113, 1683111113),
