(1076, 63, 3088508737253133322, NULL, 'CrcllU5qcwK', 47, 98, 0, 0, 0, 0, 0, 0, '5.89', 'Heute zum Thema #bathroom bin ich auch mal wieder bei der #iic dabei. \n\nHeute ein Blick in unser Hauptbad. Wir haben die Toilette mit dieser Wand etwas abgegrenzt was Privatsphre schafft, obwohl das Bad aber sonst sehr offen gestaltet ist. Fr uns die perfekte Lsung  \n.\n.\n.\n.\n.\n.\n#instagraminteriorchallenge #badezimmer #bathroomgoals #hausundgartenliebe #hausbau #masterbad', 1682398954, '[]', 'IMAGE', 'images/content/posts/342921591_762592138636362_4390935513929013810_n.jpg', NULL, NULL, 'https://instagram.com/p/CrcllU5qcwK', 0, 0, '[\"#bathroom\",\"#iic\",\"#badezimmer\",\"#bathroomgoals\",\"#hausundgartenliebe\",\"#hausbau\",\"#masterbad\"]', 'post', 'profile_scrape', 0, 1683111113, 1683111113),
(1077, 63, 3085935124180255813, NULL, 'CrTcaU8qkRF', 25, 79, 1141, 0, 0, 0, 0, 0, '4.22', 'Da mir das Reel vom Magnolienbumchen so gefallen hat gibts das jetzt fr euch nochmals einfach mit anderer Musik. Finde einfach das gehrt in den Feed \n\nLeider hat es die Blten dieses Jahr etwas verhagelt, hoffe aber es wchst nun gut an und kann dann nchstes Jahr wieder in voller Pracht blhen \n\nMusik : @thisislioba \n.\n.\n.\n.\n.\n.\n#magnolie #garten #gartensaison2023 #pflanzen #gartenliebe #hausundgartenliebe #gartenblogger #traumhaus #hanglage #springvibes #magnolienblte #aussicht #garteninspo #magnolienstrauch #lizenfreiemusik #reupload', 1682092188, '[]', 'VIDEO', 'images/content/posts/342378218_885793272514336_5216645277732319187_n.jpg', NULL, NULL, 'https://instagram.com/p/CrTcaU8qkRF', 0, 0, '[\"#garten\",\"#gartensaison2023\",\"#pflanzen\",\"#gartenliebe\",\"#hausundgartenliebe\",\"#gartenblogger\",\"#traumhaus\",\"#hanglage\",\"#springvibes\",\"#magnolienbl\\u00fcte\",\"#aussicht\",\"#garteninspo\",\"#magnolienstrauch\",\"#lizenfreiemusik\",\"#reupload\"]', 'post', 'profile_scrape', 0, 1683111113, 1683111113),
(1078, 63, 3084542400587738019, NULL, 'CrOfviBqauj', 26, 122, 199, 0, 0, 0, 0, 0, '6.01', 'Heute Abend war ich nach der Arbeit noch kurz im Garten. Der Tag war sehr nervenaufreiben und stressig und da liebe ich es noch kurz im Garten durchzuatmen, all die Pflanzen die blhen anzuschauen oder auch einfach in den Himmel zu schauen. Das gibt mir total viel Energie und erdet mich dann auch wieder. Dabei ist dieses spontane Reel entstanden. \n\nWas ist eure #auszeitimalltag ?\n\nMusik : @sonnenberg_musik \nDanke fr dieses tolle Lied \n.\n.\n.\n.\n.\n.\n#garten #gartenliebe #hausundgartenliebe #gartenreel #spontanesreel #durchatmen #energietanken #metime #batterienaufladen #auszeitimalltag #lizenzfreiemusik', 1681926146, '[]', 'VIDEO', 'images/content/posts/342119070_242125641697713_872343361232965640_n.jpg', NULL, NULL, 'https://instagram.com/p/CrOfviBqauj', 0, 0, '[\"#auszeitimalltag\",\"#gartenliebe\",\"#hausundgartenliebe\",\"#gartenreel\",\"#spontanesreel\",\"#durchatmen\",\"#energietanken\",\"#metime\",\"#batterienaufladen\",\"#auszeitimalltag\",\"#lizenzfreiemusik\"]', 'post', 'profile_scrape', 0, 1683111113, 1683111113),
(1079, 63, 3083590676276529420, NULL, 'CrLHWHsK0kM', 43, 100, 247, 0, 0, 0, 0, 0, '5.81', 'Heute Morgen habe ich die Zeit mal wieder im Garten genutzt. Und schaut mal was da schnes bei rausgekommen ist  \n.\n.\n.\n.\n.\n.\n#felsenbirne #kupferfelsenbirne #garten #outdoor #gartenblogger #gartensaison2023 #wildtriebe #ste #dekoste #dekoinspiration #diy #ausdemeigenengarten #gartenreel', 1681812716, '[]', 'VIDEO', 'images/content/posts/341755317_238256035399823_4983164777763181641_n.jpg', NULL, NULL, 'https://instagram.com/p/CrLHWHsK0kM', 0, 0, '[\"#kupferfelsenbirne\",\"#garten\",\"#outdoor\",\"#gartenblogger\",\"#gartensaison2023\",\"#wildtriebe\",\"#\\u00e4ste\",\"#deko\\u00e4ste\",\"#dekoinspiration\",\"#diy\",\"#ausdemeigenengarten\",\"#gartenreel\"]', 'post', 'profile_scrape', 0, 1683111113, 1683111113);
