(1114, 66, 3091818284465585942, NULL, 'CroWFk7oP8W', 2, 164, 1400, 0, 0, 0, 0, 0, '1.71', '(Functional) Bodybuilding \nThe last couple weeks i trained like a #bodybuilder More on machines, for example my new hate -love relationship with the smith machine  \nIm so in love with the #process and also what bodybuilding do with my #mindset! \nEven though my ingredients in training are still the same: ROM, tempo, quality work  \nTraining through a Full Range of Motion is different for each person. But you do have your own unique functional range at each joint, and i encourage you to always explore that full range. When you keep your joints strong at all angles, you can increase flexibility with weight training. And you can improve joint health.\n\nTraining through a full range of motion will keep you in the game longer. Strength is gained in the range it is trained. \n\nStay healthy and strong, \nNatalie ', 1682794519, '[]', 'VIDEO', 'images/content/posts/344278890_1919899411696146_3115223888345924860_n.jpg', NULL, NULL, 'https://instagram.com/p/CroWFk7oP8W', 0, 0, '[\"#bodybuilder\",\"#process\",\"#mindset!\"]', 'post', 'profile_scrape', 0, 1683130093, 1683130093),
