(1181, 69, 3077746248450402162, NULL, 'Cq2WegHrWdy', 132, 302, 2740, 0, 0, 0, 0, 0, '4.29', ' DEIN ONLINE KURS \n\nEs erwartet dich ein fast 3 stndiges Video (2 VIDEOS) mit umfangreicher\nGrserkunde\ndas richtige Grser trocknen und lagern, welches Werkzeug man braucht und \nwie man einen runden Korb wickelt. \n\nAuerdem gibt es dazu natrlich auch ein Workbook.\nDer Online Kurs kostet 135  und nach dem download gehrt er dir.\n\nDu kannst ihn dir ansehen, WO du willst und WANN du willst!\n\n#kurs #online #onlinekurs  #handwerk #handwerkrockt #kreativitt #gewinnspiele #glcklich #korb #krbe #naturmaterialien #workshop #handwerken #handgemacht #mitliebegemacht #selbstgemacht #naturpur #naturmaterial #naturspirit', 1681117886, '{\"city_name\":\"M\\u00f6nchdorf\",\"region_name\":\" Oberosterreich\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/340188690_1700174183753445_5890632059596071624_n.jpg', NULL, NULL, 'https://instagram.com/p/Cq2WegHrWdy', 0, 1, '[\"#online\",\"#onlinekurs\",\"#handwerk\",\"#handwerkrockt\",\"#kreativit\\u00e4t\",\"#gewinnspiele\",\"#gl\\u00fccklich\",\"#korb\",\"#k\\u00f6rbe\",\"#naturmaterialien\",\"#workshop\",\"#handwerken\",\"#handgemacht\",\"#mitliebegemacht\",\"#selbstgemacht\",\"#naturpur\",\"#naturmaterial\",\"#naturspirit\"]', 'post', 'profile_scrape', 0, 1683130200, 1683130200),
(1182, 69, 3014113603185204794, NULL, 'CnUSFpGht46', 44, 295, 2730, 0, 0, 0, 0, 0, '3.35', '** RUNENMAGIE**\nSie sind da!!\n\nHeute habe ich mein Kartendeck \"Runenmagie\" von der Druckerei abgeholt. \n\nDie Karten & Begleitheft sind kologisch gedruckt und aus Naturpapier. Sie ruhen in einem Karton aus Kraftpapier. \n\nVor 2 Jahren habe ich damit angefangen, doch es wollte nicht sein. Jetzt bin ich um so dankbarer.\n\nAuch euch DANKE, es haben schon so viele (vor)bestellt, dass ich gleich einen zweiten Druck in Auftrag gegeben habe. \n\nSie sind schon fix in meinen Shop eingezogen, ab Montag werde ich dann die Sammelbestellungen zur Post bringen.\n\nIch bin schon so gespannt was ihr sagt. \n\n#runen #rune #runenmagie #magie #nordischerschamanismus #orakel #orakelkarten #magisch #spiritualitt #geheimnis #naturspirit', 1673531629, '{\"city_name\":\"M\\u00f6nchdorf\",\"region_name\":\" Oberosterreich\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/324851692_181079804569801_2585196553345556507_n.jpg', NULL, NULL, 'https://instagram.com/p/CnUSFpGht46', 0, 1, '[\"#rune\",\"#runenmagie\",\"#magie\",\"#nordischerschamanismus\",\"#orakel\",\"#orakelkarten\",\"#magisch\",\"#spiritualit\\u00e4t\",\"#geheimnis\",\"#naturspirit\"]', 'post', 'profile_scrape', 0, 1683130200, 1683130200),
(1183, 69, 3092548065713352078, NULL, 'Crq8BSrqm2O', 13, 217, 0, 0, 0, 0, 0, 0, '2.27', 'TANZ  IN  DEN  MAI\n\nJe nachdem von welcher Seite wir es betrachten, ist heute oder am 5. Mai zu Vollmond, Beltane oder die Walpurgisnacht.\n\nMit Freunden oder Gruppen hab ich zu Walpurgis frher in Birken, bunte Bnder mit Wnschen in den Baum gebunden. \n\nBeltane ist das Fest der Fruchtbarkeit und Verschmelzung von Mann und Frau. Ein Fest der Sinnlichkeit und Erotik - dazu spter noch mehr. Die Kelten feierten dieses Fest, weil sie damit demonstrierten entgltig den Winter besiegt zu haben und der Sommer die Oberhand gewinnt. Also der keltische Sommerbeginn.\n\nWie begehst du Beltane?\n\nIch wnsche euch von Herzen, einen freudvollen Tanz in den Mai.\n\n#beltane #beltaneblessings #tanzindenmai #walpurgisnacht #walpurgis #spiritualitt #ritual #zeremonie #mai #sinnlich #fruchtbarkeit #naturspirit', 1682880479, '{\"city_name\":\"M\\u00f6nchdorf\",\"region_name\":\" Oberosterreich\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/344277516_222162160442153_7667321713051675514_n.webp', NULL, NULL, 'https://instagram.com/p/Crq8BSrqm2O', 0, 0, '[\"#beltaneblessings\",\"#tanzindenmai\",\"#walpurgisnacht\",\"#walpurgis\",\"#spiritualit\\u00e4t\",\"#ritual\",\"#zeremonie\",\"#mai\",\"#sinnlich\",\"#fruchtbarkeit\",\"#naturspirit\"]', 'post', 'profile_scrape', 0, 1683130200, 1683130200),
(1184, 69, 3090347304178783277, NULL, 'CrjHn_yKZQt', 17, 206, 2638, 0, 0, 0, 0, 0, '2.2', ' Beltane - Walpurgisnacht \n\nSorry nochmal fr die Unannehmlichkeiten, vielleicht ist es beim Mitschnitt besser anzuhren.\n\nEinen Beitrag zu Beltane und auch den Kruterwein, findest du in meinem Naturmagazin\nauf meiner Website. In die Suchleiste einfach Beltane eingeben.\n\nIch wnsche euch eine schne Hexennacht vom 30. April - 1. Mai', 1682618152, '{\"city_name\":\"M\\u00f6nchdorf\",\"region_name\":\" Oberosterreich\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/343601109_1088717905852028_1532883918465289498_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/10000000_5838515876275834_3146563553441004084_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=110&_nc_ohc=uBl4R9eVdA4AX-QhuwO&edm=AOQ1c0wBAAAA&vs=17847359465960187_2072705814&_nc_vs=HBksFQAYJEdJQ1dtQUI2SnRKb0diNFVBRFM2Q25MaDFxb3JicUNCQUFBRhUAAsgBABUAGCRHSUNXbUFCM0JwNlpvN0FBQUxkLXpXTGQxc2tCYnFDQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbo6secseT0PxUCKAJDMywXQKZsoMSbpeMYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=c7d8ae623a&ccb=7-5&oh=00_AfB9FM_Kvgb5j5LTNvXwWl55TF0AVASQYLizSovwwEDljg&oe=64542A2E&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CrjHn_yKZQt', 0, 0, '[]', 'post', 'profile_scrape', 0, 1683130200, 1683130200),
(1185, 69, 3089460134039059765, NULL, 'Crf95-NIP01', 55, 591, 0, 0, 0, 0, 0, 0, '6.38', ' LWENZAHNKAPERN \n\nHeuer mag zwar der Frhling noch nicht so richtig in Schwung kommen, trotzdem nutze ich die zwischendurch warmen und sonnigen Tage, um die immer mehr werdenden Kruter zu pflcken. Diese verarbeite ich zu schmackhaften Leckereien oder Naturkosmetik Produkten. Derzeit bin ich stndig am Einkochen. \n\nBrlauch, Gnseblmchen, Vogelmiere, Brunnenkresse und jetzt der Lwenzahn.\n\nDer Lwenzahn ist ein Vertreter der Familie der Korbbltler. Der Korbboden dieser Familie gelten als besonders nahrhaft, deswegen wurden diese auch oft als Notnahrung eingekocht und gegessen. Die Bitterstoffe eignen sich wunderbar fr eine Leberkur. Wie bei allen Frhjahrsblhern hat auch der Lwenzahn eine blutreinigende Wirkung. Dabei werden die Verdauungsorgane, Niere und Blase angeregt und altes ausgeschieden. Wegen seiner Vitamine ist er auch in Kombination mit anderen Frhlingskrutern, gegen die anbrechende Frhjahrsmdigkeit einsetzbar. \n\nUnd da es einige Blten gibt, die sich wunderbar als falsche Kapern einlegen lassen, so sind es heute die Lwenzahnblten.\n\nDu brauchst dafr gar nicht viel.\n Lwenzahnknospen\n Essig\n Honig\n Senfkrner\nDille\n Pfefferkrner\n Wacholderbeeren\n\nWie die eingelegten Knospen genau gemacht werden, findest du als neuen Blogbeitrag in meinem Naturmagazin. Den Link dafr findest du in meinem Profil.\n\nAus dem Lwenzahn kann man ja vieles machen.\n Hast du auch so ein Lieblingsrezept vom Lwenzahn? \n\n#lwenzahn #lwenzahnkapern #dandelion #wildkruterkche #wildkruter #vegan #plantbased #veganerezepte #kruterkche #kruterhexe #kruterliebe #kruterrezepte #kruter #knospen #naturspirit', 1682512369, '{\"city_name\":\"M\\u00f6nchdorf\",\"region_name\":\" Oberosterreich\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/343159666_1255751922004397_361488424408604928_n.jpg', NULL, NULL, 'https://instagram.com/p/Crf95-NIP01', 0, 0, '[\"#l\\u00f6wenzahnkapern\",\"#dandelion\",\"#wildkr\\u00e4uterk\\u00fcche\",\"#wildkr\\u00e4uter\",\"#vegan\",\"#plantbased\",\"#veganerezepte\",\"#kr\\u00e4uterk\\u00fcche\",\"#kr\\u00e4uterhexe\",\"#kr\\u00e4uterliebe\",\"#kr\\u00e4uterrezepte\",\"#kr\\u00e4uter\",\"#knospen\",\"#naturspirit\"]', 'post', 'profile_scrape', 0, 1683130200, 1683130200),
(1186, 69, 3088805700192842443, NULL, 'CrdpGtMMjLL', 40, 353, 1495, 0, 0, 0, 0, 0, '3.88', ' JAHRESZEITENKORB \n\nEinen besonderen Korb mchte ich euch heute vorstellen. 1 Korbdesign, 4 Jahreszeiten, 4 Farben.\n\n Frhling\n Sommer\n Herbst \n Winter\n\nEndlich habe ich es geschafft, alle 4 fertig zu bekommen, um sie euch gemeinsam zu zeigen. Lange hat es gedauert, doch jetzt sind sie da, die Schnheiten.\n\nDiese Krbe strahlen in den Farben der Jahreszeiten und genauso habe ich sie auch genannt.\n\nAlle 4 findest du ab 1. Mai in meinem Shop. \n\n Na was sagt ihr dazu, wie gefallen sie euch? \n\n#jahreszeiten #korb #krbe #selbstgemacht #handgemacht #alteswissen #kunsthandwerk #handwerkskunst #brauchtum #tradition #naturmaterial #naturliebe #korbliebe #naturspirit', 1682435015, '{\"city_name\":\"M\\u00fchlviertel\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/343125238_273443128346558_2679395542879215505_n.jpg', NULL, NULL, 'https://instagram.com/p/CrdpGtMMjLL', 0, 0, '[\"#korb\",\"#k\\u00f6rbe\",\"#selbstgemacht\",\"#handgemacht\",\"#alteswissen\",\"#kunsthandwerk\",\"#handwerkskunst\",\"#brauchtum\",\"#tradition\",\"#naturmaterial\",\"#naturliebe\",\"#korbliebe\",\"#naturspirit\"]', 'post', 'profile_scrape', 0, 1683130200, 1683130200),
(1187, 69, 3085946611926239899, NULL, 'CrTfBfvrwqb', 13, 135, 1270, 0, 0, 0, 0, 0, '1.46', ' SELFCARE \n\nJetzt beginnt wieder die Zeit, wo es bei mir drunter und drber geht. Ein Workshop nach dem anderen und ich muss aufpassen, dass ich nicht auf der Strecke bleibe.\n\nWas mir da hilft? Ein ausgiebiges Bad, mit Blten, Badepralinen oder Badeessenzen und leiser, gemtlicher Musik.\n\nUnd ja, auch mir fehlt oft die Zeit, dass ich meine Naturkosmetik Produkte selber mache und dann kaufe ich welche. Aber nicht irgendwo.\n\nWerbung:\nMeine Produkte stammen vom @handmade_by_nature_shop \nHandmade by Nature steht fr die Wertschtzung der Natur und traditioneller Handwerkskunst. Der 100% sterreichische Onlineshop mit handgemachten Produkten aus ganz sterreich, bei denen BIO Standard ist. Die meisten Produkte haben eine weit hhere Qualitt ganz ohne Gtesiegel.\n\nIch stbere so gerne durch diesen Shop, doch dort gibt es nicht nur Naturkosmetik, sondern auch Bio Lebensmittel, Schmuck, nachhaltiger Lebensstil, fr Katz & Hund, Geschenkkrbe, Gesundheit, Sport & Freizeit, Mode - Fashion und vieles mehr.\n\nUnd wisst ihr was? Ich habe ein ganz besonderes Zuckerl fr euch. Muttertag steht vor der Tre und die Geschenkkrbe sind ein Traum. \n\nIch darf euch auf den gesamten Einkauf mit meinem Rabattcode:\nNaturspirit\n10% anbieten. Glaubt mir, da werdet ihr sicher fndig. \n\n Viel Freude beim Stbern! \n\n#naturkosmetik #nachhaltig #bio #lebensmittel #nachhaltigkeit #natural \n#naturprodukt #ko #naturschutz #umweltschutz #klimaschutz #muttertag #schenken #dankbarkeit #schenkenmachtfreude #mutter #schenkenmachtglcklich', 1682094762, '{\"city_name\":\"M\\u00f6nchdorf\",\"region_name\":\" Oberosterreich\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/342354051_6169647446455480_5064605834388148740_n.jpg', NULL, NULL, 'https://instagram.com/p/CrTfBfvrwqb', 0, 0, '[\"#nachhaltig\",\"#bio\",\"#lebensmittel\",\"#nachhaltigkeit\",\"#natural\",\"#naturprodukt\",\"#\\u00f6ko\",\"#naturschutz\",\"#umweltschutz\",\"#klimaschutz\",\"#muttertag\",\"#schenken\",\"#dankbarkeit\",\"#schenkenmachtfreude\",\"#mutter\",\"#schenkenmachtgl\\u00fccklich\"]', 'post', 'profile_scrape', 0, 1683130200, 1683130200),
(1188, 69, 3084204298891461952, NULL, 'CrNS3gSKIVA', 203, 517, 0, 0, 0, 0, 0, 0, '7.11', ' THAT\'S  ME \n\nTja, man solls nicht glauben, doch ich bin schon ber ein halbes Jahrhundert jung, ganze 54. Und zwar heute am 19. April\n\nIn den brigen Fotos ist jeweils ein Jahrzehnt dazwischen. Am 2. Foto bin ich 40, dann 33 und schlielich se 24, einfach unglaublich.\n\nTrotzdem hab ich nichts ausgelassen und gelebt, geliebt, gelitten und geweint, tja \"that\'s live\" sozusagen. \n\nJetzt ist es wohl amtlich, ich gehre zum alten Eisen und wisst ihr was? lter werden tut gar nicht weh. Na gut, ab und zu zwickt es schon mal \n\nIch bin dankbar, dass ihr mich hier begleitet. \nIch bin dankbar, dass ihr meine Seite mgt.\nIch bin dankbar, dass ihr mir dabei helft, dass ein so altes Handwerk nicht ausstirbt und\nIch bin dankbar, dass ich durch eure Einkufe, meine Berufung leben darf.\n\n SCHN,  DASS  ES  EUCH  GIBT!!! \n\nP.S Bin schon gespannt, was ihr zu den lteren Fotos sagt. \n\n#birthday #geburtstag #dankbar #thankyou #danke #dankefralles #leben #lieben #lachen #weinen #ichliebedasleben #naturliebe #kruterhexe #happybirthday #cheers #ich #sinnfluencer #ichbinich #iam #ichbin #naturspirit', 1681885858, '{\"city_name\":\"M\\u00f6nchdorf\",\"region_name\":\" Oberosterreich\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/341546601_744855563808012_4596603771980140819_n.webp', NULL, NULL, 'https://instagram.com/p/CrNS3gSKIVA', 0, 0, '[\"#geburtstag\",\"#dankbar\",\"#thankyou\",\"#danke\",\"#dankef\\u00fcralles\",\"#leben\",\"#lieben\",\"#lachen\",\"#weinen\",\"#ichliebedasleben\",\"#naturliebe\",\"#kr\\u00e4uterhexe\",\"#happybirthday\",\"#cheers\",\"#ich\",\"#sinnfluencer\",\"#ichbinich\",\"#iam\",\"#ichbin\",\"#naturspirit\"]', 'post', 'profile_scrape', 0, 1683130200, 1683130200),
(1189, 69, 3080776973876785927, NULL, 'CrBHlXIIPMH', 26, 213, 0, 0, 0, 0, 0, 0, '2.36', ' MUTTERTAGSKERZEN \n[Rezept zum Abspeichern]\n\nBald ist Muttertag und genau, was gibt es schneres als seine Mama mit etwas wunderbarem zu berraschen.\n\nIhr wisst ja, ich upcycle gerne und so ist aus den Wachsresten und alten Glsern, dieses Mal eine wundervoll duftende Kerze geworden. Verziert hab ich die Kerze mit Blten. Im Wachs, habe ich wohlriechende therische le mit beigemengt. \n\nDie toll aussehenden Bio le mit Holzdeckel habe ich von @saponosa_naturkosmetik \nBald ist Muttertag und ihr knnt im Online Shop www.saponosa.at/\nauf euren gesamten Einkauf, mit dem \nRabattcode: Naturspirit10\n10% auf euren Einkauf sparen. \n\nIch verlinke euch die Seite dann nochmal in der Story.\n\nDu brauchst:\n Wachsreste (Bienen,- Raps,-Sojawachs)\n Glser\n Docht\n therische le\n Optional - Blten\n\nDas Wachs wird geschmolzen und die Glser geleert. Ich gebe die Blten dazu und wenn das Wachs schon etwas ausgekhlt ist, so viele Tropfen therische le meiner Wahl. \nBevor das Wachs ganz hart wird, gebe ich oben drauf noch einmal Blten.\nAuskhlen lassen, Deckel drauf, verzieren und verschenken.\n\nViel Freude mit dem Rezept!\n\nWomit berrascht du deine Mutter heuer zum Muttertag?\n\nDie Glser sind im brigen alte Senfglser von @ja_natuerlich\n\n#muttertag #muttertagsgeschenk #kerze #duftkerzen #zerowaste #nachhaltigkeit #zerowasteliving #zerowastehome #therischele #mutter #nachhaltigegeschenke #ko #upcycle #upcycling #naturspirit', 1681477256, '{\"city_name\":\"M\\u00f6nchdorf\",\"region_name\":\" Oberosterreich\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/340830810_160576186632061_2718927535877907588_n.jpg', NULL, NULL, 'https://instagram.com/p/CrBHlXIIPMH', 0, 0, '[\"#muttertagsgeschenk\",\"#kerze\",\"#duftkerzen\",\"#zerowaste\",\"#nachhaltigkeit\",\"#zerowasteliving\",\"#zerowastehome\",\"#\\u00e4therische\\u00f6le\",\"#mutter\",\"#nachhaltigegeschenke\",\"#\\u00f6ko\",\"#upcycle\",\"#upcycling\",\"#naturspirit\"]', 'post', 'profile_scrape', 0, 1683130200, 1683130200),
(1190, 69, 3079173479604456003, NULL, 'Cq7a_ctoIpD', 41, 506, 0, 0, 0, 0, 0, 0, '5.4', '  LWENZAHN  \n[Rezept zum Abspeichern]\n\nLwenzahnzucker und Lwenzahnsalz........\n\nIch liebe es aus den Blten des Lwenzahns einen Zucker fr Sspeisen zu machen, oder ein schn gefrbtes Salz fr Sommersalate.\n\n Magisches Pflanzenportrait\nDer Lwenzahn ist in der indianischen Astrologie dem rotschwnzigen Habicht (bei uns der Widder) zugeordnet. Also passend fr diese Jahreszeit. \n\nMagisch gesehen ist der Lwenzahn von einer geheimnisvollen Aura umgeben. Seine Bedeutung geht als Orakel oder Kraut mit magischer Kraft ins Reich des mystisch Verborgenen. In Nordamerika beispielsweise rauchten die Ureinwohner nicht nur getrocknete Tabakbltter zu kultischen Zwecken sondern nach Norden hin zunehmend auch die des Lwenzahns. In Europa wurde ein Verreiben der Pflanze auf der Haut mit der Erfllung von Wnschen in Verbindung gebracht. Auerdem war sie in der Nacht vor Allerheiligen am All Hallows Eve, woraus das Wort Halloween entstand, Bestandteil druidischer Beschwrungsrituale. Ganz naheliegend ist auch, dass dem Lwenzahn als Pusteblume eine weissagende Kraft zugeschrieben wurde. Beispielsweise gilt hier die nach einmaligem Pusten brig gebliebene Anzahl an Schirmchen als Hinweis auf verbleibenden Lebensjahre.\n\nSo, jetzt zum Rezept:\n4 EL Lwenzahnblten (ohne Grn)\n50 g Xylit oder Zucker\n\nDie Lwenzahnblten an einem sonnigen Tag pflcken und vom Grnen befreien. Nur das Gelbe der Blten verwenden, sonst wird dieser bitter. \nIch gebe beides in einen Mixer und mahle alles gut durch. Danach lege ich den feuchten Zucker auf ein Backpapier und lasse ihn 1-2 Tage trocknen. In Glser fllen und bei Bedarf verwenden.\n\nDas Salz knnt ihr von der Menge her, genauso machen, wie beim Gnseblmchen.\n\nHast du schon mal Lwenzahnzucker oder Salz gemacht?\n\n#lwenzahn #magie #essbareblten #magischepflanzen #lwenzahnblten #essbarewildpflanzen #plantbased #wildkruter #detox #leberfasten #ausleiten #heilpflanzenkunde #dandelions #taraxacum #rezeptideen #leckerschmecker #naturspirit', 1681286104, '{\"city_name\":\"M\\u00f6nchdorf\",\"region_name\":\" Oberosterreich\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/329933966_552946793384182_3080721298466406423_n.jpg', NULL, NULL, 'https://instagram.com/p/Cq7a_ctoIpD', 0, 0, '[\"#magie\",\"#essbarebl\\u00fcten\",\"#magischepflanzen\",\"#l\\u00f6wenzahnbl\\u00fcten\",\"#essbarewildpflanzen\",\"#plantbased\",\"#wildkr\\u00e4uter\",\"#detox\",\"#leberfasten\",\"#ausleiten\",\"#heilpflanzenkunde\",\"#dandelions\",\"#taraxacum\",\"#rezeptideen\",\"#leckerschmecker\",\"#naturspirit\"]', 'post', 'profile_scrape', 0, 1683130200, 1683130200),
(1191, 69, 3076292448132692057, NULL, 'CqxL67EKnhZ', 68, 473, 4087, 0, 0, 0, 0, 0, '5.34', ' Shake it Baby \n\nKruterbutter aus Schlagobers (Schlagsahne) selber machen, geht recht einfach. Kinder lieben es.\n\nDu brauchst: \n  1-2 Handvoll Kruter & Blten deiner Wahl\n 1 Becher Bio Schlagobers\n Salz & Pfeffer\n Schraubglas mit Deckel\n\nKruter zerkleinern und mit dem Schlagobers in ein Schraubglas geben. Etwas Salz & Pfeffer dazu, Deckel oben drauf und shaken.\n\nEs kann schon 6-8 Minuten dauern, bis das Obers zur Butter wird.\n\nDie brig gebliebene Molke leere ich ber ein Sieb ab ( bitte nicht wegleeren, ist sehr wertvoll fr Suppen & Saucen) und geniee dann die selbst geschlagene Butter aufs Brot, zu Gegrilltem oder einfach nur so.\n\nHast du schon mal auf diese Weise Kruterbutter gemacht?\n\n#kruterbutter #kruter #kruterliebe #grillbeilage #einfacherezepte #wildkruter #rezeptideen #lecker #krutersammeln #osterbrunch #shake #shakeit #wildekche #kruterkche #naturspirit', 1680944013, '{\"city_name\":\"M\\u00f6nchdorf\",\"region_name\":\" Oberosterreich\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/340004411_550289740313123_1733505915871991496_n.jpg', NULL, NULL, 'https://instagram.com/p/CqxL67EKnhZ', 0, 0, '[\"#kr\\u00e4uter\",\"#kr\\u00e4uterliebe\",\"#grillbeilage\",\"#einfacherezepte\",\"#wildkr\\u00e4uter\",\"#rezeptideen\",\"#lecker\",\"#kr\\u00e4utersammeln\",\"#osterbrunch\",\"#shake\",\"#shakeit\",\"#wildek\\u00fcche\",\"#kr\\u00e4uterk\\u00fcche\",\"#naturspirit\"]', 'post', 'profile_scrape', 0, 1683130200, 1683130200),
(1192, 69, 3074824062325387465, NULL, 'Cqr-DGNunDJ', 24, 174, 1187, 0, 0, 0, 0, 0, '1.96', 'OSTERINSPIRATIONEN \n\nIch finde ja immer, das braune Eier zu Ostern, ziemlich stiefmtterlich betrachtet werden. Auch sie kann man schn verzieren, wenn man mag.\n\nBraune Eier kochen und mit einem Pinsel bemalen oder verzieren. Fertig!!!\n\nSieht doch total schn aus, oder?\n\n#ostern #osterdeko #ostereier #ostereierfrben #osterdekoration #naturspirit', 1680767975, '{\"city_name\":\"M\\u00f6nchdorf\",\"region_name\":\" Oberosterreich\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/339677896_1128992758501942_1892260665144624504_n.jpg', NULL, NULL, 'https://instagram.com/p/Cqr-DGNunDJ', 0, 0, '[\"#osterdeko\",\"#ostereier\",\"#ostereierf\\u00e4rben\",\"#osterdekoration\",\"#naturspirit\"]', 'post', 'profile_scrape', 0, 1683130200, 1683130200);
