(1194, 69, 2949616826935470361, NULL, 'CjvJOBZAOkZ', 110, 628, 3804, 0, 0, 0, 0, 0, '7.29', '**Loblied an den Lavendel**\n\nIch kann mich nie satt sehen, wenn ich fr jemanden einen Lavendelkorb mache. Dieses Mal ist ein wirklich ganz besonderer entstanden.\n\nEr hat 30 cm Durchmesser und ist 8 cm hoch - also schon ein ziemlich groer. \n\nWenn dann noch die verblhten Bltenkpfe dran sind und der Korb eine blau/lila Farbe bekommt, dann ist er einfach wirklich was ganz besonderes.\n\nWie gefllt er euch?\n\n#lavender #lavendel #lavendelliebe #basket #basketry #korb #krbe #selbstgemacht #selbstgenht #diy #naturprodukt #naturpur #naturprodukte #handarbeit #alteswissen #alteshandwerk #handwerk #handwerkskunst #kunsthandwerk #handgemacht #naturkunst #naturwunder #wunderschn #onlineworkshop #kreativ #kreativsein #naturwerkstatt #naturhandwerk #kreativitt', 1665842625, '{\"city_name\":\"M\\u00f6nchdorf\",\"region_name\":\" Oberosterreich\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/311442102_662642218536104_5966785109899463632_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/311861404_218834850472108_2462411354673366756_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=104&_nc_ohc=KOZ6BtpgfBUAX8aJm3x&edm=AOQ1c0wBAAAA&vs=879620359592263_1096617194&_nc_vs=HBksFQAYJEdKeWdsaEtzNElaMUI4Y0FBT1RHTWFZVVBpd2lidlZCQUFBRhUAAsgBABUAGCRHQ2NUbFJMN1U0cDNCdEFCQUlVVjdLNFZLZWxVYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACakrPnMgJ3uPxUCKAJDMywXQDlu2RaHKwIYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=c7d8ab79e0&ccb=7-5&oh=00_AfALwPxMS-NCSKZ1SosTaAyKoBAEuD6mKNsT073o10ZxVg&oe=645477C3&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CjvJOBZAOkZ', 0, 0, '[\"#lavendel\",\"#lavendelliebe\",\"#basket\",\"#basketry\",\"#korb\",\"#k\\u00f6rbe\",\"#selbstgemacht\",\"#selbstgen\\u00e4ht