(1195, 69, 2877212536764640046, NULL, 'Cft6Y7dKCsu', 81, 378, 2913, 0, 0, 0, 0, 0, '4.53', ' SOMMERLICHER SIRUP \n**aus der strahlenlosen Kamille**\nGeschmacklich bin ich so ein Fan, weil dieses unscheinbare Krutlein, dieses nicht beachten gar nicht verdient hat.\n\nIn der Heilwirkung hnlich ihrer groen Schwester, der echten Kamille und doch so wenig beachtet. Hast du schon einmal ein Bltenkpchen zwischen den Fingern zerrieben?\nDer Geruch hnelt det einer Ananas und den hab ich in einem Sirup eingefangen. \n \nUnd wisst ihr was? Der Sirup sieht aus wie ein Ananassaft und so schmeckt er auch. Milder, aber doch der Frucht sehr hnlich.\n\n\nMchtet ihr das Rezept?\n\n\n\n#sirup #sommer #kruter #kamille #eistee #summervibes #mitliebegemacht #rezepte #rezeptvideo #video #rezept #plantbased #kruterhexe #kruterfrau #kruterpdagogin #kruterliebe #wildkruter #wildpflanzen #heilkruter #homemade #selbstgemacht #naturpur #instavideo #kruterwissen #botanik', 1657210570, '{\"city_name\":\"K\\u00f6nigswiesen\",\"region_name\":\" Oberosterreich\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/292286355_1402800080203835_4126267382052526753_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_168749105641159_7418879557873341992_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=107&_nc_ohc=VeLr7GpvPYgAX8UIk3P&edm=AOQ1c0wBAAAA&vs=447178200254266_984388450&_nc_vs=HBksFQAYJEdJQ1dtQURIZG4tMmVaa0FBQ2lXY3FhbUotVm1idlZCQUFBRhUAAsgBABUAGCRHRmVyYVJFNTUzSmdxNklBQUYzNTJWLXowRFlUYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbg9Zy3hJHdPxUCKAJDMywXQFA3bItDlYEYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=c7d8ab9c71&ccb=7-5&oh=00_AfDTZduPmVSt-kTfARHZclNhEOzrfdZFk7Py2JUPT6vgmg&oe=64545C55&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/Cft6Y7dKCsu', 0, 0, '[\"#sommer\",\"#kr\\u00e4u