(1196, 69, 2797969667163179657, NULL, 'CbUYpaHlEqJ', 42, 229, 6588, 0, 0, 0, 0, 0, '2.68', ' DIE 3 PALMKTZCHEN ZU OSTARA \nKennst du die Geschichte, warum man zu Ostara 3 Palmktzchen essen sollte?\nEs gibt darber zwar unterschiedliche Berichte und Meinungen. Die einen sagen am Palmsonntag, die anderen sagen zu Ostara. Ich finde es ist einerlei.\n \nUnsere Vorfahren machten zu Ostara einen Palmbuschen, den sie auf die Felder stellten. In einem Ritual wurde dieser geweiht und man bittete um eine reiche Ernte frs Jahr. Heute wird der Palmbuschen nach der Weihe mit nach Hause genommen und dort an verschiedenen Orten aufgestellt: Auf dem Feld soll er die Ernte schtzen, unterm Dach vor Unwetter und Feuer bewahren und im Stall Krankheiten abwehren.\n \nWeidenktzchen landeten frher im Bettbezug und sogar im Suppentopf - denn sie sind essbar. Einst war es auch blich, drei Palmkatzerl zu essen  das sollte vor Halsweh bewahren. Nachdem der Palmbuschen geweiht war, sollte man als erstes 3 Palmktzchen essen, bevor man was anderes a, nur so war es wirksam. \nKindern, die diese Palmktzchen nicht essen wollen, mischte meistens die Mutter dieses unter das Essen, so dass sie es aen, ohne es zu merken.\n\nUnd was macht man mit dem Palmzweig vom Vorjahr? Der wird traditionell am Aschermittwoch verbrannt und die Asche dann fr das Aschenkreuz verwendet. Wer seinen Palmbuschen nicht in die Kirche bringen kann, verbrennt ihn daheim oder vergrbt ihn im Garten. \n\nIch wnsche euch ein wundervolles Ostarafest oder Frhlingstag,- und Nachtgleiche.\n\nHast du schon mal Palmktzchen gegessen? Kanntest du diesen Brauch?\n\n\n#palmktzchen #ostara #brauchtum #brauch #tradition #brauchtumspflege #palmbuschen #weidenktzchen #ostern #heiden #heidentum #heidnisch #naturspiritualitt #spiritualitt #jahreskreis #frhlingsbeginn #frhlingsanfang #frhling #jahreskreisfeste #rituals #ritual #rituale #ostarablessings #witchesofinsta #spring', 1647765886, '[]', 'VIDEO', 'images/content/posts/276147630_1034512984085616_3143858059393893297_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/277058784_2239698716171213_1936476593555361832_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=105&_nc_ohc=FL51u-aRXnYAX_zpYKl&edm=AOQ1c0wBAAAA&vs=654531765779174_1907466627&_nc_vs=HBksFQAYJEdPQ1VneERObTJGXy12UUhBQ2pRdWJJenY5OGFidlZCQUFBRhUAAsgBABUAGCRHSWtVY3hBOTJwckRpUFVCQU5DQ0hSQ1NfNVpiYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbWsNbsjKjdPxUCKAJDMywXQEV7peNT988YEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=c7d8a4076a&ccb=7-5&oh=00_AfDz0jVD-A7dIYr7ktWiwAjdXq5WS2xx1KMK7I55kllC_w&oe=6454672E&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CbUYpaHlEqJ', 0, 0, '[\"#ostara\",\"#brauchtum\",\"#brauch\",\"#tradition\",\"#brauchtumspflege\",\"#palmbuschen\",\"#weidenk\\u00e4tzchen\",\"#ostern\",\"#heiden\",\"#heidentum\",\"#heidnisch\",\"#naturspiritualit\\u00e4t\",\"#spiritualit\\u00e4t\",\"#jahreskreis\",\"#fr\\u00fchlingsbeginn\",\"#fr\\u00fchlingsanfang\",\"#fr\\u00fchling\",\"#jahreskreisfeste\",\"#rituals\",\"#ritual\",\"#rituale\",\"#ostarablessings\",\"#witchesofinsta\",\"#spring\"]', 'post', 'profile_scrape', 0, 1683130200, 1683130200),
(1197, 69, 2777930331017471137, NULL, 'CaNMOr_FGSh', 58, 716, 8123, 0, 0, 0, 0, 0, '7.64', ' MUNTERMACHERKRUTER \nSchn langsam ist es soweit. Jeden Tag strecken mehr und mehr Kruter ihre Kpfe durch die Erde um empor zu steigen. Zumindest bei uns im Mhlviertel wird es noch ein bisschen dauern, bis die ersten Kruter zu pflcken sind, doch jeder Tag ist jetzt bereits erkennbar.\n\nUnd gerade im Frhjahr, wo wir denken, der Winterschlaf ist vorbei, schon kippen wir in die Frhjahrsmdigkeit. Doch das muss nicht sein, denn genau die ersten Kruter und Blten die ihre Kpfe aus der Erde strecken sind perfekt fr eine Frhjahrskur. \n\nDie ersten Kruter des Jahres beschenken uns mit reichlichem Vitamin C, sie strken uns und man kann diese als eine Art Frhjahrs Putz im Innen und Auen bezeichnen, sie entschlacken und reinigen und sind auch zustzlich eine Art Schnheitskur. \n\nDoch nicht nur das, diese Kruter sind ganz hervorragend um uns vor der Frhjahrsmdigkeit zu schtzen, daher auch das Wort Muntermacherkruter. Mit einer Art \"Kur\" die du in Form von Smoothies, Suppen, Kruterbutter oder auch Aufstrichen machen kannst untersttzt du deinen Stoffwechsel und machst dich sozusagen fit und munter fr den Frhling.\n\nWelche Kruter sind das?\n Gnseblmchen\n Vogelmiere\n Giersch\n Brlauch\n Scharbockskraut\n Brennnessel\n Gundelrebe\n Brunnenkresse\nund viele mehr. Wie viele es sind, bzw. welche gerade jetzt besonders wichtig sind, gibts bei mir am Blog. Den Link dazu findest du in meinem Profil.\n\n\nWie geht es dir mit der Frhjahrsmdigkeit - trifft sie dich auch jedes Jahr?\n\n\n\n#frhling #frhjahrsmdigkeit #frhjahr #kruter #plantbased #frischekruter #kruterhexe #kruterkunde #brlauch #kruterfrau #herbs #wildkruter #kruterwissen #gesundheit #entgiften #nature #kruterkche #greens #healthyfood #vitamines #foodblogger #vegan #stoffwechsel #stoffwechselkur #healthylifestyle #wildpflanzen #gesundessen #zeitraffer', 1645376405, '{\"city_name\":\"K\\u00f6nigswiesen\",\"region_name\":\" Oberosterreich\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/274382873_344967214185857_709430879030927114_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/274502045_275862791328744_6742141803809748581_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=100&_nc_ohc=sBcRAIbxzggAX9HwAYG&edm=AOQ1c0wBAAAA&vs=655044388878364_636224344&_nc_vs=HBksFQAYJEdKMlJYQkRvRTY5UDVmb0FBR1UyWk1rLTVwQmRidlZCQUFBRhUAAsgBABUAGCRHTjI3V3hDVkFrSzE3azhCQUtDWXRZVzA2SzU0YnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbgmvXondf4PxUCKAJDMywXQD4qfvnbItEYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=c7d8ab74ca&ccb=7-5&oh=00_AfCG1zV7F7zeyvfHUcbolr3dqF7eyFRLQxGe5f4h8Bh9iw&oe=64541443&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CaNMOr_FGSh', 0, 0, '[\"#fr\\u00fchjahrsm\\u00fcdigkeit\",\"#fr\\u00fchjahr\",\"#kr\\u00e4uter\",\"#plantbased\",\"#frischekr\\u00e4uter\",\"#kr\\u00e4uterhexe\",\"#kr\\u00e4uterkunde\",\"#b\\u00e4rlauch\",\"#kr\\u00e4uterfrau\",\"#herbs\",\"#wildkr\\u00e4uter\",\"#kr\\u00e4uterwissen\",\"#gesundheit\",\"#entgiften\",\"#nature\",\"#kr\\u00e4uterk\\u00fcche\",\"#greens\",\"#healthyfood\",\"#vitamines\",\"#foodblogger\",\"#vegan\",\"#stoffwechsel\",\"#stoffwechselkur\",\"#healthylifestyle\",\"#wildpflanzen\",\"#gesundessen\",\"#zeitraffer\"]', 'post', 'profile_scrape', 0, 1683130200, 1683130200),
(1198, 69, 2757648608768869540, NULL, 'CZFIsyNBMSk', 59, 288, 3449, 0, 0, 0, 0, 0, '3.43', ' Einblick in mein Handwerk \nHeute habe ich wieder mal ein Video fr euch, wo ich festhalte, wie man einen Korb fertigt. Zumindest wie man den Boden macht. In den nchsten Tagen zeige ich euch den Rest. \n\nIm Grunde genommen ist das Korbwickeln nicht sehr schwer, mit ein bisschen bung hat man es schnell heraussen. Ein bisschen Kraft jedoch ist von Nten. \n\nWenn du gerne lernen mchtest, wie man solche Krbe wickelt, dann gerne auf meine Website schauen, bald hab ich alle Termine fr euch dort bereit gestellt. Ich mache sowohl Prsenz,- als auch Online Kurse.\nIch freu mich auf dich. \nMan beobachte meine Zehen. \n\n\nNa, bist du jetzt neugierig geworden?\n.\n.\n.\n.\n#korb #krbe #korbliebe #basket #handgemacht #geschenkideen', 1642957436, '[]', 'VIDEO', 'images/content/posts/272356585_1282482832237001_8093332668960465881_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/10000000_4587056394740525_269505227420500927_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5mZWVkLmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=105&_nc_ohc=r9tx16WBwpQAX_ZWhx6&edm=AOQ1c0wBAAAA&vs=17947986787662527_885258229&_nc_vs=HBksFQAYJEdJQ1dtQUF0SS1sSzUwc1FBTF9EZ3BHVGViMERia1lMQUFBRhUAAsgBABUAGCRHTnlyUUJEbXJyLXFka2NDQUZkWm1wU0FvQWtiYmtZTEFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMBUAACbIvdvrzsfHPxUCKAJDMywXQE33bItDlYEYEmRhc2hfYmFzZWxpbmVfMV92MREAdeoHAA%3D%3D&_nc_rid=c7d8ab73ba&ccb=7-5&oh=00_AfCgBKFw6587zhFzWRttCoCkLwI8SF9Ot38-vL5nnWzukQ&oe=64542A0A&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CZFIsyNBMSk', 0, 0, '[\"#k\\u00f6rbe\",\"#korbliebe\",\"#basket\",\"#handgemacht\",\"#geschenkideen\"]', 'post', 'profile_scrape', 0, 1683130200, 1683130200),
(1199, 69, 2730867142786734452, NULL, 'CXl_TKWltl0', 47, 159, 1445, 0, 0, 0, 0, 0, '2.03', '~ AROMA TOFFEES ~\nIch mache schon seit einigen Jahren Aromamelts aus Wachsresten selber. Doch irgendwie hat mir der Name nicht so wirklich gefallen, bis mich Valerie von @blattunddorn auf den Namen Toffees gebracht hat.\n~\nHeute habe ich ein Video fr euch, in dem ich euch zeige, wie diese Duft Toffees hergestellt werden. Ich nehme dazu gesunde Wachsreste, weil ich keine tierischen Fette, Erdl oder auch Palml in meinen bedufteten Rumen haben mchte. Ich verwende Rapswachs und Bienenwachs.\n~\nDiese Aromatoffees gebe ich in meine Duftlampe und znde das Teelicht an. Das Wachs schmilzt langsam und setzt die beigefgten therischen le frei und natrlich auch die der getrockneten Pflanzenteile. Es ist ein ganz feiner Duft und kein aufdringlicher.\n~\nRuchern kann so einfach sein. Im brigen sind diese Toffees schnell gemacht und vielleicht noch ein Weihnachtsgeschenk, solltest du noch auf der Suche sein.\n~\n~\nSoll ich euch morgen das Rezept posten?\nHast du schon mal mit Ruchertoffees geruchert?\n.\n.\n.\n.\n#ruchern #ruchernmitkrutern #ruchernfrdieseele #video #kurzvideo #naturvideo #igtv #toffees #melts #kruter #duftlampe #duftkerze #aromatherapy #therischele #diychristmas #diy #selbstgemacht #rauhnchte #kruter #kruterhexe #kruterpdagogin #bienenwachs #rapswachs #gesundheit #videos', 1639765789, '{\"city_name\":\"K\\u00f6nigswiesen\",\"region_name\":\" Oberosterreich\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/268416417_244870834402152_638979993526093388_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_1446938035701158_231346253870527228_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=102&_nc_ohc=3WXkj1LVahkAX9AaLNL&edm=AOQ1c0wBAAAA&vs=1269959466804143_