(1202, 69, 2578649934536330963, NULL, 'CPJNHQEH07T', 20, 103, 681, 0, 0, 0, 0, 0, '1.21', 'Mit Lindenblten ruchern war schon bei den Germanen und Slawen bekannt und beliebt. Ein Rucherwerk aus Lindenbltter wurde zu damaliger Zeit gegen Dmonen und Hexen verruchert. \nEin Rucherwerk von Lindenblten lsst Wohlstand und Reichtum ins Haus flieen. \n.\nEine Lindenblten-Rucherung ffnet das Herz und lsst geistigen Wohlstand hineinbringen. Wir erreichen dadurch Gelassenheit und unsere ngste schwinden vor neuen Aufgaben. Wenn diese neuen Aufgaben im Raum stehen und wir uns bei ihrem Gedanken ein bisschen unwohl fhlen, ist die Rucherung der Lindenblten ein Nhrboden unseres Geistes.\nWenn unsere Herzen verhrtet sind, ist diese Rucherung unsere ffnung fr eine andere Sichtweise. Wenn wir von unserem Umfeld nur mentale Klte erfahren, ist eine Lindenbltter-Rucherung unser Seelentrost. Der Rauch gibt uns ein Gefhl von Geborgenheit und sich fallen lassen. Erschpfte Seelen finden in diesem Rucherwerk ihre Auferstehung. Der Pflanzengeist ist sanft und gtig. Er zeigt uns den richtigen Weg. In Beziehungskrisen sind Linden-Rucherungen sehr wohltuend, zumal dieser schne Baum auch im Zeichen der Ehe und Liebe steht.\nBeim Ruchern verbreiten die getrockneten Blten einen aromatisch-weichen, leicht slichen und warmen Duft. Ebenfalls lassen sich das getrocknete Holz, die Rinde sowie das Laub im Herbst (Bltter) als Ruchermittel verwenden. Der Rauch der Blten hat eine beruhigende, entspannende und erkltungshemmende Wirkung auf den Menschen. Eine Lindenblten Rucherung ist somit das ganze Jahr ber geeignet.\n.\nHast du schon einmal mit Lindenblten geruchert?\n.\n.\n.\n#lindenblten #linde #winterlinde #sommerlinde #ruchern #reinigung #rucherung #igtv #instagreen #instavideo #instavideos #kreidlstammtisch #baumdesjahres #video #videos #kurzvideo #naturvideo #ruchernmitkrutern #ruchernfrdieseele #ruchernmitheimischenkrutern #videoclip #waldliebe #baumliebe #baum #wald #instagreen #naturspirit @quendelgruen @lebe.lieber.frisch @wildbluetenzauber', 1621619531, '[]', 'VIDEO', 'images/content/posts/189216036_379116776967116_7281827883163401329_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_466490737785805_7176387381401794826_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjY0MC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=101&_nc_ohc=bbzB1abg2DoAX8s5AZZ&edm=AOQ1c0wBAAAA&vs=17955821572442236_3848716724&_nc_vs=HBksFQAYJEdJQ1dtQUROZTdkV1JhZ0JBQXE1REI5TnBwZGpidlZCQUFBRhUAAsgBABUAGCRHRUxqT2d1eXFtWXRtN2NCQUJwRExDRXh1VmtwYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACaA8eCxvIbUPxUCKAJDMywXQGw5mZmZmZoYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=c7d8a0d3e0&ccb=7-5&oh=00_AfAS-JKop0VmS3-mdqEuEjtFm_uJuZA_gA39EvByNLkKdA&oe=64547663&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CPJNHQEH07T', 0, 0, '[\"#linde\",\"#winterlinde\",\"#sommerlinde\",\"#r\\u00e4uchern\",\"#reinigung\",\"#r\\u00e4ucherung\",\"#igtv\",\"#instagreen\",\"#instavideo\",\"#instavideos\",\"#kreidlstammtisch\",\"#baumdesjahres\",\"#video\",\"#videos\",\"#kurzvideo\",\"#naturvideo\",\"#r\\u00e4uchernmitkr\\u00e4utern\",\"#r\\u00e4uchernf\\u00fcrdieseele\",\"#r\\u00e4uchernmitheimischenkr\\u00e4utern\",\"#videoclip\",\"#waldliebe\",\"#baumliebe\",\"#baum\",\"#wald\",\"#instagreen\",\"#naturspirit\"]', 'post', 'profile_scrape', 0, 1683130200, 1683130200),
(1203, 69, 2576410440760255694, NULL, 'CPBP6U9H2TO', 6, 119, 490, 0, 0, 0, 0, 0, '1.23', 'Diese Woche dreht sich bei uns Damen vom #kreidlstammtisch alles um den Baum des Jahres (gilt nur fr sterreich).\nEs ist die wundervoll magische und majesttisch anmutige Linde. Viele Lieder wurden schon von ihr gesungen, Gedichte geschrieben und Gerichtsbarkeiten unter ihr abgehalten. Kaum ein  Baum wurde bei unseren Vorfahren so verehrt wie die Linde.\n.\nIn dieser Woche erfhrst du vieles ber diesen zauberhaften Baum. Zum einen gibt es von @quendelgruen ein umfangreiches Pflanzenportrait, @lebe.lieber.frisch hat uns mit Lindenblttern wunderbar verkocht und @wildbluetenzauber wird uns etwas Naturkosmetik und fr die Gesundheit zaubern.\n.\nIch darf heute etwas Mystik und Magie in diese Woche bringen. Geniet dieses Video, ganz in Ruhe, es ist nmlich auch eine kleine bung mit eingepackt. Viel Freude damit.\n.\nBist du auch schon im Lindenfieber?\n.\n.\n.\n#linde #lindenbaum #baum #baumliebe #baumdesjahres #essbarebume #bume #laubbaum #laubbume #magie #mystik #poesie #waldhexe #hexenkche #waldliebe #wald #waldfee #waldkind #waldmensch #waldfrau #naturspiritualitt #naturalspirit #naturespirit #naturespirituality #alteswissen #kelten #germanen #druidentum #naturspirit', 1621352961, '[]', 'VIDEO', 'images/content/posts/187558772_1480836742253782_3866740545255685635_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_503892183979343_5088979073282700477_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjEyODAuaWd0di5kZWZhdWx0IiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=111&_nc_ohc=AlSki3gBeoEAX8-xNU_&edm=AOQ1c0wBAAAA&vs=18225453868000070_4030796382&_nc_vs=HBksFQAYJEdJQ1dtQUJQbGFHS1Njb0JBTDEwYVN5QnI1OUdidlZCQUFBRhUAAsgBABUAGCRHSXJ1RXd2WWRWM1pJYjhEQU9TS3JXdmswWEJxYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACaMy9u6yfzfQBUCKAJDMywXQIA6ZFocrAgYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=c7d8a484c1&