(1204, 70, 2902983177545954972, NULL, 'ChJd9G-j7ac', 46, -1, 0, 0, 0, 0, 0, 0, '1.05', '  \n\nGuten Morgen ,\nIch liebe ja #haferflocken zum Frhstck. - Derzeit am liebsten eingeweicht in Kokosnuss Drink  zusammen mit einen Apfel  und getoppt mit allerlei Leckeren . Unter anderem mit meinen Lieblingssnack den Banana Bites  mit Schokolade  @soul_bites_ , die sind so lecker - die musst du probieren . \n\n Banana Bites  sind getrocknete Bananen  ummantelt mit  Bitterschokolade die mit Kokosbltenzucker gest ist - Na Lust drauf bekommen  Mit meinen Code:  sparst du 15% Rabatt bei @soul_bites_ . \n\n: pro Bowl mit Topping\nca. 494kcal / 75g KH / 12g E / 13g F\n\n : 1 \n\n   : \nFr das Oatmeal \n50g Haferflocken \n100g Kokos Drink \nopt. 50g Wasser/ o. Kokos Drink \n1 TL Leinsaat geschrotet \n1/2 Apfel  \n1 EL getrocknete Sauerkirschen \nTopping \n1/2 Banane  \n1 EL Granola @mymuesli \nein paar Blaubeeren  \npaar Banana Bites  @soul_bites_ \n1 TL Haselnussmus Choco Crush @naughtynuts \n\n  + : ca. 40min \n\n: \nHaferflocken und Leinsaat 30min oder ber Nacht im Khlschrank in Kokos Drink einweichen\nGrob gerieben Apfel und Sauerkirschen unterrhren und nach Belieben noch etwas Wasser oder Kokos Drink dazugeben \nMit den Toppings anrichten und vernaschen \n\n-  - weil tolle Produkte \n\n#oatmeal #frhstck #birchermuesli #frhstcksideen #vegan #vegandeutschland #banane #haferflockenfrhstck #veggie #foodblogger_de #soulbites #soulbites #snacks #gesundundlecker #breakfastbowl #bowlfood #frhstcksbowl #fitfood #fitindentag #abnehmenmitgenuss #healthyfood #einfacherezepte #rezeptefrjedentag #ohnezuckerzusatz #essenmachtglcklich #gutscheincode #rabattcode #leckerschmecker #gesundesfrhstck #overnightoats', 1660282583, '[]', 'IMAGE', 'images/content/posts/298706236_132272556174424_7063816681362104419_n.jpg', NULL, NULL, 'https://instagram.com/p/ChJd9G-j7ac', 0, 0, '[\"#haferflocken\",\"#oatmeal\",\"#fr\\u00fchst\\u00fcck\",\"#birchermuesli\",\"#fr\\u00fchst\\u00fccksideen\",\"#vegan\",\"#vegandeutschland\",\"#banane\",\"#haferflockenfr\\u00fchst\\u00fcck\",\"#veggie\",\"#foodblogger_de\",\"#soulbites\",\"#soulbites\",\"#snacks\",\"#gesundundlecker\",\"#breakfastbowl\",\"#bowlfood\",\"#fr\\u00fchst\\u00fccksbowl\",\"#fitfood\",\"#fitindentag\",\"#abnehmenmitgenuss\",\"#healthyfood\",\"#einfacherezepte\",\"#rezeptef\\u00fcrjedentag\",\"#ohnezuckerzusatz\",\"#essenmachtgl\\u00fccklich\",\"#gutscheincode\",\"#rabattcode\",\"#leckerschmecker\",\"#gesundesfr\\u00fchst\\u00fcck\",\"#overnightoats\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
(1205, 70, 2901759661756488224, NULL, 'ChFHwnGjZog', 45, -1, 0, 0, 0, 0, 0, 0, '1.03', ' \n\nDiese kleinen Mini Waffeln  sind schnell und einfach im Waffeleisen gemacht, schmecken sowohl s mit Apfelmus oder auch herzhaft mit Kruterquark. \n\n: pro Portion mit Apfelmus\nca. 350 kcal / 66g KH / 8g E / 4g F\n\n: 1 \n\n   : \n200g abgekhlte, gekochte Kartoffeln  \n30g Magerquark / Sojaquark \n1 kleine Schalotte  \n1/2 TL Kartoffel Allrounder  @justspices mit den Code:  gibt 5 Rabatt ab 20 BW, derzeit gibt es auch den Adventskalender bei @justspices zu kaufen mit nur 2 Gewrzen die auch schon im letzten Kalender waren - es lohnt sich also  \n30g Strke \netwas l zum fetten \n\n : 15min\n\n: \nDas Waffeleisen vorheizen \nDie Zwiebel fein schneiden, die Kartoffeln stampfen und mit den restlichen Zutaten vermengen \nAus den Teig ca. 30 kleinen Bllchen formen, Waffeleisen leicht fetten und nach und nach die Bllchen darin goldbraun ausbacken \nAuf Kchenpapier abtropfen lassen und vernaschen \n\n-- weil tolle Produkte \n\n#kartoffeln #waffeln #kartoffelpuffer #rsti #einfacherezepte #vegandeutschland #veggie #fingerfood #rezeptideen #snacks #mittagessen #einfachekche #schnellerezepte #kochenfrkinder #rezeptefrjedentag #resteverwertung #hashbrowns #potato #waffles #kartoffelwaffeln #potatowaffles #justspices #justspicesrabattcode #gutscheincode #lustaufgenuss #vegan #foodblogger_de #abnehmenmitgenuss #foodporn #kochen', 1660136729, '[]', 'IMAGE', 'images/content/posts/298780366_1514493782343883_4987269832048230746_n.jpg', NULL, NULL, 'https://instagram.com/p/ChFHwnGjZog', 0, 0, '[\"#kartoffeln\",\"#waffeln\",\"#kartoffelpuffer\",\"#r\\u00f6sti\",\"#einfacherezepte\",\"#vegandeutschland\",\"#veggie\",\"#fingerfood\",\"#rezeptideen\",\"#snacks\",\"#mittagessen\",\"#einfachek\\u00fcche\",\"#schnellerezepte\",\"#kochenf\\u00fcrkinder\",\"#rezeptef\\u00fcrjedentag\",\"#resteverwertung\",\"#hashbrowns\",\"#potato\",\"#waffles\",\"#kartoffelwaffeln\",\"#potatowaffles\",\"#justspices\",\"