(1206, 70, 2900189722041936109, NULL, 'Cg_iy-zjGjt', 16, -1, 0, 0, 0, 0, 0, 0, '0.35', '\n-getoppt mit Haferflocken Streuseln\n\nDiese saftigen Muffins sind vegan   und soo lecker - die musst du probieren. Gewrz habe ich die Muffins mit den Pancake Spice  @justspices was durch den enthalten Zimt, Kardamom und der Zitronenschale mega gut zu Blaubeeren passt und mit den Code  sparst du  @justspices auch noch  ab 20 BW   Derzeit gibt es brigens auf den Adventskalender von @justspices 30% Rabatt  Super als Geschenk und garantiert gesnder als Sigkeiten. \n\n \n: pro \nca. 226 kcal / 34g KH / 4g E / 8g F \n\n: 7 Stck \n\n   :\nFr den Teig\n1 EL Leinsaat \n2,5 EL warmes Wasser  \n150g Hafer Drink  \n1/2 EL Apfelessig  \n175g Mehl  \n1 gehuften TL Backpulver \n1/8 TL Natron \n1 TL Pancake Spice  @justspices \n20g Braunen Zucker \n50g Kokosblten Sirup  \n40g Kokosl  \n125g frische Heidelbeeren  \nFr die Streusel\n20g Haferflocken \n20g Brauner Zucker \n1 TL Oatmeal Spice  @justspices \n1 Prise Feines Natursalz  @justspices \n\n: ca. 20min \n: 25min\n\n:\nLeinsaat in einen Mrser fein mahlen und mit den Wasser verrhren -15min warten\nHafermilch und Apfelessig vermengen -15min warten \nFr den Teig alle Zutaten bis auf die Blaubeeren vermengen und die Blaubeeren unterheben \nAlle Zutaten fr die Streusel verrhren\nDen Teig in Muffinfrmchen verteilen und mit den Streuseln toppen \nIm vorgeheizt Backofen bei 180 Grad Celsius bei Ober-/Unterhitze 25min backen \n\n-- weil tolle Produkte \n\n#muffins #backen #veganbacken #selbstgebacken #blaubeeren #heidelbeeren #vegan #veganerezepte #einfachbacken #kaffeeundkuchen #foodblogger_de #haferflocken #frhstckskuchen #dessert #blaubeermuffins #blueberrymuffins #cake #kuchen #backrezepte #cupcakes #fingerfood #schnellerezepte #frischausdemofen #gebck #wissenwasdrinist #partysnacks #rezeptideen #justspices #justspicesrabattcode #einfacherezepte', 1659949578, '[]', 'IMAGE', 'images/content/posts/297854985_1748469948866751_9067896957252530359_n.jpg', NULL, NULL, 'https://instagram.com/p/Cg_iy-zjGjt', 0, 0, '[\"#muffins\",\"#backen\",\"#veganbacken\",\"#selbstgebacken\",\"#blaubeeren\",\"#heidelbeeren\",\"#vegan\",\"#veganerezepte\",\"#einfachbacken\",\"#kaffeeundkuchen\",\"#foodblogger_de\",\"#haferflocken\",\"#fr\\u00fchst\\u00fcckskuchen\",\"#dessert\",\"#blaubeermuffins\",\"#blueberrymuffins\",\"#cake\",\"#kuchen\",\"#backrezepte\",\"#cupcakes\",\"#fingerfood\",\"#schnellerezepte\",\"#frischausdemofen\",\"#geb\\u00e4ck\",\"#wissenwasdrinist\",\"#partysnacks\",\"#rezeptideen\",\"#justspices\",\"#justspicesrabattcode\",\"#einfacherezepte\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
(1207, 70, 2897302626100841946, NULL, 'Cg1SWNLjA3a', 18, -1, 0, 0, 0, 0, 0, 0, '0.4', '    \n\nDieser leichte #sommersalat passt zum #grillen oder fr die #mittagspause und ist super erfrischend.\n\nBei mir gab dazu ein schnelles Balsamico Dressing mit meinen Lieblingsbalsamico den Bio Birnen Balsamessig  @adrian_manufaktur und den Balsamico Dressing Mix  @justspices -mit den Code  sparst du brigens derzeit 5  ab 20 BW . \n\n : pro Portion \nca. 343 kcal / 21g KH / 13g E / 21g F\n\n: 1 \n\n   :\n1 Zucchini (ca. 400g) \netwas Olivenl \n1 gehuften TL Zucchini Gewrzmix @justspices \n1 EL Pinienkerne (ca. 7g) \neine Handvoll Rucola (ca. 60g)\n125g  Cherry Tomaten  \n\n : ca. 15min \n\n :\nZucchini in Scheiben schneiden und mit l und Zucchini Gewrzmix vermengen und kurz marinieren \nZwischenzeitlich Pinienkerne in einer fettfreien Pfanne rsten, Salat, Tomaten und Dressing nach Wahl vorbereiten \nDen Zucchini von beiden Seiten kurz grillen entweder in einer Grillpfanne oder auf den Grill \nAlles zusammen anrichten und genieen  \n\n-- weil tolle Produkte \n\n#sommerkche #schnellerezepte #zucchini #zucchinirezepte #salat #salatliebe #gemsekche #sommerrezepte #einfacherezepte #feierabendkche #healthyfood #grillenmitfreunden #grillbeilage #bbq #veggie #vegan #feierabendkche #zucchinisalat #frischundlecker #justspices #rabattcode #gutscheincode #leckerundgesund #abnehmenmitgenuss #vegandeutschland #rucola #tomaten #lowcarb', 1659605409, '[]', 'IMAGE', 'images/content/posts/297034418_432973608883291_581651546030802078_n.jpg', NULL, NULL, 'https://instagram.com/p/Cg1SWNLjA3a', 0, 0, '[\"#sommersalat\",\"#grillen\",\"#mittagspause\",\"#sommerk\\u00fcche\",\"#schnellerezepte\",\"#zucchini\",\"#zucchinirezepte\",\"#salat\",\"#salatliebe\",\"#gem\\u00fcsek\\u00fcche\",\"#sommerrezepte\",\"#einfacherezepte\",\"#feierabendk\\u00fcche\",\"#healthyfood\",\"#grillenmitfreunden\",\"#grillbeilage\",\"#bbq\",\"#veggie\",\"#vegan\",\"#feierabendk\\u00fcche\",\"#zucchinisalat\",\"#frischundlecker\",\"#justspices\",\"#rabattcode\",\"#gutscheincode\",\"#leckerundgesund\",\"#abnehmenmitgenuss\",\"#vegandeutschland\",\"#rucola\",\"#tomaten\",\"#lowcarb\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
(1208, 70, 2890842555246664923, NULL, 'CgeVfzXD1zb', 27, -1, 0, 0, 0, 0, 0, 0, '0.61', '\n-mit Apfel, Mohn und Heidelbeeren  \n\nDieser se Auflauf ist schnell gemacht, schmeckt kalt und warm super lecker und eignet sich als #dessert , zum #frhstck oder auch zu #kaffeeundkuchen . \n\n : pro Portion \nca. 155kcal / 17g KH / 10g E / 4g F\n\n : 5 \n\n   : \nFr die Mohnmasse \n50ml Mandel Drink / Milch  \n25g Mohn \n2 TL Vanille Kipferl Zucker @justspices mit den Code:  gratis Gewrz \nFr die Quarkmasse\n250g Magerquark \n2 Eier  \n1 Prise Feines Natursalz  @justspices \n1 gehuften TL Grie\n1 TL Apfelkuchen Gewrz  @justspices \n20g Puderzucker \nFr den Belag \n200g geschlte pfel  \n120g Heidelbeeren  \n\n : ca. 15min\n : 35min \n\n : \nFr die Mohmasse die Milch erwrmen und die restlichen Zutaten einrhren und quellen lassen \nFr die Quarkmasse die Eier trennen\nQuark, Eigelbe, Grie und Apfelkuchen Gewrz @justspices verrhren \nDie Eiweie mit der Prise Salz steif schlagen und unter die Quarkmasse heben, alles in eine gefettete Form verteilen \nDie Apfel in Spalten schneiden auf die Quarkmasse verteilen, Mohn drauf geben und mit Heidelbeeren toppen \nBei 170 Grad Celsius im vorgeheizten Backofen bei Umlauft 35min backen \n \n : Wer mchte kann statt Zucker auch Erythrit verwenden oder den Kuchen noch mit Zucker und Zimt bestreuen \n\n-- weil tolle Produkte \n\n#quarkauflauf #quark #magerquark #quarkkuchen #cheesecake #apfelkuchen #heidelbeeren #blaubeeren #tarte #backen #backenmitliebe #auflauf #rezeptideen #einfachundlecker #schnellerezepte #einfachbacken #leichtekche #sommerkche #justspices #gutscheincode #rabattcode #justspicesgewrze #kuchenrezept #kuchen #blaubeerkuchen #mohn #mohnkuchen', 1658835308, '[]', 'IMAGE', 'images/content/posts/295503160_573803771129528_8572244796177606507_n.jpg', NULL, NULL, 'https://instagram.com/p/CgeVfzXD1zb', 0, 0, '[\"#dessert\",\"#fr\\u00fchst\\u00fcck\",\"#kaffeeundkuchen\",\"#quarkauflauf\",\"#quark\",\"#magerquark\",\"#quarkkuchen\",\"#cheesecake\",\"#apfelkuchen\",\"#heidelbeeren\",\"#blaubeeren\",\"#tarte\",\"#backen\",\"#backenmitliebe\",\"#auflauf\",\"#rezeptideen\",\"#einfachundlecker\",\"#schnellerezepte\",\"#einfachbacken\",\"#leichtek\\u00fcche\",\"#sommerk\\u00fcche\",\"#justspices\",\"#gutscheincode\",\"#rabattcode\",\"#justspicesgew\\u00fcrze\",\"#kuchenrezept\",\"#kuchen\",\"#blaubeerkuchen\",\"#mohn\",\"#mohnkuchen\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
(1209, 70, 2888789810733721237, NULL, 'CgXCwcDjSaV', 53, -1, 0, 0, 0, 0, 0, 0, '1.22', '\n\nIn der fruchtigen, sen Variante mit Nektarine & Heidelbeeren .\n\nGetoppt mit Zitronenthymian , Honig  & den Blten Mix  @justspices . Derzeit bekommst du brigens mit den Code:  passend zur #sommerkche   das      ab 20 BW. \n\n: pro Flammkuchen \n\n: 2 Flammkuchen\n\n   : \nFr den Teig\n200g Dinkelmehl Typ 1150  \n2 EL Olivenl \nca. 110ml Wasser  \n1/2 TL Feines Natursalz  @justspices \nFr den Belag \n80g Camembert  \n2 Nektarinen \n100g TK Heidelbeeren  \n1 TL Vanille Kipferl Zucker @justspices \nLimettensaft und Schale  \n100g Crme Frache light \n100g frische Heidelbeeren  \nHonig  \nZitronenthymian\nFeines Natursalz , Pfeffer  @justspices \nBlten Mix  @justspices \n\n: 45min\n: 10min\n\n : \nAus den Zutaten fr den Teig einen Knetteig herstellen & 30min abgedeckt ruhen \nZwischenzeitlich den Belag vorbereiten & den Ofen auf 250 Grad Celsius O-/ UH vorheizen \nTK Heidelbeeren mit etwas Zitronenthymian,Spritzer Limettensaft + etwas Schale & den Vanille Kipferl Zucker im Topf einkochen & die Heidelbeeren dabei leicht zerdrcken \nKse & Nektarinen schneiden, Crme Frache mit Limettensaft & Schale, Salz & Pfeffer anrhren \nJeweils die Hlfte des Teiges dnn auf Backpapier ausrollen, mit Crme bestreichen, mit Kse & Nektarinen belegen \nIm Backofen o.  im Grill auf einem Pizzastein 10min backen \nMit den eingekochten Heidelbeeren, frischen Heidelbeeren, Zitronenthymian, Honig & Blten Mix dekorieren \n\n-- weil tolle Produkte \n\n#flammkuchen #sommerrezepte #schnellekche #einfachundlecker #backen #veggie #dasaugeisstmit #heidelbeeren #blaubeeren #nektarine #familienkche #familienessen #essenmitgenuss #partyfood #rezeptideen #flammkuchenliebe #vegetarischerezepte #pizza #kalorienzhlen #gutscheincode #rabattcode #justspices #ofengericht #abendessen #grillenmitfreunden #grillen #mittagessen #feierabendkche #camembert', 1658590602, '[]', 'IMAGE', 'images/content/posts/295492716_1112861909326946_317983242249178186_n.jpg', NULL, NULL, 'https://instagram.com/p/CgXCwcDjSaV', 0, 0, '[\"#sommerk\\u00fcche\",\"#flammkuchen\",\"#sommerrezepte\",\"#schnellek\\u00fcche\",\"#einfachundlecker\",\"#backen\",\"#veggie\",\"#dasaugeisstmit\",\"#heidelbeeren\",\"#blaubeeren\",\"#nektarine\",\"#familienk\\u00fcche\",\"#familienessen\",\"#essenmitgenuss\",\"#partyfood\",\"#rezeptideen\",\"#flammkuchenliebe\",\"#vegetarischerezepte\",\"#pizza\",\"#kalorienz\\u00e4hlen\",\"#gutscheincode\",\"#rabattcode\",\"#justspices\",\"#ofengericht\",\"#abendessen\",\"#grillenmitfreunden\",\"#grillen\",\"#mittagessen\",\"#feierabendk\\u00fcche\",\"#camembert\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
(1210, 70, 2887152737308124134, NULL, 'CgROh4njCPm', 27, -1, 0, 0, 0, 0, 0, 0, '0.61', '  \n\nDiese Mini Pancakes  sind super schnell gemacht mit Hilfe der Soulbowl Waldbeeren @soul_bites_  und so lecker . Zusammen mit etwas Joghurt und frischen Frchten serviert startet man fit  in den Tag.  \n\nbrigens die Bowls @soul_bites_  bestehen zu 100% aus natrlichen Zutaten, sind ohne Zucker, Bio, Vegan  und werden unter anderen aus geretteten Bananen  die an den Handel nicht verkauft werden, wegen Schnheitsmacken, hergestellt. \n\n : pro Portion\nca. 427 kcal / 55g KH / 20g E / 11g F\n\n: 1 Bowl\n\n   :\nFr die Pancakes\n50g Soulbowl Waldbeeren  @soul_bites_  15% Rabatt mit den Code  alternativ gemahlene Haferflocken + Waldfruchtfruchtpulver + evtl. eine Se nach Wahl\n100ml Mineralwasser  \n1 Ei  \n1/4 TL Backpulver \nTopping \n150g Joghurt\n80g rote Johannisbeeren\n1 Pfirsich  \nSes Stullen Spice  @justspices mit den Code:  gratis     ab 20 BW \n\n : ca. 10min\n\n :\nZutaten fr die Pancakes vermengen und in einer gefetteten Pfanne ausbacken \nMit den Toppings anrichten \n\n-- weil tolle Produkte \n\n#soulbowl #frhstck #pancakes #cerealpancakes #frhstcksideen #frhstcksbowl #justspices #rabattcode #gutscheincode #sommerkche #johannisbeeren #eierkuchen #pfannkuchen #veggie #schnellekche #gesundundlecker #gesundesfrhstck #fitfood #ohnezucker #einfacherezepte #schnellerezepte #yummy #rezeptefrjedentag #kochenmitliebe #essenmachtglcklich #healthyfood #waldbeeren #pfirsich #leichtekche #soulbites', 1658395448, '[]', 'IMAGE', 'images/content/posts/294459607_411007397720209_160113601953835811_n.jpg', NULL, NULL, 'https://instagram.com/p/CgROh4njCPm', 0, 0, '[\"#soulbowl\",\"#fr\\u00fchst\\u00fcck\",\"#pancakes\",\"#cerealpancakes\",\"#fr\\u00fchst\\u00fccksideen\",\"#fr\\u00fchst\\u00fccksbowl\",\"#justspices\",\"#rabattcode\",\"#gutscheincode\",\"#sommerk\\u00fcche\",\"#johannisbeeren\",\"#eierkuchen\",\"#pfannkuchen\",\"#veggie\",\"#schnellek\\u00fcche\",\"#gesundundlecker\",\"#gesundesfr\\u00fchst\\u00fcck\",\"#fitfood\",\"#ohnezucker\",\"#einfacherezepte\",\"#schnellerezepte\",\"#yummy\",\"#rezeptef\\u00fcrjedentag\",\"#kochenmitliebe\",\"#essenmachtgl\\u00fccklich\",\"#healthyfood\",\"#waldbeeren\",\"#pfirsich\",\"#leichtek\\u00fcche\",\"#soulbites\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263);
