(1211, 70, 2885942931306119653, NULL, 'CgM7c4-jQHl', 40, -1, 0, 0, 0, 0, 0, 0, '0.91', '  \n\nHeute habe ich fr dich einen saftig und fluffigen Johannisbeerkuchen, verfeinert mit Zitronenabrieb  und Vanille Kipferl Zucker  @justspices , das ist ein Vanillezucker mit echter Vanille.  \n\nMit den Code:  gibt es derzeit brigens das     ab 20 BW . Der Mix passt zu jeden Salatdressing, fr Salatlieberhaber echt ein muss.  \n\n : pro 1/2 Kchlein oder fr pro Stck \nca. 180kcal / 27g KH / 4g E / 6g F\n\n: fr 6 Gugelhupf Weckglser  280ml oder eine 16cm  Gugelhupfform \n\n   : \n75g Butter  \n100g Zucker \n1 EL Vanille Kipferl Zucker  @justspices \n2 Eier  \n200g Johannisbeeren \nAbrieb von 1/2 Zitrone  \n250g Mehl \n1/4 TL Natron \n2 TL Backpulver \n200g Buttermilch  \n1 Prise Feines Natursalz  @justspices \n\n: 15min\n\n: je nach Backform 30-40min\n\n: \nJohannisbeeren waschen und gut abtropfen lassen \nEine Backform fetten und bemehlen\nButter mit Zucker, Zitronenabrieb und Salz schaumig rhren, danach ein Ei nach den anderen einrhren \nMehl mit Backpulver und Natron mischen, sieben und abwechselnd mit der Buttermilch kurz einrhren \nJohannisbeeren unterheben\nTeig in die Backform verteilen und bei 175 Grad Celsius bei Ober-/ Unterhitze 30-40min backen \n\n-- weil tolle Produkte \n\n#beeren #johannisbeeren #johannisbeerkuchen #kuchen #kuchenrezept #beerenkuchen #obstkuchen #rhrkuchen #justspices #gutscheincode #rabattcode #sommerkuchen #sommerkche #bundtcake #ribisel #einfachbacken #backrezepte #buttermilchkuchen #gugelhupf #buttermilkcake #kaffeeundkuchen #sonntagskuchen #backen #kuchenrezept #einfacherezepte #solecker #schnellgemacht #kuchenliebe #foodblogger_de #rotejohannisbeeren #ichliebebacken', 1658251228, '[]', 'IMAGE', 'images/content/posts/294639633_829893874593945_1003363844155167001_n.jpg', NULL, NULL, 'https://instagram.com/p/CgM7c4-jQHl', 0, 0, '[\"#beeren\",\"#johannisbeeren\",\"#johannisbeerkuchen\",\"#kuchen\",\"#kuchenrezept\",\"#beerenkuchen\",\"#obstkuchen\",\"#r\\u00fchrkuchen\",\"#justspices\",\"#gutscheincode\",\"#rabattcode\",\"#sommerkuchen\",\"#sommerk\\u00fcche\",\"#bundtcake\",\"#ribisel\",\"#einfachbacken\",\"#backrezepte\",\"#buttermilchkuchen\",\"#gugelhupf\",\"#buttermilkcake\",\"#kaffeeundkuchen\",\"#sonntagskuchen\",\"#backen\",\"#kuchenrezept\",\"#einfacherezepte\",\"#solecker\",\"#schnellgemacht\",\"#kuchenliebe\",\"#foodblogger_de\",\"#rotejohannisbeeren\",\"#ichliebebacken\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
(1212, 70, 2882903613041968348, NULL, 'CgCIY_RDoTc', 38, -1, 0, 0, 0, 0, 0, 0, '0.87', ' \n\nUnglaublich wir haben schon Tag 5 unserer MOTTOWOCHE BBQ-Beilagen. Heute darf ich dir mein Rezept dazu vorstellen, einen Griechischen Schichtsalat - bei mir in der vegangen Variante . Du kannst ihn aber auch problemlos vegetarisch oder mit Fleisch zubereiten . \n\nWenn du wissen willst was die anderen Mdels so leckeres gezaubert haben, schaut gerne bei ihn vorbei, lass ein  da und lass dich von uns inspirieren fr deine nchste #grillparty .Ich verlinke dir alle Accounts im Bild und in meinen Highlights BBQ. \n\n : pro Portion\nca. 210 kcal / 9g KH / 19g E / 11g F\n\n : 6 Portionen \n\n   : \nFr den veganen Feta  \n200g Tofu Natur Fest \n150ml Birnen Essig  @adrian_manufaktur \n120ml Mandeldrink  \n2 TL Griechischer Allrounder  @justspices mit den Code:  gibts derzeit %  \n1 TL Feines Natursalz  @justspices \n2 TL Hefeflocken \nFr den veganen Tzatziki  \n1/2 Gurke  \n250g Sojajoghurt oder Sojaquark \n2 TL Tsatsiki Gewrz  @justspices \n1 Knobizehe  \netwas Olivenl\nSpritzer Zitronensaft  \nFr den Salat \nca. 1/2 kleinen Eisbergsalat \n2 Fleischtomaten  \n1/2 Gurke  \n1 rote Zwiebel  \n1 grne Paprika  \nschwarze Oliven  \nPfefferonen \nveganes Hackfleisch (Bei mir 1 Pck.  Jackfruit Veggie Hack  75g) \n2 EL Tomatenmark \n2 TL Griechischer Allrounder  @justspices \nKrautsalat (bei mir selbstgemacht aus 175g Weikraut) \n\n \nAm Vortrag den veganen Feta zubereiten, presse den Feta gut aus,schneide ihn in Wrfel, rhre aus den brigen Zutaten eine Marinade an & gebe den Tofu dazu & lass ihn im Khlschrank durchziehen \nTzatziki aus den obigen Zutaten herstellen \nFr den Salat das Hack in einer Pfanne mit l anbraten, Tomatenmark,  Griechischen Allrounder dazugeben, mit Salz/Pfeffer abschmecken & abkhlen lassen \nDie restlichen Zutaten vorbereiten & alles zusammen in eine Schale hbsch anrichten \n\n-- weil tolle Produkte', 1657888913, '[]', 'IMAGE', 'images/content/posts/294246065_1431142990733600_17185438048903305_n.jpg', NULL, NULL, 'https://instagram.com/p/CgCIY_RDoTc', 0, 0, '[\"#grillparty\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
(1213, 70, 2881511085013047631, NULL, 'Cf9LxCejZlP', 25, -1, 0, 0, 0, 0, 0, 0, '0.56', '   \n\nNa wo sind meine Knobi-Fans ? Bekommst du auch nicht genug von Knobi, dann habe ich fr dich genau das richtige Rezept. \n\nZu der Sauce gab es bei mir selbstgemachte Chili Nudel , getoppt mit frischer Petersilie  und weil es nie genug Knoblauch sein kann  noch mit den Knoblauch Pfeffer  @justspices einfach nur geil . \n\nMit den Code:   sparst du brigens derzeit 21% bei @justspices  noch bist zum 17.07. auf alles auer Bcher und Gutscheine  \n\n : pro Portion \nca. 459kcal / 55g KH / 15g E / 19g F \n\n: 4  \n\n   : \nNudeln \n3 Knoblauchzehen \n40g Parmesankse  \n250ml Kochsahne 7% Fett  \n1 TL Mehl  \n15g Butter/ Margarine  \n2 gehufte TL Gemsebrhe ohne Zuckerzusatz  @justspices \nPetersilie , Zitronenschale und einen Spritzer Zitronensaft  \nFeines Natursalz , Knoblauch Pfeffer  @justspices \n\n : 15min\n\n : \nNudeln in reichlich Salzwasser al dente kochen\nZwischenzeitlich den Knobi hacken \nIn einer Pfanne Butter und Mehl anschwitzen, Knobi dazugeben \nMit Sahne ablschen und die Gemsebrhe einrhren, zum Schluss noch den Parmesankse dazu reiben\nDie Nudeln abseihen und dabei etwas Nudelwasser auffangen \nDie Nudeln in die Sauce geben, umrhren und nach Belieben etwas Kochwasser dazugeben, mit Salz, Pfeffer, Zitronenschale und Saft abschmecken und mit Petersilie servieren \n\n-- weil tolle Produkte \n\n#pasta #nudeln #einfacherezepte #schnellerezepte #schnellekche #rezeptefrjedentag #feierabendkche #kochenmitliebe #kochen #justspices #gutscheincode #rabattcode #knoblauchsauce #knoblauch #pastasauce #sauce #soe #garlic #garlicpasta #knoblauchnudeln #nudelnmachenglcklich #leckerschmecker #mittagessen #abendessen #einfachkochen #einfachundlecker #familienrezepte #pastaliebe #vegetarisch #vegetarischerezepte', 1657722910, '[]', 'IMAGE', 'images/content/posts/293069047_574363714333451_3041299120350980193_n.jpg', NULL, NULL, 'https://instagram.com/p/Cf9LxCejZlP', 0, 0, '[\"#pasta\",\"#nudeln\",\"#einfacherezepte\",\"#schnellerezepte\",\"#schnellek\\u00fcche\",\"#rezeptef\\u00fcrjedentag\",\"#feierabendk\\u00fcche\",\"#kochenmitliebe\",\"#kochen\",\"#justspices\",\"#gutscheincode\",\"#rabattcode\",\"#knoblauchsauce\",\"#knoblauch\",\"#pastasauce\",\"#sauce\",\"#so\\u00dfe\",\"#garlic\",\"#garlicpasta\",\"#knoblauchnudeln\",\"#nudelnmachengl\\u00fccklich\",\"#leckerschmecker\",\"#mittagessen\",\"#abendessen\",\"#einfachkochen\",\"#einfachundlecker\",\"#familienrezepte\",\"#pastaliebe\",\"#vegetarisch\",\"#vegetarischerezepte\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
(1214, 70, 2880100954505236361, NULL, 'Cf4LI8GjE-J', 27, -1, 0, 0, 0, 0, 0, 0, '0.61', '   \n\nDieses  softe Toastbrot ist schnell gemacht, lsst sich super toasten und das Rezept ist wie immer mega easy nach zu backen. \n\n: pro 100g \nca. 257kcal / 43g KH / 7g E / 5g F\n\n : Fr ein 660g Toastbrot\n\n   :\n70g kernige Haferflocken \n160ml kochendes Wasser  \n25g l \n120ml Wasser  \n8g Feines Natursalz  @justspices mit denCode  sparst du % bis zum 17.07. \n1 EL Hafersirup oder Honig \n115g Weizenvollkornmehl  \n230g Weizenmehl Typ 550  \n4g frische Hefe \n\n : ca. 3,5h \n\n : 35min \n\n :\ndie Haferflocken mit dem kochendem Wasser bergieen und 10min quellen lassen \nZusammen mit den restlichen Zutaten gut verkneten und 50min abgedeckt aufgehen lassen \nDen Teig in 3 Teile teilen und zylinderfrmig aufrollen\nIn eine eckige Form geben und abgedeckt ca. 2h aufgehen lassen \nIm vorgeheizt Backenofen bei 175 Grad Celsius bei Ober und Unterhitze 15min mit Dampf  und weitere 20min ohne Dampf backen \n\n-- weil tolle Produkte \n\n#brotbacken #brot #hefe #toastbrot #toast #selbstgebacken #hefeteig #vollkorntoast #vollkorn #vollkornbrot #brotzeit #brotrezept #haferflocken #einfacherezepte #schnellerezepte #backenfrdiefamilie #foodblogger #foodie #oats #selbstgebackenesbrot #justspices #rabattcode #gutscheincode #bakingbread #toastbread #brotundbrtchen #backen #backenmachtglcklich #bread #yeastbread', 1657554810, '[]', 'IMAGE', 'images/content/posts/292763960_1074506266800827_2044520257756759522_n.jpg', NULL, NULL, 'https://instagram.com/p/Cf4LI8GjE-J', 0, 0, '[\"#brotbacken\",\"#brot\",\"#hefe\",\"#toastbrot\",\"#toast\",\"#selbstgebacken\",\"#hefeteig\",\"#vollkorntoast\",\"#vollkorn\",\"#vollkornbrot\",\"#brotzeit\",\"#brotrezept\",\"#haferflocken\",\"#einfacherezepte\",\"#schnellerezepte\",\"#backenf\\u00fcrdiefamilie\",\"#foodblogger\",\"#foodie\",\"#oats\",\"#selbstgebackenesbrot\",\"#justspices\",\"#rabattcode\",\"#gutscheincode\",\"#bakingbread\",\"#toastbread\",\"#brotundbr\\u00f6tchen\",\"#backen\",\"#backenmachtgl\\u00fccklich\",\"#bread\",\"#yeastbread\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
(1215, 70, 2876458747000962467, NULL, 'CfrO_2CDr2j', 40, -1, 0, 0, 0, 0, 0, 0, '0.91', '     \n\nDiese lecker Schnitte besteht aus einen knusprigen Schokoladen-Keks Boden, einer sahnigen Vanillepuddingcreme und getoppt wird das ganze noch von einer Schokoladen Cashew-Mousse. Verziert mit Kakaonibs und dem Bltenmix @justspices ist der #nobakecake ein Traum. \n\nbrigens mit den Code:   lohnt es sich derzeit richtig, denn du bekommst derzeit %   bei @justspices \n\n : pro Stck \nca. 185 kcal / 15g KH / 3g E / 12g F\n\n : 12 Stck (fr eine Schnittenform) \n\n   : \nFr den Boden\n100g vegane  Schokolade  \n1 TL Kokosl  \n100g zerbrselte vegane Kekse  \n50ml Mandel Drink  \nFr die Vanillecreme \n1 Pck. Puddingpulver Vanille \n300ml Mandeldrink \nkalorienarme Se nach Wahl \n100ml vegane Schlagsahne \n1 TL Vanille Kipferl Zucker  @justspices \n1 Pck. Sahnesteif \nFr die Schokoladenmousse\n60g Cashewkerne \n4 Datteln (ca. 38g) \n100ml Mandel Drink \n1 TL Vanille Extrakt \n20g Kokosl \n20g Backkakao \n2 TL Flohsamenschalen \n\n: 4h\n\n  :6h \n\n: \nFr die Mousse die Cashewkerne mind. 6h oder ber Nacht in Wasser einweichen \nFr Vanillecreme aus den Puddingpulver, der Milch und der Se nach Wahl einen Pudding kochen und diesen abgedeckt abkhlen lassen \nZwischenzeitlich den Boden herstellen, dazu alle Zutaten bis auf die Kekse in eine Schale geben und ber einen Wasserbad schmelzen, die Kekse dazugeben und in einer Schnittenform verteilen, in den Khlschrank stellen \nFr die Vanillecreme die Sahne mit Zucker und Sahnesteif steif schlagen, den abgekhlten Pudding cremig rhren und die geschlagene Sahne unterheben auf den Boden verteilen und ab in den Khlschrank \nFr die Mousse die eingeweichten Nsse mit den restlichen Zutaten in einen Mixer geben und cremig mixen, auf die Vanillecreme verteilen und mind. 3h khl stellen \n\n-- weil tolle Produkte', 1657120625, '[]', 'IMAGE', 'images/content/posts/292213920_537929944792217_6994057291436709129_n.jpg', NULL, NULL, 'https://instagram.com/p/CfrO_2CDr2j', 0, 0, '[\"#nobakecake\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
