(1230, 71, 2116993654992092433, NULL, 'B1hEoNNjz0R', 86, 297, 1217, 0, 0, 0, 0, 0, '13.71', 'Jeder hat seine eigene Geschichte, ich denke jeder knnte eine erzhlen , denn jeder wurde wahrscheinlich schon mal auf irgendeine Art und weie gedemtigt , gedemtigt wegen eines wohl nicht in der Normliegenden Krperteils oder sonstigen Eigenschaften, diese von der Gesellschaft vorgegeben sind.\nJeder wurde schon einmal irgendwie verletzt , ich meine jetzt nicht krperlich, ich meine mit Worten, mit Stzen und mit Blicken. Denn Worte knnen sehr verletzend sein, wenn man sie falsch bentzt, sie knnen eine  jede Menge anrichten. Meine Schwche war jahrelang mein Gewicht, oft wurde mir zugetragen ich sei Fett, dick, oder nicht schn. Vielen hat es wohl Spa gemacht oder sie fanden sich dadurch ziemlich cool, das zu mir zu sagen... Der verletzendste Satz war wohl immer der deutsche Panzer rollt wieder diesen einen Satz werde ich wohl nie vergessen mein ganzes Leben lang! Das Resmee des ganzen war, das mein Selbstwertgefhl so in denn Keller gesunken ist, dass ich mich selbst nicht leiden konnte und mein Ventil -die Bulimie entwickelte. Diese Worte, dieses Gefhl hat sich Jahrelang  eingeprgt, dementsprechend dauerte es eben auch genauso lang mein Denken und Handeln wieder umzudrehen. Aber nun sag ich STOP, STOP zu Beleidigungen, STOP mich selbst nieder zu machen, STOP zu zig bldsinnigen Diten, und STOP zu denen die mich Jahrelang schikaniert haben! Ich bin so wie ich bin! Und so bin ich genau richtig und so seit ihr auch genau richtig, anstatt uns gegenseitig fertig zu machen sollten wir uns Worte des Respekts schenken, Liebe, Achtsamkeit & Einfhlsamkeit! Wir sollten aufhren an idealen festzukleben, wir sollten Worte bewusster whlen, weil verletzende Wrter strker und hrter sein knnen als alles andere! Nur gemeinsam sind wir stark !  \nEin rieen Dankeschn an alle die mich immer untersttzten  Danke @hayslgrey fr deine Hilfe bei dem Video \n#togetterwearebetterandstrong #ihrseidperfektsowieih