(1246, 73, 3095256806679160911, NULL, 'Cr0j6qSuKhP', 0, 13, 0, 0, 0, 0, 0, 0, '0.06', 'Gewinnspiel mit @nowbiolimo \n\nSchaut doch mal bei @nowbiolimo vorbei! Gemeinsam mit unserer Partnerfirma @neumarkter.lammsbraeu luft gerade ein groes Gewinnspiel mit tollen Preisen. Als Hauptgewinn kannst du einen 1.000  BIO HOTELS Gutschein gewinnen und dir nachhaltige Erholung in unseren BIO HOTELS gnnen! Aber es warten noch weitere tolle Gewinne auf dich! Die Pltze 28 drfen sich auf je zwei bernachtungen fr 2 Personen in ausgewhlten BIO HOTELS freuen, Platz 915 auf einen 250  BIO HOTELS Gutschein. Darber hinaus gibt es BIO HOTELS berraschungspakete, Brauereifhrungen bei der Neumarkter Lammsbru und now berraschungsboxen zu gewinnen!\n\nZum Gewinnspiel gelangt ihr ber den 2. Link in unserer Bio \n\nViel Glck \n\n@biohotel_eggensberger @biohotelamadeus @biohotelrupertus @theinersgarten.biorefugium @biohotelbayerischerwirt @biohotel.steineggerhof @biohotel_grafenast \n.\n.\n#biohotels #biohotel #hotelsfrdiezukunft #hotelsforfuture #bio #biolimonade #biobier #biologisch #urlaub #gewinnen #bier #lammsbru #nowbiolimo #nowbiolimonade #nowbio', 1683203389, NULL, 'IMAGE', 'images/content/posts/344758780_567907368779218_8022127274725649798_n.jpg', NULL, NULL, 'https://instagram.com/p/Cr0j6qSuKhP', 0, 0, '[\"#biohotel\",\"#hotelsf\\u00fcrdiezukunft\",\"#hotelsforfuture\",\"#bio\",\"#biolimonade\",\"#biobier\",\"#biologisch\",\"#urlaub\",\"#gewinnen\",\"#bier\",\"#lammsbr\\u00e4u\",\"#nowbiolimo\",\"#nowbiolimonade\",\"#nowbio\"]', 'post', 'profile_scrape', 0, 1683204171, 1683204171),
