(1248, 73, 3093066251026871302, NULL, 'Crsx14XNLQG', 1, 124, 0, 0, 0, 0, 0, 0, '0.54', ' Auf der Suche nach einem erholsamen Yoga-Urlaub in den Alpen? Dann bist du in unserem BIO HOTEL @biohotel.stillebach genau richtig! \n\nWir legen groen Wert auf gesundes und bewusstes Leben und bieten dir daher ein hochwertiges Yoga-Angebot, das dich sowohl als Anfnger, als auch als fortgeschrittener \"Yogi\" herausfordert und inspiriert. \n\nEntdecke unseren neuen Yogastadl: ausgestattet mit Matten, Kissen, Gurten und Vorrichtungen fr Aerial Yoga, bietet dir unser Yogastadl alles, was du fr deine Yoga-Praxis bentigst. Unsere professionell ausgebildete Yoga-Lehrerin Daniela leitet sorgsam und mit viel Elan vielseitige und kreative Yogastunden, die dich in Einklang mit dir selbst und der Natur bringen.\n\nErlebe eine Auszeit vom Alltag inmitten der atemberaubenden Bergwelt des Pitztals und tauche in die 2000 Jahre alte Technik des Yoga ein. Wir freuen uns auf dich! \n\n#biohotels #biohotel #hotelsfrdiezukunft #hotelsforfuture #biohotelstillebach #dachtirols #pitztal #yogaurlaub #yogaimurlaub #alpenyoga #gesundesleben #bewusstesleben #yogastadl #aerialyoga #tirol', 1682942252, '{\"city_name\":\"Biohotel Stillebach\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/343775339_546396317689577_198347997536105260_n.jpg', NULL, NULL, 'https://instagram.com/p/Crsx14XNLQG', 0, 0, '[\"#biohotel\",\"#hotelsf\\u00fcrdiezukunft\",\"#hotelsforfuture\",\"#biohotelstillebach\",\"#dachtirols\",\"#pitztal\",\"#yogaurlaub\",\"#yogaimurlaub\",\"#alpenyoga\",\"#gesundesleben\",\"#bewusstesleben\",\"#yogastadl\",\"#aerialyoga\",\"#tirol\"]', 'post', 'profile_scrape', 0, 1683204171, 1683204171);
