(1249, 73, 3092261154130787463, NULL, 'Crp6yLctHyH', 2, 159, 0, 0, 0, 0, 0, 0, '0.69', 'Du willst einen nachhaltigen Aktivurlaub in Sdtirol verbringen? \n\nDann ist unser BIO HOTEL @theinersgarten.biorefugium das perfekte Ziel! Nahe Meran in Sdtirol kannst du frisch, fit und vital bleiben. Geniee den Duft nach Bergkrutern und frischem Gras, sattgrne Almweiden, dichte Wlder, kristallklare Seen und imposante Gipfel. Das Aktivprogramm ist im Aufenthaltspreis inbegriffen und bietet dir wchentlich gefhrte Wanderungen mit Wanderfhrerin Julia, Ausflge mit geprften Bike-Guides der Bike Academy Lana, Yoga und Waldbaden mit Gabriele und vieles mehr. Buche jetzt deinen nachhaltigen Aktivurlaub im Meraner Land! \n\n#biohotels #biohotel #hotelsfrdiezukunft #hotelsforfuture #theinersgarten #biorefugium #NachhaltigerAktivurlaub #Sdtirol #GartenDerEnergie #RadhotelSdtirol #FrischFitVital #Wanderungen #BikeAusflge #Yoga #Waldbaden', 1682846277, '{\"city_name\":\"theiner\'s garten BIO Vitalhotel\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/343972002_630200965154821_239488959786389084_n.jpg', NULL, NULL, 'https://instagram.com/p/Crp6yLctHyH', 0, 0, '[\"#biohotel\",\"#hotelsf\\u00fcrdiezukunft\",\"#hotelsforfuture\",\"#theinersgarten\",\"#biorefugium\",\"#nachhaltigeraktivurlaub\",\"#s\\u00fcdtirol\",\"#gartenderenergie\",\"#radhotels\\u00fcdtirol\",\"#frischfitvital\",\"#wanderungen\",\"#bikeausfl\\u00fcge\",\"#yoga\",\"#waldbaden\"]', 'post', 'profile_scrape', 0, 1683204171, 1683204171),
(1250, 73, 3088598521230198263, NULL, 'Crc5_2vuQX3', 3, 100, 0, 0, 0, 0, 0, 0, '0.44', 'Wast isn\'t waste until we waste is.  WILL.I.AM\n(Mll ist kein Mll, bis wir ihn wegwerfen)\n\nIn unseren BIO HOTELS setzen wir auf Ressourcenschonung, wiederverwendbare oder recycelte Materialien und strikte Mlltrennung um dem Problem der Vermllung entgegenzuwirken. \n.\n.\n#biohotels #biohotel #hotelsfrdiezukunft #hotelsforfuture #nachhaltigkeit #mll #recycling #recycle #waste #umwelt #umweltschutz', 1682409660, NULL, 'IMAGE', 'images/content/posts/343037234_204919815584095_3332887275239815593_n.jpg', NULL, NULL, 'https://instagram.com/p/Crc5_2vuQX3', 0, 0, '[\"#biohotel\",\"#hotelsf\\u00fcrdiezukunft\",\"#hotelsforfuture\",\"#nachhaltigkeit\",\"#m\\u00fcll\",\"#recycling\",\"#recycle\",\"#waste\",\"#umwelt\",\"#umweltschutz\"]', 'post', 'profile_scrape', 0, 1683204171, 1683204171),
(1251, 73, 3087864085597152209, NULL, 'CraTAaQtGPR', 392, 578, 0, 0, 0, 0, 0, 0, '4.19', 'Starte deine Reise zu dirselbst und hole dir deine Dosis Selbstliebe! \n\nWir verlosen gemeinsam mit @ohshanti.de drei Selbstliebe Geschenk Boxen. Hier werden die Themen Selbstakzeptanz, Krper annehmen, Resilienz & Bedrfnisse behandelt, um dir im Leben wieder mehr Freude und Selbstliebe zu schenken! \nNehm dir eine Auszeit und finde zu dir!\nWas du dafr tun musst? Ganz einfach: \n\nFolge@ohshanti.de&@biohotels\n Like diesen Beitrag\n Verrate uns in den Kommentaren, wer auch etwas Zeit fr sich gebrauchen knnte. \n Fr ein Extra-Los reposte diesen Beitrag in deiner Story \n\nDas Gewinnspiel luft bis zum 04.05.2023  23:59 Uhr und der/die GewinnerIn wird am 05.05.2023 ausgelost und per PN benachrichtigt. Dieses Gewinnspiel steht in keiner Verbindung mit Facebook oder Instagram. Die Teilnahmebedingungen findest du ber den Link in unserer Bio.\n\nVIEL GLCK \n.\n.\n#biohotels #biohotel #hotelsfrdiezukunft #hotelsforfuture #giveaway #gewinnspiel #nachhaltigkeit #selbstliebe #achtsamkeit #box #resilienz #freude #ohshanti', 1682322105, NULL, 'IMAGE', 'images/content/posts/342555946_243202681692997_5866865070945401700_n.jpg', NULL, NULL, 'https://instagram.com/p/CraTAaQtGPR', 0, 0, '[\"#biohotel\",\"#hotelsf\\u00fcrdiezukunft\",\"#hotelsforfuture\",\"#giveaway\",\"#gewinnspiel\",\"#nachhaltigkeit\",\"#selbstliebe\",\"#achtsamkeit\",\"#box\",\"#resilienz\",\"#freude\",\"#ohshanti\"]', 'post', 'profile_scrape', 0, 1683204171, 1683204171),
(1252, 73, 3086424144031678932, NULL, 'CrVLmgLMoHU', 5, 111, 0, 0, 0, 0, 0, 0, '0.5', 'Happy Earthday \n\nLasst uns einen Moment innehalten, um unsere wunderschne Erde zu wrdigen und darber nachzudenken, was wir tun knnen, um sie zu schtzen. Kleine Handlungen knnen einen groen Unterschied beim Erhalt unserer Umwelt machen. Ob es darum geht, Plastikmll zu reduzieren, Energie zu sparen oder nachhaltig Urlaub zu machen  jeder Beitrag zhlt! Lasst uns gemeinsam daran arbeiten, eine sauberere, gesndere und nachhaltigere Welt fr uns selbst und zuknftige Generationen zu schaffen. \n.\n.\n#biohotels #biohotels #hotelsfrdiezukunft #hotelsforfuture #nachhaltig #earthday #Erdtag #Umweltschutz #Nachhaltigkeit #klimawandel #klimaschutz', 1682150453, NULL, 'IMAGE', 'images/content/posts/342383739_618066383208334_7693816375501233526_n.jpg', NULL, NULL, 'https://instagram.com/p/CrVLmgLMoHU', 0, 0, '[\"#biohotels\",\"#hotelsf\\u00fcrdiezukunft\",\"#hotelsforfuture\",\"#nachhaltig\",\"#earthday\",\"#erdtag\",\"#umweltschutz\",\"#nachhaltigkeit\",\"#klimawandel\",\"#klimaschutz\"]', 'post', 'profile_scrape', 0, 1683204171, 1683204171),
(1253, 73, 3085079461091555132, NULL, 'CrQZ2ymNzc8', 4, 89, 0, 0, 0, 0, 0, 0, '0.4', ' Rezept des Monats \nBltterteigkrapfen mit Kartoffel-Polenta-Lauchfllung auf Gemsekohl & Preiselbeerensauce \n\nApril ist die Saison des Lauches und daher gibt es diesen Monat ein leckeres Rezept mit Lauch, Gemsekohl, Kartoffeln und Polenta aus unserem BIO HOTEL @biohotelpanorama \n\nUnd so geht\'s:\nFr die Bltterteigkrapfen die Gemsebrhe zum Kochen bringen, die Maisgries-Polenta einriseln lassen und mit Butter cremig rhren. Mit Salz und Pfeffer abschmecken. Die Polenta in eine Form gieen und khl stellen. Bltterteigscheiben aus dem Gefrierfach nehmen, 5 Min. leicht antauen lassen und in je 4 Quadrate teilen. Diese auf ein mit Backpapier belegtes Backblech geben und im Ofen bei 200 Grad hellbraun backen. Danach die Bltterteigkrapfen herausnehmen, 5 Min. abkhlen lassen, mit dem Messer waagrecht durchschneiden & aufklappen. \n\nNun die Polenta und die Kartoffeln mit einer Kartoffelraspel hobeln. Dann den Lauch fein schneiden und in etwas l gemeinsam mit den Zwiebel glasig dnsten. Anschlieend die geraspelte Polenta & Kartoffeln dazugeben und mit Salz und Pfeffer abschmecken. Belege die Bden der Bltterteigkrapfen mit je 25g Fllung und schliee diese.\n\nZum Schluss die gefllten Krapfen nochmals fr 8 Min. bei 165 Grad im Ofen erhitzen und in der Zwischenzeit den blanchierten und abgeschmeckten Grnkohl am Teller anrichten. Je 3-4 Bltterteigkrapfen draufsetzen und mit Preiselbeerensauce servieren. \n\nFr die Preiselbeersauce l in einem Topf erhitzen & das geschnittene Wurzelgemse anrsten bis es leicht braun wird. Tomatenmark dazugeben & weiter rsten. Alles mit Rotwein ablschen und gut verrhren. Jetzt die Gemsebrhe dazugeben und bei kleiner Flamme 1,5 h kcheln lassen. Die Soe nochmals auf die Hlfte reduzieren und die Preiselbeeren dazugeben. \n\nViel Spa beim nachmachen! \n.\n.\n#biohotels #biohotel #hotelsfrdiezukunft #hotelsforfuture #kochen #kochenmitdenbiohotels #rezeptdesmonats #nachhaltigkochen #rezept #diy #nachkochen #biologisch #bio #nachhaltig', 1681990152, NULL, 'IMAGE', 'images/content/posts/341833605_185668214313985_4028595043945694615_n.jpg', NULL, NULL, 'https://instagram.com/p/CrQZ2ymNzc8', 0, 0, '[\"#biohotel\",\"#hotelsf\\u00fcrdiezukunft\",\"#hotelsforfuture\",\"#kochen\",\"#kochenmitdenbiohotels\",\"#rezeptdesmonats\",\"#nachhaltigkochen\",\"#rezept\",\"#diy\",\"#nachkochen\",\"#biologisch\",\"#bio\",\"#nachhaltig\"]', 'post', 'profile_scrape', 0, 1683204171, 1683204171),
(1254, 73, 3083646225345464722, NULL, 'CrLT-dysMmS', 0, 70, 0, 0, 0, 0, 0, 0, '0.3', 'Sharing is Caring  Teile deine Dinge und schone die Umwelt! \n\nWusstest du, dass wir oft unntig viele Dinge besitzen, die wir nur selten oder gar nicht benutzen? Wir alle haben sicherlich schon mal ein Auto, einen Rasenmher oder eine Bohrmaschine gekauft, die meiste Zeit aber stehen diese Dinge ungenutzt herum.\n\nHier gibt es eine nachhaltigere Lsung: Sharing! Teile deine Dinge mit Freunden oder greife auf offizielle Sharing-Modelle zu? Denn wenn wir gemeinsam nutzen, sparen wir nicht nur Platz, sondern auch Ressourcen und schonen somit die Umwelt. Auerdem entlasten wir dadurch auch unseren Geldbeutel.\n\nLass uns gemeinsam Verantwortung bernehmen und unseren Teil zur Nachhaltigkeit beitragen. \n.\n.\n#biohotels #biohotel #hotelsfrdiezukunft #hotelsforfuture #bio #urlaub #nachhaltig #sharingiscaring #nachhaltigkeit #umweltschutz #gemeinsam #teilen', 1681819299, NULL, 'IMAGE', 'images/content/posts/341362491_804959454309493_1456897819091621467_n.jpg', NULL, NULL, 'https://instagram.com/p/CrLT-dysMmS', 0, 0, '[\"#biohotel\",\"#hotelsf\\u00fcrdiezukunft\",\"#hotelsforfuture\",\"#bio\",\"#urlaub\",\"#nachhaltig\",\"#sharingiscaring\",\"#nachhaltigkeit\",\"#umweltschutz\",\"#gemeinsam\",\"#teilen\"]', 'post', 'profile_scrape', 0, 1683204171, 1683204171),
(1255, 73, 3082910818471707469, NULL, 'CrIsw4xNwNN', 1, 115, 0, 0, 0, 0, 0, 0, '0.5', 'Hier wird Kreativitt gefrdert! #greenmeeting in Garmisch-Partenkirchen \n\nEntdecke die neugebaute Kreativwerkstatt in unseren BIO HOTEL @biohotel_garmischerhof - hier kannst du CO2-neutrale & nachhaltige Tagungen, Workshops oder Seminare fr bis zu 28 TeilnehmerInnen planen. Um die Verpflegung kmmert sich das Hotel-Team  freu dich auf 100 % biologische Lebensmittel und Getrnke! \n\nDeine Gste knnen anschlieend im BIO HOTEL @biohotel_garmischerhof oder im BIO HOTEL @biohotel_bavaria bernachten.\n.\n.\n#biohotels #biohotel #hotelsfrdiezukunft #hotelsforfuture #kreativwerkstatt #garmisch #nachhaltig #tagen #greenmeeting #nachhaltigatagen #businesstrip #geschftsreise #kreativ #garmischpartenkirchen #garmischerhof', 1681731630, '{\"city_name\":\"Garmisch-Partenkirchen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/341764908_3251119061867476_4489121752102447728_n.jpg', NULL, NULL, 'https://instagram.com/p/CrIsw4xNwNN', 0, 0, '[\"#greenmeeting\",\"#biohotel\",\"#hotelsf\\u00fcrdiezukunft\",\"#hotelsforfuture\",\"#kreativwerkstatt\",\"#garmisch\",\"#nachhaltig\",\"#tagen\",\"#greenmeeting\",\"#nachhaltigatagen\",\"#businesstrip\",\"#gesch\\u00e4ftsreise\",\"#kreativ\",\"#garmischpartenkirchen\",\"#garmischerhof\"]', 'post', 'profile_scrape', 0, 1683204171, 1683204171),
(1256, 73, 3079232305382423895, NULL, 'Cq7oXefOf1X', 2, 91, 0, 0, 0, 0, 0, 0, '0.4', 'Jobs fill your pocket. Adventures fill your soul.  Jaime Lyn Beatty \n(Jobs fllen deine Tasche. Abenteuer fllen deine Seele.)\n\nTu dir und deiner Seele etwas gutes und begib dich auf deine nchste Reise! Entdecke neue Orte und lerne neue Menschen kennen. Um auf deiner Reise nicht nur dir sondern auch der Umwelt Gutes zu tun, entscheide dich bei der Wahl des Hotels fr unsere nachhaltigen BIO HOTELS. \n.\n.\n#biohotels #biohotel #hotelsfrdiezukunft #hotelsforfuture #bio #nachhaltigkeit #abenteuer #adventure #nachhaltig #reisen #urlaub #biourlaub', 1681293119, NULL, 'IMAGE', 'images/content/posts/341004679_3439041333017171_5104524773638623663_n.jpg', NULL, NULL, 'https://instagram.com/p/Cq7oXefOf1X', 0, 0, '[\"#biohotel\",\"#hotelsf\\u00fcrdiezukunft\",\"#hotelsforfuture\",\"#bio\",\"#nachhaltigkeit\",\"#abenteuer\",\"#adventure\",\"#nachhaltig\",\"#reisen\",\"#urlaub\",\"#biourlaub\"]', 'post', 'profile_scrape', 0, 1683204171, 1683204171),
