(1258, 74, 3085953657762363198, NULL, 'CrTgoBsPjc-', 2, 58, 320, 0, 0, 0, 0, 0, '1.95', 'Valencia = Sonne, gutes Essen, Meer, tolle Stadt \n\n#valencia #valncia #valenci #valenciaspain #valenciagram #spain #spanien #urlaub w/ @wibkekroll', 1682094572, NULL, 'VIDEO', 'images/content/posts/342107169_586169049941607_933411222804983168_n.jpg', NULL, NULL, 'https://instagram.com/p/CrTgoBsPjc-', 0, 0, '[\"#val\\u00e8ncia\",\"#valenci\\u00e0\",\"#valenciaspain\",\"#valenciagram\",\"#spain\",\"#spanien\",\"#urlaub\"]', 'post', 'profile_scrape', 0, 1683205662, 1683205662),
(1259, 74, 3062547219668485297, NULL, 'CqAWnhgM0Sx', 8, 69, 0, 0, 0, 0, 0, 0, '2.5', 'Wir bedanken uns bei allen Kunden*innen, Veranstaltungsteilnehmern*innen, unseren tollen Mitarbeitern*innen und allen Kooperationspartnern*innen, die uns auf diesem Weg begleitet haben. \n\nAuf die nchsten Jahre: Schulungen, Trainings, Kampagnen, Content-Produktionen, Coachings und vieles mehr! \n\n#soreal #sorealgmbh #jubilum #3jahre #socialmedia #beratung #consulting #digitaletransformation #digital #danke', 1679304100, '{\"city_name\":\"Stuttgart\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/336333702_881402193155112_2432194319065689145_n.jpg', NULL, NULL, 'https://instagram.com/p/CqAWnhgM0Sx', 0, 0, '[\"#sorealgmbh\",\"#jubil\\u00e4um\",\"#3jahre\",\"#socialmedia\",\"#beratung\",\"#consulting\",\"#digitaletransformation\",\"#digital\",\"#danke\"]', 'post', 'profile_scrape', 0, 1683205662, 1683205662),
(1260, 74, 3053356775029709573, NULL, 'Cpfs888LZsF', 2, 89, 0, 0, 0, 0, 0, 0, '2.95', 'Gerade vergeht nicht eine Woche, in der wir keine Anfrage wie diese bekommen: Knnen Sie auch Personalgewinnung?Am besten gestern!\n\nNa klar, ob in Kampagnen, mit Keynotes oder Workshops.Heute hatten wir beispielsweise mit @so.real.gmbh wieder ein Update unserer Recruiting-Kampagne fr die Ausbildung in der Speditions- und Logistikbranche beim @vsl_bw / @moveyourfuture. Was wir hier anwenden, hilft vielleicht auch dir:\n\n Die Aufmerksamkeit steigerst du, in dem du deine Zielgruppe verstehst. Auf sie eingehst und Einblicke in dein Unternehmen gibst.\n\n Prfe zudem regelmig selbst als Mystery-Shopper deine eigene Bewerbungsjourney. Jeden Klick, den du deinen Bewerbern sparen kannst, steigert deine Abschlussrate. (Bitte auch die Besttigungsmail nach dem Einreichen der Bewerbung beleuchten. Oftmals wurde diese von einer Person geschrieben, die, naja sagen wir mal, die Emotionsvielfalt einer KI haben.)\n\n Orientiere dich gerne an E-Commerce-Anbietern, alle 5-Minuten erhalte ich hier beim Online-Shopping gefhlt ein Update zu meiner Sendung. Sind deine Bewerber (m/w/d) immer auf dem Laufenden?Hilft u.a. auch Bewerber-Ghosting zu minimieren.\n\nIch hoffe, damit hast du ein paar Impulse fr die Optimierung deines Recruitings. Ansonsten -me.\n\n#recruiting #journey #personalgewinnung#hr #humanressource #personal #azubi #ausbildung #mitarbeitermarketing #mitarbeitergewinnung #bewerber #arbeitgebermarke #employerbranding', 1678208513, '{\"city_name\":\"Stuttgart\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/332696465_581157704063658_6366948952137719706_n.jpg', NULL, NULL, 'https://instagram.com/p/Cpfs888LZsF', 0, 0, '[\"#journey\",\"#personalgewinnung\\u00a0#hr\",\"#humanressource\",\"#personal\",\"#azubi\",\"#ausbildung\",\"#mitarbeitermarketing\",\"#mitarbeitergewinnung\",\"#bewerber\",\"#arbeitgebermarke\",\"#employerbranding\"]', 'post', 'profile_scrape', 0, 1683205662, 1683205662),
(1261, 74, 3039615288597056500, NULL, 'Cou4gAarIv0', 2, 44, 0, 0, 0, 0, 0, 0, '1.49', 'What? Ganz pragmatisch erklrt: Neuromarketing beschftigt sich damit, wie Auswahl- und Kaufentscheidung im menschlichen Gehirn ablaufen. Fr Marketers ist es daher sehr interessant, wie sich diese Erkenntnisse im Marketing einsetzen lassen. Und auch fr Verbraucher, gut zu wissen, wie Werbung die Entscheidungen im Alltag beeinflusst. \n\nSwipe mal und schau dir an, wie du a) diese Effekte im Marketing nutzen kannst, aber auch b) diese Dinge im Alltag eventuell abwehren kannst. \n\n Hat dich etwas berrascht?\n\nPs: Warum ich dir das erzhle? Ich habe das ganze mal studiert (M.A. Wirtschaftspsychologie) und mchte dich inspirieren. \n\n#neuromarketing #werbepsychologie #marketingpsychologie #psychologie #einfluss #marketing #socialmedia #wirtschaftspsychologie', 1676570400, NULL, 'IMAGE', 'images/content/posts/331141282_690802736174892_6719671984892181928_n.jpg', NULL, NULL, 'https://instagram.com/p/Cou4gAarIv0', 0, 0, '[\"#werbepsychologie\",\"#marketingpsychologie\",\"#psychologie\",\"#einfluss\",\"#marketing\",\"#socialmedia\",\"#wirtschaftspsychologie\"]', 'post', 'profile_scrape', 0, 1683205662, 1683205662),
(1262, 74, 3033817112717258406, NULL, 'CoaSJcVA26m', 0, 33, 257, 0, 0, 0, 0, 0, '1.07', 'Heute toller Workshop zum Thema LinkedIn. \nDoch was haben wir konkret getan? \n\nAufgeteilt auf drei Gruppen, ging es mit den Fhrungskrften von ATR International AG erst um Social-Media-Strategie (Worldwide), mit dem Marketing-Team rund um das Thema Contents und mit wichtigen Corporate Influencern, um digitale Sichtbarkeit fr das ganze Unternehmen auf LinkedIn.\n\nSo konnten wir den unterschiedlichen Wissensstnden gerecht werden und den maximalen Praxisnutzen fr jede Zielgruppe herausarbeiten.\n\nEgal, ob B2B oder B2C oder andere Geschftsbeziehungen etabliert werden sollen, es geht immer um:\n\n Menschen\n Authentizitt\n Mehrwert\n\n Ich hoffe, fr dich war in diesem Post ein Mehrwert, ansonsten meine Frage:\nWas interessiert dich konkret beim Thema: Social Media, Corporate Influencer oder LinkedIn?\n\n#socialmediaworkshop #linkedin #b2b #mehrwert #workshop #socialmedia @so.real.gmbh', 1675879408, '{\"city_name\":\"Denkendorf\",\"country_name\":\" Baden-Wurttemberg\",\"tagged_location\":\"true\"}', 'VIDEO', 'images/content/posts/329414383_2331988213629758_1547626259448743212_n.jpg', NULL, NULL, 'https://instagram.com/p/CoaSJcVA26m', 0, 0, '[\"#linkedin\",\"#b2b\",\"#mehrwert\",\"#workshop\",\"#socialmedia\"]', 'post', 'profile_scrape', 0, 1683205662, 1683205662),
(1263, 74, 3027298650308863047, NULL, 'CoDIBVIreRH', 4, 94, 0, 0, 0, 0, 0, 0, '3.18', 'Tipps fr Tools mit knstlicher Intelligenz, mit der du noch diese Woche produktiver werden kannst. Von automatisiertem Texten, ber Videoproduktion, Prsentation oder bersetzungen. \n\n Was ist aktuell dein Lieblings-KI-Tool?\n\n Du verstehst nur Bahnhof? Dann kommt zu meinem KI-Crashkurs am 14.03.2023, 13 Uhr: www.so-real.de/ki\n\n#ki #knstlicheintelligenz #chatgpt #webinar #kitools #software #socialmedia #marketing #produktivitt', 1675102143, NULL, 'IMAGE', 'images/content/posts/327820672_861804721721630_7850805070277954761_n.jpg', NULL, NULL, 'https://instagram.com/p/CoDIBVIreRH', 0, 0, '[\"#k\\u00fcnstlicheintelligenz\",\"#chatgpt\",\"#webinar\",\"#kitools\",\"#software\",\"#socialmedia\",\"#marketing\",\"#produktivit\\u00e4t\"]', 'post', 'profile_scrape', 0, 1683205662, 1683205662),
(1264, 74, 3019260590417749693, NULL, 'CnmkYKgL6a9', 1, 63, 0, 0, 0, 0, 0, 0, '2.08', '+++ Ads. Ads. Ads. +++\nJa, genau du hast richtig gelesen: 3x Ads.\nWusstest du folgende Dinge rund um das Thema Social-Media-Werbeanzeigen?\n\n  dass du Personen, die mit deinen Social-Media-Accounts interagiert haben, jederzeit wieder targetieren kannst?\n  dass du auf Instagram die breite Masse erreichst, auf LinkedIn exakt auf Jobtitel targeten und bei TikTok am gnstigsten Werbung schalten kannst?\n  dass immer mehr Unternehmen Social-Media-Werbung schalten und damit in Zukunft die Preise weiter steigen werden?\n  dass du mit Social-Media-Werbeanzeigen wunderbar latent Suchende fr Karrieremglichkeiten, als auch im Vertrieb ansprechen kannst?\n  dass du sehr einfach, mehrere Creatives gegeneinander testen und damit auch Learnings fr deine organische Social-Media-Arbeit ableiten kannst.\n\nWenn du mindestens bei einem gesagt hast, okay cool, das war mir so nicht klar, dann lade ich dich herzlich zu meiner Modulreihe rund um:\n\n Link in der Bio, oder so-real.de/veranstaltungen oder schreibe mir gerne eine Nachricht bei weiteren Fragen.\n\nIch freue mich auf dich. \n\n#socialmedia #socialmediawerbeanzeigen #socialmediaads #werbeanzeigen #webinar #weiterbildung #reichweite #vrsocial #bwgv #volksbank #raiffeisenbank', 1674143931, '{\"city_name\":\"Stuttgart\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/326072693_591965006097797_57190179878340162_n.jpg', NULL, NULL, 'https://instagram.com/p/CnmkYKgL6a9', 0, 0, '[\"#socialmediawerbeanzeigen\",\"#socialmediaads\",\"#werbeanzeigen\",\"#webinar\",\"#weiterbildung\",\"#reichweite\",\"#vrsocial\",\"#bwgv\",\"#volksbank\",\"#raiffeisenbank\"]', 'post', 'profile_scrape', 0, 1683205662, 1683205662),
(1265, 74, 3009040462115857791, NULL, 'CnCQluTMWV_', 0, 32, 0, 0, 0, 0, 0, 0, '1.04', 'Alles, was im Dezember 2022 auf Social Media und im digitalen Orbit passiert ist. Kuratiert in einem Post. \n\n Du willst einen Social-Media-Update und -Trend-Rundumschlag? Dann melde dich zu einem meiner Web-Seminare an: so-real.de/veranstaltungen\n\n Alle Quellen und News im Detail findest du auf unserem @so.real.gmbh-Blog\nso-real.de/so-blog\n\nIch wnsche dir ein gesundes, glckliches und erfolgreiches neues Jahr! \n\n#socialmedianews #socialmediatrends #socialmediaupdates #2023 #2022 #news #updates #socialmedia #onlinemarketing', 1672925597, NULL, 'IMAGE', 'images/content/posts/323752452_717654999794492_3837696744140581429_n.jpg', NULL, NULL, 'https://instagram.com/p/CnCQluTMWV_', 0, 0, '[\"#socialmediatrends\",\"#socialmediaupdates\",\"#2023\",\"#2022\",\"#news\",\"#updates\",\"#socialmedia\",\"#onlinemarketing\"]', 'post', 'profile_scrape', 0, 1683205662, 1683205662),
(1266, 74, 3005497931280606308, NULL, 'Cm1rHHXJuRk', 0, 51, 308, 0, 0, 0, 0, 0, '1.65', 'Es ist einfach ein schnes Ritual fr mich, am Jahresende noch mal ein Resmee zu ziehen. Ganz nach dem 50 Cents Motto: Reflect the past, focus on the future. Danke 2022, du warst gut! \n\nMeine gesetzten Ziele aus diesem Jahr konnte ich zum Groteil erreichen:\n- Sport 90/100\n- Bcher gelesen 10/10\n- Workshop, Webinar, Livestream und Coaching Teilnehmer: >5.000/5.000\n- Erfolgreiches Jahr fr @so.real.gmbh \n- Glckliche Wifey @nathaliekroll_ \n - Kochskills verbessert\n\nWenn mir Themen wichtig sind, dann gehe ich diese direkt an und warte nicht auf den Jahreswechsel. Ein paar Ziele habe ich mir dennoch fr 2023 gesetzt:\n- mehr Deep-Work-Phasen\n- weniger Mail-Unterbrechungen\n- Prozesse optimieren und automatisieren\n- beibehalten: Wifey / Freunde / Family, Reisen und Sport\n\nFazit: 2022 war super, viele Reisen (Highlights: Verona, Venedig & Dahner Felsenland), viele Bands gesehen (Highlight: Coldplay) und viel gelesen (Highlight: Die with zero). In drei Wrtern: travel, read, family & friends - happy wife, happy life. \n\nWas willst du 2023 tun oder auch nicht mehr tun?\n\n#2022 #recap #review #year2022 #jahresrckblick #reel', 1672503481, NULL, 'VIDEO', 'images/content/posts/322708259_1332619154195857_3402181867207232987_n.jpg', NULL, NULL, 'https://instagram.com/p/Cm1rHHXJuRk', 0, 0, '[\"#recap\",\"#review\",\"#year2022\",\"#jahresr\\u00fcckblick\",\"#reel\"]', 'post', 'profile_scrape', 0, 1683205662, 1683205662),
(1267, 74, 3004609391601021425, NULL, 'CmyhFKTLnHx', 6, 72, 0, 0, 0, 0, 0, 0, '2.53', 'Vor ein paar Jahren habe ich Wirtschaftspsychologie, Fachrichtung Marketingpsychologie im Master studiert.\n\nDort habe ich sehr viele ntzliche Effekte, Methoden, psychologische Phnomene und das Neuromarketing kennengelernt. Seitdem wende ich diese Themen immer wieder im Marketing, bei Workshops und natrlich bei Kampagnen unserer Kunden an  um in das Gedchtnis der Zielgruppe zukommen. \n\nFangen wir heute mit Storytelling und Neuromarketing an. Setze das Geschichten erzhlen am besten auch fr deine Jahresberichte, Rckblicke etc. ein. So bleibst du besser im Gedchtnis. \n\nVielleicht ist es ja auch fr dich interessant. Dann folge mir fr weitere Tipps, die ich im Jahr 2023 verffentlichen werde.\n\nGuten Rutsch \n\n#neuromarketing #wirtschaftspsychologie #storytelling #marketingpsychologie #effekte #methoden #zielgruppen', 1672397372, NULL, 'IMAGE', 'images/content/posts/322397409_1325300194904184_2883232738581563889_n.jpg', NULL, NULL, 'https://instagram.com/p/CmyhFKTLnHx', 0, 0, '[\"#wirtschaftspsychologie\",\"#storytelling\",\"#marketingpsychologie\",\"#effekte\",\"#methoden\",\"#zielgruppen\"]', 'post', 'profile_scrape', 0, 1683205662, 1683205662),
(1268, 74, 2988529346218986089, NULL, 'Cl5Y5tCNopp', 6, 59, 1052, 0, 0, 0, 0, 0, '2.11', 'Absoluter, aktueller Social-Media-Hype: Bilder mit AI (Knstlicher Intelligenz) zu erstellen oder zu bearbeiten. Drei, die ber Nacht viral gegangen sind:\n Mepa.Ai,\n Lensa und\n Astria\n\n Besonders mepa.ai ist durch Influencer aktuell sehr viral gegangen und funktioniert folgendermaen:\n\nDu reichst 9 Bilder von dir ein (ruhiger Hintergrund, Gesicht gut erkennbar - keine Sonnenbrillen-Bilder aus deinem letzten Strandurlaub), bezahlst aktuell ca. 9  und erhltst dann nach 24 Stunden, 200, mit knstlicher Intelligenz bearbeitete Bilder.\n\n#ai #knstlicheintelligenz #aiart #mepaai #art #portrait #future #trend #viral', 1670480498, '{\"city_name\":\"Germany\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":\"true\"}', 'VIDEO', 'images/content/posts/318546229_118105561123273_71102800789317744_n.jpg', NULL, NULL, 'https://instagram.com/p/Cl5Y5tCNopp', 0, 0, '[\"#k\\u00fcnstlicheintelligenz\",\"#aiart\",\"#mepaai\",\"#art\",\"#portrait\",\"#future\",\"#trend\",\"#viral\"]', 'post', 'profile_scrape', 0, 1683205662, 1683205662),
