(1304, 75, 1554364583225186958, NULL, 'BWSNlpildqO', 6, 41, 503, 0, 0, 0, 0, 0, '0.72', 'Die Musik von Alt-J, whrend die Sonne untergegangen ist. Etwa eine Stunde danach wrden wir Zeuge von einem tragischen Unglck und dem leider sehr enttuschenden Umgang des Festivalveranstalters damit. \nAus 30m Hhe strzt ein Akrobat vor 25.000 Zuschauern ab. Danach Dunkel. \nEin passionierter Artist verunglckt. \nWir standen ca. 50 Meter daneben.\n\nUnfassbar war fr uns wie der Veranstalter und die Bands die Tragdie im Anschluss behandelt haben - wie als ob nichts gewesen war. \nAuf Social Media haben wir daher unserem Unmut Luft gemacht - lange bevor das erste Statement in einer in unseren Augen unrzueichenden Form vom Veranstalter kam.\nWir haben zu den leider nur traurigen ca. 1% gehrt - die nachdem unmittelbar danach eine Reaktion ausblieb und sowohl Zuschauer als auch Band so weiter gemacht haben als wre nichts gewesen - zumindest den Main Act verlassen haben.\nFr uns ist die fehlende Reaktion, zumindest eines Statements danach, vllig unverstndlich und das Verhalten von 95% der Zuschauer (Lemminge) ein menschliches Armutszeugnis.\n\nIn Gedanken bei Pedro. \n#madcool2017', 1499514719, '{\"city_name\":\"Caja M\\u00e1gica\",\"country_code\":\"PE\",\"country_name\":\"peru\",\"tagged_location\":\"true\"}', 'VIDEO', 'images/content/posts/19534659_150068708893904_4085273914433863680_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/19952350_123882671551454_6703994643937230848_n.mp4?efg=eyJxZV9ncm91cHMiOiJbXCJpZ19wcm9ncmVzc2l2ZV91cmxnZW4ucHJvZHVjdF90eXBlLmZlZWRcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=102&_nc_ohc=gMpBYlklfREAX9o07TA&edm=AOQ1c0wBAAAA&ccb=7-5&oh=00_AfCQFCDk4ahucbaXqlBIuRgJ47-fIYGAqN_c8ef0x-r9vw&oe=645D307D&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/BWSNlpildqO', 0, 0, '[\"#madcool2017\"]', 'post', 'profile_scrape', 0, 1683727016, 1683727016),
