(1306, 75, 1526911923173212636, NULL, 'BUwrk3gDEHc', 4, 103, 422, 0, 0, 0, 0, 0, '1.65', 'Durch das digitale Nomadentum sind wir mit total spannenden Leuten vernetzt, die alle eins gemeinsam haben: Herzblut und ne ordentliche Portion Mut. So auch der liebe Geri von @stroncton \nGuckt euch mal allein diese liebevolle detailreiche Verpackung an \nWir finden, das ist ein tolles, ideenreiches, handgemachtes Label mit guten Textilien und untersttzt sogar noch @skateaid \nAber genug der Worte, jetzt wird ... AUSGEPACKT!! ', 1496242107, NULL, 'VIDEO', 'images/content/posts/18812780_473127133033441_4959660420458610688_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/18854773_1206135942828079_7711278995857211392_n.mp4?efg=eyJxZV9ncm91cHMiOiJbXCJpZ19wcm9ncmVzc2l2ZV91cmxnZW4ucHJvZHVjdF90eXBlLmZlZWRcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=107&_nc_ohc=DbnjLGD8xvsAX-4H40m&edm=AOQ1c0wBAAAA&ccb=7-5&oh=00_AfDKdka13vLuT3du2-pZBvjSfP0WP0FqJlxO5kdo2eNfoQ&oe=645CFEA8&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/BUwrk3gDEHc', 0, 0, NULL, 'post', 'profile_scrape', 0, 1683727016, 1683727016),
